B.aif=new A.c(B.c,["Adults should aim for 6\u20138 glasses of fluid per day; water, lower-fat milk, and sugar-free drinks all count.","\u064a\u062c\u0628 \u0623\u0646 \u064a\u0647\u062f\u0641 \u0627\u0644\u0628\u0627\u0644\u063a\u0648\u0646 \u0625\u0644\u0649 \u0634\u0631\u0628 6-8 \u0623\u0643\u0648\u0627\u0628 \u0645\u0646 \u0627\u0644\u0633\u0648\u0627\u0626\u0644 \u064a\u0648\u0645\u064a\u0627\u064b\u061b \u0648\u064a\u064f\u062d\u062a\u0633\u0628 \u0627\u0644\u0645\u0627\u0621 \u0648\u0627\u0644\u062d\u0644\u064a\u0628 \u0642\u0644\u064a\u0644 \u0627\u0644\u062f\u0633\u0645 \u0648\u0627\u0644\u0645\u0634\u0631\u0648\u0628\u0627\u062a \u0627\u0644\u062e\u0627\u0644\u064a\u0629 \u0645\u0646 \u0627\u0644\u0633\u0643\u0631.","NHS"],t.w)
B.adI=new A.c(B.c,["Even mild dehydration of 1\u20132% body weight loss can impair concentration, mood, and memory.","\u062d\u062a\u0649 \u0627\u0644\u062c\u0641\u0627\u0641 \u0627\u0644\u062e\u0641\u064a\u0641 \u0628\u0641\u0642\u062f\u0627\u0646 1-2% \u0645\u0646 \u0648\u0632\u0646 \u0627\u0644\u062c\u0633\u0645 \u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u064f\u0636\u0639\u0641 \u0627\u0644\u062a\u0631\u0643\u064a\u0632 \u0648\u0627\u0644\u0645\u0632\u0627\u062c \u0648\u0627\u0644\u0630\u0627\u0643\u0631\u0629.","Harvard Health"],t.w)
B.acr=new A.c(B.c,["Thirst is not always a reliable early indicator of dehydration \u2014 check your urine colour instead; pale straw is ideal.","\u0627\u0644\u0639\u0637\u0634 \u0644\u064a\u0633 \u062f\u0627\u0626\u0645\u0627\u064b \u0645\u0624\u0634\u0631\u0627\u064b \u0645\u0628\u0643\u0631\u0627\u064b \u0645\u0648\u062b\u0648\u0642\u0627\u064b \u0639\u0644\u0649 \u0627\u0644\u062c\u0641\u0627\u0641 \u2014 \u062a\u062d\u0642\u0642 \u0645\u0646 \u0644\u0648\u0646 \u0627\u0644\u0628\u0648\u0644 \u0628\u062f\u0644\u0627\u064b \u0645\u0646 \u0630\u0644\u0643\u061b \u0627\u0644\u0644\u0648\u0646 \u0627\u0644\u0623\u0635\u0641\u0631 \u0627\u0644\u0628\u0627\u0647\u062a \u0647\u0648 \u0627\u0644\u0645\u062b\u0627\u0644\u064a.","NHS"],t.w)
B.abh=new A.c(B.c,["Water makes up about 60% of adult body weight and is involved in every metabolic process.","\u064a\u0634\u0643\u0651\u0644 \u0627\u0644\u0645\u0627\u0621 \u0646\u062d\u0648 60% \u0645\u0646 \u0648\u0632\u0646 \u062c\u0633\u0645 \u0627\u0644\u0628\u0627\u0644\u063a\u064a\u0646 \u0648\u064a\u0634\u0627\u0631\u0643 \u0641\u064a \u0643\u0644 \u0639\u0645\u0644\u064a\u0629 \u0623\u064a\u0636\u064a\u0629.","Mayo Clinic"],t.w)
B.aiH=new A.c(B.c,["Drinking a glass of water before meals may help reduce overall calorie intake at that meal.","\u0634\u0631\u0628 \u0643\u0648\u0628 \u0645\u0646 \u0627\u0644\u0645\u0627\u0621 \u0642\u0628\u0644 \u0627\u0644\u0648\u062c\u0628\u0627\u062a \u0642\u062f \u064a\u0633\u0627\u0639\u062f \u0641\u064a \u062a\u0642\u0644\u064a\u0644 \u0625\u062c\u0645\u0627\u0644\u064a \u0627\u0644\u0633\u0639\u0631\u0627\u062a \u0627\u0644\u062d\u0631\u0627\u0631\u064a\u0629 \u0627\u0644\u0645\u062a\u0646\u0627\u0648\u0644\u0629 \u0641\u064a \u062a\u0644\u0643 \u0627\u0644\u0648\u062c\u0628\u0629.","Harvard Health"],t.w)
B.acb=new A.c(B.c,["Caffeinated drinks like tea and coffee count toward your daily fluid intake, despite a mild diuretic effect.","\u0627\u0644\u0645\u0634\u0631\u0648\u0628\u0627\u062a \u0627\u0644\u062a\u064a \u062a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u0627\u0644\u0643\u0627\u0641\u064a\u064a\u0646 \u0643\u0627\u0644\u0634\u0627\u064a \u0648\u0627\u0644\u0642\u0647\u0648\u0629 \u062a\u064f\u062d\u062a\u0633\u0628 \u0636\u0645\u0646 \u0627\u0633\u062a\u0647\u0644\u0627\u0643 \u0627\u0644\u0633\u0648\u0627\u0626\u0644 \u0627\u0644\u064a\u0648\u0645\u064a\u060c \u0631\u063a\u0645 \u062a\u0623\u062b\u064a\u0631\u0647\u0627 \u0627\u0644\u0645\u062f\u0631 \u0627\u0644\u062e\u0641\u064a\u0641 \u0644\u0644\u0628\u0648\u0644.","NHS"],t.w)
B.agZ=new A.c(B.c,["During exercise, drink water before, during, and after \u2014 about 200 ml every 15\u201320 minutes of activity.","\u0623\u062b\u0646\u0627\u0621 \u0627\u0644\u062a\u0645\u0631\u064a\u0646\u060c \u0627\u0634\u0631\u0628 \u0627\u0644\u0645\u0627\u0621 \u0642\u0628\u0644\u0647 \u0648\u0623\u062b\u0646\u0627\u0621\u0647 \u0648\u0628\u0639\u062f\u0647 \u2014 \u0646\u062d\u0648 200 \u0645\u0644 \u0643\u0644 15-20 \u062f\u0642\u064a\u0642\u0629 \u0645\u0646 \u0627\u0644\u0646\u0634\u0627\u0637.","Mayo Clinic"],t.w)
B.acE=new A.c(B.c,["Fruits and vegetables with high water content (cucumber, watermelon, oranges) contribute to daily hydration.","\u0627\u0644\u0641\u0648\u0627\u0643\u0647 \u0648\u0627\u0644\u062e\u0636\u0631\u0627\u0648\u0627\u062a \u0630\u0627\u062a \u0627\u0644\u0645\u062d\u062a\u0648\u0649 \u0627\u0644\u0645\u0627\u0626\u064a \u0627\u0644\u0639\u0627\u0644\u064a (\u0627\u0644\u062e\u064a\u0627\u0631\u060c \u0627\u0644\u0628\u0637\u064a\u062e\u060c \u0627\u0644\u0628\u0631\u062a\u0642\u0627\u0644) \u062a\u0633\u0627\u0647\u0645 \u0641\u064a \u0627\u0644\u062a\u0631\u0637\u064a\u0628 \u0627\u0644\u064a\u0648\u0645\u064a.","Harvard Health"],t.w)
B.ahu=new A.c(B.c,["In hot weather or during illness with fever, increase fluid intake above your usual baseline.","\u0641\u064a \u0627\u0644\u0637\u0642\u0633 \u0627\u0644\u062d\u0627\u0631 \u0623\u0648 \u0623\u062b\u0646\u0627\u0621 \u0627\u0644\u0645\u0631\u0636 \u0627\u0644\u0645\u0635\u062d\u0648\u0628 \u0628\u062d\u0645\u0649\u060c \u0632\u0650\u062f \u0627\u0633\u062a\u0647\u0644\u0627\u0643 \u0627\u0644\u0633\u0648\u0627\u0626\u0644 \u0641\u0648\u0642 \u0627\u0644\u0645\u0639\u062f\u0644 \u0627\u0644\u0645\u0639\u062a\u0627\u062f.","Mayo Clinic"],t.w)
B.ab0=new A.c(B.c,["Older adults are at higher risk of dehydration because the thirst mechanism weakens with age.","\u0643\u0628\u0627\u0631 \u0627\u0644\u0633\u0646 \u0623\u0643\u062b\u0631 \u0639\u0631\u0636\u0629 \u0644\u0644\u062c\u0641\u0627\u0641 \u0644\u0623\u0646 \u0622\u0644\u064a\u0629 \u0627\u0644\u0639\u0637\u0634 \u062a\u0636\u0639\u0641 \u0645\u0639 \u0627\u0644\u062a\u0642\u062f\u0645 \u0641\u064a \u0627\u0644\u0639\u0645\u0631.","NHS"],t.w)
B.aaW=new A.c(B.c,["Sparkling water is just as hydrating as still water and counts equally toward daily intake.","\u0627\u0644\u0645\u064a\u0627\u0647 \u0627\u0644\u063a\u0627\u0632\u064a\u0629 \u0645\u0631\u0637\u0628\u0629 \u0628\u0646\u0641\u0633 \u0642\u062f\u0631 \u0627\u0644\u0645\u064a\u0627\u0647 \u0627\u0644\u0639\u0627\u062f\u064a\u0629 \u0648\u062a\u064f\u062d\u062a\u0633\u0628 \u0628\u0627\u0644\u062a\u0633\u0627\u0648\u064a \u0636\u0645\u0646 \u0627\u0644\u0627\u0633\u062a\u0647\u0644\u0627\u0643 \u0627\u0644\u064a\u0648\u0645\u064a.","Mayo Clinic"],t.w)
B.acl=new A.c(B.c,["Carrying a reusable water bottle makes it easier to sip throughout the day and track intake.","\u062d\u0645\u0644 \u0632\u062c\u0627\u062c\u0629 \u0645\u0627\u0621 \u0642\u0627\u0628\u0644\u0629 \u0644\u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u064a\u0633\u0647\u0651\u0644 \u0627\u0644\u0634\u0631\u0628 \u0639\u0644\u0649 \u0645\u062f\u0627\u0631 \u0627\u0644\u064a\u0648\u0645 \u0648\u0645\u062a\u0627\u0628\u0639\u0629 \u0627\u0644\u0627\u0633\u062a\u0647\u0644\u0627\u0643.","Harvard Health"],t.w)
B.ae1=new A.c(B.c,["Dark yellow or amber urine usually signals you need to drink more water.","\u0627\u0644\u0628\u0648\u0644 \u0627\u0644\u0623\u0635\u0641\u0631 \u0627\u0644\u062f\u0627\u0643\u0646 \u0623\u0648 \u0627\u0644\u0643\u0647\u0631\u0645\u0627\u0646\u064a \u064a\u0634\u064a\u0631 \u0639\u0627\u062f\u0629\u064b \u0625\u0644\u0649 \u062d\u0627\u062c\u062a\u0643 \u0644\u0634\u0631\u0628 \u0627\u0644\u0645\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u0645\u0627\u0621.","Mayo Clinic"],t.w)
B.aiG=new A.c(B.c,["Alcohol is a diuretic \u2014 alternate alcoholic drinks with glasses of water to stay hydrated.","\u0627\u0644\u0643\u062d\u0648\u0644 \u0645\u062f\u0631 \u0644\u0644\u0628\u0648\u0644 \u2014 \u062a\u0646\u0627\u0648\u0628 \u0628\u064a\u0646 \u0627\u0644\u0645\u0634\u0631\u0648\u0628\u0627\u062a \u0627\u0644\u0643\u062d\u0648\u0644\u064a\u0629 \u0648\u0623\u0643\u0648\u0627\u0628 \u0627\u0644\u0645\u0627\u0621 \u0644\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u0627\u0644\u062a\u0631\u0637\u064a\u0628.","NHS"],t.w)
B.afY=new A.c(B.c,["Soup and broth-based dishes contribute meaningfully to daily fluid intake.","\u0627\u0644\u0634\u0648\u0631\u0628\u0627\u062a \u0648\u0627\u0644\u0623\u0637\u0628\u0627\u0642 \u0627\u0644\u0645\u0628\u0646\u064a\u0629 \u0639\u0644\u0649 \u0627\u0644\u0645\u0631\u0642 \u062a\u0633\u0627\u0647\u0645 \u0628\u0634\u0643\u0644 \u0645\u0644\u0645\u0648\u0633 \u0641\u064a \u0627\u0633\u062a\u0647\u0644\u0627\u0643 \u0627\u0644\u0633\u0648\u0627\u0626\u0644 \u0627\u0644\u064a\u0648\u0645\u064a.","Harvard Health"],t.w)
B.ahU=new A.c(B.c,["Dehydration can cause headaches; drinking water is often the first remedy to try.","\u0627\u0644\u062c\u0641\u0627\u0641 \u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u0633\u0628\u0628 \u0627\u0644\u0635\u062f\u0627\u0639\u061b \u0634\u0631\u0628 \u0627\u0644\u0645\u0627\u0621 \u063a\u0627\u0644\u0628\u0627\u064b \u0645\u0627 \u064a\u0643\u0648\u0646 \u0623\u0648\u0644 \u0639\u0644\u0627\u062c \u064a\u062c\u0628 \u062a\u062c\u0631\u0628\u062a\u0647.","NHS"],t.w)
B.ae3=new A.c(B.c,["Children and teenagers need about 6\u20138 glasses of fluid per day, more when physically active.","\u064a\u062d\u062a\u0627\u062c \u0627\u0644\u0623\u0637\u0641\u0627\u0644 \u0648\u0627\u0644\u0645\u0631\u0627\u0647\u0642\u0648\u0646 \u0625\u0644\u0649 \u0646\u062d\u0648 6-8 \u0623\u0643\u0648\u0627\u0628 \u0645\u0646 \u0627\u0644\u0633\u0648\u0627\u0626\u0644 \u064a\u0648\u0645\u064a\u0627\u064b\u060c \u0648\u0623\u0643\u062b\u0631 \u0639\u0646\u062f \u0645\u0645\u0627\u0631\u0633\u0629 \u0627\u0644\u0646\u0634\u0627\u0637 \u0627\u0644\u0628\u062f\u0646\u064a.","NHS"],t.w)
B.ahO=new A.c(B.c,["Herbal teas count toward your fluid intake and are a good caffeine-free option.","\u0634\u0627\u064a \u0627\u0644\u0623\u0639\u0634\u0627\u0628 \u064a\u064f\u062d\u062a\u0633\u0628 \u0636\u0645\u0646 \u0627\u0633\u062a\u0647\u0644\u0627\u0643 \u0627\u0644\u0633\u0648\u0627\u0626\u0644 \u0648\u0647\u0648 \u062e\u064a\u0627\u0631 \u062c\u064a\u062f \u062e\u0627\u0644\u064d \u0645\u0646 \u0627\u0644\u0643\u0627\u0641\u064a\u064a\u0646.","Mayo Clinic"],t.w)
B.ac8=new A.c(B.c,["During breastfeeding, women need additional fluids \u2014 about 700 ml more per day than usual.","\u0623\u062b\u0646\u0627\u0621 \u0627\u0644\u0631\u0636\u0627\u0639\u0629 \u0627\u0644\u0637\u0628\u064a\u0639\u064a\u0629\u060c \u062a\u062d\u062a\u0627\u062c \u0627\u0644\u0646\u0633\u0627\u0621 \u0625\u0644\u0649 \u0633\u0648\u0627\u0626\u0644 \u0625\u0636\u0627\u0641\u064a\u0629 \u2014 \u0646\u062d\u0648 700 \u0645\u0644 \u0623\u0643\u062b\u0631 \u064a\u0648\u0645\u064a\u0627\u064b \u0645\u0646 \u0627\u0644\u0645\u0639\u062a\u0627\u062f.","NHS"],t.w)
B.aem=new A.c(B.c,["Keeping water at your desk or bedside removes friction and helps build a drinking habit.","\u0625\u0628\u0642\u0627\u0621 \u0627\u0644\u0645\u0627\u0621 \u0639\u0644\u0649 \u0645\u0643\u062a\u0628\u0643 \u0623\u0648 \u0628\u062c\u0627\u0646\u0628 \u0633\u0631\u064a\u0631\u0643 \u064a\u0632\u064a\u0644 \u0627\u0644\u0639\u0648\u0627\u0626\u0642 \u0648\u064a\u0633\u0627\u0639\u062f \u0641\u064a \u0628\u0646\u0627\u0621 \u0639\u0627\u062f\u0629 \u0627\u0644\u0634\u0631\u0628.","Harvard Health"],t.w)
B.ahJ=new A.c(B.c,["Eating protein at every meal helps maintain and repair muscle tissue throughout the day.","\u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0641\u064a \u0643\u0644 \u0648\u062c\u0628\u0629 \u064a\u0633\u0627\u0639\u062f \u0641\u064a \u0627\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u0627\u0644\u0623\u0646\u0633\u062c\u0629 \u0627\u0644\u0639\u0636\u0644\u064a\u0629 \u0648\u0625\u0635\u0644\u0627\u062d\u0647\u0627 \u0637\u0648\u0627\u0644 \u0627\u0644\u064a\u0648\u0645.","Harvard Health"],t.w)
B.ahw=new A.c(B.c,["Adults need roughly 0.8 g of protein per kilogram of body weight per day as a minimum.","\u064a\u062d\u062a\u0627\u062c \u0627\u0644\u0628\u0627\u0644\u063a\u0648\u0646 \u0625\u0644\u0649 \u0646\u062d\u0648 0.8 \u063a\u0631\u0627\u0645 \u0645\u0646 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0644\u0643\u0644 \u0643\u064a\u0644\u0648\u063a\u0631\u0627\u0645 \u0645\u0646 \u0648\u0632\u0646 \u0627\u0644\u062c\u0633\u0645 \u064a\u0648\u0645\u064a\u0627\u064b \u0643\u062d\u062f \u0623\u062f\u0646\u0649.","WHO"],t.w)
B.agp=new A.c(B.c,["Spreading protein intake across meals is more effective for muscle synthesis than loading it into one meal.","\u062a\u0648\u0632\u064a\u0639 \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0639\u0644\u0649 \u0627\u0644\u0648\u062c\u0628\u0627\u062a \u0623\u0643\u062b\u0631 \u0641\u0639\u0627\u0644\u064a\u0629 \u0644\u0628\u0646\u0627\u0621 \u0627\u0644\u0639\u0636\u0644\u0627\u062a \u0645\u0646 \u062a\u0631\u0643\u064a\u0632\u0647 \u0641\u064a \u0648\u062c\u0628\u0629 \u0648\u0627\u062d\u062f\u0629.","Harvard Health"],t.w)
B.afd=new A.c(B.c,["Beans, lentils, chickpeas, and tofu are excellent plant-based protein sources.","\u0627\u0644\u0641\u0627\u0635\u0648\u0644\u064a\u0627 \u0648\u0627\u0644\u0639\u062f\u0633 \u0648\u0627\u0644\u062d\u0645\u0635 \u0648\u0627\u0644\u062a\u0648\u0641\u0648 \u0645\u0635\u0627\u062f\u0631 \u0645\u0645\u062a\u0627\u0632\u0629 \u0644\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0627\u0644\u0646\u0628\u0627\u062a\u064a.","NHS"],t.w)
B.ahZ=new A.c(B.c,["Eggs are one of the most complete protein sources, containing all nine essential amino acids.","\u0627\u0644\u0628\u064a\u0636 \u0645\u0646 \u0623\u0643\u062b\u0631 \u0645\u0635\u0627\u062f\u0631 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0627\u0643\u062a\u0645\u0627\u0644\u0627\u064b\u060c \u0625\u0630 \u064a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u062c\u0645\u064a\u0639 \u0627\u0644\u0623\u062d\u0645\u0627\u0636 \u0627\u0644\u0623\u0645\u064a\u0646\u064a\u0629 \u0627\u0644\u0623\u0633\u0627\u0633\u064a\u0629 \u0627\u0644\u062a\u0633\u0639\u0629.","Mayo Clinic"],t.w)
B.ac_=new A.c(B.c,["Greek yogurt contains roughly twice the protein of regular yogurt per serving.","\u0627\u0644\u0632\u0628\u0627\u062f\u064a \u0627\u0644\u064a\u0648\u0646\u0627\u0646\u064a \u064a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u0636\u0639\u0641 \u0643\u0645\u064a\u0629 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0627\u0644\u0645\u0648\u062c\u0648\u062f\u0629 \u0641\u064a \u0627\u0644\u0632\u0628\u0627\u062f\u064a \u0627\u0644\u0639\u0627\u062f\u064a \u062a\u0642\u0631\u064a\u0628\u0627\u064b \u0644\u0643\u0644 \u062d\u0635\u0629.","Harvard Health"],t.w)
B.afm=new A.c(B.c,["Fish provides high-quality protein along with omega-3 fatty acids that support heart health.","\u064a\u0648\u0641\u0631 \u0627\u0644\u0633\u0645\u0643 \u0628\u0631\u0648\u062a\u064a\u0646\u0627\u064b \u0639\u0627\u0644\u064a \u0627\u0644\u062c\u0648\u062f\u0629 \u0625\u0644\u0649 \u062c\u0627\u0646\u0628 \u0623\u062d\u0645\u0627\u0636 \u0623\u0648\u0645\u064a\u063a\u0627-3 \u0627\u0644\u062f\u0647\u0646\u064a\u0629 \u0627\u0644\u062a\u064a \u062a\u062f\u0639\u0645 \u0635\u062d\u0629 \u0627\u0644\u0642\u0644\u0628.","NHS"],t.w)
B.aeD=new A.c(B.c,["Protein takes longer to digest than carbohydrates, which helps you feel fuller for longer after meals.","\u064a\u0633\u062a\u063a\u0631\u0642 \u0647\u0636\u0645 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0648\u0642\u062a\u0627\u064b \u0623\u0637\u0648\u0644 \u0645\u0646 \u0627\u0644\u0643\u0631\u0628\u0648\u0647\u064a\u062f\u0631\u0627\u062a\u060c \u0645\u0645\u0627 \u064a\u0633\u0627\u0639\u062f\u0643 \u0639\u0644\u0649 \u0627\u0644\u0634\u0639\u0648\u0631 \u0628\u0627\u0644\u0634\u0628\u0639 \u0644\u0641\u062a\u0631\u0629 \u0623\u0637\u0648\u0644 \u0628\u0639\u062f \u0627\u0644\u0648\u062c\u0628\u0627\u062a.","Mayo Clinic"],t.w)
B.ac2=new A.c(B.c,["Nuts and seeds provide protein along with healthy fats, fiber, and essential minerals.","\u062a\u0648\u0641\u0631 \u0627\u0644\u0645\u0643\u0633\u0631\u0627\u062a \u0648\u0627\u0644\u0628\u0630\u0648\u0631 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0625\u0644\u0649 \u062c\u0627\u0646\u0628 \u0627\u0644\u062f\u0647\u0648\u0646 \u0627\u0644\u0635\u062d\u064a\u0629 \u0648\u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0648\u0627\u0644\u0645\u0639\u0627\u062f\u0646 \u0627\u0644\u0623\u0633\u0627\u0633\u064a\u0629.","Harvard Health"],t.w)
B.ag5=new A.c(B.c,["Lean poultry (chicken breast, turkey) is one of the lowest-fat animal protein sources available.","\u0627\u0644\u062f\u0648\u0627\u062c\u0646 \u0627\u0644\u062e\u0627\u0644\u064a\u0629 \u0645\u0646 \u0627\u0644\u062f\u0647\u0646 (\u0635\u062f\u0631 \u0627\u0644\u062f\u062c\u0627\u062c\u060c \u0627\u0644\u062f\u064a\u0643 \u0627\u0644\u0631\u0648\u0645\u064a) \u0645\u0646 \u0623\u0642\u0644 \u0645\u0635\u0627\u062f\u0631 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0627\u0644\u062d\u064a\u0648\u0627\u0646\u064a \u062f\u0647\u0648\u0646\u0627\u064b.","NHS"],t.w)
B.ag4=new A.c(B.c,["Combining different plant proteins (e.g. rice and beans) across the day provides all essential amino acids.","\u0627\u0644\u062c\u0645\u0639 \u0628\u064a\u0646 \u0628\u0631\u0648\u062a\u064a\u0646\u0627\u062a \u0646\u0628\u0627\u062a\u064a\u0629 \u0645\u062e\u062a\u0644\u0641\u0629 (\u0645\u062b\u0644 \u0627\u0644\u0623\u0631\u0632 \u0648\u0627\u0644\u0641\u0627\u0635\u0648\u0644\u064a\u0627) \u0639\u0644\u0649 \u0645\u062f\u0627\u0631 \u0627\u0644\u064a\u0648\u0645 \u064a\u0648\u0641\u0631 \u062c\u0645\u064a\u0639 \u0627\u0644\u0623\u062d\u0645\u0627\u0636 \u0627\u0644\u0623\u0645\u064a\u0646\u064a\u0629 \u0627\u0644\u0623\u0633\u0627\u0633\u064a\u0629.","Harvard Health"],t.w)
B.abQ=new A.c(B.c,["Cottage cheese is high in protein and pairs well with fruit for a balanced snack.","\u062c\u0628\u0646 \u0627\u0644\u0642\u0631\u064a\u0634 \u063a\u0646\u064a \u0628\u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0648\u064a\u062a\u0646\u0627\u0633\u0628 \u062c\u064a\u062f\u0627\u064b \u0645\u0639 \u0627\u0644\u0641\u0627\u0643\u0647\u0629 \u0643\u0648\u062c\u0628\u0629 \u062e\u0641\u064a\u0641\u0629 \u0645\u062a\u0648\u0627\u0632\u0646\u0629.","Mayo Clinic"],t.w)
B.afk=new A.c(B.c,["Quinoa is one of the few plant foods that contains all nine essential amino acids.","\u0627\u0644\u0643\u064a\u0646\u0648\u0627 \u0645\u0646 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0646\u0628\u0627\u062a\u064a\u0629 \u0627\u0644\u0642\u0644\u064a\u0644\u0629 \u0627\u0644\u062a\u064a \u062a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u062c\u0645\u064a\u0639 \u0627\u0644\u0623\u062d\u0645\u0627\u0636 \u0627\u0644\u0623\u0645\u064a\u0646\u064a\u0629 \u0627\u0644\u0623\u0633\u0627\u0633\u064a\u0629 \u0627\u0644\u062a\u0633\u0639\u0629.","Harvard Health"],t.w)
B.ac4=new A.c(B.c,["Protein needs increase during pregnancy and breastfeeding to support fetal and infant growth.","\u062a\u0632\u062f\u0627\u062f \u0627\u062d\u062a\u064a\u0627\u062c\u0627\u062a \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0623\u062b\u0646\u0627\u0621 \u0627\u0644\u062d\u0645\u0644 \u0648\u0627\u0644\u0631\u0636\u0627\u0639\u0629 \u0644\u062f\u0639\u0645 \u0646\u0645\u0648 \u0627\u0644\u062c\u0646\u064a\u0646 \u0648\u0627\u0644\u0631\u0636\u064a\u0639.","WHO"],t.w)
B.acu=new A.c(B.c,["Older adults may need more protein (1.0\u20131.2 g per kg) to prevent age-related muscle loss.","\u0642\u062f \u064a\u062d\u062a\u0627\u062c \u0643\u0628\u0627\u0631 \u0627\u0644\u0633\u0646 \u0625\u0644\u0649 \u0627\u0644\u0645\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 (1.0-1.2 \u063a\u0631\u0627\u0645 \u0644\u0643\u0644 \u0643\u063a) \u0644\u0645\u0646\u0639 \u0641\u0642\u062f\u0627\u0646 \u0627\u0644\u0639\u0636\u0644\u0627\u062a \u0627\u0644\u0645\u0631\u062a\u0628\u0637 \u0628\u0627\u0644\u0639\u0645\u0631.","Harvard Health"],t.w)
B.ahD=new A.c(B.c,["Edamame (young soybeans) provides about 17 g of protein per cup and makes a great snack.","\u064a\u0648\u0641\u0631 \u0627\u0644\u0625\u062f\u0627\u0645\u0627\u0645\u064a (\u0641\u0648\u0644 \u0627\u0644\u0635\u0648\u064a\u0627 \u0627\u0644\u0635\u063a\u064a\u0631) \u0646\u062d\u0648 17 \u063a\u0631\u0627\u0645\u0627\u064b \u0645\u0646 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0644\u0643\u0644 \u0643\u0648\u0628 \u0648\u064a\u064f\u0639\u062f \u0648\u062c\u0628\u0629 \u062e\u0641\u064a\u0641\u0629 \u0631\u0627\u0626\u0639\u0629.","Mayo Clinic"],t.w)
B.ahB=new A.c(B.c,["Protein helps stabilize blood sugar levels, reducing energy crashes between meals.","\u064a\u0633\u0627\u0639\u062f \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0641\u064a \u0627\u0633\u062a\u0642\u0631\u0627\u0631 \u0645\u0633\u062a\u0648\u064a\u0627\u062a \u0627\u0644\u0633\u0643\u0631 \u0641\u064a \u0627\u0644\u062f\u0645\u060c \u0645\u0645\u0627 \u064a\u0642\u0644\u0644 \u0645\u0646 \u0627\u0646\u062e\u0641\u0627\u0636 \u0627\u0644\u0637\u0627\u0642\u0629 \u0628\u064a\u0646 \u0627\u0644\u0648\u062c\u0628\u0627\u062a.","Harvard Health"],t.w)
B.afK=new A.c(B.c,["Whey and casein in dairy products are highly bioavailable forms of protein.","\u0628\u0631\u0648\u062a\u064a\u0646\u0627 \u0645\u0635\u0644 \u0627\u0644\u0644\u0628\u0646 \u0648\u0627\u0644\u0643\u0627\u0632\u064a\u0646 \u0641\u064a \u0645\u0646\u062a\u062c\u0627\u062a \u0627\u0644\u0623\u0644\u0628\u0627\u0646 \u0645\u0646 \u0623\u0634\u0643\u0627\u0644 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0639\u0627\u0644\u064a\u0629 \u0627\u0644\u062a\u0648\u0627\u0641\u0631 \u0627\u0644\u062d\u064a\u0648\u064a.","Mayo Clinic"],t.w)
B.adc=new A.c(B.c,["After resistance exercise, consuming 20\u201330 g of protein helps maximize muscle repair.","\u0628\u0639\u062f \u062a\u0645\u0627\u0631\u064a\u0646 \u0627\u0644\u0645\u0642\u0627\u0648\u0645\u0629\u060c \u064a\u0633\u0627\u0639\u062f \u062a\u0646\u0627\u0648\u0644 20-30 \u063a\u0631\u0627\u0645\u0627\u064b \u0645\u0646 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0641\u064a \u062a\u0639\u0638\u064a\u0645 \u0625\u0635\u0644\u0627\u062d \u0627\u0644\u0639\u0636\u0644\u0627\u062a.","Harvard Health"],t.w)
B.aeY=new A.c(B.c,["Choosing lean cuts of red meat and trimming visible fat provides protein with less saturated fat.","\u0627\u062e\u062a\u064a\u0627\u0631 \u0642\u0637\u0639 \u0627\u0644\u0644\u062d\u0645 \u0627\u0644\u0623\u062d\u0645\u0631 \u0627\u0644\u062e\u0627\u0644\u064a\u0629 \u0645\u0646 \u0627\u0644\u062f\u0647\u0646 \u0648\u0625\u0632\u0627\u0644\u0629 \u0627\u0644\u062f\u0647\u0648\u0646 \u0627\u0644\u0645\u0631\u0626\u064a\u0629 \u064a\u0648\u0641\u0631 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0645\u0639 \u062f\u0647\u0648\u0646 \u0645\u0634\u0628\u0639\u0629 \u0623\u0642\u0644.","NHS"],t.w)
B.acq=new A.c(B.c,["Adults should aim for at least 30 g of fiber per day, but most people eat only about 20 g.","\u064a\u062c\u0628 \u0623\u0646 \u064a\u0647\u062f\u0641 \u0627\u0644\u0628\u0627\u0644\u063a\u0648\u0646 \u0625\u0644\u0649 \u062a\u0646\u0627\u0648\u0644 30 \u063a\u0631\u0627\u0645\u0627\u064b \u0639\u0644\u0649 \u0627\u0644\u0623\u0642\u0644 \u0645\u0646 \u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u064a\u0648\u0645\u064a\u0627\u064b\u060c \u0644\u0643\u0646 \u0645\u0639\u0638\u0645 \u0627\u0644\u0646\u0627\u0633 \u064a\u062a\u0646\u0627\u0648\u0644\u0648\u0646 \u0646\u062d\u0648 20 \u063a\u0631\u0627\u0645\u0627\u064b \u0641\u0642\u0637.","NHS"],t.w)
B.acx=new A.c(B.c,["Fiber helps maintain bowel health and regularity by adding bulk to stool.","\u062a\u0633\u0627\u0639\u062f \u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0641\u064a \u0627\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u0635\u062d\u0629 \u0627\u0644\u0623\u0645\u0639\u0627\u0621 \u0648\u0627\u0646\u062a\u0638\u0627\u0645\u0647\u0627 \u0639\u0646 \u0637\u0631\u064a\u0642 \u0625\u0636\u0627\u0641\u0629 \u062d\u062c\u0645 \u0644\u0644\u0628\u0631\u0627\u0632.","Mayo Clinic"],t.w)
B.ah6=new A.c(B.c,["Whole grains like oats, brown rice, and whole wheat bread are excellent fiber sources.","\u0627\u0644\u062d\u0628\u0648\u0628 \u0627\u0644\u0643\u0627\u0645\u0644\u0629 \u0645\u062b\u0644 \u0627\u0644\u0634\u0648\u0641\u0627\u0646 \u0648\u0627\u0644\u0623\u0631\u0632 \u0627\u0644\u0628\u0646\u064a \u0648\u062e\u0628\u0632 \u0627\u0644\u0642\u0645\u062d \u0627\u0644\u0643\u0627\u0645\u0644 \u0645\u0635\u0627\u062f\u0631 \u0645\u0645\u062a\u0627\u0632\u0629 \u0644\u0644\u0623\u0644\u064a\u0627\u0641.","NHS"],t.w)
B.afE=new A.c(B.c,["Soluble fiber (found in oats, beans, apples) helps lower blood cholesterol levels.","\u062a\u0633\u0627\u0639\u062f \u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0627\u0644\u0642\u0627\u0628\u0644\u0629 \u0644\u0644\u0630\u0648\u0628\u0627\u0646 (\u0627\u0644\u0645\u0648\u062c\u0648\u062f\u0629 \u0641\u064a \u0627\u0644\u0634\u0648\u0641\u0627\u0646 \u0648\u0627\u0644\u0641\u0627\u0635\u0648\u0644\u064a\u0627 \u0648\u0627\u0644\u062a\u0641\u0627\u062d) \u0641\u064a \u062e\u0641\u0636 \u0645\u0633\u062a\u0648\u064a\u0627\u062a \u0627\u0644\u0643\u0648\u0644\u064a\u0633\u062a\u0631\u0648\u0644 \u0641\u064a \u0627\u0644\u062f\u0645.","Harvard Health"],t.w)
B.adk=new A.c(B.c,["Insoluble fiber (found in whole wheat, nuts, vegetables) helps food pass through the digestive system.","\u062a\u0633\u0627\u0639\u062f \u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u063a\u064a\u0631 \u0627\u0644\u0642\u0627\u0628\u0644\u0629 \u0644\u0644\u0630\u0648\u0628\u0627\u0646 (\u0627\u0644\u0645\u0648\u062c\u0648\u062f\u0629 \u0641\u064a \u0627\u0644\u0642\u0645\u062d \u0627\u0644\u0643\u0627\u0645\u0644 \u0648\u0627\u0644\u0645\u0643\u0633\u0631\u0627\u062a \u0648\u0627\u0644\u062e\u0636\u0631\u0627\u0648\u0627\u062a) \u0627\u0644\u0637\u0639\u0627\u0645 \u0639\u0644\u0649 \u0627\u0644\u0645\u0631\u0648\u0631 \u0639\u0628\u0631 \u0627\u0644\u062c\u0647\u0627\u0632 \u0627\u0644\u0647\u0636\u0645\u064a.","Mayo Clinic"],t.w)
B.adE=new A.c(B.c,["Increasing fiber intake gradually and drinking plenty of water helps prevent digestive discomfort.","\u0632\u064a\u0627\u062f\u0629 \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u062a\u062f\u0631\u064a\u062c\u064a\u0627\u064b \u0648\u0634\u0631\u0628 \u0627\u0644\u0643\u062b\u064a\u0631 \u0645\u0646 \u0627\u0644\u0645\u0627\u0621 \u064a\u0633\u0627\u0639\u062f \u0641\u064a \u0645\u0646\u0639 \u0627\u0644\u0627\u0646\u0632\u0639\u0627\u062c \u0627\u0644\u0647\u0636\u0645\u064a.","NHS"],t.w)
B.ag_=new A.c(B.c,["Leaving the skin on fruits and vegetables increases their fiber content significantly.","\u062a\u0631\u0643 \u0627\u0644\u0642\u0634\u0631\u0629 \u0639\u0644\u0649 \u0627\u0644\u0641\u0648\u0627\u0643\u0647 \u0648\u0627\u0644\u062e\u0636\u0631\u0627\u0648\u0627\u062a \u064a\u0632\u064a\u062f \u0645\u0646 \u0645\u062d\u062a\u0648\u0627\u0647\u0627 \u0645\u0646 \u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0628\u0634\u0643\u0644 \u0643\u0628\u064a\u0631.","Harvard Health"],t.w)
B.acQ=new A.c(B.c,["Legumes (beans, lentils, peas) are among the highest-fiber foods available, with 7\u20138 g per half cup.","\u0627\u0644\u0628\u0642\u0648\u0644\u064a\u0627\u062a (\u0627\u0644\u0641\u0627\u0635\u0648\u0644\u064a\u0627 \u0648\u0627\u0644\u0639\u062f\u0633 \u0648\u0627\u0644\u0628\u0627\u0632\u0644\u0627\u0621) \u0645\u0646 \u0623\u063a\u0646\u0649 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0628\u0627\u0644\u0623\u0644\u064a\u0627\u0641\u060c \u0628\u0645\u0639\u062f\u0644 7-8 \u063a\u0631\u0627\u0645\u0627\u062a \u0644\u0643\u0644 \u0646\u0635\u0641 \u0643\u0648\u0628.","Mayo Clinic"],t.w)
B.ada=new A.c(B.c,["A high-fiber diet is associated with a lower risk of developing type 2 diabetes.","\u064a\u0631\u062a\u0628\u0637 \u0627\u0644\u0646\u0638\u0627\u0645 \u0627\u0644\u063a\u0630\u0627\u0626\u064a \u0627\u0644\u063a\u0646\u064a \u0628\u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0628\u0627\u0646\u062e\u0641\u0627\u0636 \u062e\u0637\u0631 \u0627\u0644\u0625\u0635\u0627\u0628\u0629 \u0628\u062f\u0627\u0621 \u0627\u0644\u0633\u0643\u0631\u064a \u0645\u0646 \u0627\u0644\u0646\u0648\u0639 \u0627\u0644\u062b\u0627\u0646\u064a.","WHO"],t.w)
B.acd=new A.c(B.c,["Berries are among the highest-fiber fruits \u2014 raspberries provide about 8 g per cup.","\u0627\u0644\u062a\u0648\u062a \u0645\u0646 \u0623\u063a\u0646\u0649 \u0627\u0644\u0641\u0648\u0627\u0643\u0647 \u0628\u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u2014 \u064a\u0648\u0641\u0631 \u062a\u0648\u062a \u0627\u0644\u0639\u0644\u064a\u0642 \u0646\u062d\u0648 8 \u063a\u0631\u0627\u0645\u0627\u062a \u0644\u0643\u0644 \u0643\u0648\u0628.","Harvard Health"],t.w)
B.abW=new A.c(B.c,["Popcorn (air-popped, without excess butter) is a whole grain snack with about 3.5 g fiber per 3 cups.","\u0627\u0644\u0641\u0634\u0627\u0631 (\u0627\u0644\u0645\u062d\u0636\u0651\u0631 \u0628\u0627\u0644\u0647\u0648\u0627\u0621 \u062f\u0648\u0646 \u0632\u0628\u062f\u0629 \u0632\u0627\u0626\u062f\u0629) \u0648\u062c\u0628\u0629 \u062e\u0641\u064a\u0641\u0629 \u0645\u0646 \u0627\u0644\u062d\u0628\u0648\u0628 \u0627\u0644\u0643\u0627\u0645\u0644\u0629 \u062a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u0646\u062d\u0648 3.5 \u063a\u0631\u0627\u0645 \u0645\u0646 \u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0644\u0643\u0644 3 \u0623\u0643\u0648\u0627\u0628.","Mayo Clinic"],t.w)
B.aeV=new A.c(B.c,["Avocados provide about 10 g of fiber per fruit along with healthy monounsaturated fats.","\u064a\u0648\u0641\u0631 \u0627\u0644\u0623\u0641\u0648\u0643\u0627\u062f\u0648 \u0646\u062d\u0648 10 \u063a\u0631\u0627\u0645\u0627\u062a \u0645\u0646 \u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0644\u0643\u0644 \u062d\u0628\u0629 \u0625\u0644\u0649 \u062c\u0627\u0646\u0628 \u0627\u0644\u062f\u0647\u0648\u0646 \u0627\u0644\u0623\u062d\u0627\u062f\u064a\u0629 \u063a\u064a\u0631 \u0627\u0644\u0645\u0634\u0628\u0639\u0629 \u0627\u0644\u0635\u062d\u064a\u0629.","Harvard Health"],t.w)
B.ac5=new A.c(B.c,["Switching from white to whole grain bread, pasta, and rice is an easy way to boost daily fiber.","\u0627\u0644\u062a\u062d\u0648\u0644 \u0645\u0646 \u0627\u0644\u062e\u0628\u0632 \u0627\u0644\u0623\u0628\u064a\u0636 \u0648\u0627\u0644\u0645\u0639\u0643\u0631\u0648\u0646\u0629 \u0648\u0627\u0644\u0623\u0631\u0632 \u0625\u0644\u0649 \u0646\u0638\u064a\u0631\u0627\u062a\u0647\u0627 \u0645\u0646 \u0627\u0644\u062d\u0628\u0648\u0628 \u0627\u0644\u0643\u0627\u0645\u0644\u0629 \u0637\u0631\u064a\u0642\u0629 \u0633\u0647\u0644\u0629 \u0644\u0632\u064a\u0627\u062f\u0629 \u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0627\u0644\u064a\u0648\u0645\u064a\u0629.","NHS"],t.w)
B.agg=new A.c(B.c,["Fiber-rich foods tend to be more filling, which can help with weight management.","\u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u063a\u0646\u064a\u0629 \u0628\u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u062a\u0645\u064a\u0644 \u0625\u0644\u0649 \u0623\u0646 \u062a\u0643\u0648\u0646 \u0623\u0643\u062b\u0631 \u0625\u0634\u0628\u0627\u0639\u0627\u064b\u060c \u0645\u0645\u0627 \u064a\u0633\u0627\u0639\u062f \u0641\u064a \u0625\u062f\u0627\u0631\u0629 \u0627\u0644\u0648\u0632\u0646.","Mayo Clinic"],t.w)
B.ahk=new A.c(B.c,["Chia seeds provide about 10 g of fiber per ounce and can be added to yogurt or smoothies.","\u062a\u0648\u0641\u0631 \u0628\u0630\u0648\u0631 \u0627\u0644\u0634\u064a\u0627 \u0646\u062d\u0648 10 \u063a\u0631\u0627\u0645\u0627\u062a \u0645\u0646 \u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0644\u0643\u0644 \u0623\u0648\u0646\u0635\u0629 \u0648\u064a\u0645\u0643\u0646 \u0625\u0636\u0627\u0641\u062a\u0647\u0627 \u0625\u0644\u0649 \u0627\u0644\u0632\u0628\u0627\u062f\u064a \u0623\u0648 \u0627\u0644\u0639\u0635\u0627\u0626\u0631.","Harvard Health"],t.w)
B.aff=new A.c(B.c,["A diet high in fiber may reduce the risk of colorectal cancer.","\u0642\u062f \u064a\u0642\u0644\u0644 \u0627\u0644\u0646\u0638\u0627\u0645 \u0627\u0644\u063a\u0630\u0627\u0626\u064a \u0627\u0644\u063a\u0646\u064a \u0628\u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0645\u0646 \u062e\u0637\u0631 \u0627\u0644\u0625\u0635\u0627\u0628\u0629 \u0628\u0633\u0631\u0637\u0627\u0646 \u0627\u0644\u0642\u0648\u0644\u0648\u0646 \u0648\u0627\u0644\u0645\u0633\u062a\u0642\u064a\u0645.","WHO"],t.w)
B.ad6=new A.c(B.c,["Artichokes are one of the highest-fiber vegetables, with about 10 g per medium artichoke.","\u0627\u0644\u062e\u0631\u0634\u0648\u0641 \u0645\u0646 \u0623\u063a\u0646\u0649 \u0627\u0644\u062e\u0636\u0631\u0627\u0648\u0627\u062a \u0628\u0627\u0644\u0623\u0644\u064a\u0627\u0641\u060c \u0628\u0646\u062d\u0648 10 \u063a\u0631\u0627\u0645\u0627\u062a \u0644\u0643\u0644 \u062d\u0628\u0629 \u0645\u062a\u0648\u0633\u0637\u0629.","Mayo Clinic"],t.w)
B.afN=new A.c(B.c,["Adding beans or lentils to soups, stews, and salads is an easy way to increase fiber intake.","\u0625\u0636\u0627\u0641\u0629 \u0627\u0644\u0641\u0627\u0635\u0648\u0644\u064a\u0627 \u0623\u0648 \u0627\u0644\u0639\u062f\u0633 \u0625\u0644\u0649 \u0627\u0644\u0634\u0648\u0631\u0628\u0627\u062a \u0648\u0627\u0644\u064a\u062e\u0646\u0627\u062a \u0648\u0627\u0644\u0633\u0644\u0637\u0627\u062a \u0637\u0631\u064a\u0642\u0629 \u0633\u0647\u0644\u0629 \u0644\u0632\u064a\u0627\u062f\u0629 \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0623\u0644\u064a\u0627\u0641.","NHS"],t.w)
B.afQ=new A.c(B.c,["Fiber slows the absorption of sugar, helping to improve blood sugar control.","\u062a\u0628\u0637\u0626 \u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0627\u0645\u062a\u0635\u0627\u0635 \u0627\u0644\u0633\u0643\u0631\u060c \u0645\u0645\u0627 \u064a\u0633\u0627\u0639\u062f \u0641\u064a \u062a\u062d\u0633\u064a\u0646 \u0627\u0644\u062a\u062d\u0643\u0645 \u0628\u0633\u0643\u0631 \u0627\u0644\u062f\u0645.","Harvard Health"],t.w)
B.ahh=new A.c(B.c,["Sweet potatoes provide about 4 g of fiber each and are a nutritious alternative to white potatoes.","\u062a\u0648\u0641\u0631 \u0627\u0644\u0628\u0637\u0627\u0637\u0627 \u0627\u0644\u062d\u0644\u0648\u0629 \u0646\u062d\u0648 4 \u063a\u0631\u0627\u0645\u0627\u062a \u0645\u0646 \u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0644\u0643\u0644 \u062d\u0628\u0629 \u0648\u0647\u064a \u0628\u062f\u064a\u0644 \u0645\u063a\u0630\u064d\u0651 \u0644\u0644\u0628\u0637\u0627\u0637\u0627 \u0627\u0644\u0628\u064a\u0636\u0627\u0621.","Mayo Clinic"],t.w)
B.ai3=new A.c(B.c,["Vitamin D helps the body absorb calcium; consider a supplement during winter months when sunlight is limited.","\u064a\u0633\u0627\u0639\u062f \u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u062f \u0627\u0644\u062c\u0633\u0645 \u0639\u0644\u0649 \u0627\u0645\u062a\u0635\u0627\u0635 \u0627\u0644\u0643\u0627\u0644\u0633\u064a\u0648\u0645\u061b \u064a\u064f\u0646\u0635\u062d \u0628\u062a\u0646\u0627\u0648\u0644 \u0645\u0643\u0645\u0651\u0644 \u063a\u0630\u0627\u0626\u064a \u062e\u0644\u0627\u0644 \u0623\u0634\u0647\u0631 \u0627\u0644\u0634\u062a\u0627\u0621 \u0639\u0646\u062f\u0645\u0627 \u064a\u0643\u0648\u0646 \u0636\u0648\u0621 \u0627\u0644\u0634\u0645\u0633 \u0645\u062d\u062f\u0648\u062f\u0627\u064b.","NHS"],t.w)
B.abU=new A.c(B.c,["Iron from plant sources (spinach, lentils) is absorbed better when eaten with vitamin C-rich foods.","\u064a\u064f\u0645\u062a\u0635 \u0627\u0644\u062d\u062f\u064a\u062f \u0645\u0646 \u0627\u0644\u0645\u0635\u0627\u062f\u0631 \u0627\u0644\u0646\u0628\u0627\u062a\u064a\u0629 (\u0627\u0644\u0633\u0628\u0627\u0646\u062e \u0648\u0627\u0644\u0639\u062f\u0633) \u0628\u0634\u0643\u0644 \u0623\u0641\u0636\u0644 \u0639\u0646\u062f \u062a\u0646\u0627\u0648\u0644\u0647 \u0645\u0639 \u0623\u0637\u0639\u0645\u0629 \u063a\u0646\u064a\u0629 \u0628\u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u062c.","Harvard Health"],t.w)
B.ad3=new A.c(B.c,["Calcium is essential for strong bones and teeth \u2014 dairy products, fortified plant milks, and leafy greens are good sources.","\u0627\u0644\u0643\u0627\u0644\u0633\u064a\u0648\u0645 \u0636\u0631\u0648\u0631\u064a \u0644\u0639\u0638\u0627\u0645 \u0648\u0623\u0633\u0646\u0627\u0646 \u0642\u0648\u064a\u0629 \u2014 \u0645\u0646\u062a\u062c\u0627\u062a \u0627\u0644\u0623\u0644\u0628\u0627\u0646 \u0648\u0627\u0644\u062d\u0644\u064a\u0628 \u0627\u0644\u0646\u0628\u0627\u062a\u064a \u0627\u0644\u0645\u062f\u0639\u0651\u0645 \u0648\u0627\u0644\u062e\u0636\u0631\u0627\u0648\u0627\u062a \u0627\u0644\u0648\u0631\u0642\u064a\u0629 \u0645\u0635\u0627\u062f\u0631 \u062c\u064a\u062f\u0629.","Mayo Clinic"],t.w)
B.acH=new A.c(B.c,["Folate is critical during early pregnancy to prevent neural tube defects; leafy greens and legumes are rich sources.","\u062d\u0645\u0636 \u0627\u0644\u0641\u0648\u0644\u064a\u0643 \u0628\u0627\u0644\u063a \u0627\u0644\u0623\u0647\u0645\u064a\u0629 \u0641\u064a \u0628\u062f\u0627\u064a\u0629 \u0627\u0644\u062d\u0645\u0644 \u0644\u0645\u0646\u0639 \u0639\u064a\u0648\u0628 \u0627\u0644\u0623\u0646\u0628\u0648\u0628 \u0627\u0644\u0639\u0635\u0628\u064a\u061b \u0648\u0627\u0644\u062e\u0636\u0631\u0627\u0648\u0627\u062a \u0627\u0644\u0648\u0631\u0642\u064a\u0629 \u0648\u0627\u0644\u0628\u0642\u0648\u0644\u064a\u0627\u062a \u0645\u0635\u0627\u062f\u0631 \u063a\u0646\u064a\u0629 \u0628\u0647.","WHO"],t.w)
B.agU=new A.c(B.c,["Vitamin B12 is found mainly in animal products; vegans should take a supplement or eat fortified foods.","\u064a\u0648\u062c\u062f \u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u062812 \u0628\u0634\u0643\u0644 \u0631\u0626\u064a\u0633\u064a \u0641\u064a \u0627\u0644\u0645\u0646\u062a\u062c\u0627\u062a \u0627\u0644\u062d\u064a\u0648\u0627\u0646\u064a\u0629\u061b \u064a\u062c\u0628 \u0639\u0644\u0649 \u0627\u0644\u0646\u0628\u0627\u062a\u064a\u064a\u0646 \u062a\u0646\u0627\u0648\u0644 \u0645\u0643\u0645\u0651\u0644 \u0623\u0648 \u0623\u0637\u0639\u0645\u0629 \u0645\u062f\u0639\u0651\u0645\u0629.","NHS"],t.w)
B.afq=new A.c(B.c,["Potassium helps regulate blood pressure; bananas, potatoes, spinach, and beans are rich sources.","\u064a\u0633\u0627\u0639\u062f \u0627\u0644\u0628\u0648\u062a\u0627\u0633\u064a\u0648\u0645 \u0641\u064a \u062a\u0646\u0638\u064a\u0645 \u0636\u063a\u0637 \u0627\u0644\u062f\u0645\u061b \u0648\u0627\u0644\u0645\u0648\u0632 \u0648\u0627\u0644\u0628\u0637\u0627\u0637\u0633 \u0648\u0627\u0644\u0633\u0628\u0627\u0646\u062e \u0648\u0627\u0644\u0641\u0627\u0635\u0648\u0644\u064a\u0627 \u0645\u0635\u0627\u062f\u0631 \u063a\u0646\u064a\u0629 \u0628\u0647.","Harvard Health"],t.w)
B.adl=new A.c(B.c,["Zinc supports immune function and wound healing; meat, shellfish, legumes, and seeds are good sources.","\u064a\u062f\u0639\u0645 \u0627\u0644\u0632\u0646\u0643 \u0648\u0638\u064a\u0641\u0629 \u0627\u0644\u0645\u0646\u0627\u0639\u0629 \u0648\u0627\u0644\u062a\u0626\u0627\u0645 \u0627\u0644\u062c\u0631\u0648\u062d\u061b \u0648\u0627\u0644\u0644\u062d\u0648\u0645 \u0648\u0627\u0644\u0645\u062d\u0627\u0631 \u0648\u0627\u0644\u0628\u0642\u0648\u0644\u064a\u0627\u062a \u0648\u0627\u0644\u0628\u0630\u0648\u0631 \u0645\u0635\u0627\u062f\u0631 \u062c\u064a\u062f\u0629 \u0644\u0647.","Mayo Clinic"],t.w)
B.add=new A.c(B.c,["Vitamin A supports vision and immune health; orange and yellow vegetables, liver, and dairy are rich sources.","\u064a\u062f\u0639\u0645 \u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u0623 \u0627\u0644\u0631\u0624\u064a\u0629 \u0648\u0635\u062d\u0629 \u0627\u0644\u0645\u0646\u0627\u0639\u0629\u061b \u0648\u0627\u0644\u062e\u0636\u0631\u0627\u0648\u0627\u062a \u0627\u0644\u0628\u0631\u062a\u0642\u0627\u0644\u064a\u0629 \u0648\u0627\u0644\u0635\u0641\u0631\u0627\u0621 \u0648\u0627\u0644\u0643\u0628\u062f \u0648\u0645\u0646\u062a\u062c\u0627\u062a \u0627\u0644\u0623\u0644\u0628\u0627\u0646 \u0645\u0635\u0627\u062f\u0631 \u063a\u0646\u064a\u0629 \u0628\u0647.","WHO"],t.w)
B.ai8=new A.c(B.c,["Magnesium is involved in over 300 enzyme reactions; nuts, seeds, whole grains, and dark chocolate provide it.","\u064a\u0634\u0627\u0631\u0643 \u0627\u0644\u0645\u063a\u0646\u064a\u0633\u064a\u0648\u0645 \u0641\u064a \u0623\u0643\u062b\u0631 \u0645\u0646 300 \u062a\u0641\u0627\u0639\u0644 \u0625\u0646\u0632\u064a\u0645\u064a\u061b \u0648\u062a\u0648\u0641\u0631\u0647 \u0627\u0644\u0645\u0643\u0633\u0631\u0627\u062a \u0648\u0627\u0644\u0628\u0630\u0648\u0631 \u0648\u0627\u0644\u062d\u0628\u0648\u0628 \u0627\u0644\u0643\u0627\u0645\u0644\u0629 \u0648\u0627\u0644\u0634\u0648\u0643\u0648\u0644\u0627\u062a\u0629 \u0627\u0644\u062f\u0627\u0643\u0646\u0629.","Harvard Health"],t.w)
B.adB=new A.c(B.c,["Iodine is essential for thyroid function; fish, dairy, and iodized salt are the main dietary sources.","\u0627\u0644\u064a\u0648\u062f \u0636\u0631\u0648\u0631\u064a \u0644\u0648\u0638\u064a\u0641\u0629 \u0627\u0644\u063a\u062f\u0629 \u0627\u0644\u062f\u0631\u0642\u064a\u0629\u061b \u0648\u0627\u0644\u0623\u0633\u0645\u0627\u0643 \u0648\u0645\u0646\u062a\u062c\u0627\u062a \u0627\u0644\u0623\u0644\u0628\u0627\u0646 \u0648\u0627\u0644\u0645\u0644\u062d \u0627\u0644\u0645\u0639\u0627\u0644\u062c \u0628\u0627\u0644\u064a\u0648\u062f \u0647\u064a \u0627\u0644\u0645\u0635\u0627\u062f\u0631 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0627\u0644\u0631\u0626\u064a\u0633\u064a\u0629.","NHS"],t.w)
B.aiv=new A.c(B.c,["Vitamin C supports the immune system and helps the body make collagen; citrus fruits, peppers, and berries are excellent sources.","\u064a\u062f\u0639\u0645 \u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u062c \u062c\u0647\u0627\u0632 \u0627\u0644\u0645\u0646\u0627\u0639\u0629 \u0648\u064a\u0633\u0627\u0639\u062f \u0627\u0644\u062c\u0633\u0645 \u0641\u064a \u0625\u0646\u062a\u0627\u062c \u0627\u0644\u0643\u0648\u0644\u0627\u062c\u064a\u0646\u061b \u0648\u0627\u0644\u062d\u0645\u0636\u064a\u0627\u062a \u0648\u0627\u0644\u0641\u0644\u0641\u0644 \u0648\u0627\u0644\u062a\u0648\u062a \u0645\u0635\u0627\u062f\u0631 \u0645\u0645\u062a\u0627\u0632\u0629.","Mayo Clinic"],t.w)
B.adb=new A.c(B.c,["Selenium acts as an antioxidant; just two Brazil nuts per day provides your recommended intake.","\u064a\u0639\u0645\u0644 \u0627\u0644\u0633\u064a\u0644\u064a\u0646\u064a\u0648\u0645 \u0643\u0645\u0636\u0627\u062f \u0644\u0644\u0623\u0643\u0633\u062f\u0629\u061b \u062d\u0628\u062a\u0627\u0646 \u0641\u0642\u0637 \u0645\u0646 \u062c\u0648\u0632 \u0627\u0644\u0628\u0631\u0627\u0632\u064a\u0644 \u064a\u0648\u0645\u064a\u0627\u064b \u062a\u0648\u0641\u0631\u0627\u0646 \u0627\u0644\u0643\u0645\u064a\u0629 \u0627\u0644\u0645\u0648\u0635\u0649 \u0628\u0647\u0627.","Harvard Health"],t.w)
B.aev=new A.c(B.c,["Vitamin K is needed for blood clotting and bone health; green leafy vegetables are the best source.","\u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u0643 \u0636\u0631\u0648\u0631\u064a \u0644\u062a\u062e\u062b\u0631 \u0627\u0644\u062f\u0645 \u0648\u0635\u062d\u0629 \u0627\u0644\u0639\u0638\u0627\u0645\u061b \u0648\u0627\u0644\u062e\u0636\u0631\u0627\u0648\u0627\u062a \u0627\u0644\u0648\u0631\u0642\u064a\u0629 \u0627\u0644\u062e\u0636\u0631\u0627\u0621 \u0647\u064a \u0623\u0641\u0636\u0644 \u0645\u0635\u062f\u0631.","NHS"],t.w)
B.aaZ=new A.c(B.c,["Omega-3 fatty acids support brain and heart health; aim for two portions of fish per week, one being oily.","\u062a\u062f\u0639\u0645 \u0623\u062d\u0645\u0627\u0636 \u0623\u0648\u0645\u064a\u063a\u0627-3 \u0627\u0644\u062f\u0647\u0646\u064a\u0629 \u0635\u062d\u0629 \u0627\u0644\u062f\u0645\u0627\u063a \u0648\u0627\u0644\u0642\u0644\u0628\u061b \u0627\u0647\u062f\u0641 \u0625\u0644\u0649 \u062d\u0635\u062a\u064a\u0646 \u0645\u0646 \u0627\u0644\u0623\u0633\u0645\u0627\u0643 \u0623\u0633\u0628\u0648\u0639\u064a\u0627\u064b\u060c \u0625\u062d\u062f\u0627\u0647\u0645\u0627 \u062f\u0647\u0646\u064a\u0629.","NHS"],t.w)
B.ahb=new A.c(B.c,["B vitamins help the body convert food into energy; whole grains, meat, eggs, and legumes are key sources.","\u062a\u0633\u0627\u0639\u062f \u0641\u064a\u062a\u0627\u0645\u064a\u0646\u0627\u062a \u0628 \u0627\u0644\u062c\u0633\u0645 \u0641\u064a \u062a\u062d\u0648\u064a\u0644 \u0627\u0644\u0637\u0639\u0627\u0645 \u0625\u0644\u0649 \u0637\u0627\u0642\u0629\u061b \u0648\u0627\u0644\u062d\u0628\u0648\u0628 \u0627\u0644\u0643\u0627\u0645\u0644\u0629 \u0648\u0627\u0644\u0644\u062d\u0648\u0645 \u0648\u0627\u0644\u0628\u064a\u0636 \u0648\u0627\u0644\u0628\u0642\u0648\u0644\u064a\u0627\u062a \u0645\u0635\u0627\u062f\u0631 \u0631\u0626\u064a\u0633\u064a\u0629.","Mayo Clinic"],t.w)
B.afc=new A.c(B.c,["Eating a variety of colorful fruits and vegetables helps ensure a broad spectrum of vitamins and minerals.","\u062a\u0646\u0627\u0648\u0644 \u062a\u0634\u0643\u064a\u0644\u0629 \u0645\u062a\u0646\u0648\u0639\u0629 \u0645\u0646 \u0627\u0644\u0641\u0648\u0627\u0643\u0647 \u0648\u0627\u0644\u062e\u0636\u0631\u0627\u0648\u0627\u062a \u0627\u0644\u0645\u0644\u0648\u0646\u0629 \u064a\u0633\u0627\u0639\u062f \u0641\u064a \u0636\u0645\u0627\u0646 \u0637\u064a\u0641 \u0648\u0627\u0633\u0639 \u0645\u0646 \u0627\u0644\u0641\u064a\u062a\u0627\u0645\u064a\u0646\u0627\u062a \u0648\u0627\u0644\u0645\u0639\u0627\u062f\u0646.","Harvard Health"],t.w)
B.aiE=new A.c(B.c,["Vitamin E is an antioxidant found in nuts, seeds, and vegetable oils that protects cells from damage.","\u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u0647\u0640 \u0645\u0636\u0627\u062f \u0644\u0644\u0623\u0643\u0633\u062f\u0629 \u064a\u0648\u062c\u062f \u0641\u064a \u0627\u0644\u0645\u0643\u0633\u0631\u0627\u062a \u0648\u0627\u0644\u0628\u0630\u0648\u0631 \u0648\u0627\u0644\u0632\u064a\u0648\u062a \u0627\u0644\u0646\u0628\u0627\u062a\u064a\u0629 \u0648\u064a\u062d\u0645\u064a \u0627\u0644\u062e\u0644\u0627\u064a\u0627 \u0645\u0646 \u0627\u0644\u062a\u0644\u0641.","Mayo Clinic"],t.w)
B.acV=new A.c(B.c,["Chromium helps regulate blood sugar; broccoli, grape juice, and whole grains are sources.","\u064a\u0633\u0627\u0639\u062f \u0627\u0644\u0643\u0631\u0648\u0645 \u0641\u064a \u062a\u0646\u0638\u064a\u0645 \u0633\u0643\u0631 \u0627\u0644\u062f\u0645\u061b \u0648\u0627\u0644\u0628\u0631\u0648\u0643\u0644\u064a \u0648\u0639\u0635\u064a\u0631 \u0627\u0644\u0639\u0646\u0628 \u0648\u0627\u0644\u062d\u0628\u0648\u0628 \u0627\u0644\u0643\u0627\u0645\u0644\u0629 \u0645\u0635\u0627\u062f\u0631 \u0644\u0647.","Harvard Health"],t.w)
B.ai9=new A.c(B.c,["Copper supports iron metabolism and nerve function; shellfish, nuts, seeds, and dark chocolate contain it.","\u064a\u062f\u0639\u0645 \u0627\u0644\u0646\u062d\u0627\u0633 \u0623\u064a\u0636 \u0627\u0644\u062d\u062f\u064a\u062f \u0648\u0648\u0638\u064a\u0641\u0629 \u0627\u0644\u0623\u0639\u0635\u0627\u0628\u061b \u0648\u064a\u062d\u062a\u0648\u064a \u0639\u0644\u064a\u0647 \u0627\u0644\u0645\u062d\u0627\u0631 \u0648\u0627\u0644\u0645\u0643\u0633\u0631\u0627\u062a \u0648\u0627\u0644\u0628\u0630\u0648\u0631 \u0648\u0627\u0644\u0634\u0648\u0643\u0648\u0644\u0627\u062a\u0629 \u0627\u0644\u062f\u0627\u0643\u0646\u0629.","Mayo Clinic"],t.w)
B.aew=new A.c(B.c,["Too much of certain vitamins (A, D, E, K) can be harmful; aim to get nutrients from food first.","\u0627\u0644\u0625\u0641\u0631\u0627\u0637 \u0641\u064a \u062a\u0646\u0627\u0648\u0644 \u0628\u0639\u0636 \u0627\u0644\u0641\u064a\u062a\u0627\u0645\u064a\u0646\u0627\u062a (\u0623\u060c \u062f\u060c \u0647\u0640\u060c \u0643) \u0642\u062f \u064a\u0643\u0648\u0646 \u0636\u0627\u0631\u0627\u064b\u061b \u0627\u062d\u0631\u0635 \u0639\u0644\u0649 \u0627\u0644\u062d\u0635\u0648\u0644 \u0639\u0644\u0649 \u0627\u0644\u0639\u0646\u0627\u0635\u0631 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0645\u0646 \u0627\u0644\u0637\u0639\u0627\u0645 \u0623\u0648\u0644\u0627\u064b.","NHS"],t.w)
B.ace=new A.c(B.c,["Eating breakfast helps replenish blood glucose and can improve concentration and energy levels throughout the morning.","\u062a\u0646\u0627\u0648\u0644 \u0648\u062c\u0628\u0629 \u0627\u0644\u0625\u0641\u0637\u0627\u0631 \u064a\u0633\u0627\u0639\u062f \u0641\u064a \u062a\u062c\u062f\u064a\u062f \u063a\u0644\u0648\u0643\u0648\u0632 \u0627\u0644\u062f\u0645 \u0648\u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u062d\u0633\u0651\u0646 \u0627\u0644\u062a\u0631\u0643\u064a\u0632 \u0648\u0645\u0633\u062a\u0648\u064a\u0627\u062a \u0627\u0644\u0637\u0627\u0642\u0629 \u0637\u0648\u0627\u0644 \u0627\u0644\u0635\u0628\u0627\u062d.","NHS"],t.w)
B.acw=new A.c(B.c,["Eating at regular times helps your body regulate hunger hormones and energy use.","\u0627\u0644\u0623\u0643\u0644 \u0641\u064a \u0623\u0648\u0642\u0627\u062a \u0645\u0646\u062a\u0638\u0645\u0629 \u064a\u0633\u0627\u0639\u062f \u062c\u0633\u0645\u0643 \u0639\u0644\u0649 \u062a\u0646\u0638\u064a\u0645 \u0647\u0631\u0645\u0648\u0646\u0627\u062a \u0627\u0644\u062c\u0648\u0639 \u0648\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0637\u0627\u0642\u0629.","Harvard Health"],t.w)
B.adr=new A.c(B.c,["Leaving at least two hours between your last meal and bedtime may improve sleep quality and digestion.","\u062a\u0631\u0643 \u0633\u0627\u0639\u062a\u064a\u0646 \u0639\u0644\u0649 \u0627\u0644\u0623\u0642\u0644 \u0628\u064a\u0646 \u0622\u062e\u0631 \u0648\u062c\u0628\u0629 \u0648\u0648\u0642\u062a \u0627\u0644\u0646\u0648\u0645 \u0642\u062f \u064a\u062d\u0633\u0651\u0646 \u062c\u0648\u062f\u0629 \u0627\u0644\u0646\u0648\u0645 \u0648\u0627\u0644\u0647\u0636\u0645.","Mayo Clinic"],t.w)
B.abR=new A.c(B.c,["Planning meals ahead reduces the likelihood of reaching for high-calorie convenience foods.","\u0627\u0644\u062a\u062e\u0637\u064a\u0637 \u0627\u0644\u0645\u0633\u0628\u0642 \u0644\u0644\u0648\u062c\u0628\u0627\u062a \u064a\u0642\u0644\u0644 \u0645\u0646 \u0627\u062d\u062a\u0645\u0627\u0644\u064a\u0629 \u0627\u0644\u0644\u062c\u0648\u0621 \u0625\u0644\u0649 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0633\u0631\u064a\u0639\u0629 \u0639\u0627\u0644\u064a\u0629 \u0627\u0644\u0633\u0639\u0631\u0627\u062a \u0627\u0644\u062d\u0631\u0627\u0631\u064a\u0629.","NHS"],t.w)
B.aei=new A.c(B.c,["If you skip meals, you are more likely to overeat at the next one due to increased hunger.","\u0625\u0630\u0627 \u062a\u062e\u0637\u064a\u062a \u0648\u062c\u0628\u0629\u060c \u0641\u0645\u0646 \u0627\u0644\u0645\u0631\u062c\u062d \u0623\u0646 \u062a\u0641\u0631\u0637 \u0641\u064a \u0627\u0644\u0623\u0643\u0644 \u0641\u064a \u0627\u0644\u0648\u062c\u0628\u0629 \u0627\u0644\u062a\u0627\u0644\u064a\u0629 \u0628\u0633\u0628\u0628 \u0632\u064a\u0627\u062f\u0629 \u0627\u0644\u062c\u0648\u0639.","Harvard Health"],t.w)
B.adQ=new A.c(B.c,["A balanced meal includes protein, complex carbohydrates, healthy fat, and vegetables.","\u0627\u0644\u0648\u062c\u0628\u0629 \u0627\u0644\u0645\u062a\u0648\u0627\u0632\u0646\u0629 \u062a\u0634\u0645\u0644 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0648\u0627\u0644\u0643\u0631\u0628\u0648\u0647\u064a\u062f\u0631\u0627\u062a \u0627\u0644\u0645\u0639\u0642\u062f\u0629 \u0648\u0627\u0644\u062f\u0647\u0648\u0646 \u0627\u0644\u0635\u062d\u064a\u0629 \u0648\u0627\u0644\u062e\u0636\u0631\u0627\u0648\u0627\u062a.","Mayo Clinic"],t.w)
B.agY=new A.c(B.c,["Eating slowly and chewing thoroughly gives your brain time to register fullness, typically about 20 minutes.","\u0627\u0644\u0623\u0643\u0644 \u0628\u0628\u0637\u0621 \u0648\u0627\u0644\u0645\u0636\u063a \u062c\u064a\u062f\u0627\u064b \u064a\u0645\u0646\u062d \u062f\u0645\u0627\u063a\u0643 \u0627\u0644\u0648\u0642\u062a \u0644\u062a\u0633\u062c\u064a\u0644 \u0627\u0644\u0634\u0628\u0639\u060c \u0639\u0627\u062f\u0629\u064b \u0646\u062d\u0648 20 \u062f\u0642\u064a\u0642\u0629.","Harvard Health"],t.w)
B.ach=new A.c(B.c,["Mid-morning and mid-afternoon snacks can prevent energy dips if they include protein and fiber.","\u0627\u0644\u0648\u062c\u0628\u0627\u062a \u0627\u0644\u062e\u0641\u064a\u0641\u0629 \u0641\u064a \u0645\u0646\u062a\u0635\u0641 \u0627\u0644\u0635\u0628\u0627\u062d \u0648\u0628\u0639\u062f \u0627\u0644\u0638\u0647\u0631 \u064a\u0645\u0643\u0646 \u0623\u0646 \u062a\u0645\u0646\u0639 \u0627\u0646\u062e\u0641\u0627\u0636 \u0627\u0644\u0637\u0627\u0642\u0629 \u0625\u0630\u0627 \u062a\u0636\u0645\u0646\u062a \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0648\u0627\u0644\u0623\u0644\u064a\u0627\u0641.","NHS"],t.w)
B.af9=new A.c(B.c,["Batch cooking on weekends sets you up with healthy ready-made meals for the busy week ahead.","\u0637\u0647\u064a \u0643\u0645\u064a\u0627\u062a \u0643\u0628\u064a\u0631\u0629 \u0641\u064a \u0639\u0637\u0644\u0629 \u0646\u0647\u0627\u064a\u0629 \u0627\u0644\u0623\u0633\u0628\u0648\u0639 \u064a\u0648\u0641\u0631 \u0644\u0643 \u0648\u062c\u0628\u0627\u062a \u0635\u062d\u064a\u0629 \u062c\u0627\u0647\u0632\u0629 \u0644\u0644\u0623\u0633\u0628\u0648\u0639 \u0627\u0644\u0645\u0632\u062f\u062d\u0645.","NHS"],t.w)
B.acR=new A.c(B.c,["Mindful eating \u2014 paying attention to taste, texture, and hunger cues \u2014 can help prevent overeating.","\u0627\u0644\u0623\u0643\u0644 \u0627\u0644\u0648\u0627\u0639\u064a \u2014 \u0627\u0644\u0627\u0646\u062a\u0628\u0627\u0647 \u0644\u0644\u0637\u0639\u0645 \u0648\u0627\u0644\u0642\u0648\u0627\u0645 \u0648\u0625\u0634\u0627\u0631\u0627\u062a \u0627\u0644\u062c\u0648\u0639 \u2014 \u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u0633\u0627\u0639\u062f \u0641\u064a \u0645\u0646\u0639 \u0627\u0644\u0625\u0641\u0631\u0627\u0637 \u0641\u064a \u0627\u0644\u0623\u0643\u0644.","Harvard Health"],t.w)
B.ahg=new A.c(B.c,["Eating your heaviest meal earlier in the day may be beneficial for metabolic health.","\u062a\u0646\u0627\u0648\u0644 \u0623\u062b\u0642\u0644 \u0648\u062c\u0628\u0629 \u0641\u064a \u0648\u0642\u062a \u0645\u0628\u0643\u0631 \u0645\u0646 \u0627\u0644\u064a\u0648\u0645 \u0642\u062f \u064a\u0643\u0648\u0646 \u0645\u0641\u064a\u062f\u0627\u064b \u0644\u0635\u062d\u0629 \u0627\u0644\u0623\u064a\u0636.","Harvard Health"],t.w)
B.agR=new A.c(B.c,["Keeping a consistent eating schedule, even on weekends, supports stable blood sugar levels.","\u0627\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u062c\u062f\u0648\u0644 \u0623\u0643\u0644 \u0645\u0646\u062a\u0638\u0645\u060c \u062d\u062a\u0649 \u0641\u064a \u0639\u0637\u0644\u0629 \u0646\u0647\u0627\u064a\u0629 \u0627\u0644\u0623\u0633\u0628\u0648\u0639\u060c \u064a\u062f\u0639\u0645 \u0627\u0633\u062a\u0642\u0631\u0627\u0631 \u0645\u0633\u062a\u0648\u064a\u0627\u062a \u0627\u0644\u0633\u0643\u0631 \u0641\u064a \u0627\u0644\u062f\u0645.","Mayo Clinic"],t.w)
B.agi=new A.c(B.c,["Preparing a grocery list before shopping reduces impulse purchases of less nutritious items.","\u0625\u0639\u062f\u0627\u062f \u0642\u0627\u0626\u0645\u0629 \u0645\u0634\u062a\u0631\u064a\u0627\u062a \u0642\u0628\u0644 \u0627\u0644\u062a\u0633\u0648\u0642 \u064a\u0642\u0644\u0644 \u0645\u0646 \u0627\u0644\u0645\u0634\u062a\u0631\u064a\u0627\u062a \u0627\u0644\u0639\u0634\u0648\u0627\u0626\u064a\u0629 \u0644\u0644\u0645\u0648\u0627\u062f \u0627\u0644\u0623\u0642\u0644 \u062a\u063a\u0630\u064a\u0629.","NHS"],t.w)
B.ah9=new A.c(B.c,["Having healthy snacks readily available (cut vegetables, fruit, nuts) makes good choices easier.","\u062a\u0648\u0641\u064a\u0631 \u0648\u062c\u0628\u0627\u062a \u062e\u0641\u064a\u0641\u0629 \u0635\u062d\u064a\u0629 \u062c\u0627\u0647\u0632\u0629 (\u062e\u0636\u0631\u0627\u0648\u0627\u062a \u0645\u0642\u0637\u0639\u0629\u060c \u0641\u0648\u0627\u0643\u0647\u060c \u0645\u0643\u0633\u0631\u0627\u062a) \u064a\u0633\u0647\u0651\u0644 \u0627\u062a\u062e\u0627\u0630 \u0627\u0644\u062e\u064a\u0627\u0631\u0627\u062a \u0627\u0644\u062c\u064a\u062f\u0629.","Harvard Health"],t.w)
B.af8=new A.c(B.c,["Cooking at home gives you more control over ingredients, portions, and cooking methods.","\u0627\u0644\u0637\u0647\u064a \u0641\u064a \u0627\u0644\u0645\u0646\u0632\u0644 \u064a\u0645\u0646\u062d\u0643 \u062a\u062d\u0643\u0645\u0627\u064b \u0623\u0643\u0628\u0631 \u0641\u064a \u0627\u0644\u0645\u0643\u0648\u0646\u0627\u062a \u0648\u0627\u0644\u062d\u0635\u0635 \u0648\u0637\u0631\u0642 \u0627\u0644\u0637\u0628\u062e.","Mayo Clinic"],t.w)
B.aci=new A.c(B.c,["Using a smaller plate can naturally reduce portion sizes without making you feel deprived.","\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0637\u0628\u0642 \u0623\u0635\u063a\u0631 \u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u0642\u0644\u0644 \u0623\u062d\u062c\u0627\u0645 \u0627\u0644\u062d\u0635\u0635 \u0628\u0634\u0643\u0644 \u0637\u0628\u064a\u0639\u064a \u062f\u0648\u0646 \u0623\u0646 \u062a\u0634\u0639\u0631 \u0628\u0627\u0644\u062d\u0631\u0645\u0627\u0646.","Harvard Health"],t.w)
B.agX=new A.c(B.c,["A serving of meat or fish should be roughly the size of your palm.","\u064a\u062c\u0628 \u0623\u0646 \u062a\u0643\u0648\u0646 \u062d\u0635\u0629 \u0627\u0644\u0644\u062d\u0645 \u0623\u0648 \u0627\u0644\u0633\u0645\u0643 \u0628\u062d\u062c\u0645 \u0631\u0627\u062d\u0629 \u064a\u062f\u0643 \u062a\u0642\u0631\u064a\u0628\u0627\u064b.","NHS"],t.w)
B.abG=new A.c(B.c,["A serving of cheese is about the size of two thumbs placed together.","\u062d\u0635\u0629 \u0627\u0644\u062c\u0628\u0646 \u062a\u0639\u0627\u062f\u0644 \u062a\u0642\u0631\u064a\u0628\u0627\u064b \u062d\u062c\u0645 \u0625\u0628\u0647\u0627\u0645\u064a\u0646 \u0645\u0636\u0645\u0648\u0645\u064a\u0646 \u0645\u0639\u0627\u064b.","NHS"],t.w)
B.abf=new A.c(B.c,["One serving of cooked pasta or rice is about the size of your clenched fist.","\u062d\u0635\u0629 \u0648\u0627\u062d\u062f\u0629 \u0645\u0646 \u0627\u0644\u0645\u0639\u0643\u0631\u0648\u0646\u0629 \u0623\u0648 \u0627\u0644\u0623\u0631\u0632 \u0627\u0644\u0645\u0637\u0628\u0648\u062e \u062a\u0639\u0627\u062f\u0644 \u062a\u0642\u0631\u064a\u0628\u0627\u064b \u062d\u062c\u0645 \u0642\u0628\u0636\u0629 \u064a\u062f\u0643.","NHS"],t.w)
B.aeH=new A.c(B.c,["Reading the serving size on food labels helps you understand exactly how much you are eating.","\u0642\u0631\u0627\u0621\u0629 \u062d\u062c\u0645 \u0627\u0644\u062d\u0635\u0629 \u0639\u0644\u0649 \u0645\u0644\u0635\u0642\u0627\u062a \u0627\u0644\u0637\u0639\u0627\u0645 \u062a\u0633\u0627\u0639\u062f\u0643 \u0639\u0644\u0649 \u0641\u0647\u0645 \u0627\u0644\u0643\u0645\u064a\u0629 \u0627\u0644\u062a\u064a \u062a\u062a\u0646\u0627\u0648\u0644\u0647\u0627 \u0628\u0627\u0644\u0636\u0628\u0637.","Mayo Clinic"],t.w)
B.ac7=new A.c(B.c,["Restaurants often serve two to three times the recommended portion size; consider sharing or saving half.","\u0627\u0644\u0645\u0637\u0627\u0639\u0645 \u063a\u0627\u0644\u0628\u0627\u064b \u0645\u0627 \u062a\u0642\u062f\u0645 \u0636\u0639\u0641\u064a\u0646 \u0625\u0644\u0649 \u062b\u0644\u0627\u062b\u0629 \u0623\u0636\u0639\u0627\u0641 \u062d\u062c\u0645 \u0627\u0644\u062d\u0635\u0629 \u0627\u0644\u0645\u0648\u0635\u0649 \u0628\u0647\u061b \u0641\u0643\u0651\u0631 \u0641\u064a \u0627\u0644\u0645\u0634\u0627\u0631\u0643\u0629 \u0623\u0648 \u062d\u0641\u0638 \u0627\u0644\u0646\u0635\u0641.","Harvard Health"],t.w)
B.aeJ=new A.c(B.c,["Filling half your plate with vegetables and salad naturally limits space for higher-calorie foods.","\u0645\u0644\u0621 \u0646\u0635\u0641 \u0637\u0628\u0642\u0643 \u0628\u0627\u0644\u062e\u0636\u0631\u0627\u0648\u0627\u062a \u0648\u0627\u0644\u0633\u0644\u0637\u0629 \u064a\u062d\u062f\u0651 \u0628\u0634\u0643\u0644 \u0637\u0628\u064a\u0639\u064a \u0645\u0646 \u0627\u0644\u0645\u0633\u0627\u062d\u0629 \u0627\u0644\u0645\u062a\u0627\u062d\u0629 \u0644\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0623\u0639\u0644\u0649 \u0633\u0639\u0631\u0627\u062a \u062d\u0631\u0627\u0631\u064a\u0629.","Harvard Health"],t.w)
B.aio=new A.c(B.c,["Pre-portioning snacks into small containers prevents mindless eating from large bags.","\u062a\u0642\u0633\u064a\u0645 \u0627\u0644\u0648\u062c\u0628\u0627\u062a \u0627\u0644\u062e\u0641\u064a\u0641\u0629 \u0645\u0633\u0628\u0642\u0627\u064b \u0641\u064a \u062d\u0627\u0648\u064a\u0627\u062a \u0635\u063a\u064a\u0631\u0629 \u064a\u0645\u0646\u0639 \u0627\u0644\u0623\u0643\u0644 \u063a\u064a\u0631 \u0627\u0644\u0648\u0627\u0639\u064a \u0645\u0646 \u0627\u0644\u0623\u0643\u064a\u0627\u0633 \u0627\u0644\u0643\u0628\u064a\u0631\u0629.","Mayo Clinic"],t.w)
B.acD=new A.c(B.c,["Serving food from the kitchen rather than placing dishes on the table reduces the temptation for seconds.","\u062a\u0642\u062f\u064a\u0645 \u0627\u0644\u0637\u0639\u0627\u0645 \u0645\u0646 \u0627\u0644\u0645\u0637\u0628\u062e \u0628\u062f\u0644\u0627\u064b \u0645\u0646 \u0648\u0636\u0639 \u0627\u0644\u0623\u0637\u0628\u0627\u0642 \u0639\u0644\u0649 \u0627\u0644\u0645\u0627\u0626\u062f\u0629 \u064a\u0642\u0644\u0644 \u0645\u0646 \u0625\u063a\u0631\u0627\u0621 \u0623\u062e\u0630 \u062d\u0635\u0629 \u062b\u0627\u0646\u064a\u0629.","Harvard Health"],t.w)
B.aej=new A.c(B.c,["A portion of nuts as a snack is about a small handful (30 g), roughly 150\u2013180 calories.","\u062d\u0635\u0629 \u0627\u0644\u0645\u0643\u0633\u0631\u0627\u062a \u0643\u0648\u062c\u0628\u0629 \u062e\u0641\u064a\u0641\u0629 \u062a\u0639\u0627\u062f\u0644 \u062d\u0641\u0646\u0629 \u0635\u063a\u064a\u0631\u0629 (30 \u063a\u0631\u0627\u0645\u0627\u064b)\u060c \u0623\u064a \u0646\u062d\u0648 150-180 \u0633\u0639\u0631\u0629 \u062d\u0631\u0627\u0631\u064a\u0629.","NHS"],t.w)
B.ahp=new A.c(B.c,["Drinking a glass of water before a meal can help you eat a more appropriate portion.","\u0634\u0631\u0628 \u0643\u0648\u0628 \u0645\u0646 \u0627\u0644\u0645\u0627\u0621 \u0642\u0628\u0644 \u0627\u0644\u0648\u062c\u0628\u0629 \u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u0633\u0627\u0639\u062f\u0643 \u0639\u0644\u0649 \u062a\u0646\u0627\u0648\u0644 \u062d\u0635\u0629 \u0645\u0646\u0627\u0633\u0628\u0629.","Harvard Health"],t.w)
B.afI=new A.c(B.c,["Check cereal box servings \u2014 many people pour two to three times the recommended amount.","\u062a\u062d\u0642\u0642 \u0645\u0646 \u062d\u0635\u0635 \u0639\u0644\u0628 \u0627\u0644\u062d\u0628\u0648\u0628 \u2014 \u0643\u062b\u064a\u0631 \u0645\u0646 \u0627\u0644\u0646\u0627\u0633 \u064a\u0633\u0643\u0628\u0648\u0646 \u0636\u0639\u0641\u064a\u0646 \u0625\u0644\u0649 \u062b\u0644\u0627\u062b\u0629 \u0623\u0636\u0639\u0627\u0641 \u0627\u0644\u0643\u0645\u064a\u0629 \u0627\u0644\u0645\u0648\u0635\u0649 \u0628\u0647\u0627.","Mayo Clinic"],t.w)
B.adm=new A.c(B.c,["Using measuring cups for cooking oils ensures you do not add excessive hidden calories.","\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0623\u0643\u0648\u0627\u0628 \u0627\u0644\u0642\u064a\u0627\u0633 \u0644\u0632\u064a\u0648\u062a \u0627\u0644\u0637\u0628\u062e \u064a\u0636\u0645\u0646 \u0639\u062f\u0645 \u0625\u0636\u0627\u0641\u0629 \u0633\u0639\u0631\u0627\u062a \u062d\u0631\u0627\u0631\u064a\u0629 \u0645\u062e\u0641\u064a\u0629 \u0645\u0641\u0631\u0637\u0629.","NHS"],t.w)
B.ahP=new A.c(B.c,["Eating from a bowl rather than a bag helps you see and control how much you consume.","\u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0637\u0639\u0627\u0645 \u0645\u0646 \u0648\u0639\u0627\u0621 \u0628\u062f\u0644\u0627\u064b \u0645\u0646 \u0643\u064a\u0633 \u064a\u0633\u0627\u0639\u062f\u0643 \u0639\u0644\u0649 \u0631\u0624\u064a\u0629 \u0627\u0644\u0643\u0645\u064a\u0629 \u0627\u0644\u062a\u064a \u062a\u0633\u062a\u0647\u0644\u0643\u0647\u0627 \u0648\u0627\u0644\u062a\u062d\u0643\u0645 \u0628\u0647\u0627.","Harvard Health"],t.w)
B.acM=new A.c(B.c,["When dining out, ask for dressings and sauces on the side so you control the amount added.","\u0639\u0646\u062f \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0637\u0639\u0627\u0645 \u062e\u0627\u0631\u062c \u0627\u0644\u0645\u0646\u0632\u0644\u060c \u0627\u0637\u0644\u0628 \u0627\u0644\u0635\u0644\u0635\u0627\u062a \u0648\u0627\u0644\u062a\u062a\u0628\u064a\u0644\u0627\u062a \u062c\u0627\u0646\u0628\u0627\u064b \u0644\u062a\u062a\u062d\u0643\u0645 \u0641\u064a \u0627\u0644\u0643\u0645\u064a\u0629 \u0627\u0644\u0645\u0636\u0627\u0641\u0629.","Mayo Clinic"],t.w)
B.agQ=new A.c(B.c,["Wash your hands thoroughly with soap and warm water for at least 20 seconds before preparing food.","\u0627\u063a\u0633\u0644 \u064a\u062f\u064a\u0643 \u062c\u064a\u062f\u0627\u064b \u0628\u0627\u0644\u0635\u0627\u0628\u0648\u0646 \u0648\u0627\u0644\u0645\u0627\u0621 \u0627\u0644\u062f\u0627\u0641\u0626 \u0644\u0645\u062f\u0629 20 \u062b\u0627\u0646\u064a\u0629 \u0639\u0644\u0649 \u0627\u0644\u0623\u0642\u0644 \u0642\u0628\u0644 \u062a\u062d\u0636\u064a\u0631 \u0627\u0644\u0637\u0639\u0627\u0645.","WHO"],t.w)
B.adU=new A.c(B.c,["Use separate chopping boards for raw meat and ready-to-eat foods to prevent cross-contamination.","\u0627\u0633\u062a\u062e\u062f\u0645 \u0623\u0644\u0648\u0627\u062d \u062a\u0642\u0637\u064a\u0639 \u0645\u0646\u0641\u0635\u0644\u0629 \u0644\u0644\u062d\u0648\u0645 \u0627\u0644\u0646\u064a\u0626\u0629 \u0648\u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u062c\u0627\u0647\u0632\u0629 \u0644\u0644\u0623\u0643\u0644 \u0644\u0645\u0646\u0639 \u0627\u0644\u062a\u0644\u0648\u062b \u0627\u0644\u0645\u062a\u0628\u0627\u062f\u0644.","NHS"],t.w)
B.aeg=new A.c(B.c,["Refrigerate perishable foods within two hours of purchase or preparation to slow bacterial growth.","\u0636\u0639 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0642\u0627\u0628\u0644\u0629 \u0644\u0644\u062a\u0644\u0641 \u0641\u064a \u0627\u0644\u062b\u0644\u0627\u062c\u0629 \u062e\u0644\u0627\u0644 \u0633\u0627\u0639\u062a\u064a\u0646 \u0645\u0646 \u0627\u0644\u0634\u0631\u0627\u0621 \u0623\u0648 \u0627\u0644\u062a\u062d\u0636\u064a\u0631 \u0644\u0625\u0628\u0637\u0627\u0621 \u0646\u0645\u0648 \u0627\u0644\u0628\u0643\u062a\u064a\u0631\u064a\u0627.","Mayo Clinic"],t.w)
B.ac3=new A.c(B.c,["Cook poultry to an internal temperature of at least 74 \xb0C (165 \xb0F) to kill harmful bacteria.","\u0627\u0637\u0628\u062e \u0627\u0644\u062f\u0648\u0627\u062c\u0646 \u062d\u062a\u0649 \u062a\u0635\u0644 \u062f\u0631\u062c\u0629 \u0627\u0644\u062d\u0631\u0627\u0631\u0629 \u0627\u0644\u062f\u0627\u062e\u0644\u064a\u0629 \u0625\u0644\u0649 74 \u062f\u0631\u062c\u0629 \u0645\u0626\u0648\u064a\u0629 (165 \u0641\u0647\u0631\u0646\u0647\u0627\u064a\u062a) \u0639\u0644\u0649 \u0627\u0644\u0623\u0642\u0644 \u0644\u0644\u0642\u0636\u0627\u0621 \u0639\u0644\u0649 \u0627\u0644\u0628\u0643\u062a\u064a\u0631\u064a\u0627 \u0627\u0644\u0636\u0627\u0631\u0629.","WHO"],t.w)
B.adY=new A.c(B.c,["Defrost frozen food in the refrigerator, in cold water, or in the microwave \u2014 never at room temperature.","\u0642\u0645 \u0628\u0625\u0630\u0627\u0628\u0629 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0645\u062c\u0645\u062f\u0629 \u0641\u064a \u0627\u0644\u062b\u0644\u0627\u062c\u0629 \u0623\u0648 \u0641\u064a \u0645\u0627\u0621 \u0628\u0627\u0631\u062f \u0623\u0648 \u0641\u064a \u0627\u0644\u0645\u064a\u0643\u0631\u0648\u0648\u064a\u0641 \u2014 \u0648\u0644\u0627 \u062a\u0630\u0628\u0647\u0627 \u0623\u0628\u062f\u0627\u064b \u0641\u064a \u062f\u0631\u062c\u0629 \u062d\u0631\u0627\u0631\u0629 \u0627\u0644\u063a\u0631\u0641\u0629.","NHS"],t.w)
B.adw=new A.c(B.c,["Leftover cooked food should be refrigerated within one hour and consumed within two days.","\u064a\u062c\u0628 \u0648\u0636\u0639 \u0628\u0642\u0627\u064a\u0627 \u0627\u0644\u0637\u0639\u0627\u0645 \u0627\u0644\u0645\u0637\u0628\u0648\u062e \u0641\u064a \u0627\u0644\u062b\u0644\u0627\u062c\u0629 \u062e\u0644\u0627\u0644 \u0633\u0627\u0639\u0629 \u0648\u0627\u062d\u062f\u0629 \u0648\u0627\u0633\u062a\u0647\u0644\u0627\u0643\u0647\u0627 \u0641\u064a \u063a\u0636\u0648\u0646 \u064a\u0648\u0645\u064a\u0646.","NHS"],t.w)
B.ae7=new A.c(B.c,["Do not wash raw chicken before cooking; this spreads bacteria via water droplets to nearby surfaces.","\u0644\u0627 \u062a\u063a\u0633\u0644 \u0627\u0644\u062f\u062c\u0627\u062c \u0627\u0644\u0646\u064a\u0621 \u0642\u0628\u0644 \u0627\u0644\u0637\u0628\u062e\u061b \u0641\u0630\u0644\u0643 \u064a\u0646\u0634\u0631 \u0627\u0644\u0628\u0643\u062a\u064a\u0631\u064a\u0627 \u0639\u0628\u0631 \u0631\u0630\u0627\u0630 \u0627\u0644\u0645\u0627\u0621 \u0625\u0644\u0649 \u0627\u0644\u0623\u0633\u0637\u062d \u0627\u0644\u0645\u062c\u0627\u0648\u0631\u0629.","NHS"],t.w)
B.afT=new A.c(B.c,["Check the use-by date on perishable foods \u2014 after this date, the food may no longer be safe to eat.","\u062a\u062d\u0642\u0642 \u0645\u0646 \u062a\u0627\u0631\u064a\u062e \u0627\u0646\u062a\u0647\u0627\u0621 \u0627\u0644\u0635\u0644\u0627\u062d\u064a\u0629 \u0639\u0644\u0649 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0642\u0627\u0628\u0644\u0629 \u0644\u0644\u062a\u0644\u0641 \u2014 \u0628\u0639\u062f \u0647\u0630\u0627 \u0627\u0644\u062a\u0627\u0631\u064a\u062e \u0642\u062f \u0644\u0627 \u064a\u0643\u0648\u0646 \u0627\u0644\u0637\u0639\u0627\u0645 \u0622\u0645\u0646\u0627\u064b \u0644\u0644\u0623\u0643\u0644.","NHS"],t.w)
B.ag1=new A.c(B.c,["Keep your refrigerator at 5 \xb0C or below to keep food safe; use a fridge thermometer to verify.","\u062d\u0627\u0641\u0638 \u0639\u0644\u0649 \u062f\u0631\u062c\u0629 \u062d\u0631\u0627\u0631\u0629 \u062b\u0644\u0627\u062c\u062a\u0643 \u0639\u0646\u062f 5 \u062f\u0631\u062c\u0627\u062a \u0645\u0626\u0648\u064a\u0629 \u0623\u0648 \u0623\u0642\u0644 \u0644\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u0633\u0644\u0627\u0645\u0629 \u0627\u0644\u0637\u0639\u0627\u0645\u061b \u0648\u0627\u0633\u062a\u062e\u062f\u0645 \u0645\u0642\u064a\u0627\u0633 \u062d\u0631\u0627\u0631\u0629 \u0644\u0644\u062a\u062d\u0642\u0642.","NHS"],t.w)
B.ad1=new A.c(B.c,["Reheat leftover food until it is steaming hot all the way through, reaching at least 70 \xb0C.","\u0623\u0639\u062f \u062a\u0633\u062e\u064a\u0646 \u0628\u0642\u0627\u064a\u0627 \u0627\u0644\u0637\u0639\u0627\u0645 \u062d\u062a\u0649 \u064a\u0635\u0628\u062d \u0633\u0627\u062e\u0646\u0627\u064b \u062c\u062f\u0627\u064b \u0628\u0627\u0644\u0643\u0627\u0645\u0644\u060c \u0628\u062d\u064a\u062b \u062a\u0635\u0644 \u062f\u0631\u062c\u0629 \u0627\u0644\u062d\u0631\u0627\u0631\u0629 \u0625\u0644\u0649 70 \u062f\u0631\u062c\u0629 \u0645\u0626\u0648\u064a\u0629 \u0639\u0644\u0649 \u0627\u0644\u0623\u0642\u0644.","WHO"],t.w)
B.ahy=new A.c(B.c,["Raw eggs may contain Salmonella; cook eggs until both the white and yolk are firm.","\u0642\u062f \u064a\u062d\u062a\u0648\u064a \u0627\u0644\u0628\u064a\u0636 \u0627\u0644\u0646\u064a\u0621 \u0639\u0644\u0649 \u0628\u0643\u062a\u064a\u0631\u064a\u0627 \u0627\u0644\u0633\u0627\u0644\u0645\u0648\u0646\u064a\u0644\u0627\u061b \u0627\u0637\u0628\u062e \u0627\u0644\u0628\u064a\u0636 \u062d\u062a\u0649 \u064a\u062a\u0645\u0627\u0633\u0643 \u0643\u0644 \u0645\u0646 \u0627\u0644\u0628\u064a\u0627\u0636 \u0648\u0627\u0644\u0635\u0641\u0627\u0631.","Mayo Clinic"],t.w)
B.aeQ=new A.c(B.c,["Rice can contain Bacillus cereus spores; cool and refrigerate leftover rice within one hour.","\u0642\u062f \u064a\u062d\u062a\u0648\u064a \u0627\u0644\u0623\u0631\u0632 \u0639\u0644\u0649 \u0623\u0628\u0648\u0627\u063a \u0628\u0643\u062a\u064a\u0631\u064a\u0627 \u0627\u0644\u0639\u0635\u0648\u064a\u0629 \u0627\u0644\u0634\u0645\u0639\u064a\u0629\u061b \u0628\u064e\u0631\u0651\u062f \u0627\u0644\u0623\u0631\u0632 \u0627\u0644\u0645\u062a\u0628\u0642\u064a \u0648\u0636\u0639\u0647 \u0641\u064a \u0627\u0644\u062b\u0644\u0627\u062c\u0629 \u062e\u0644\u0627\u0644 \u0633\u0627\u0639\u0629 \u0648\u0627\u062d\u062f\u0629.","NHS"],t.w)
B.ahL=new A.c(B.c,["Canned food that is bulging, leaking, or has a foul odor should be discarded immediately.","\u064a\u062c\u0628 \u0627\u0644\u062a\u062e\u0644\u0635 \u0641\u0648\u0631\u0627\u064b \u0645\u0646 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0645\u0639\u0644\u0628\u0629 \u0627\u0644\u0645\u0646\u062a\u0641\u062e\u0629 \u0623\u0648 \u0627\u0644\u0645\u062a\u0633\u0631\u0628\u0629 \u0623\u0648 \u0630\u0627\u062a \u0627\u0644\u0631\u0627\u0626\u062d\u0629 \u0627\u0644\u0643\u0631\u064a\u0647\u0629.","Mayo Clinic"],t.w)
B.ai_=new A.c(B.c,["Wash all fruits and vegetables under running water before eating, even if you plan to peel them.","\u0627\u063a\u0633\u0644 \u062c\u0645\u064a\u0639 \u0627\u0644\u0641\u0648\u0627\u0643\u0647 \u0648\u0627\u0644\u062e\u0636\u0631\u0627\u0648\u0627\u062a \u062a\u062d\u062a \u0627\u0644\u0645\u0627\u0621 \u0627\u0644\u062c\u0627\u0631\u064a \u0642\u0628\u0644 \u062a\u0646\u0627\u0648\u0644\u0647\u0627\u060c \u062d\u062a\u0649 \u0644\u0648 \u0643\u0646\u062a \u062a\u0646\u0648\u064a \u062a\u0642\u0634\u064a\u0631\u0647\u0627.","WHO"],t.w)
B.adN=new A.c(B.c,["Pregnant women should avoid soft mould-ripened cheeses, raw fish, and p\xe2t\xe9 to reduce infection risk.","\u064a\u062c\u0628 \u0639\u0644\u0649 \u0627\u0644\u062d\u0648\u0627\u0645\u0644 \u062a\u062c\u0646\u0628 \u0627\u0644\u0623\u062c\u0628\u0627\u0646 \u0627\u0644\u0637\u0631\u064a\u0629 \u0627\u0644\u0645\u0639\u062a\u0651\u0642\u0629 \u0628\u0627\u0644\u0639\u0641\u0646 \u0648\u0627\u0644\u0623\u0633\u0645\u0627\u0643 \u0627\u0644\u0646\u064a\u0626\u0629 \u0648\u0627\u0644\u0628\u0627\u062a\u064a\u0647 \u0644\u0644\u062d\u062f \u0645\u0646 \u062e\u0637\u0631 \u0627\u0644\u0639\u062f\u0648\u0649.","NHS"],t.w)
B.acF=new A.c(B.c,["The gut and brain communicate through the gut-brain axis; a balanced diet supports both digestive and mental health.","\u064a\u062a\u0648\u0627\u0635\u0644 \u0627\u0644\u062f\u0645\u0627\u063a \u0648\u0627\u0644\u0623\u0645\u0639\u0627\u0621 \u0639\u0628\u0631 \u0645\u062d\u0648\u0631 \u0627\u0644\u0623\u0645\u0639\u0627\u0621 \u0648\u0627\u0644\u062f\u0645\u0627\u063a\u061b \u0648\u0627\u0644\u0646\u0638\u0627\u0645 \u0627\u0644\u063a\u0630\u0627\u0626\u064a \u0627\u0644\u0645\u062a\u0648\u0627\u0632\u0646 \u064a\u062f\u0639\u0645 \u0627\u0644\u0635\u062d\u0629 \u0627\u0644\u0647\u0636\u0645\u064a\u0629 \u0648\u0627\u0644\u0646\u0641\u0633\u064a\u0629 \u0645\u0639\u0627\u064b.","Harvard Health"],t.w)
B.agh=new A.c(B.c,["Omega-3 fatty acids found in oily fish may help reduce symptoms of depression and anxiety.","\u0642\u062f \u062a\u0633\u0627\u0639\u062f \u0623\u062d\u0645\u0627\u0636 \u0623\u0648\u0645\u064a\u063a\u0627-3 \u0627\u0644\u062f\u0647\u0646\u064a\u0629 \u0627\u0644\u0645\u0648\u062c\u0648\u062f\u0629 \u0641\u064a \u0627\u0644\u0623\u0633\u0645\u0627\u0643 \u0627\u0644\u062f\u0647\u0646\u064a\u0629 \u0641\u064a \u062a\u062e\u0641\u064a\u0641 \u0623\u0639\u0631\u0627\u0636 \u0627\u0644\u0627\u0643\u062a\u0626\u0627\u0628 \u0648\u0627\u0644\u0642\u0644\u0642.","Harvard Health"],t.w)
B.ahj=new A.c(B.c,["Regular meals help stabilize blood sugar, which can prevent mood swings and irritability.","\u062a\u0633\u0627\u0639\u062f \u0627\u0644\u0648\u062c\u0628\u0627\u062a \u0627\u0644\u0645\u0646\u062a\u0638\u0645\u0629 \u0641\u064a \u0627\u0633\u062a\u0642\u0631\u0627\u0631 \u0633\u0643\u0631 \u0627\u0644\u062f\u0645\u060c \u0645\u0645\u0627 \u064a\u0645\u0646\u0639 \u062a\u0642\u0644\u0628\u0627\u062a \u0627\u0644\u0645\u0632\u0627\u062c \u0648\u0627\u0644\u0639\u0635\u0628\u064a\u0629.","NHS"],t.w)
B.ab3=new A.c(B.c,["Emotional eating is a common response to stress; recognizing triggers is the first step toward changing the pattern.","\u0627\u0644\u0623\u0643\u0644 \u0627\u0644\u0639\u0627\u0637\u0641\u064a \u0627\u0633\u062a\u062c\u0627\u0628\u0629 \u0634\u0627\u0626\u0639\u0629 \u0644\u0644\u062a\u0648\u062a\u0631\u061b \u0648\u0627\u0644\u062a\u0639\u0631\u0641 \u0639\u0644\u0649 \u0627\u0644\u0645\u062d\u0641\u0632\u0627\u062a \u0647\u0648 \u0627\u0644\u062e\u0637\u0648\u0629 \u0627\u0644\u0623\u0648\u0644\u0649 \u0644\u062a\u063a\u064a\u064a\u0631 \u0647\u0630\u0627 \u0627\u0644\u0646\u0645\u0637.","Mayo Clinic"],t.w)
B.ab9=new A.c(B.c,["Foods rich in tryptophan (turkey, eggs, cheese) support serotonin production, which regulates mood.","\u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u063a\u0646\u064a\u0629 \u0628\u0627\u0644\u062a\u0631\u064a\u0628\u062a\u0648\u0641\u0627\u0646 (\u0627\u0644\u062f\u064a\u0643 \u0627\u0644\u0631\u0648\u0645\u064a \u0648\u0627\u0644\u0628\u064a\u0636 \u0648\u0627\u0644\u062c\u0628\u0646) \u062a\u062f\u0639\u0645 \u0625\u0646\u062a\u0627\u062c \u0627\u0644\u0633\u064a\u0631\u0648\u062a\u0648\u0646\u064a\u0646 \u0627\u0644\u0630\u064a \u064a\u0646\u0638\u0645 \u0627\u0644\u0645\u0632\u0627\u062c.","Harvard Health"],t.w)
B.agx=new A.c(B.c,["A Mediterranean-style diet rich in fruits, vegetables, fish, and olive oil is associated with lower rates of depression.","\u064a\u0631\u062a\u0628\u0637 \u0627\u0644\u0646\u0638\u0627\u0645 \u0627\u0644\u063a\u0630\u0627\u0626\u064a \u0627\u0644\u0645\u062a\u0648\u0633\u0637\u064a \u0627\u0644\u063a\u0646\u064a \u0628\u0627\u0644\u0641\u0648\u0627\u0643\u0647 \u0648\u0627\u0644\u062e\u0636\u0631\u0627\u0648\u0627\u062a \u0648\u0627\u0644\u0623\u0633\u0645\u0627\u0643 \u0648\u0632\u064a\u062a \u0627\u0644\u0632\u064a\u062a\u0648\u0646 \u0628\u0627\u0646\u062e\u0641\u0627\u0636 \u0645\u0639\u062f\u0644\u0627\u062a \u0627\u0644\u0627\u0643\u062a\u0626\u0627\u0628.","Harvard Health"],t.w)
B.aht=new A.c(B.c,["Excessive caffeine intake can increase anxiety and disrupt sleep; limit to 400 mg per day (about 4 cups of coffee).","\u0627\u0644\u0625\u0641\u0631\u0627\u0637 \u0641\u064a \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0643\u0627\u0641\u064a\u064a\u0646 \u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u0632\u064a\u062f \u0627\u0644\u0642\u0644\u0642 \u0648\u064a\u0639\u0637\u0651\u0644 \u0627\u0644\u0646\u0648\u0645\u061b \u062d\u062f\u0651\u062f \u0627\u0633\u062a\u0647\u0644\u0627\u0643\u0643 \u0628\u0640 400 \u0645\u0644\u063a \u064a\u0648\u0645\u064a\u0627\u064b (\u0646\u062d\u0648 4 \u0623\u0643\u0648\u0627\u0628 \u0642\u0647\u0648\u0629).","Mayo Clinic"],t.w)
B.aep=new A.c(B.c,["Probiotics in fermented foods (yogurt, kefir, sauerkraut) may positively influence mood via the gut-brain connection.","\u0642\u062f \u062a\u0624\u062b\u0631 \u0627\u0644\u0628\u0631\u0648\u0628\u064a\u0648\u062a\u064a\u0643 \u0641\u064a \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0645\u062e\u0645\u0631\u0629 (\u0627\u0644\u0632\u0628\u0627\u062f\u064a \u0648\u0627\u0644\u0643\u0641\u064a\u0631 \u0648\u0645\u062e\u0644\u0644 \u0627\u0644\u0645\u0644\u0641\u0648\u0641) \u0625\u064a\u062c\u0627\u0628\u064a\u0627\u064b \u0639\u0644\u0649 \u0627\u0644\u0645\u0632\u0627\u062c \u0639\u0628\u0631 \u0627\u0644\u0631\u0627\u0628\u0637 \u0628\u064a\u0646 \u0627\u0644\u0623\u0645\u0639\u0627\u0621 \u0648\u0627\u0644\u062f\u0645\u0627\u063a.","Harvard Health"],t.w)
B.acm=new A.c(B.c,["Skipping meals can lead to low blood sugar, causing fatigue, poor concentration, and irritability.","\u062a\u062e\u0637\u064a \u0627\u0644\u0648\u062c\u0628\u0627\u062a \u0642\u062f \u064a\u0624\u062f\u064a \u0625\u0644\u0649 \u0627\u0646\u062e\u0641\u0627\u0636 \u0633\u0643\u0631 \u0627\u0644\u062f\u0645 \u0645\u0633\u0628\u0628\u0627\u064b \u0627\u0644\u0625\u0631\u0647\u0627\u0642 \u0648\u0636\u0639\u0641 \u0627\u0644\u062a\u0631\u0643\u064a\u0632 \u0648\u0627\u0644\u0639\u0635\u0628\u064a\u0629.","NHS"],t.w)
B.agS=new A.c(B.c,["B vitamins, particularly B6, B12, and folate, play a role in producing brain chemicals that regulate mood.","\u062a\u0644\u0639\u0628 \u0641\u064a\u062a\u0627\u0645\u064a\u0646\u0627\u062a \u0628\u060c \u0648\u062e\u0627\u0635\u0629 \u06286 \u0648\u062812 \u0648\u062d\u0645\u0636 \u0627\u0644\u0641\u0648\u0644\u064a\u0643\u060c \u062f\u0648\u0631\u0627\u064b \u0641\u064a \u0625\u0646\u062a\u0627\u062c \u0627\u0644\u0645\u0648\u0627\u062f \u0627\u0644\u0643\u064a\u0645\u064a\u0627\u0626\u064a\u0629 \u0627\u0644\u062f\u0645\u0627\u063a\u064a\u0629 \u0627\u0644\u0645\u0646\u0638\u0645\u0629 \u0644\u0644\u0645\u0632\u0627\u062c.","Harvard Health"],t.w)
B.abx=new A.c(B.c,["Eating together with family or friends has social and emotional benefits and often leads to healthier food choices.","\u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0637\u0639\u0627\u0645 \u0645\u0639 \u0627\u0644\u0639\u0627\u0626\u0644\u0629 \u0623\u0648 \u0627\u0644\u0623\u0635\u062f\u0642\u0627\u0621 \u0644\u0647 \u0641\u0648\u0627\u0626\u062f \u0627\u062c\u062a\u0645\u0627\u0639\u064a\u0629 \u0648\u0639\u0627\u0637\u0641\u064a\u0629 \u0648\u063a\u0627\u0644\u0628\u0627\u064b \u0645\u0627 \u064a\u0624\u062f\u064a \u0625\u0644\u0649 \u062e\u064a\u0627\u0631\u0627\u062a \u063a\u0630\u0627\u0626\u064a\u0629 \u0623\u0643\u062b\u0631 \u0635\u062d\u0629.","NHS"],t.w)
B.aha=new A.c(B.c,["Restrictive dieting can worsen mental health; focus on adding nutritious foods rather than eliminating entire groups.","\u0627\u0644\u062d\u0645\u064a\u0627\u062a \u0627\u0644\u062a\u0642\u064a\u064a\u062f\u064a\u0629 \u0642\u062f \u062a\u064f\u0633\u064a\u0621 \u0625\u0644\u0649 \u0627\u0644\u0635\u062d\u0629 \u0627\u0644\u0646\u0641\u0633\u064a\u0629\u061b \u0631\u0643\u0651\u0632 \u0639\u0644\u0649 \u0625\u0636\u0627\u0641\u0629 \u0623\u0637\u0639\u0645\u0629 \u0645\u063a\u0630\u064a\u0629 \u0628\u062f\u0644\u0627\u064b \u0645\u0646 \u062d\u0630\u0641 \u0645\u062c\u0645\u0648\u0639\u0627\u062a \u063a\u0630\u0627\u0626\u064a\u0629 \u0643\u0627\u0645\u0644\u0629.","Harvard Health"],t.w)
B.aen=new A.c(B.c,["Dark chocolate (70%+ cocoa) in moderation may improve mood due to flavonoids and theobromine.","\u0627\u0644\u0634\u0648\u0643\u0648\u0644\u0627\u062a\u0629 \u0627\u0644\u062f\u0627\u0643\u0646\u0629 (\u0628\u0646\u0633\u0628\u0629 \u0643\u0627\u0643\u0627\u0648 70% \u0623\u0648 \u0623\u0643\u062b\u0631) \u0628\u0627\u0639\u062a\u062f\u0627\u0644 \u0642\u062f \u062a\u062d\u0633\u0651\u0646 \u0627\u0644\u0645\u0632\u0627\u062c \u0628\u0641\u0636\u0644 \u0627\u0644\u0641\u0644\u0627\u0641\u0648\u0646\u0648\u064a\u062f\u0627\u062a \u0648\u0627\u0644\u062b\u064a\u0648\u0628\u0631\u0648\u0645\u064a\u0646.","Harvard Health"],t.w)
B.agq=new A.c(B.c,["Staying well-hydrated is important for cognitive function; even mild dehydration can worsen anxiety.","\u0627\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u062a\u0631\u0637\u064a\u0628 \u0627\u0644\u062c\u0633\u0645 \u0645\u0647\u0645 \u0644\u0644\u0648\u0638\u0627\u0626\u0641 \u0627\u0644\u0630\u0647\u0646\u064a\u0629\u061b \u062d\u062a\u0649 \u0627\u0644\u062c\u0641\u0627\u0641 \u0627\u0644\u062e\u0641\u064a\u0641 \u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u0642\u0644\u0642.","Mayo Clinic"],t.w)
B.aia=new A.c(B.c,["Journaling your food intake and mood can help identify patterns between what you eat and how you feel.","\u062a\u062f\u0648\u064a\u0646 \u0645\u0627 \u062a\u0623\u0643\u0644\u0647 \u0648\u0645\u0632\u0627\u062c\u0643 \u0641\u064a \u062f\u0641\u062a\u0631 \u064a\u0648\u0645\u064a \u064a\u0633\u0627\u0639\u062f \u0641\u064a \u062a\u062d\u062f\u064a\u062f \u0627\u0644\u0623\u0646\u0645\u0627\u0637 \u0628\u064a\u0646 \u063a\u0630\u0627\u0626\u0643 \u0648\u0634\u0639\u0648\u0631\u0643.","Mayo Clinic"],t.w)
B.afC=new A.c(B.c,["A sustainable rate of weight loss is 0.5 to 1 kg (1\u20132 lbs) per week.","\u0627\u0644\u0645\u0639\u062f\u0644 \u0627\u0644\u0645\u0633\u062a\u062f\u0627\u0645 \u0644\u0641\u0642\u062f\u0627\u0646 \u0627\u0644\u0648\u0632\u0646 \u0647\u0648 0.5 \u0625\u0644\u0649 1 \u0643\u064a\u0644\u0648\u063a\u0631\u0627\u0645 (1-2 \u0631\u0637\u0644) \u0623\u0633\u0628\u0648\u0639\u064a\u0627\u064b.","NHS"],t.w)
B.afZ=new A.c(B.c,["Weight management is about long-term habits, not short-term diets; focus on changes you can maintain.","\u0625\u062f\u0627\u0631\u0629 \u0627\u0644\u0648\u0632\u0646 \u062a\u062a\u0639\u0644\u0642 \u0628\u0627\u0644\u0639\u0627\u062f\u0627\u062a \u0637\u0648\u064a\u0644\u0629 \u0627\u0644\u0645\u062f\u0649 \u0648\u0644\u064a\u0633 \u0627\u0644\u062d\u0645\u064a\u0627\u062a \u0642\u0635\u064a\u0631\u0629 \u0627\u0644\u0645\u062f\u0649\u061b \u0631\u0643\u0651\u0632 \u0639\u0644\u0649 \u062a\u063a\u064a\u064a\u0631\u0627\u062a \u064a\u0645\u0643\u0646\u0643 \u0627\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u064a\u0647\u0627.","Harvard Health"],t.w)
B.acU=new A.c(B.c,["A calorie deficit of about 500 calories per day typically leads to about 0.5 kg of weight loss per week.","\u0639\u062c\u0632 \u064a\u0648\u0645\u064a \u0628\u0646\u062d\u0648 500 \u0633\u0639\u0631\u0629 \u062d\u0631\u0627\u0631\u064a\u0629 \u064a\u0624\u062f\u064a \u0639\u0627\u062f\u0629\u064b \u0625\u0644\u0649 \u0641\u0642\u062f\u0627\u0646 \u0646\u062d\u0648 0.5 \u0643\u064a\u0644\u0648\u063a\u0631\u0627\u0645 \u0623\u0633\u0628\u0648\u0639\u064a\u0627\u064b.","Mayo Clinic"],t.w)
B.abS=new A.c(B.c,["Protein-rich foods increase satiety and can help reduce overall calorie intake naturally.","\u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u063a\u0646\u064a\u0629 \u0628\u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u062a\u0632\u064a\u062f \u0627\u0644\u0634\u0639\u0648\u0631 \u0628\u0627\u0644\u0634\u0628\u0639 \u0648\u064a\u0645\u0643\u0646 \u0623\u0646 \u062a\u0633\u0627\u0639\u062f \u0641\u064a \u062a\u0642\u0644\u064a\u0644 \u0625\u062c\u0645\u0627\u0644\u064a \u0627\u0644\u0633\u0639\u0631\u0627\u062a \u0627\u0644\u062d\u0631\u0627\u0631\u064a\u0629 \u0627\u0644\u0645\u062a\u0646\u0627\u0648\u0644\u0629 \u0628\u0634\u0643\u0644 \u0637\u0628\u064a\u0639\u064a.","Harvard Health"],t.w)
B.acL=new A.c(B.c,["Regular physical activity combined with dietary changes is more effective for weight management than diet alone.","\u0627\u0644\u0646\u0634\u0627\u0637 \u0627\u0644\u0628\u062f\u0646\u064a \u0627\u0644\u0645\u0646\u062a\u0638\u0645 \u0645\u0639 \u0627\u0644\u062a\u063a\u064a\u064a\u0631\u0627\u062a \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0623\u0643\u062b\u0631 \u0641\u0639\u0627\u0644\u064a\u0629 \u0641\u064a \u0625\u062f\u0627\u0631\u0629 \u0627\u0644\u0648\u0632\u0646 \u0645\u0646 \u0627\u0644\u062d\u0645\u064a\u0629 \u0648\u062d\u062f\u0647\u0627.","WHO"],t.w)
B.aez=new A.c(B.c,["Getting 7\u20139 hours of sleep per night supports healthy weight; poor sleep disrupts hunger hormones.","\u0627\u0644\u062d\u0635\u0648\u0644 \u0639\u0644\u0649 7-9 \u0633\u0627\u0639\u0627\u062a \u0645\u0646 \u0627\u0644\u0646\u0648\u0645 \u0644\u064a\u0644\u0627\u064b \u064a\u062f\u0639\u0645 \u0627\u0644\u0648\u0632\u0646 \u0627\u0644\u0635\u062d\u064a\u061b \u0641\u0642\u0644\u0629 \u0627\u0644\u0646\u0648\u0645 \u062a\u064f\u062e\u0644\u0651 \u0628\u0647\u0631\u0645\u0648\u0646\u0627\u062a \u0627\u0644\u062c\u0648\u0639.","Harvard Health"],t.w)
B.afi=new A.c(B.c,["Stress raises cortisol levels, which can increase appetite and promote fat storage, especially around the abdomen.","\u064a\u0631\u0641\u0639 \u0627\u0644\u062a\u0648\u062a\u0631 \u0645\u0633\u062a\u0648\u064a\u0627\u062a \u0627\u0644\u0643\u0648\u0631\u062a\u064a\u0632\u0648\u0644\u060c \u0645\u0645\u0627 \u0642\u062f \u064a\u0632\u064a\u062f \u0627\u0644\u0634\u0647\u064a\u0629 \u0648\u064a\u0639\u0632\u0632 \u062a\u062e\u0632\u064a\u0646 \u0627\u0644\u062f\u0647\u0648\u0646\u060c \u062e\u0627\u0635\u0629 \u062d\u0648\u0644 \u0627\u0644\u0628\u0637\u0646.","Mayo Clinic"],t.w)
B.acA=new A.c(B.c,["Keeping a food diary increases awareness of eating habits and has been shown to support weight loss.","\u064a\u0633\u0627\u0639\u062f \u062a\u062f\u0648\u064a\u0646 \u0627\u0644\u0637\u0639\u0627\u0645 \u0641\u064a \u062f\u0641\u062a\u0631 \u064a\u0648\u0645\u064a \u0639\u0644\u0649 \u0632\u064a\u0627\u062f\u0629 \u0627\u0644\u0648\u0639\u064a \u0628\u0639\u0627\u062f\u0627\u062a \u0627\u0644\u0623\u0643\u0644 \u0648\u0642\u062f \u062b\u0628\u062a \u0623\u0646\u0647 \u064a\u062f\u0639\u0645 \u0641\u0642\u062f\u0627\u0646 \u0627\u0644\u0648\u0632\u0646.","Harvard Health"],t.w)
B.ahf=new A.c(B.c,["Replacing sugary drinks with water, tea, or black coffee can eliminate a significant source of hidden calories.","\u0627\u0633\u062a\u0628\u062f\u0627\u0644 \u0627\u0644\u0645\u0634\u0631\u0648\u0628\u0627\u062a \u0627\u0644\u0633\u0643\u0631\u064a\u0629 \u0628\u0627\u0644\u0645\u0627\u0621 \u0623\u0648 \u0627\u0644\u0634\u0627\u064a \u0623\u0648 \u0627\u0644\u0642\u0647\u0648\u0629 \u0627\u0644\u0633\u0648\u062f\u0627\u0621 \u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u0632\u064a\u0644 \u0645\u0635\u062f\u0631\u0627\u064b \u0643\u0628\u064a\u0631\u0627\u064b \u0645\u0646 \u0627\u0644\u0633\u0639\u0631\u0627\u062a \u0627\u0644\u062d\u0631\u0627\u0631\u064a\u0629 \u0627\u0644\u0645\u062e\u0641\u064a\u0629.","NHS"],t.w)
B.abL=new A.c(B.c,["Weighing yourself at the same time each day (ideally morning) provides the most consistent tracking data.","\u0648\u0632\u0646 \u0646\u0641\u0633\u0643 \u0641\u064a \u0627\u0644\u0648\u0642\u062a \u0630\u0627\u062a\u0647 \u0643\u0644 \u064a\u0648\u0645 (\u0648\u064a\u064f\u0641\u0636\u0651\u0644 \u0641\u064a \u0627\u0644\u0635\u0628\u0627\u062d) \u064a\u0648\u0641\u0631 \u0628\u064a\u0627\u0646\u0627\u062a \u062a\u062a\u0628\u0639 \u0623\u0643\u062b\u0631 \u0627\u062a\u0633\u0627\u0642\u0627\u064b.","Mayo Clinic"],t.w)
B.acn=new A.c(B.c,["Small, consistent changes like taking stairs or walking after dinner add up to meaningful calorie expenditure.","\u0627\u0644\u062a\u063a\u064a\u064a\u0631\u0627\u062a \u0627\u0644\u0635\u063a\u064a\u0631\u0629 \u0627\u0644\u0645\u0633\u062a\u0645\u0631\u0629 \u0643\u0635\u0639\u0648\u062f \u0627\u0644\u062f\u0631\u062c \u0623\u0648 \u0627\u0644\u0645\u0634\u064a \u0628\u0639\u062f \u0627\u0644\u0639\u0634\u0627\u0621 \u062a\u062a\u0631\u0627\u0643\u0645 \u0644\u062a\u0634\u0643\u0651\u0644 \u0625\u0646\u0641\u0627\u0642\u0627\u064b \u0645\u0644\u0645\u0648\u0633\u0627\u064b \u0644\u0644\u0633\u0639\u0631\u0627\u062a \u0627\u0644\u062d\u0631\u0627\u0631\u064a\u0629.","Harvard Health"],t.w)
B.agO=new A.c(B.c,['Beware of "health halo" foods (granola, smoothie bowls, trail mix) which can be surprisingly high in calories.','\u0627\u062d\u0630\u0631 \u0645\u0646 \u0623\u0637\u0639\u0645\u0629 "\u0627\u0644\u0647\u0627\u0644\u0629 \u0627\u0644\u0635\u062d\u064a\u0629" (\u0627\u0644\u063a\u0631\u0627\u0646\u0648\u0644\u0627 \u0648\u0623\u0648\u0639\u064a\u0629 \u0627\u0644\u0633\u0645\u0648\u0630\u064a \u0648\u062e\u0644\u064a\u0637 \u0627\u0644\u0645\u0643\u0633\u0631\u0627\u062a \u0648\u0627\u0644\u0641\u0648\u0627\u0643\u0647 \u0627\u0644\u0645\u062c\u0641\u0641\u0629) \u0627\u0644\u062a\u064a \u0642\u062f \u062a\u0643\u0648\u0646 \u0639\u0627\u0644\u064a\u0629 \u0627\u0644\u0633\u0639\u0631\u0627\u062a \u0628\u0634\u0643\u0644 \u0645\u0641\u0627\u062c\u0626.',"Harvard Health"],t.w)
B.afw=new A.c(B.c,["Fad diets that promise rapid results often lead to muscle loss and are rarely sustainable long-term.","\u0627\u0644\u062d\u0645\u064a\u0627\u062a \u0627\u0644\u0631\u0627\u0626\u062c\u0629 \u0627\u0644\u062a\u064a \u062a\u0639\u062f \u0628\u0646\u062a\u0627\u0626\u062c \u0633\u0631\u064a\u0639\u0629 \u063a\u0627\u0644\u0628\u0627\u064b \u0645\u0627 \u062a\u0624\u062f\u064a \u0625\u0644\u0649 \u0641\u0642\u062f\u0627\u0646 \u0627\u0644\u0639\u0636\u0644\u0627\u062a \u0648\u0646\u0627\u062f\u0631\u0627\u064b \u0645\u0627 \u062a\u0643\u0648\u0646 \u0645\u0633\u062a\u062f\u0627\u0645\u0629 \u0639\u0644\u0649 \u0627\u0644\u0645\u062f\u0649 \u0627\u0644\u0637\u0648\u064a\u0644.","NHS"],t.w)
B.afj=new A.c(B.c,["Increasing vegetable intake at meals displaces higher-calorie foods and adds volume with fewer calories.","\u0632\u064a\u0627\u062f\u0629 \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u062e\u0636\u0631\u0627\u0648\u0627\u062a \u0641\u064a \u0627\u0644\u0648\u062c\u0628\u0627\u062a \u064a\u062d\u0644\u0651 \u0645\u062d\u0644 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0623\u0639\u0644\u0649 \u0633\u0639\u0631\u0627\u062a \u0648\u064a\u0636\u064a\u0641 \u062d\u062c\u0645\u0627\u064b \u0628\u0633\u0639\u0631\u0627\u062a \u0623\u0642\u0644.","Harvard Health"],t.w)
B.adu=new A.c(B.c,["Alcohol contains 7 calories per gram (nearly as much as fat) and can weaken dietary resolve.","\u064a\u062d\u062a\u0648\u064a \u0627\u0644\u0643\u062d\u0648\u0644 \u0639\u0644\u0649 7 \u0633\u0639\u0631\u0627\u062a \u062d\u0631\u0627\u0631\u064a\u0629 \u0644\u0643\u0644 \u063a\u0631\u0627\u0645 (\u062a\u0642\u0631\u064a\u0628\u0627\u064b \u0628\u0642\u062f\u0631 \u0627\u0644\u062f\u0647\u0648\u0646) \u0648\u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u064f\u0636\u0639\u0641 \u0627\u0644\u0627\u0644\u062a\u0632\u0627\u0645 \u0628\u0627\u0644\u062d\u0645\u064a\u0629.","NHS"],t.w)
B.agD=new A.c(B.c,["Building muscle through resistance training increases your resting metabolic rate.","\u0628\u0646\u0627\u0621 \u0627\u0644\u0639\u0636\u0644\u0627\u062a \u0645\u0646 \u062e\u0644\u0627\u0644 \u062a\u0645\u0627\u0631\u064a\u0646 \u0627\u0644\u0645\u0642\u0627\u0648\u0645\u0629 \u064a\u0632\u064a\u062f \u0645\u0646 \u0645\u0639\u062f\u0644 \u0627\u0644\u0623\u064a\u0636 \u0623\u062b\u0646\u0627\u0621 \u0627\u0644\u0631\u0627\u062d\u0629.","Mayo Clinic"],t.w)
B.agL=new A.c(B.c,["It is normal for weight to fluctuate 1\u20132 kg day to day due to water retention, digestion, and hormones.","\u0645\u0646 \u0627\u0644\u0637\u0628\u064a\u0639\u064a \u0623\u0646 \u064a\u062a\u0642\u0644\u0628 \u0627\u0644\u0648\u0632\u0646 \u0628\u0645\u0642\u062f\u0627\u0631 1-2 \u0643\u064a\u0644\u0648\u063a\u0631\u0627\u0645 \u064a\u0648\u0645\u064a\u0627\u064b \u0628\u0633\u0628\u0628 \u0627\u062d\u062a\u0628\u0627\u0633 \u0627\u0644\u0645\u0627\u0621 \u0648\u0627\u0644\u0647\u0636\u0645 \u0648\u0627\u0644\u0647\u0631\u0645\u0648\u0646\u0627\u062a.","Harvard Health"],t.w)
B.adO=new A.c(B.c,["Eating enough fiber helps you feel full and satisfied, reducing the urge to snack between meals.","\u062a\u0646\u0627\u0648\u0644 \u0643\u0645\u064a\u0629 \u0643\u0627\u0641\u064a\u0629 \u0645\u0646 \u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u064a\u0633\u0627\u0639\u062f\u0643 \u0639\u0644\u0649 \u0627\u0644\u0634\u0639\u0648\u0631 \u0628\u0627\u0644\u0627\u0645\u062a\u0644\u0627\u0621 \u0648\u0627\u0644\u0631\u0636\u0627\u060c \u0645\u0645\u0627 \u064a\u0642\u0644\u0644 \u0627\u0644\u0631\u063a\u0628\u0629 \u0641\u064a \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0648\u062c\u0628\u0627\u062a \u0627\u0644\u062e\u0641\u064a\u0641\u0629 \u0628\u064a\u0646 \u0627\u0644\u0648\u062c\u0628\u0627\u062a.","Mayo Clinic"],t.w)
B.aeW=new A.c(B.c,['Setting specific, measurable goals (like "eat 5 servings of vegetables daily") is more effective than vague intentions.','\u0648\u0636\u0639 \u0623\u0647\u062f\u0627\u0641 \u0645\u062d\u062f\u062f\u0629 \u0648\u0642\u0627\u0628\u0644\u0629 \u0644\u0644\u0642\u064a\u0627\u0633 (\u0645\u062b\u0644 "\u062a\u0646\u0627\u0648\u0644 5 \u062d\u0635\u0635 \u0645\u0646 \u0627\u0644\u062e\u0636\u0631\u0627\u0648\u0627\u062a \u064a\u0648\u0645\u064a\u0627\u064b") \u0623\u0643\u062b\u0631 \u0641\u0639\u0627\u0644\u064a\u0629 \u0645\u0646 \u0627\u0644\u0646\u0648\u0627\u064a\u0627 \u0627\u0644\u063a\u0627\u0645\u0636\u0629.',"Harvard Health"],t.w)
B.afh=new A.c(B.c,["BMI is a useful screening tool but does not distinguish between muscle and fat; consider waist circumference too.","\u0645\u0624\u0634\u0631 \u0643\u062a\u0644\u0629 \u0627\u0644\u062c\u0633\u0645 \u0623\u062f\u0627\u0629 \u0641\u062d\u0635 \u0645\u0641\u064a\u062f\u0629 \u0644\u0643\u0646\u0647 \u0644\u0627 \u064a\u0645\u064a\u0651\u0632 \u0628\u064a\u0646 \u0627\u0644\u0639\u0636\u0644\u0627\u062a \u0648\u0627\u0644\u062f\u0647\u0648\u0646\u061b \u0636\u0639 \u0641\u064a \u0627\u0644\u0627\u0639\u062a\u0628\u0627\u0631 \u0623\u064a\u0636\u0627\u064b \u0645\u062d\u064a\u0637 \u0627\u0644\u062e\u0635\u0631.","NHS"],t.w)
B.ahW=new A.c(B.c,["Vegetarians should pay special attention to iron, B12, zinc, and omega-3 intake from plant sources or supplements.","\u064a\u062c\u0628 \u0639\u0644\u0649 \u0627\u0644\u0646\u0628\u0627\u062a\u064a\u064a\u0646 \u0625\u064a\u0644\u0627\u0621 \u0627\u0647\u062a\u0645\u0627\u0645 \u062e\u0627\u0635 \u0644\u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u062d\u062f\u064a\u062f \u0648\u062812 \u0648\u0627\u0644\u0632\u0646\u0643 \u0648\u0623\u0648\u0645\u064a\u063a\u0627-3 \u0645\u0646 \u0645\u0635\u0627\u062f\u0631 \u0646\u0628\u0627\u062a\u064a\u0629 \u0623\u0648 \u0645\u0643\u0645\u0644\u0627\u062a.","NHS"],t.w)
B.abC=new A.c(B.c,["A well-planned vegan diet can meet all nutritional needs, but B12 supplementation is essential.","\u064a\u0645\u0643\u0646 \u0644\u0644\u0646\u0638\u0627\u0645 \u0627\u0644\u063a\u0630\u0627\u0626\u064a \u0627\u0644\u0646\u0628\u0627\u062a\u064a \u0627\u0644\u0634\u0627\u0645\u0644 \u0627\u0644\u0645\u062e\u0637\u0637 \u062c\u064a\u062f\u0627\u064b \u062a\u0644\u0628\u064a\u0629 \u062c\u0645\u064a\u0639 \u0627\u0644\u0627\u062d\u062a\u064a\u0627\u062c\u0627\u062a \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629\u060c \u0644\u0643\u0646 \u0645\u0643\u0645\u0644\u0627\u062a \u062812 \u0636\u0631\u0648\u0631\u064a\u0629.","Harvard Health"],t.w)
B.ad8=new A.c(B.c,["Gluten-free diets are medically necessary for people with coeliac disease but offer no proven benefit for others.","\u0627\u0644\u0623\u0646\u0638\u0645\u0629 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0627\u0644\u062e\u0627\u0644\u064a\u0629 \u0645\u0646 \u0627\u0644\u063a\u0644\u0648\u062a\u064a\u0646 \u0636\u0631\u0648\u0631\u064a\u0629 \u0637\u0628\u064a\u0627\u064b \u0644\u0645\u0631\u0636\u0649 \u0627\u0644\u062f\u0627\u0621 \u0627\u0644\u0628\u0637\u0646\u064a\u060c \u0644\u0643\u0646\u0647\u0627 \u0644\u0627 \u062a\u0642\u062f\u0645 \u0641\u0627\u0626\u062f\u0629 \u0645\u062b\u0628\u062a\u0629 \u0644\u0644\u0622\u062e\u0631\u064a\u0646.","Mayo Clinic"],t.w)
B.aic=new A.c(B.c,["If following a dairy-free diet, ensure adequate calcium from fortified plant milks, tofu, or leafy greens.","\u0625\u0630\u0627 \u0643\u0646\u062a \u062a\u062a\u0628\u0639 \u0646\u0638\u0627\u0645\u0627\u064b \u063a\u0630\u0627\u0626\u064a\u0627\u064b \u062e\u0627\u0644\u064a\u0627\u064b \u0645\u0646 \u0627\u0644\u0623\u0644\u0628\u0627\u0646\u060c \u062a\u0623\u0643\u062f \u0645\u0646 \u0627\u0644\u062d\u0635\u0648\u0644 \u0639\u0644\u0649 \u0643\u0645\u064a\u0629 \u0643\u0627\u0641\u064a\u0629 \u0645\u0646 \u0627\u0644\u0643\u0627\u0644\u0633\u064a\u0648\u0645 \u0645\u0646 \u0627\u0644\u062d\u0644\u064a\u0628 \u0627\u0644\u0646\u0628\u0627\u062a\u064a \u0627\u0644\u0645\u062f\u0639\u0651\u0645 \u0623\u0648 \u0627\u0644\u062a\u0648\u0641\u0648 \u0623\u0648 \u0627\u0644\u062e\u0636\u0631\u0627\u0648\u0627\u062a \u0627\u0644\u0648\u0631\u0642\u064a\u0629.","NHS"],t.w)
B.adH=new A.c(B.c,["The Mediterranean diet, rich in olive oil, fish, fruits, and vegetables, is one of the most researched and recommended dietary patterns.","\u064a\u064f\u0639\u062f \u062d\u0645\u064a\u0629 \u0627\u0644\u0628\u062d\u0631 \u0627\u0644\u0623\u0628\u064a\u0636 \u0627\u0644\u0645\u062a\u0648\u0633\u0637\u060c \u0627\u0644\u063a\u0646\u064a\u0629 \u0628\u0632\u064a\u062a \u0627\u0644\u0632\u064a\u062a\u0648\u0646 \u0648\u0627\u0644\u0623\u0633\u0645\u0627\u0643 \u0648\u0627\u0644\u0641\u0648\u0627\u0643\u0647 \u0648\u0627\u0644\u062e\u0636\u0631\u0627\u0648\u0627\u062a\u060c \u0645\u0646 \u0623\u0643\u062b\u0631 \u0627\u0644\u0623\u0646\u0645\u0627\u0637 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0628\u062d\u062b\u0627\u064b \u0648\u0627\u0644\u0645\u0648\u0635\u0649 \u0628\u0647\u0627.","Harvard Health"],t.w)
B.ahv=new A.c(B.c,["The DASH diet emphasizes fruits, vegetables, whole grains, and lean protein to lower blood pressure.","\u064a\u0631\u0643\u0632 \u0646\u0638\u0627\u0645 \u062f\u0627\u0634 \u0627\u0644\u063a\u0630\u0627\u0626\u064a \u0639\u0644\u0649 \u0627\u0644\u0641\u0648\u0627\u0643\u0647 \u0648\u0627\u0644\u062e\u0636\u0631\u0627\u0648\u0627\u062a \u0648\u0627\u0644\u062d\u0628\u0648\u0628 \u0627\u0644\u0643\u0627\u0645\u0644\u0629 \u0648\u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0627\u0644\u062e\u0627\u0644\u064a \u0645\u0646 \u0627\u0644\u062f\u0647\u0646 \u0644\u062e\u0641\u0636 \u0636\u063a\u0637 \u0627\u0644\u062f\u0645.","Mayo Clinic"],t.w)
B.afl=new A.c(B.c,["Low-carb diets can be effective for short-term weight loss, but long-term safety depends on the types of fat and protein chosen.","\u064a\u0645\u0643\u0646 \u0623\u0646 \u062a\u0643\u0648\u0646 \u0627\u0644\u0623\u0646\u0638\u0645\u0629 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0645\u0646\u062e\u0641\u0636\u0629 \u0627\u0644\u0643\u0631\u0628\u0648\u0647\u064a\u062f\u0631\u0627\u062a \u0641\u0639\u0627\u0644\u0629 \u0644\u0641\u0642\u062f\u0627\u0646 \u0627\u0644\u0648\u0632\u0646 \u0639\u0644\u0649 \u0627\u0644\u0645\u062f\u0649 \u0627\u0644\u0642\u0635\u064a\u0631\u060c \u0644\u0643\u0646 \u0633\u0644\u0627\u0645\u062a\u0647\u0627 \u0639\u0644\u0649 \u0627\u0644\u0645\u062f\u0649 \u0627\u0644\u0637\u0648\u064a\u0644 \u062a\u0639\u062a\u0645\u062f \u0639\u0644\u0649 \u0623\u0646\u0648\u0627\u0639 \u0627\u0644\u062f\u0647\u0648\u0646 \u0648\u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0627\u0644\u0645\u062e\u062a\u0627\u0631\u0629.","Harvard Health"],t.w)
B.agc=new A.c(B.c,["Intermittent fasting may help some people manage calorie intake, but it is not suitable for everyone.","\u0642\u062f \u064a\u0633\u0627\u0639\u062f \u0627\u0644\u0635\u064a\u0627\u0645 \u0627\u0644\u0645\u062a\u0642\u0637\u0639 \u0628\u0639\u0636 \u0627\u0644\u0623\u0634\u062e\u0627\u0635 \u0641\u064a \u0625\u062f\u0627\u0631\u0629 \u0627\u0644\u0633\u0639\u0631\u0627\u062a \u0627\u0644\u062d\u0631\u0627\u0631\u064a\u0629\u060c \u0644\u0643\u0646\u0647 \u0644\u0627 \u064a\u0646\u0627\u0633\u0628 \u0627\u0644\u062c\u0645\u064a\u0639.","Mayo Clinic"],t.w)
B.afg=new A.c(B.c,["Lactose intolerant individuals can often tolerate yogurt and aged cheeses, which contain less lactose.","\u064a\u0645\u0643\u0646 \u0644\u0644\u0623\u0634\u062e\u0627\u0635 \u0627\u0644\u0630\u064a\u0646 \u064a\u0639\u0627\u0646\u0648\u0646 \u0645\u0646 \u0639\u062f\u0645 \u062a\u062d\u0645\u0644 \u0627\u0644\u0644\u0627\u0643\u062a\u0648\u0632 \u0641\u064a \u0627\u0644\u063a\u0627\u0644\u0628 \u062a\u062d\u0645\u0651\u0644 \u0627\u0644\u0632\u0628\u0627\u062f\u064a \u0648\u0627\u0644\u0623\u062c\u0628\u0627\u0646 \u0627\u0644\u0645\u0639\u062a\u0651\u0642\u0629 \u0627\u0644\u062a\u064a \u062a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u0644\u0627\u0643\u062a\u0648\u0632 \u0623\u0642\u0644.","Harvard Health"],t.w)
B.aiQ=new A.c(B.c,["Pregnant women have increased needs for folate, iron, calcium, and protein; a prenatal vitamin can help fill gaps.","\u062a\u0632\u062f\u0627\u062f \u0627\u062d\u062a\u064a\u0627\u062c\u0627\u062a \u0627\u0644\u062d\u0648\u0627\u0645\u0644 \u0645\u0646 \u062d\u0645\u0636 \u0627\u0644\u0641\u0648\u0644\u064a\u0643 \u0648\u0627\u0644\u062d\u062f\u064a\u062f \u0648\u0627\u0644\u0643\u0627\u0644\u0633\u064a\u0648\u0645 \u0648\u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646\u061b \u0648\u064a\u0645\u0643\u0646 \u0644\u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u0645\u0627 \u0642\u0628\u0644 \u0627\u0644\u0648\u0644\u0627\u062f\u0629 \u0633\u062f\u0651 \u0627\u0644\u0641\u062c\u0648\u0627\u062a.","WHO"],t.w)
B.af4=new A.c(B.c,["Athletes generally need more protein and carbohydrates than sedentary individuals to support training and recovery.","\u064a\u062d\u062a\u0627\u062c \u0627\u0644\u0631\u064a\u0627\u0636\u064a\u0648\u0646 \u0639\u0645\u0648\u0645\u0627\u064b \u0625\u0644\u0649 \u0628\u0631\u0648\u062a\u064a\u0646 \u0648\u0643\u0631\u0628\u0648\u0647\u064a\u062f\u0631\u0627\u062a \u0623\u0643\u062b\u0631 \u0645\u0646 \u0627\u0644\u0623\u0634\u062e\u0627\u0635 \u063a\u064a\u0631 \u0627\u0644\u0646\u0634\u0637\u064a\u0646 \u0644\u062f\u0639\u0645 \u0627\u0644\u062a\u062f\u0631\u064a\u0628 \u0648\u0627\u0644\u062a\u0639\u0627\u0641\u064a.","Mayo Clinic"],t.w)
B.aiw=new A.c(B.c,["Children and teenagers should not follow restrictive diets without medical supervision.","\u0644\u0627 \u064a\u062c\u0628 \u0623\u0646 \u064a\u062a\u0628\u0639 \u0627\u0644\u0623\u0637\u0641\u0627\u0644 \u0648\u0627\u0644\u0645\u0631\u0627\u0647\u0642\u0648\u0646 \u062d\u0645\u064a\u0627\u062a \u062a\u0642\u064a\u064a\u062f\u064a\u0629 \u062f\u0648\u0646 \u0625\u0634\u0631\u0627\u0641 \u0637\u0628\u064a.","NHS"],t.w)
B.ael=new A.c(B.c,["If you have a diagnosed food allergy, always read ingredient labels, even on products you buy regularly.","\u0625\u0630\u0627 \u0643\u0646\u062a \u062a\u0639\u0627\u0646\u064a \u0645\u0646 \u062d\u0633\u0627\u0633\u064a\u0629 \u063a\u0630\u0627\u0626\u064a\u0629 \u0645\u0634\u062e\u0651\u0635\u0629\u060c \u0627\u062d\u0631\u0635 \u062f\u0627\u0626\u0645\u0627\u064b \u0639\u0644\u0649 \u0642\u0631\u0627\u0621\u0629 \u0645\u0644\u0635\u0642\u0627\u062a \u0627\u0644\u0645\u0643\u0648\u0646\u0627\u062a \u062d\u062a\u0649 \u0639\u0644\u0649 \u0627\u0644\u0645\u0646\u062a\u062c\u0627\u062a \u0627\u0644\u062a\u064a \u062a\u0634\u062a\u0631\u064a\u0647\u0627 \u0628\u0627\u0646\u062a\u0638\u0627\u0645.","Mayo Clinic"],t.w)
B.aeP=new A.c(B.c,["Plant-based diets tend to be higher in fiber and lower in saturated fat than typical Western diets.","\u062a\u0645\u064a\u0644 \u0627\u0644\u0623\u0646\u0638\u0645\u0629 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0627\u0644\u0646\u0628\u0627\u062a\u064a\u0629 \u0625\u0644\u0649 \u0623\u0646 \u062a\u0643\u0648\u0646 \u0623\u0639\u0644\u0649 \u0641\u064a \u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0648\u0623\u0642\u0644 \u0641\u064a \u0627\u0644\u062f\u0647\u0648\u0646 \u0627\u0644\u0645\u0634\u0628\u0639\u0629 \u0645\u0642\u0627\u0631\u0646\u0629 \u0628\u0627\u0644\u0623\u0646\u0638\u0645\u0629 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0627\u0644\u063a\u0631\u0628\u064a\u0629 \u0627\u0644\u062a\u0642\u0644\u064a\u062f\u064a\u0629.","Harvard Health"],t.w)
B.ae9=new A.c(B.c,["The anti-inflammatory diet emphasizes foods that reduce inflammation: fatty fish, berries, nuts, and leafy greens.","\u064a\u0631\u0643\u0632 \u0627\u0644\u0646\u0638\u0627\u0645 \u0627\u0644\u063a\u0630\u0627\u0626\u064a \u0627\u0644\u0645\u0636\u0627\u062f \u0644\u0644\u0627\u0644\u062a\u0647\u0627\u0628\u0627\u062a \u0639\u0644\u0649 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u062a\u064a \u062a\u0642\u0644\u0644 \u0627\u0644\u0627\u0644\u062a\u0647\u0627\u0628: \u0627\u0644\u0623\u0633\u0645\u0627\u0643 \u0627\u0644\u062f\u0647\u0646\u064a\u0629 \u0648\u0627\u0644\u062a\u0648\u062a \u0648\u0627\u0644\u0645\u0643\u0633\u0631\u0627\u062a \u0648\u0627\u0644\u062e\u0636\u0631\u0627\u0648\u0627\u062a \u0627\u0644\u0648\u0631\u0642\u064a\u0629.","Harvard Health"],t.w)
B.ahE=new A.c(B.c,["The gut microbiome contains trillions of microorganisms that influence digestion, immunity, and even mental health.","\u064a\u062d\u062a\u0648\u064a \u0645\u064a\u0643\u0631\u0648\u0628\u064a\u0648\u0645 \u0627\u0644\u0623\u0645\u0639\u0627\u0621 \u0639\u0644\u0649 \u062a\u0631\u064a\u0644\u064a\u0648\u0646\u0627\u062a \u0645\u0646 \u0627\u0644\u0643\u0627\u0626\u0646\u0627\u062a \u0627\u0644\u062f\u0642\u064a\u0642\u0629 \u0627\u0644\u062a\u064a \u062a\u0624\u062b\u0631 \u0641\u064a \u0627\u0644\u0647\u0636\u0645 \u0648\u0627\u0644\u0645\u0646\u0627\u0639\u0629 \u0648\u062d\u062a\u0649 \u0627\u0644\u0635\u062d\u0629 \u0627\u0644\u0646\u0641\u0633\u064a\u0629.","Harvard Health"],t.w)
B.abD=new A.c(B.c,["Fermented foods like yogurt, kefir, kimchi, and sauerkraut introduce beneficial bacteria to the gut.","\u062a\u064f\u062f\u062e\u0644 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0645\u062e\u0645\u0631\u0629 \u0645\u062b\u0644 \u0627\u0644\u0632\u0628\u0627\u062f\u064a \u0648\u0627\u0644\u0643\u0641\u064a\u0631 \u0648\u0627\u0644\u0643\u064a\u0645\u062a\u0634\u064a \u0648\u0645\u062e\u0644\u0644 \u0627\u0644\u0645\u0644\u0641\u0648\u0641 \u0628\u0643\u062a\u064a\u0631\u064a\u0627 \u0646\u0627\u0641\u0639\u0629 \u0625\u0644\u0649 \u0627\u0644\u0623\u0645\u0639\u0627\u0621.","Harvard Health"],t.w)
B.af1=new A.c(B.c,["A diverse diet rich in different plant foods supports a more diverse and resilient gut microbiome.","\u0627\u0644\u0646\u0638\u0627\u0645 \u0627\u0644\u063a\u0630\u0627\u0626\u064a \u0627\u0644\u0645\u062a\u0646\u0648\u0639 \u0627\u0644\u063a\u0646\u064a \u0628\u0623\u0637\u0639\u0645\u0629 \u0646\u0628\u0627\u062a\u064a\u0629 \u0645\u062e\u062a\u0644\u0641\u0629 \u064a\u062f\u0639\u0645 \u0645\u064a\u0643\u0631\u0648\u0628\u064a\u0648\u0645 \u0623\u0645\u0639\u0627\u0621 \u0623\u0643\u062b\u0631 \u062a\u0646\u0648\u0639\u0627\u064b \u0648\u0645\u0631\u0648\u0646\u0629.","Harvard Health"],t.w)
B.ahz=new A.c(B.c,["Prebiotics are types of fiber that feed beneficial gut bacteria; garlic, onions, bananas, and asparagus are rich sources.","\u0627\u0644\u0628\u0631\u064a\u0628\u064a\u0648\u062a\u064a\u0643 \u0623\u0646\u0648\u0627\u0639 \u0645\u0646 \u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u062a\u063a\u0630\u064a \u0628\u0643\u062a\u064a\u0631\u064a\u0627 \u0627\u0644\u0623\u0645\u0639\u0627\u0621 \u0627\u0644\u0646\u0627\u0641\u0639\u0629\u061b \u0648\u0627\u0644\u062b\u0648\u0645 \u0648\u0627\u0644\u0628\u0635\u0644 \u0648\u0627\u0644\u0645\u0648\u0632 \u0648\u0627\u0644\u0647\u0644\u064a\u0648\u0646 \u0645\u0635\u0627\u062f\u0631 \u063a\u0646\u064a\u0629 \u0628\u0647\u0627.","Mayo Clinic"],t.w)
B.agf=new A.c(B.c,["Artificial sweeteners may alter gut bacteria composition; use them in moderation.","\u0642\u062f \u062a\u063a\u064a\u0651\u0631 \u0627\u0644\u0645\u062d\u0644\u0651\u064a\u0627\u062a \u0627\u0644\u0635\u0646\u0627\u0639\u064a\u0629 \u062a\u0631\u0643\u064a\u0628\u0629 \u0628\u0643\u062a\u064a\u0631\u064a\u0627 \u0627\u0644\u0623\u0645\u0639\u0627\u0621\u061b \u0627\u0633\u062a\u062e\u062f\u0645\u0647\u0627 \u0628\u0627\u0639\u062a\u062f\u0627\u0644.","Harvard Health"],t.w)
B.adK=new A.c(B.c,["Antibiotics can disrupt the gut microbiome; eating probiotic-rich foods during and after a course may help restoration.","\u064a\u0645\u0643\u0646 \u0644\u0644\u0645\u0636\u0627\u062f\u0627\u062a \u0627\u0644\u062d\u064a\u0648\u064a\u0629 \u0623\u0646 \u062a\u064f\u062e\u0644\u0651 \u0628\u0645\u064a\u0643\u0631\u0648\u0628\u064a\u0648\u0645 \u0627\u0644\u0623\u0645\u0639\u0627\u0621\u061b \u0648\u062a\u0646\u0627\u0648\u0644 \u0623\u0637\u0639\u0645\u0629 \u063a\u0646\u064a\u0629 \u0628\u0627\u0644\u0628\u0631\u0648\u0628\u064a\u0648\u062a\u064a\u0643 \u0623\u062b\u0646\u0627\u0621 \u0627\u0644\u0639\u0644\u0627\u062c \u0648\u0628\u0639\u062f\u0647 \u0642\u062f \u064a\u0633\u0627\u0639\u062f \u0641\u064a \u0627\u0633\u062a\u0639\u0627\u062f\u0629 \u0627\u0644\u062a\u0648\u0627\u0632\u0646.","NHS"],t.w)
B.abM=new A.c(B.c,["Whole grains provide fiber that feeds beneficial bacteria and supports regular bowel movements.","\u062a\u0648\u0641\u0631 \u0627\u0644\u062d\u0628\u0648\u0628 \u0627\u0644\u0643\u0627\u0645\u0644\u0629 \u0623\u0644\u064a\u0627\u0641\u0627\u064b \u062a\u063a\u0630\u064a \u0627\u0644\u0628\u0643\u062a\u064a\u0631\u064a\u0627 \u0627\u0644\u0646\u0627\u0641\u0639\u0629 \u0648\u062a\u062f\u0639\u0645 \u0627\u0646\u062a\u0638\u0627\u0645 \u062d\u0631\u0643\u0629 \u0627\u0644\u0623\u0645\u0639\u0627\u0621.","Harvard Health"],t.w)
B.aec=new A.c(B.c,["Excessive alcohol consumption can damage the gut lining and reduce microbial diversity.","\u0627\u0644\u0625\u0641\u0631\u0627\u0637 \u0641\u064a \u0627\u0633\u062a\u0647\u0644\u0627\u0643 \u0627\u0644\u0643\u062d\u0648\u0644 \u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u064f\u062a\u0644\u0641 \u0628\u0637\u0627\u0646\u0629 \u0627\u0644\u0623\u0645\u0639\u0627\u0621 \u0648\u064a\u0642\u0644\u0644 \u0645\u0646 \u062a\u0646\u0648\u0639 \u0627\u0644\u0645\u064a\u0643\u0631\u0648\u0628\u0627\u062a.","Harvard Health"],t.w)
B.ait=new A.c(B.c,["Eating a wide variety of fruits and vegetables \u2014 aim for 30 different plant foods per week \u2014 supports gut health.","\u062a\u0646\u0627\u0648\u0644 \u062a\u0634\u0643\u064a\u0644\u0629 \u0648\u0627\u0633\u0639\u0629 \u0645\u0646 \u0627\u0644\u0641\u0648\u0627\u0643\u0647 \u0648\u0627\u0644\u062e\u0636\u0631\u0627\u0648\u0627\u062a \u2014 \u0627\u0633\u062a\u0647\u062f\u0641 30 \u0646\u0648\u0639\u0627\u064b \u0645\u062e\u062a\u0644\u0641\u0627\u064b \u0645\u0646 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0646\u0628\u0627\u062a\u064a\u0629 \u0623\u0633\u0628\u0648\u0639\u064a\u0627\u064b \u2014 \u064a\u062f\u0639\u0645 \u0635\u062d\u0629 \u0627\u0644\u0623\u0645\u0639\u0627\u0621.","Harvard Health"],t.w)
B.aed=new A.c(B.c,["Chronic stress can negatively affect gut bacteria and increase symptoms of IBS and other digestive conditions.","\u064a\u0645\u0643\u0646 \u0644\u0644\u062a\u0648\u062a\u0631 \u0627\u0644\u0645\u0632\u0645\u0646 \u0623\u0646 \u064a\u0624\u062b\u0631 \u0633\u0644\u0628\u0627\u064b \u0639\u0644\u0649 \u0628\u0643\u062a\u064a\u0631\u064a\u0627 \u0627\u0644\u0623\u0645\u0639\u0627\u0621 \u0648\u064a\u0632\u064a\u062f \u0645\u0646 \u0623\u0639\u0631\u0627\u0636 \u0627\u0644\u0642\u0648\u0644\u0648\u0646 \u0627\u0644\u0639\u0635\u0628\u064a \u0648\u0627\u0636\u0637\u0631\u0627\u0628\u0627\u062a \u0627\u0644\u062c\u0647\u0627\u0632 \u0627\u0644\u0647\u0636\u0645\u064a \u0627\u0644\u0623\u062e\u0631\u0649.","Mayo Clinic"],t.w)
B.aiM=new A.c(B.c,["Polyphenols in tea, coffee, dark chocolate, and berries act as prebiotics and support beneficial gut bacteria.","\u062a\u0639\u0645\u0644 \u0627\u0644\u0628\u0648\u0644\u064a\u0641\u064a\u0646\u0648\u0644\u0627\u062a \u0627\u0644\u0645\u0648\u062c\u0648\u062f\u0629 \u0641\u064a \u0627\u0644\u0634\u0627\u064a \u0648\u0627\u0644\u0642\u0647\u0648\u0629 \u0648\u0627\u0644\u0634\u0648\u0643\u0648\u0644\u0627\u062a\u0629 \u0627\u0644\u062f\u0627\u0643\u0646\u0629 \u0648\u0627\u0644\u062a\u0648\u062a \u0643\u0628\u0631\u064a\u0628\u064a\u0648\u062a\u064a\u0643 \u0648\u062a\u062f\u0639\u0645 \u0628\u0643\u062a\u064a\u0631\u064a\u0627 \u0627\u0644\u0623\u0645\u0639\u0627\u0621 \u0627\u0644\u0646\u0627\u0641\u0639\u0629.","Harvard Health"],t.w)
B.ahX=new A.c(B.c,["Getting enough sleep is linked to better gut microbiome health; disrupted sleep can alter microbial balance.","\u0627\u0644\u062d\u0635\u0648\u0644 \u0639\u0644\u0649 \u0642\u0633\u0637 \u0643\u0627\u0641\u064d \u0645\u0646 \u0627\u0644\u0646\u0648\u0645 \u064a\u0631\u062a\u0628\u0637 \u0628\u0635\u062d\u0629 \u0623\u0641\u0636\u0644 \u0644\u0645\u064a\u0643\u0631\u0648\u0628\u064a\u0648\u0645 \u0627\u0644\u0623\u0645\u0639\u0627\u0621\u061b \u0648\u0627\u0636\u0637\u0631\u0627\u0628 \u0627\u0644\u0646\u0648\u0645 \u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u064f\u062e\u0644\u0651 \u0628\u0627\u0644\u062a\u0648\u0627\u0632\u0646 \u0627\u0644\u0645\u064a\u0643\u0631\u0648\u0628\u064a.","Harvard Health"],t.w)
B.aiB=new A.c(B.c,["Soluble fiber in oats and legumes feeds Bifidobacteria and Lactobacillus, two important beneficial bacterial groups.","\u062a\u063a\u0630\u064a \u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0627\u0644\u0642\u0627\u0628\u0644\u0629 \u0644\u0644\u0630\u0648\u0628\u0627\u0646 \u0641\u064a \u0627\u0644\u0634\u0648\u0641\u0627\u0646 \u0648\u0627\u0644\u0628\u0642\u0648\u0644\u064a\u0627\u062a \u0628\u0643\u062a\u064a\u0631\u064a\u0627 \u0627\u0644\u0628\u064a\u0641\u064a\u062f\u0648 \u0648\u0627\u0644\u0639\u0635\u064a\u0627\u062a \u0627\u0644\u0644\u0628\u0646\u064a\u0629\u060c \u0648\u0647\u0645\u0627 \u0645\u062c\u0645\u0648\u0639\u062a\u0627\u0646 \u0645\u0647\u0645\u062a\u0627\u0646 \u0645\u0646 \u0627\u0644\u0628\u0643\u062a\u064a\u0631\u064a\u0627 \u0627\u0644\u0646\u0627\u0641\u0639\u0629.","Mayo Clinic"],t.w)
B.ack=new A.c(B.c,["Bone broth contains collagen and amino acids that may support gut lining integrity.","\u064a\u062d\u062a\u0648\u064a \u0645\u0631\u0642 \u0627\u0644\u0639\u0638\u0627\u0645 \u0639\u0644\u0649 \u0627\u0644\u0643\u0648\u0644\u0627\u062c\u064a\u0646 \u0648\u0627\u0644\u0623\u062d\u0645\u0627\u0636 \u0627\u0644\u0623\u0645\u064a\u0646\u064a\u0629 \u0627\u0644\u062a\u064a \u0642\u062f \u062a\u062f\u0639\u0645 \u0633\u0644\u0627\u0645\u0629 \u0628\u0637\u0627\u0646\u0629 \u0627\u0644\u0623\u0645\u0639\u0627\u0621.","Harvard Health"],t.w)
B.agE=new A.c(B.c,["If you experience persistent digestive symptoms, consult a healthcare professional rather than self-diagnosing.","\u0625\u0630\u0627 \u0643\u0646\u062a \u062a\u0639\u0627\u0646\u064a \u0645\u0646 \u0623\u0639\u0631\u0627\u0636 \u0647\u0636\u0645\u064a\u0629 \u0645\u0633\u062a\u0645\u0631\u0629\u060c \u0627\u0633\u062a\u0634\u0631 \u0623\u062e\u0635\u0627\u0626\u064a \u0631\u0639\u0627\u064a\u0629 \u0635\u062d\u064a\u0629 \u0628\u062f\u0644\u0627\u064b \u0645\u0646 \u0627\u0644\u062a\u0634\u062e\u064a\u0635 \u0627\u0644\u0630\u0627\u062a\u064a.","NHS"],t.w)
B.afP=new A.c(B.c,["Eating at least five portions of fruit and vegetables per day is associated with a lower risk of heart disease.","\u064a\u0631\u062a\u0628\u0637 \u062a\u0646\u0627\u0648\u0644 \u062e\u0645\u0633 \u062d\u0635\u0635 \u0639\u0644\u0649 \u0627\u0644\u0623\u0642\u0644 \u0645\u0646 \u0627\u0644\u0641\u0648\u0627\u0643\u0647 \u0648\u0627\u0644\u062e\u0636\u0631\u0627\u0648\u0627\u062a \u064a\u0648\u0645\u064a\u0627\u064b \u0628\u0627\u0646\u062e\u0641\u0627\u0636 \u062e\u0637\u0631 \u0627\u0644\u0625\u0635\u0627\u0628\u0629 \u0628\u0623\u0645\u0631\u0627\u0636 \u0627\u0644\u0642\u0644\u0628.","WHO"],t.w)
B.ai5=new A.c(B.c,["Oily fish such as salmon, mackerel, and sardines provide omega-3 fats that help maintain a healthy heart.","\u062a\u0648\u0641\u0631 \u0627\u0644\u0623\u0633\u0645\u0627\u0643 \u0627\u0644\u062f\u0647\u0646\u064a\u0629 \u0645\u062b\u0644 \u0627\u0644\u0633\u0644\u0645\u0648\u0646 \u0648\u0627\u0644\u0645\u0627\u0643\u0631\u064a\u0644 \u0648\u0627\u0644\u0633\u0631\u062f\u064a\u0646 \u062f\u0647\u0648\u0646 \u0623\u0648\u0645\u064a\u063a\u0627-3 \u0627\u0644\u062a\u064a \u062a\u0633\u0627\u0639\u062f \u0641\u064a \u0627\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u0635\u062d\u0629 \u0627\u0644\u0642\u0644\u0628.","NHS"],t.w)
B.ae6=new A.c(B.c,["Replacing saturated fats with unsaturated fats (olive oil, nuts, avocados) helps lower LDL cholesterol.","\u0627\u0633\u062a\u0628\u062f\u0627\u0644 \u0627\u0644\u062f\u0647\u0648\u0646 \u0627\u0644\u0645\u0634\u0628\u0639\u0629 \u0628\u0627\u0644\u062f\u0647\u0648\u0646 \u063a\u064a\u0631 \u0627\u0644\u0645\u0634\u0628\u0639\u0629 (\u0632\u064a\u062a \u0627\u0644\u0632\u064a\u062a\u0648\u0646 \u0648\u0627\u0644\u0645\u0643\u0633\u0631\u0627\u062a \u0648\u0627\u0644\u0623\u0641\u0648\u0643\u0627\u062f\u0648) \u064a\u0633\u0627\u0639\u062f \u0641\u064a \u062e\u0641\u0636 \u0627\u0644\u0643\u0648\u0644\u064a\u0633\u062a\u0631\u0648\u0644 \u0627\u0644\u0636\u0627\u0631.","Harvard Health"],t.w)
B.agl=new A.c(B.c,["Excess sodium raises blood pressure; aim for less than 5 g of salt (about 1 teaspoon) per day.","\u0627\u0644\u0625\u0641\u0631\u0627\u0637 \u0641\u064a \u0627\u0644\u0635\u0648\u062f\u064a\u0648\u0645 \u064a\u0631\u0641\u0639 \u0636\u063a\u0637 \u0627\u0644\u062f\u0645\u061b \u0627\u0647\u062f\u0641 \u0625\u0644\u0649 \u0623\u0642\u0644 \u0645\u0646 5 \u063a\u0631\u0627\u0645\u0627\u062a \u0645\u0646 \u0627\u0644\u0645\u0644\u062d (\u0646\u062d\u0648 \u0645\u0644\u0639\u0642\u0629 \u0635\u063a\u064a\u0631\u0629) \u064a\u0648\u0645\u064a\u0627\u064b.","WHO"],t.w)
B.ad_=new A.c(B.c,['Soluble fiber in oats, barley, and beans can help lower LDL ("bad") cholesterol.',"\u062a\u0633\u0627\u0639\u062f \u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0627\u0644\u0642\u0627\u0628\u0644\u0629 \u0644\u0644\u0630\u0648\u0628\u0627\u0646 \u0641\u064a \u0627\u0644\u0634\u0648\u0641\u0627\u0646 \u0648\u0627\u0644\u0634\u0639\u064a\u0631 \u0648\u0627\u0644\u0641\u0627\u0635\u0648\u0644\u064a\u0627 \u0639\u0644\u0649 \u062e\u0641\u0636 \u0627\u0644\u0643\u0648\u0644\u064a\u0633\u062a\u0631\u0648\u0644 \u0627\u0644\u0636\u0627\u0631 (LDL).","Mayo Clinic"],t.w)
B.abz=new A.c(B.c,["Trans fats are the most harmful dietary fat for heart health; avoid partially hydrogenated oils.","\u0627\u0644\u062f\u0647\u0648\u0646 \u0627\u0644\u0645\u062a\u062d\u0648\u0644\u0629 \u0647\u064a \u0623\u0643\u062b\u0631 \u0627\u0644\u062f\u0647\u0648\u0646 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0636\u0631\u0631\u0627\u064b \u0628\u0635\u062d\u0629 \u0627\u0644\u0642\u0644\u0628\u061b \u062a\u062c\u0646\u0628 \u0627\u0644\u0632\u064a\u0648\u062a \u0627\u0644\u0645\u0647\u062f\u0631\u062c\u0629 \u062c\u0632\u0626\u064a\u0627\u064b.","Harvard Health"],t.w)
B.adP=new A.c(B.c,["Regular physical activity of at least 150 minutes of moderate exercise per week benefits heart health.","\u064a\u0641\u064a\u062f \u0627\u0644\u0646\u0634\u0627\u0637 \u0627\u0644\u0628\u062f\u0646\u064a \u0627\u0644\u0645\u0646\u062a\u0638\u0645 \u0628\u0645\u0627 \u0644\u0627 \u064a\u0642\u0644 \u0639\u0646 150 \u062f\u0642\u064a\u0642\u0629 \u0645\u0646 \u0627\u0644\u062a\u0645\u0627\u0631\u064a\u0646 \u0627\u0644\u0645\u0639\u062a\u062f\u0644\u0629 \u0623\u0633\u0628\u0648\u0639\u064a\u0627\u064b \u0635\u062d\u0629 \u0627\u0644\u0642\u0644\u0628.","WHO"],t.w)
B.abt=new A.c(B.c,["Nuts, eaten in moderate amounts (a small handful per day), are associated with reduced cardiovascular risk.","\u062a\u0631\u062a\u0628\u0637 \u0627\u0644\u0645\u0643\u0633\u0631\u0627\u062a \u0639\u0646\u062f \u062a\u0646\u0627\u0648\u0644\u0647\u0627 \u0628\u0643\u0645\u064a\u0627\u062a \u0645\u0639\u062a\u062f\u0644\u0629 (\u062d\u0641\u0646\u0629 \u0635\u063a\u064a\u0631\u0629 \u064a\u0648\u0645\u064a\u0627\u064b) \u0628\u0627\u0646\u062e\u0641\u0627\u0636 \u062e\u0637\u0631 \u0627\u0644\u0625\u0635\u0627\u0628\u0629 \u0628\u0623\u0645\u0631\u0627\u0636 \u0627\u0644\u0642\u0644\u0628 \u0648\u0627\u0644\u0623\u0648\u0639\u064a\u0629 \u0627\u0644\u062f\u0645\u0648\u064a\u0629.","Harvard Health"],t.w)
B.aco=new A.c(B.c,["Whole grains retain their bran and germ, providing fiber and nutrients that support cardiovascular health.","\u062a\u062d\u062a\u0641\u0638 \u0627\u0644\u062d\u0628\u0648\u0628 \u0627\u0644\u0643\u0627\u0645\u0644\u0629 \u0628\u0646\u062e\u0627\u0644\u062a\u0647\u0627 \u0648\u062c\u0646\u064a\u0646\u0647\u0627\u060c \u0645\u0645\u0627 \u064a\u0648\u0641\u0631 \u0623\u0644\u064a\u0627\u0641\u0627\u064b \u0648\u0645\u063a\u0630\u064a\u0627\u062a \u062a\u062f\u0639\u0645 \u0635\u062d\u0629 \u0627\u0644\u0642\u0644\u0628 \u0648\u0627\u0644\u0623\u0648\u0639\u064a\u0629 \u0627\u0644\u062f\u0645\u0648\u064a\u0629.","Mayo Clinic"],t.w)
B.ahC=new A.c(B.c,["Limiting added sugar helps control weight and reduces risk factors for heart disease.","\u0627\u0644\u062d\u062f \u0645\u0646 \u0627\u0644\u0633\u0643\u0631\u064a\u0627\u062a \u0627\u0644\u0645\u0636\u0627\u0641\u0629 \u064a\u0633\u0627\u0639\u062f \u0641\u064a \u0627\u0644\u062a\u062d\u0643\u0645 \u0628\u0627\u0644\u0648\u0632\u0646 \u0648\u064a\u0642\u0644\u0644 \u0645\u0646 \u0639\u0648\u0627\u0645\u0644 \u062e\u0637\u0631 \u0627\u0644\u0625\u0635\u0627\u0628\u0629 \u0628\u0623\u0645\u0631\u0627\u0636 \u0627\u0644\u0642\u0644\u0628.","NHS"],t.w)
B.abc=new A.c(B.c,["Dark leafy greens (spinach, kale) are rich in nitrates, which help relax blood vessels and lower blood pressure.","\u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u0627\u0644\u0648\u0631\u0642\u064a\u0629 \u0627\u0644\u062f\u0627\u0643\u0646\u0629 (\u0627\u0644\u0633\u0628\u0627\u0646\u062e\u060c \u0627\u0644\u0643\u0631\u0646\u0628 \u0627\u0644\u0623\u062c\u0639\u062f) \u063a\u0646\u064a\u0629 \u0628\u0627\u0644\u0646\u062a\u0631\u0627\u062a \u0627\u0644\u062a\u064a \u062a\u0633\u0627\u0639\u062f \u0639\u0644\u0649 \u0627\u0633\u062a\u0631\u062e\u0627\u0621 \u0627\u0644\u0623\u0648\u0639\u064a\u0629 \u0627\u0644\u062f\u0645\u0648\u064a\u0629 \u0648\u062e\u0641\u0636 \u0636\u063a\u0637 \u0627\u0644\u062f\u0645.","Harvard Health"],t.w)
B.acW=new A.c(B.c,["Legumes (beans, lentils, chickpeas) improve heart health by providing fiber, plant protein, and potassium.","\u0627\u0644\u0628\u0642\u0648\u0644\u064a\u0627\u062a (\u0627\u0644\u0641\u0627\u0635\u0648\u0644\u064a\u0627\u060c \u0627\u0644\u0639\u062f\u0633\u060c \u0627\u0644\u062d\u0645\u0635) \u062a\u0639\u0632\u0632 \u0635\u062d\u0629 \u0627\u0644\u0642\u0644\u0628 \u0645\u0646 \u062e\u0644\u0627\u0644 \u062a\u0648\u0641\u064a\u0631 \u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0648\u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0627\u0644\u0646\u0628\u0627\u062a\u064a \u0648\u0627\u0644\u0628\u0648\u062a\u0627\u0633\u064a\u0648\u0645.","Harvard Health"],t.w)
B.ahr=new A.c(B.c,["Excessive alcohol consumption raises blood pressure and increases the risk of heart disease.","\u0627\u0644\u0625\u0641\u0631\u0627\u0637 \u0641\u064a \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0643\u062d\u0648\u0644 \u064a\u0631\u0641\u0639 \u0636\u063a\u0637 \u0627\u0644\u062f\u0645 \u0648\u064a\u0632\u064a\u062f \u0645\u0646 \u062e\u0637\u0631 \u0627\u0644\u0625\u0635\u0627\u0628\u0629 \u0628\u0623\u0645\u0631\u0627\u0636 \u0627\u0644\u0642\u0644\u0628.","NHS"],t.w)
B.aek=new A.c(B.c,["Olive oil, especially extra virgin, contains polyphenols that have anti-inflammatory benefits for the heart.","\u0632\u064a\u062a \u0627\u0644\u0632\u064a\u062a\u0648\u0646\u060c \u0648\u062e\u0627\u0635\u0629 \u0627\u0644\u0628\u0643\u0631 \u0627\u0644\u0645\u0645\u062a\u0627\u0632\u060c \u064a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u0645\u0631\u0643\u0628\u0627\u062a \u0627\u0644\u0628\u0648\u0644\u064a\u0641\u064a\u0646\u0648\u0644 \u0627\u0644\u062a\u064a \u0644\u0647\u0627 \u0641\u0648\u0627\u0626\u062f \u0645\u0636\u0627\u062f\u0629 \u0644\u0644\u0627\u0644\u062a\u0647\u0627\u0628\u0627\u062a \u0644\u0635\u062d\u0629 \u0627\u0644\u0642\u0644\u0628.","Harvard Health"],t.w)
B.aea=new A.c(B.c,["Maintaining a healthy weight reduces strain on the heart and lowers cardiovascular risk factors.","\u0627\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u0648\u0632\u0646 \u0635\u062d\u064a \u064a\u0642\u0644\u0644 \u0645\u0646 \u0627\u0644\u0625\u062c\u0647\u0627\u062f \u0639\u0644\u0649 \u0627\u0644\u0642\u0644\u0628 \u0648\u064a\u062e\u0641\u0636 \u0639\u0648\u0627\u0645\u0644 \u062e\u0637\u0631 \u0627\u0644\u0625\u0635\u0627\u0628\u0629 \u0628\u0623\u0645\u0631\u0627\u0636 \u0627\u0644\u0642\u0644\u0628 \u0648\u0627\u0644\u0623\u0648\u0639\u064a\u0629 \u0627\u0644\u062f\u0645\u0648\u064a\u0629.","Mayo Clinic"],t.w)
B.adq=new A.c(B.c,["Garlic may have modest cholesterol-lowering and blood-pressure-lowering effects.","\u0642\u062f \u064a\u0643\u0648\u0646 \u0644\u0644\u062b\u0648\u0645 \u062a\u0623\u062b\u064a\u0631\u0627\u062a \u0645\u0639\u062a\u062f\u0644\u0629 \u0641\u064a \u062e\u0641\u0636 \u0627\u0644\u0643\u0648\u0644\u064a\u0633\u062a\u0631\u0648\u0644 \u0648\u0636\u063a\u0637 \u0627\u0644\u062f\u0645.","Mayo Clinic"],t.w)
B.ahs=new A.c(B.c,["Potassium-rich foods (bananas, sweet potatoes, spinach) help counteract sodium's effect on blood pressure.","\u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u063a\u0646\u064a\u0629 \u0628\u0627\u0644\u0628\u0648\u062a\u0627\u0633\u064a\u0648\u0645 (\u0627\u0644\u0645\u0648\u0632\u060c \u0627\u0644\u0628\u0637\u0627\u0637\u0627 \u0627\u0644\u062d\u0644\u0648\u0629\u060c \u0627\u0644\u0633\u0628\u0627\u0646\u062e) \u062a\u0633\u0627\u0639\u062f \u0641\u064a \u0645\u0648\u0627\u062c\u0647\u0629 \u062a\u0623\u062b\u064a\u0631 \u0627\u0644\u0635\u0648\u062f\u064a\u0648\u0645 \u0639\u0644\u0649 \u0636\u063a\u0637 \u0627\u0644\u062f\u0645.","Harvard Health"],t.w)
B.aiA=new A.c(B.c,["Chronic stress contributes to heart disease; regular relaxation practices can support cardiovascular health.","\u0627\u0644\u0625\u062c\u0647\u0627\u062f \u0627\u0644\u0645\u0632\u0645\u0646 \u064a\u0633\u0647\u0645 \u0641\u064a \u0623\u0645\u0631\u0627\u0636 \u0627\u0644\u0642\u0644\u0628\u061b \u0648\u0645\u0645\u0627\u0631\u0633\u0629 \u062a\u0642\u0646\u064a\u0627\u062a \u0627\u0644\u0627\u0633\u062a\u0631\u062e\u0627\u0621 \u0628\u0627\u0646\u062a\u0638\u0627\u0645 \u064a\u0645\u0643\u0646 \u0623\u0646 \u062a\u062f\u0639\u0645 \u0635\u062d\u0629 \u0627\u0644\u0642\u0644\u0628 \u0648\u0627\u0644\u0623\u0648\u0639\u064a\u0629 \u0627\u0644\u062f\u0645\u0648\u064a\u0629.","Mayo Clinic"],t.w)
B.aeo=new A.c(B.c,["Berries are rich in anthocyanins, antioxidants linked to reduced risk of heart attack.","\u0627\u0644\u062a\u0648\u062a \u063a\u0646\u064a \u0628\u0627\u0644\u0623\u0646\u062b\u0648\u0633\u064a\u0627\u0646\u064a\u0646\u060c \u0648\u0647\u064a \u0645\u0636\u0627\u062f\u0627\u062a \u0623\u0643\u0633\u062f\u0629 \u0645\u0631\u062a\u0628\u0637\u0629 \u0628\u062a\u0642\u0644\u064a\u0644 \u062e\u0637\u0631 \u0627\u0644\u0625\u0635\u0627\u0628\u0629 \u0628\u0627\u0644\u0646\u0648\u0628\u0627\u062a \u0627\u0644\u0642\u0644\u0628\u064a\u0629.","Harvard Health"],t.w)
B.af7=new A.c(B.c,["Cooking at home allows you to control salt, fat, and sugar \u2014 all critical factors for heart health.","\u0627\u0644\u0637\u0647\u064a \u0641\u064a \u0627\u0644\u0645\u0646\u0632\u0644 \u064a\u062a\u064a\u062d \u0644\u0643 \u0627\u0644\u062a\u062d\u0643\u0645 \u0641\u064a \u0627\u0644\u0645\u0644\u062d \u0648\u0627\u0644\u062f\u0647\u0648\u0646 \u0648\u0627\u0644\u0633\u0643\u0631 \u2014 \u0648\u0647\u064a \u0639\u0648\u0627\u0645\u0644 \u062d\u0627\u0633\u0645\u0629 \u0644\u0635\u062d\u0629 \u0627\u0644\u0642\u0644\u0628.","NHS"],t.w)
B.acc=new A.c(B.c,["Calcium and vitamin D work together for bone health; dairy, fortified foods, and sunlight are key sources.","\u0627\u0644\u0643\u0627\u0644\u0633\u064a\u0648\u0645 \u0648\u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u062f \u064a\u0639\u0645\u0644\u0627\u0646 \u0645\u0639\u0627\u064b \u0644\u062a\u0639\u0632\u064a\u0632 \u0635\u062d\u0629 \u0627\u0644\u0639\u0638\u0627\u0645\u061b \u0648\u0645\u0646\u062a\u062c\u0627\u062a \u0627\u0644\u0623\u0644\u0628\u0627\u0646 \u0648\u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0645\u062f\u0639\u0651\u0645\u0629 \u0648\u0623\u0634\u0639\u0629 \u0627\u0644\u0634\u0645\u0633 \u0647\u064a \u0645\u0635\u0627\u062f\u0631 \u0623\u0633\u0627\u0633\u064a\u0629 \u0644\u0647\u0645\u0627.","NHS"],t.w)
B.acv=new A.c(B.c,["Weight-bearing exercise like walking, jogging, and dancing helps maintain bone density.","\u0627\u0644\u062a\u0645\u0627\u0631\u064a\u0646 \u0627\u0644\u062a\u064a \u062a\u062a\u0636\u0645\u0646 \u062a\u062d\u0645\u064a\u0644 \u0627\u0644\u0648\u0632\u0646 \u0645\u062b\u0644 \u0627\u0644\u0645\u0634\u064a \u0648\u0627\u0644\u0631\u0643\u0636 \u0648\u0627\u0644\u0631\u0642\u0635 \u062a\u0633\u0627\u0639\u062f \u0641\u064a \u0627\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u0643\u062b\u0627\u0641\u0629 \u0627\u0644\u0639\u0638\u0627\u0645.","Mayo Clinic"],t.w)
B.afr=new A.c(B.c,["Adults need 700 mg of calcium per day; a glass of milk provides about 300 mg.","\u064a\u062d\u062a\u0627\u062c \u0627\u0644\u0628\u0627\u0644\u063a\u0648\u0646 \u0625\u0644\u0649 700 \u0645\u0644\u063a \u0645\u0646 \u0627\u0644\u0643\u0627\u0644\u0633\u064a\u0648\u0645 \u064a\u0648\u0645\u064a\u0627\u064b\u061b \u0648\u0643\u0648\u0628 \u0648\u0627\u062d\u062f \u0645\u0646 \u0627\u0644\u062d\u0644\u064a\u0628 \u064a\u0648\u0641\u0631 \u062d\u0648\u0627\u0644\u064a 300 \u0645\u0644\u063a.","NHS"],t.w)
B.adp=new A.c(B.c,["Vitamin D is essential for calcium absorption; most people in northern climates should consider a supplement in winter.","\u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u062f \u0636\u0631\u0648\u0631\u064a \u0644\u0627\u0645\u062a\u0635\u0627\u0635 \u0627\u0644\u0643\u0627\u0644\u0633\u064a\u0648\u0645\u061b \u0648\u0645\u0639\u0638\u0645 \u0627\u0644\u0623\u0634\u062e\u0627\u0635 \u0641\u064a \u0627\u0644\u0645\u0646\u0627\u062e\u0627\u062a \u0627\u0644\u0634\u0645\u0627\u0644\u064a\u0629 \u064a\u0646\u0628\u063a\u064a \u0623\u0646 \u064a\u0641\u0643\u0631\u0648\u0627 \u0641\u064a \u062a\u0646\u0627\u0648\u0644 \u0645\u0643\u0645\u0651\u0644 \u063a\u0630\u0627\u0626\u064a \u0641\u064a \u0627\u0644\u0634\u062a\u0627\u0621.","NHS"],t.w)
B.ac6=new A.c(B.c,["Excessive caffeine intake (more than 4 cups of coffee per day) may reduce calcium absorption.","\u0627\u0644\u0625\u0641\u0631\u0627\u0637 \u0641\u064a \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0643\u0627\u0641\u064a\u064a\u0646 (\u0623\u0643\u062b\u0631 \u0645\u0646 4 \u0623\u0643\u0648\u0627\u0628 \u0645\u0646 \u0627\u0644\u0642\u0647\u0648\u0629 \u064a\u0648\u0645\u064a\u0627\u064b) \u0642\u062f \u064a\u0642\u0644\u0644 \u0645\u0646 \u0627\u0645\u062a\u0635\u0627\u0635 \u0627\u0644\u0643\u0627\u0644\u0633\u064a\u0648\u0645.","Harvard Health"],t.w)
B.aeI=new A.c(B.c,["Smoking accelerates bone loss; quitting is one of the best things you can do for bone health.","\u0627\u0644\u062a\u062f\u062e\u064a\u0646 \u064a\u0633\u0631\u0651\u0639 \u0641\u0642\u062f\u0627\u0646 \u0627\u0644\u0639\u0638\u0627\u0645\u061b \u0648\u0627\u0644\u0625\u0642\u0644\u0627\u0639 \u0639\u0646\u0647 \u0645\u0646 \u0623\u0641\u0636\u0644 \u0645\u0627 \u064a\u0645\u0643\u0646\u0643 \u0641\u0639\u0644\u0647 \u0644\u0635\u062d\u0629 \u0639\u0638\u0627\u0645\u0643.","Mayo Clinic"],t.w)
B.ae2=new A.c(B.c,["Protein is needed for bone structure; aim for adequate (not excessive) daily intake.","\u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0636\u0631\u0648\u0631\u064a \u0644\u0628\u0646\u064a\u0629 \u0627\u0644\u0639\u0638\u0627\u0645\u061b \u0627\u062d\u0631\u0635 \u0639\u0644\u0649 \u062a\u0646\u0627\u0648\u0644 \u0643\u0645\u064a\u0629 \u0643\u0627\u0641\u064a\u0629 (\u0648\u0644\u064a\u0633\u062a \u0645\u0641\u0631\u0637\u0629) \u064a\u0648\u0645\u064a\u0627\u064b.","Harvard Health"],t.w)
B.adA=new A.c(B.c,["Sardines and canned salmon (eaten with bones) are excellent sources of both calcium and vitamin D.","\u0627\u0644\u0633\u0631\u062f\u064a\u0646 \u0648\u0633\u0645\u0643 \u0627\u0644\u0633\u0644\u0645\u0648\u0646 \u0627\u0644\u0645\u0639\u0644\u0651\u0628 (\u0627\u0644\u0630\u064a \u064a\u0624\u0643\u0644 \u0645\u0639 \u0639\u0638\u0627\u0645\u0647) \u0645\u0635\u0627\u062f\u0631 \u0645\u0645\u062a\u0627\u0632\u0629 \u0644\u0643\u0644 \u0645\u0646 \u0627\u0644\u0643\u0627\u0644\u0633\u064a\u0648\u0645 \u0648\u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u062f.","NHS"],t.w)
B.ab6=new A.c(B.c,["Too much salt increases calcium loss through urine; reducing sodium intake supports bone health.","\u0627\u0644\u0625\u0641\u0631\u0627\u0637 \u0641\u064a \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0645\u0644\u062d \u064a\u0632\u064a\u062f \u0645\u0646 \u0641\u0642\u062f\u0627\u0646 \u0627\u0644\u0643\u0627\u0644\u0633\u064a\u0648\u0645 \u0639\u0628\u0631 \u0627\u0644\u0628\u0648\u0644\u061b \u0648\u062a\u0642\u0644\u064a\u0644 \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0635\u0648\u062f\u064a\u0648\u0645 \u064a\u062f\u0639\u0645 \u0635\u062d\u0629 \u0627\u0644\u0639\u0638\u0627\u0645.","Harvard Health"],t.w)
B.ahc=new A.c(B.c,["Leafy greens like kale and broccoli provide calcium that is well absorbed by the body.","\u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u0627\u0644\u0648\u0631\u0642\u064a\u0629 \u0645\u062b\u0644 \u0627\u0644\u0643\u0631\u0646\u0628 \u0627\u0644\u0623\u062c\u0639\u062f \u0648\u0627\u0644\u0628\u0631\u0648\u0643\u0644\u064a \u062a\u0648\u0641\u0631 \u0643\u0627\u0644\u0633\u064a\u0648\u0645\u0627\u064b \u064a\u0645\u062a\u0635\u0647 \u0627\u0644\u062c\u0633\u0645 \u0628\u0634\u0643\u0644 \u062c\u064a\u062f.","Mayo Clinic"],t.w)
B.aee=new A.c(B.c,["Magnesium supports bone mineralization; nuts, seeds, and whole grains are good sources.","\u0627\u0644\u0645\u063a\u0646\u064a\u0633\u064a\u0648\u0645 \u064a\u062f\u0639\u0645 \u062a\u0645\u0639\u062f\u0646 \u0627\u0644\u0639\u0638\u0627\u0645\u061b \u0648\u0627\u0644\u0645\u0643\u0633\u0631\u0627\u062a \u0648\u0627\u0644\u0628\u0630\u0648\u0631 \u0648\u0627\u0644\u062d\u0628\u0648\u0628 \u0627\u0644\u0643\u0627\u0645\u0644\u0629 \u0645\u0635\u0627\u062f\u0631 \u062c\u064a\u062f\u0629 \u0644\u0647.","Harvard Health"],t.w)
B.ahe=new A.c(B.c,["Peak bone mass is built during childhood and adolescence; adequate nutrition during these years is critical.","\u062a\u064f\u0628\u0646\u0649 \u0630\u0631\u0648\u0629 \u0627\u0644\u0643\u062a\u0644\u0629 \u0627\u0644\u0639\u0638\u0645\u064a\u0629 \u062e\u0644\u0627\u0644 \u0645\u0631\u062d\u0644\u062a\u064a \u0627\u0644\u0637\u0641\u0648\u0644\u0629 \u0648\u0627\u0644\u0645\u0631\u0627\u0647\u0642\u0629\u061b \u0648\u0627\u0644\u062a\u063a\u0630\u064a\u0629 \u0627\u0644\u0643\u0627\u0641\u064a\u0629 \u062e\u0644\u0627\u0644 \u0647\u0630\u0647 \u0627\u0644\u0633\u0646\u0648\u0627\u062a \u0623\u0645\u0631 \u0628\u0627\u0644\u063a \u0627\u0644\u0623\u0647\u0645\u064a\u0629.","WHO"],t.w)
B.aeC=new A.c(B.c,["Vitamin K, found in green leafy vegetables, is needed for proper calcium metabolism in bones.","\u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u0643 \u0627\u0644\u0645\u0648\u062c\u0648\u062f \u0641\u064a \u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u0627\u0644\u0648\u0631\u0642\u064a\u0629 \u0627\u0644\u062e\u0636\u0631\u0627\u0621 \u0636\u0631\u0648\u0631\u064a \u0644\u0639\u0645\u0644\u064a\u0629 \u0623\u064a\u0636 \u0627\u0644\u0643\u0627\u0644\u0633\u064a\u0648\u0645 \u0641\u064a \u0627\u0644\u0639\u0638\u0627\u0645.","Harvard Health"],t.w)
B.ab_=new A.c(B.c,["Excessive alcohol consumption interferes with calcium balance and increases the risk of fractures.","\u0627\u0644\u0625\u0641\u0631\u0627\u0637 \u0641\u064a \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0643\u062d\u0648\u0644 \u064a\u062e\u0644\u0651 \u0628\u062a\u0648\u0627\u0632\u0646 \u0627\u0644\u0643\u0627\u0644\u0633\u064a\u0648\u0645 \u0648\u064a\u0632\u064a\u062f \u0645\u0646 \u062e\u0637\u0631 \u0627\u0644\u0643\u0633\u0648\u0631.","Mayo Clinic"],t.w)
B.abm=new A.c(B.c,["Fortified plant-based milks (soy, almond, oat) can provide similar calcium levels to cow's milk when fortified.","\u0627\u0644\u062d\u0644\u064a\u0628 \u0627\u0644\u0646\u0628\u0627\u062a\u064a \u0627\u0644\u0645\u062f\u0639\u0651\u0645 (\u062d\u0644\u064a\u0628 \u0627\u0644\u0635\u0648\u064a\u0627 \u0648\u0627\u0644\u0644\u0648\u0632 \u0648\u0627\u0644\u0634\u0648\u0641\u0627\u0646) \u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u0648\u0641\u0631 \u0645\u0633\u062a\u0648\u064a\u0627\u062a \u0643\u0627\u0644\u0633\u064a\u0648\u0645 \u0645\u0645\u0627\u062b\u0644\u0629 \u0644\u062d\u0644\u064a\u0628 \u0627\u0644\u0628\u0642\u0631 \u0639\u0646\u062f \u062a\u062f\u0639\u064a\u0645\u0647.","NHS"],t.w)
B.aft=new A.c(B.c,["The WHO recommends that free sugars should make up less than 10% of total daily energy intake.","\u062a\u0648\u0635\u064a \u0645\u0646\u0638\u0645\u0629 \u0627\u0644\u0635\u062d\u0629 \u0627\u0644\u0639\u0627\u0644\u0645\u064a\u0629 \u0628\u0623\u0646 \u062a\u0634\u0643\u0651\u0644 \u0627\u0644\u0633\u0643\u0631\u064a\u0627\u062a \u0627\u0644\u062d\u0631\u0629 \u0623\u0642\u0644 \u0645\u0646 10% \u0645\u0646 \u0625\u062c\u0645\u0627\u0644\u064a \u0627\u0644\u0637\u0627\u0642\u0629 \u0627\u0644\u064a\u0648\u0645\u064a\u0629 \u0627\u0644\u0645\u062a\u0646\u0627\u0648\u0644\u0629.","WHO"],t.w)
B.adG=new A.c(B.c,["One can of regular soda contains about 35\u201340 g of sugar, which is nearly the entire recommended daily limit.","\u062a\u062d\u062a\u0648\u064a \u0639\u0644\u0628\u0629 \u0648\u0627\u062d\u062f\u0629 \u0645\u0646 \u0627\u0644\u0645\u0634\u0631\u0648\u0628\u0627\u062a \u0627\u0644\u063a\u0627\u0632\u064a\u0629 \u0627\u0644\u0639\u0627\u062f\u064a\u0629 \u0639\u0644\u0649 \u062d\u0648\u0627\u0644\u064a 35-40 \u063a\u0631\u0627\u0645\u0627\u064b \u0645\u0646 \u0627\u0644\u0633\u0643\u0631\u060c \u0648\u0647\u0648 \u0645\u0627 \u064a\u0642\u0627\u0631\u0628 \u0627\u0644\u062d\u062f \u0627\u0644\u0623\u0642\u0635\u0649 \u0627\u0644\u0645\u0648\u0635\u0649 \u0628\u0647 \u064a\u0648\u0645\u064a\u0627\u064b.","NHS"],t.w)
B.aaX=new A.c(B.c,['Checking ingredient lists for words ending in "-ose" (glucose, fructose, sucrose) helps identify hidden sugars.','\u0627\u0644\u062a\u062d\u0642\u0642 \u0645\u0646 \u0642\u0627\u0626\u0645\u0629 \u0627\u0644\u0645\u0643\u0648\u0646\u0627\u062a \u0628\u062d\u062b\u0627\u064b \u0639\u0646 \u0643\u0644\u0645\u0627\u062a \u062a\u0646\u062a\u0647\u064a \u0628\u0640 "-\u0648\u0632" (\u063a\u0644\u0648\u0643\u0648\u0632\u060c \u0641\u0631\u0643\u062a\u0648\u0632\u060c \u0633\u0643\u0631\u0648\u0632) \u064a\u0633\u0627\u0639\u062f \u0641\u064a \u0627\u0643\u062a\u0634\u0627\u0641 \u0627\u0644\u0633\u0643\u0631\u064a\u0627\u062a \u0627\u0644\u0645\u062e\u0641\u064a\u0629.',"Harvard Health"],t.w)
B.aby=new A.c(B.c,["Reducing sugar intake gradually allows your taste buds to adjust, making sweet foods taste sweeter over time.","\u062a\u0642\u0644\u064a\u0644 \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0633\u0643\u0631 \u062a\u062f\u0631\u064a\u062c\u064a\u0627\u064b \u064a\u0633\u0645\u062d \u0644\u0628\u0631\u0627\u0639\u0645 \u0627\u0644\u062a\u0630\u0648\u0642 \u0628\u0627\u0644\u062a\u0643\u064a\u0651\u0641\u060c \u0645\u0645\u0627 \u064a\u062c\u0639\u0644 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u062d\u0644\u0648\u0629 \u062a\u0628\u062f\u0648 \u0623\u0643\u062b\u0631 \u062d\u0644\u0627\u0648\u0629 \u0645\u0639 \u0627\u0644\u0648\u0642\u062a.","NHS"],t.w)
B.afH=new A.c(B.c,["Flavoring water with lemon, lime, cucumber, or mint is a refreshing alternative to sugary drinks.","\u0625\u0636\u0627\u0641\u0629 \u0646\u0643\u0647\u0629 \u0644\u0644\u0645\u0627\u0621 \u0628\u0627\u0644\u0644\u064a\u0645\u0648\u0646 \u0623\u0648 \u0627\u0644\u0644\u064a\u0645\u0648\u0646 \u0627\u0644\u062d\u0627\u0645\u0636 \u0623\u0648 \u0627\u0644\u062e\u064a\u0627\u0631 \u0623\u0648 \u0627\u0644\u0646\u0639\u0646\u0627\u0639 \u0628\u062f\u064a\u0644 \u0645\u0646\u0639\u0634 \u0644\u0644\u0645\u0634\u0631\u0648\u0628\u0627\u062a \u0627\u0644\u0633\u0643\u0631\u064a\u0629.","Mayo Clinic"],t.w)
B.ah3=new A.c(B.c,["Most adults eat about 8\u201310 g of salt per day, nearly double the WHO recommended limit of 5 g.","\u064a\u062a\u0646\u0627\u0648\u0644 \u0645\u0639\u0638\u0645 \u0627\u0644\u0628\u0627\u0644\u063a\u064a\u0646 \u062d\u0648\u0627\u0644\u064a 8-10 \u063a\u0631\u0627\u0645\u0627\u062a \u0645\u0646 \u0627\u0644\u0645\u0644\u062d \u064a\u0648\u0645\u064a\u0627\u064b\u060c \u0623\u064a \u0645\u0627 \u064a\u0642\u0627\u0631\u0628 \u0636\u0639\u0641 \u0627\u0644\u062d\u062f \u0627\u0644\u0645\u0648\u0635\u0649 \u0628\u0647 \u0645\u0646 \u0645\u0646\u0638\u0645\u0629 \u0627\u0644\u0635\u062d\u0629 \u0627\u0644\u0639\u0627\u0644\u0645\u064a\u0629 \u0648\u0647\u0648 5 \u063a\u0631\u0627\u0645\u0627\u062a.","WHO"],t.w)
B.ag3=new A.c(B.c,["About 75% of the salt we eat comes from processed and packaged foods, not from the salt shaker.","\u062d\u0648\u0627\u0644\u064a 75% \u0645\u0646 \u0627\u0644\u0645\u0644\u062d \u0627\u0644\u0630\u064a \u0646\u062a\u0646\u0627\u0648\u0644\u0647 \u064a\u0623\u062a\u064a \u0645\u0646 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0645\u0635\u0646\u0651\u0639\u0629 \u0648\u0627\u0644\u0645\u0639\u0644\u0651\u0628\u0629\u060c \u0648\u0644\u064a\u0633 \u0645\u0646 \u0645\u0644\u0651\u0627\u062d\u0629 \u0627\u0644\u0637\u0639\u0627\u0645.","NHS"],t.w)
B.agd=new A.c(B.c,["Herbs, spices, lemon juice, and vinegar are effective ways to add flavor without adding salt.","\u0627\u0644\u0623\u0639\u0634\u0627\u0628 \u0648\u0627\u0644\u062a\u0648\u0627\u0628\u0644 \u0648\u0639\u0635\u064a\u0631 \u0627\u0644\u0644\u064a\u0645\u0648\u0646 \u0648\u0627\u0644\u062e\u0644 \u0637\u0631\u0642 \u0641\u0639\u0651\u0627\u0644\u0629 \u0644\u0625\u0636\u0627\u0641\u0629 \u0627\u0644\u0646\u0643\u0647\u0629 \u062f\u0648\u0646 \u0625\u0636\u0627\u0641\u0629 \u0627\u0644\u0645\u0644\u062d.","Harvard Health"],t.w)
B.ab7=new A.c(B.c,["High sugar intake is linked to weight gain, tooth decay, and increased risk of type 2 diabetes.","\u064a\u0631\u062a\u0628\u0637 \u0627\u0644\u0625\u0641\u0631\u0627\u0637 \u0641\u064a \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0633\u0643\u0631 \u0628\u0632\u064a\u0627\u062f\u0629 \u0627\u0644\u0648\u0632\u0646 \u0648\u062a\u0633\u0648\u0651\u0633 \u0627\u0644\u0623\u0633\u0646\u0627\u0646 \u0648\u0627\u0631\u062a\u0641\u0627\u0639 \u062e\u0637\u0631 \u0627\u0644\u0625\u0635\u0627\u0628\u0629 \u0628\u062f\u0627\u0621 \u0627\u0644\u0633\u0643\u0631\u064a \u0645\u0646 \u0627\u0644\u0646\u0648\u0639 \u0627\u0644\u062b\u0627\u0646\u064a.","WHO"],t.w)
B.acj=new A.c(B.c,['"No added sugar" does not mean sugar-free; the product may still contain naturally occurring sugars.','\u0639\u0628\u0627\u0631\u0629 "\u0628\u062f\u0648\u0646 \u0633\u0643\u0631 \u0645\u0636\u0627\u0641" \u0644\u0627 \u062a\u0639\u0646\u064a \u062e\u0627\u0644\u064a\u0627\u064b \u0645\u0646 \u0627\u0644\u0633\u0643\u0631\u061b \u0641\u0642\u062f \u064a\u062d\u062a\u0648\u064a \u0627\u0644\u0645\u0646\u062a\u062c \u0639\u0644\u0649 \u0633\u0643\u0631\u064a\u0627\u062a \u0637\u0628\u064a\u0639\u064a\u0629.',"NHS"],t.w)
B.aik=new A.c(B.c,["Breakfast cereals, sauces, and breads can be surprisingly high in both sugar and salt.","\u062d\u0628\u0648\u0628 \u0627\u0644\u0625\u0641\u0637\u0627\u0631 \u0648\u0627\u0644\u0635\u0644\u0635\u0627\u062a \u0648\u0627\u0644\u062e\u0628\u0632 \u0642\u062f \u062a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u0643\u0645\u064a\u0627\u062a \u0645\u0631\u062a\u0641\u0639\u0629 \u0628\u0634\u0643\u0644 \u0645\u0641\u0627\u062c\u0626 \u0645\u0646 \u0627\u0644\u0633\u0643\u0631 \u0648\u0627\u0644\u0645\u0644\u062d \u0645\u0639\u0627\u064b.","NHS"],t.w)
B.ady=new A.c(B.c,["Fruit juices contain natural sugars and lack the fiber of whole fruit; limit to 150 ml per day.","\u0639\u0635\u0627\u0626\u0631 \u0627\u0644\u0641\u0627\u0643\u0647\u0629 \u062a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u0633\u0643\u0631\u064a\u0627\u062a \u0637\u0628\u064a\u0639\u064a\u0629 \u0648\u062a\u0641\u062a\u0642\u0631 \u0625\u0644\u0649 \u0623\u0644\u064a\u0627\u0641 \u0627\u0644\u0641\u0627\u0643\u0647\u0629 \u0627\u0644\u0643\u0627\u0645\u0644\u0629\u061b \u064a\u064f\u0646\u0635\u062d \u0628\u0627\u0644\u0627\u0643\u062a\u0641\u0627\u0621 \u0628\u0640 150 \u0645\u0644 \u064a\u0648\u0645\u064a\u0627\u064b.","NHS"],t.w)
B.aip=new A.c(B.c,["Gradually reducing salt in cooking allows your palate to adjust; most people stop noticing the difference after 2\u20133 weeks.","\u062a\u0642\u0644\u064a\u0644 \u0627\u0644\u0645\u0644\u062d \u062a\u062f\u0631\u064a\u062c\u064a\u0627\u064b \u0623\u062b\u0646\u0627\u0621 \u0627\u0644\u0637\u0647\u064a \u064a\u0633\u0645\u062d \u0644\u0630\u0627\u0626\u0642\u062a\u0643 \u0628\u0627\u0644\u062a\u0643\u064a\u0651\u0641\u061b \u0648\u0645\u0639\u0638\u0645 \u0627\u0644\u0646\u0627\u0633 \u064a\u062a\u0648\u0642\u0641\u0648\u0646 \u0639\u0646 \u0645\u0644\u0627\u062d\u0638\u0629 \u0627\u0644\u0641\u0631\u0642 \u0628\u0639\u062f 2-3 \u0623\u0633\u0627\u0628\u064a\u0639.","Harvard Health"],t.w)
B.agJ=new A.c(B.c,['Choosing "reduced salt" or "low sodium" versions of canned foods can meaningfully cut daily salt intake.','\u0627\u062e\u062a\u064a\u0627\u0631 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0645\u0639\u0644\u0651\u0628\u0629 "\u0645\u0646\u062e\u0641\u0636\u0629 \u0627\u0644\u0645\u0644\u062d" \u0623\u0648 "\u0642\u0644\u064a\u0644\u0629 \u0627\u0644\u0635\u0648\u062f\u064a\u0648\u0645" \u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u0642\u0644\u0644 \u0628\u0634\u0643\u0644 \u0645\u0644\u0645\u0648\u0633 \u0645\u0646 \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0645\u0644\u062d \u0627\u0644\u064a\u0648\u0645\u064a.',"Mayo Clinic"],t.w)
B.ahM=new A.c(B.c,["Honey, agave, and maple syrup are still free sugars and count toward the daily limit.","\u0627\u0644\u0639\u0633\u0644 \u0648\u0634\u0631\u0627\u0628 \u0627\u0644\u0635\u0628\u0651\u0627\u0631 \u0648\u0634\u0631\u0627\u0628 \u0627\u0644\u0642\u064a\u0642\u0628 \u0644\u0627 \u062a\u0632\u0627\u0644 \u0633\u0643\u0631\u064a\u0627\u062a \u062d\u0631\u0629 \u0648\u062a\u064f\u062d\u062a\u0633\u0628 \u0636\u0645\u0646 \u0627\u0644\u062d\u062f \u0627\u0644\u064a\u0648\u0645\u064a \u0627\u0644\u0645\u0633\u0645\u0648\u062d.","WHO"],t.w)
B.aer=new A.c(B.c,["High salt intake is a leading risk factor for high blood pressure and stroke worldwide.","\u0627\u0644\u0625\u0641\u0631\u0627\u0637 \u0641\u064a \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0645\u0644\u062d \u0639\u0627\u0645\u0644 \u062e\u0637\u0631 \u0631\u0626\u064a\u0633\u064a \u0644\u0627\u0631\u062a\u0641\u0627\u0639 \u0636\u063a\u0637 \u0627\u0644\u062f\u0645 \u0648\u0627\u0644\u0633\u0643\u062a\u0629 \u0627\u0644\u062f\u0645\u0627\u063a\u064a\u0629 \u0639\u0644\u0649 \u0645\u0633\u062a\u0648\u0649 \u0627\u0644\u0639\u0627\u0644\u0645.","WHO"],t.w)
B.ah4=new A.c(B.c,["Dried fruit is nutrient-dense but concentrated in sugar; keep portions to about 30 g.","\u0627\u0644\u0641\u0648\u0627\u0643\u0647 \u0627\u0644\u0645\u062c\u0641\u0641\u0629 \u063a\u0646\u064a\u0629 \u0628\u0627\u0644\u0639\u0646\u0627\u0635\u0631 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0644\u0643\u0646\u0647\u0627 \u0645\u0631\u0643\u0651\u0632\u0629 \u0627\u0644\u0633\u0643\u0631\u061b \u064a\u064f\u0646\u0635\u062d \u0628\u0627\u0644\u0627\u0643\u062a\u0641\u0627\u0621 \u0628\u062d\u0635\u0629 \u062a\u0628\u0644\u063a \u062d\u0648\u0627\u0644\u064a 30 \u063a\u0631\u0627\u0645\u0627\u064b.","NHS"],t.w)
B.acC=new A.c(B.c,["Reading traffic-light labels (green, amber, red) on food packaging helps quickly identify high-sugar and high-salt products.","\u0642\u0631\u0627\u0621\u0629 \u0645\u0644\u0635\u0642\u0627\u062a \u0625\u0634\u0627\u0631\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 (\u0627\u0644\u0623\u062e\u0636\u0631 \u0648\u0627\u0644\u0623\u0635\u0641\u0631 \u0648\u0627\u0644\u0623\u062d\u0645\u0631) \u0639\u0644\u0649 \u0639\u0628\u0648\u0627\u062a \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u062a\u0633\u0627\u0639\u062f \u0641\u064a \u062a\u062d\u062f\u064a\u062f \u0627\u0644\u0645\u0646\u062a\u062c\u0627\u062a \u0639\u0627\u0644\u064a\u0629 \u0627\u0644\u0633\u0643\u0631 \u0648\u0627\u0644\u0645\u0644\u062d \u0628\u0633\u0631\u0639\u0629.","NHS"],t.w)
B.adz=new A.c(B.c,["Cooking from scratch gives you complete control over how much sugar and salt goes into your food.","\u0627\u0644\u0637\u0647\u064a \u0645\u0646 \u0627\u0644\u0635\u0641\u0631 \u064a\u0645\u0646\u062d\u0643 \u062a\u062d\u0643\u0645\u0627\u064b \u0643\u0627\u0645\u0644\u0627\u064b \u0641\u064a \u0643\u0645\u064a\u0629 \u0627\u0644\u0633\u0643\u0631 \u0648\u0627\u0644\u0645\u0644\u062d \u0627\u0644\u062a\u064a \u062a\u062f\u062e\u0644 \u0641\u064a \u0637\u0639\u0627\u0645\u0643.","Harvard Health"],t.w)
B.agw=new A.c(B.c,["Children should have even lower sugar and salt limits than adults; setting good habits early protects long-term health.","\u064a\u0646\u0628\u063a\u064a \u0623\u0646 \u062a\u0643\u0648\u0646 \u062d\u062f\u0648\u062f \u0627\u0644\u0633\u0643\u0631 \u0648\u0627\u0644\u0645\u0644\u062d \u0644\u062f\u0649 \u0627\u0644\u0623\u0637\u0641\u0627\u0644 \u0623\u0642\u0644 \u0645\u0646 \u0627\u0644\u0628\u0627\u0644\u063a\u064a\u0646\u061b \u0648\u063a\u0631\u0633 \u0627\u0644\u0639\u0627\u062f\u0627\u062a \u0627\u0644\u0635\u062d\u064a\u0629 \u0645\u0628\u0643\u0631\u0627\u064b \u064a\u062d\u0645\u064a \u0627\u0644\u0635\u062d\u0629 \u0639\u0644\u0649 \u0627\u0644\u0645\u062f\u0649 \u0627\u0644\u0628\u0639\u064a\u062f.","WHO"],t.w)
B.ai4=new A.c(B.c,["Steaming vegetables preserves more vitamins and minerals than boiling them.","\u0637\u0647\u064a \u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u0639\u0644\u0649 \u0627\u0644\u0628\u062e\u0627\u0631 \u064a\u062d\u0627\u0641\u0638 \u0639\u0644\u0649 \u0627\u0644\u0641\u064a\u062a\u0627\u0645\u064a\u0646\u0627\u062a \u0648\u0627\u0644\u0645\u0639\u0627\u062f\u0646 \u0623\u0643\u062b\u0631 \u0645\u0646 \u0633\u0644\u0642\u0647\u0627.","Harvard Health"],t.w)
B.agv=new A.c(B.c,["Using non-stick pans or cooking spray reduces the amount of oil needed for cooking.","\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0645\u0642\u0627\u0644\u064a \u063a\u064a\u0631 \u0627\u0644\u0644\u0627\u0635\u0642\u0629 \u0623\u0648 \u0631\u0630\u0627\u0630 \u0627\u0644\u0637\u0647\u064a \u064a\u0642\u0644\u0644 \u0645\u0646 \u0643\u0645\u064a\u0629 \u0627\u0644\u0632\u064a\u062a \u0627\u0644\u0644\u0627\u0632\u0645\u0629 \u0644\u0644\u0637\u0628\u062e.","NHS"],t.w)
B.agB=new A.c(B.c,["Grilling, baking, and poaching are healthier cooking methods than deep-frying.","\u0627\u0644\u0634\u064a\u0651 \u0648\u0627\u0644\u062e\u0628\u0632 \u0648\u0627\u0644\u0633\u0644\u0642 \u0637\u0631\u0642 \u0637\u0647\u064a \u0623\u0643\u062b\u0631 \u0635\u062d\u0629 \u0645\u0646 \u0627\u0644\u0642\u0644\u064a \u0627\u0644\u0639\u0645\u064a\u0642.","Mayo Clinic"],t.w)
B.ai1=new A.c(B.c,["Marinating meat in acidic ingredients (lemon, vinegar) reduces the formation of harmful compounds during high-heat cooking.","\u062a\u062a\u0628\u064a\u0644 \u0627\u0644\u0644\u062d\u0645 \u0628\u0645\u0643\u0648\u0646\u0627\u062a \u062d\u0645\u0636\u064a\u0629 (\u0627\u0644\u0644\u064a\u0645\u0648\u0646\u060c \u0627\u0644\u062e\u0644) \u064a\u0642\u0644\u0644 \u0645\u0646 \u062a\u0643\u0648\u0651\u0646 \u0627\u0644\u0645\u0631\u0643\u0628\u0627\u062a \u0627\u0644\u0636\u0627\u0631\u0629 \u0623\u062b\u0646\u0627\u0621 \u0627\u0644\u0637\u0647\u064a \u0639\u0644\u0649 \u062d\u0631\u0627\u0631\u0629 \u0639\u0627\u0644\u064a\u0629.","Harvard Health"],t.w)
B.acN=new A.c(B.c,["Roasting vegetables (broccoli, cauliflower, carrots) at high heat brings out natural sweetness without added sugar.","\u062a\u062d\u0645\u064a\u0635 \u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a (\u0627\u0644\u0628\u0631\u0648\u0643\u0644\u064a\u060c \u0627\u0644\u0642\u0631\u0646\u0628\u064a\u0637\u060c \u0627\u0644\u062c\u0632\u0631) \u0639\u0644\u0649 \u062d\u0631\u0627\u0631\u0629 \u0639\u0627\u0644\u064a\u0629 \u064a\u0628\u0631\u0632 \u062d\u0644\u0627\u0648\u062a\u0647\u0627 \u0627\u0644\u0637\u0628\u064a\u0639\u064a\u0629 \u062f\u0648\u0646 \u0625\u0636\u0627\u0641\u0629 \u0633\u0643\u0631.","NHS"],t.w)
B.aeq=new A.c(B.c,["Crushing or chopping garlic and letting it sit for 10 minutes before cooking maximizes the formation of beneficial allicin.","\u0647\u0631\u0633 \u0627\u0644\u062b\u0648\u0645 \u0623\u0648 \u062a\u0642\u0637\u064a\u0639\u0647 \u0648\u062a\u0631\u0643\u0647 \u0644\u0645\u062f\u0629 10 \u062f\u0642\u0627\u0626\u0642 \u0642\u0628\u0644 \u0627\u0644\u0637\u0647\u064a \u064a\u0632\u064a\u062f \u0645\u0646 \u062a\u0643\u0648\u0651\u0646 \u0645\u0627\u062f\u0629 \u0627\u0644\u0623\u0644\u064a\u0633\u064a\u0646 \u0627\u0644\u0645\u0641\u064a\u062f\u0629.","Harvard Health"],t.w)
B.adi=new A.c(B.c,["Using whole herbs and spices not only adds flavor but also provides small amounts of antioxidants.","\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0623\u0639\u0634\u0627\u0628 \u0648\u0627\u0644\u062a\u0648\u0627\u0628\u0644 \u0627\u0644\u0643\u0627\u0645\u0644\u0629 \u0644\u0627 \u064a\u0636\u064a\u0641 \u0646\u0643\u0647\u0629 \u0641\u062d\u0633\u0628\u060c \u0628\u0644 \u064a\u0648\u0641\u0631 \u0623\u064a\u0636\u0627\u064b \u0643\u0645\u064a\u0627\u062a \u0635\u063a\u064a\u0631\u0629 \u0645\u0646 \u0645\u0636\u0627\u062f\u0627\u062a \u0627\u0644\u0623\u0643\u0633\u062f\u0629.","Mayo Clinic"],t.w)
B.abP=new A.c(B.c,["Blanching vegetables (brief boiling then ice bath) preserves color, texture, and nutrients for later use.","\u0633\u0644\u0642 \u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u0644\u0641\u062a\u0631\u0629 \u0648\u062c\u064a\u0632\u0629 \u062b\u0645 \u062a\u0628\u0631\u064a\u062f\u0647\u0627 \u0641\u064a \u0645\u0627\u0621 \u0645\u062b\u0644\u0651\u062c \u064a\u062d\u0627\u0641\u0638 \u0639\u0644\u0649 \u0644\u0648\u0646\u0647\u0627 \u0648\u0642\u0648\u0627\u0645\u0647\u0627 \u0648\u0639\u0646\u0627\u0635\u0631\u0647\u0627 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0644\u0627\u0633\u062a\u062e\u062f\u0627\u0645\u0647\u0627 \u0644\u0627\u062d\u0642\u0627\u064b.","Harvard Health"],t.w)
B.agr=new A.c(B.c,["Slow cooking is ideal for tough, lean cuts of meat, making them tender without added fat.","\u0627\u0644\u0637\u0647\u064a \u0627\u0644\u0628\u0637\u064a\u0621 \u0645\u062b\u0627\u0644\u064a \u0644\u0642\u0637\u0639 \u0627\u0644\u0644\u062d\u0645 \u0627\u0644\u0642\u0627\u0633\u064a\u0629 \u0648\u0627\u0644\u0642\u0644\u064a\u0644\u0629 \u0627\u0644\u062f\u0647\u0646\u060c \u0625\u0630 \u064a\u062c\u0639\u0644\u0647\u0627 \u0637\u0631\u064a\u0629 \u062f\u0648\u0646 \u0625\u0636\u0627\u0641\u0629 \u062f\u0647\u0648\u0646.","NHS"],t.w)
B.ahY=new A.c(B.c,["Adding a small amount of healthy fat (olive oil) when cooking vegetables improves absorption of fat-soluble vitamins A, D, E, and K.","\u0625\u0636\u0627\u0641\u0629 \u0643\u0645\u064a\u0629 \u0635\u063a\u064a\u0631\u0629 \u0645\u0646 \u0627\u0644\u062f\u0647\u0648\u0646 \u0627\u0644\u0635\u062d\u064a\u0629 (\u0632\u064a\u062a \u0627\u0644\u0632\u064a\u062a\u0648\u0646) \u0639\u0646\u062f \u0637\u0647\u064a \u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u064a\u062d\u0633\u0651\u0646 \u0627\u0645\u062a\u0635\u0627\u0635 \u0627\u0644\u0641\u064a\u062a\u0627\u0645\u064a\u0646\u0627\u062a \u0627\u0644\u0630\u0627\u0626\u0628\u0629 \u0641\u064a \u0627\u0644\u062f\u0647\u0648\u0646 A \u0648D \u0648E \u0648K.","Harvard Health"],t.w)
B.af0=new A.c(B.c,["Tomatoes release more lycopene (a beneficial antioxidant) when cooked than when eaten raw.","\u064a\u064f\u0637\u0644\u0642 \u0627\u0644\u0637\u0645\u0627\u0637\u0645 \u0643\u0645\u064a\u0629 \u0623\u0643\u0628\u0631 \u0645\u0646 \u0627\u0644\u0644\u064a\u0643\u0648\u0628\u064a\u0646 (\u0645\u0636\u0627\u062f \u0623\u0643\u0633\u062f\u0629 \u0645\u0641\u064a\u062f) \u0639\u0646\u062f \u0637\u0647\u064a\u0647\u0627 \u0645\u0642\u0627\u0631\u0646\u0629 \u0628\u062a\u0646\u0627\u0648\u0644\u0647\u0627 \u0646\u064a\u0626\u0629.","Harvard Health"],t.w)
B.abj=new A.c(B.c,["Stir-frying at high heat for a short time preserves nutrients and requires only a small amount of oil.","\u0627\u0644\u0642\u0644\u064a \u0627\u0644\u0633\u0631\u064a\u0639 \u0628\u0627\u0644\u062a\u062d\u0631\u064a\u0643 \u0639\u0644\u0649 \u062d\u0631\u0627\u0631\u0629 \u0639\u0627\u0644\u064a\u0629 \u0644\u0641\u062a\u0631\u0629 \u0642\u0635\u064a\u0631\u0629 \u064a\u062d\u0627\u0641\u0638 \u0639\u0644\u0649 \u0627\u0644\u0639\u0646\u0627\u0635\u0631 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0648\u0644\u0627 \u064a\u062a\u0637\u0644\u0628 \u0633\u0648\u0649 \u0643\u0645\u064a\u0629 \u0642\u0644\u064a\u0644\u0629 \u0645\u0646 \u0627\u0644\u0632\u064a\u062a.","Mayo Clinic"],t.w)
B.abr=new A.c(B.c,['Using a vegetable spiralizer to make zucchini or carrot "noodles" is a simple way to eat more vegetables.','\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0623\u062f\u0627\u0629 \u062a\u0642\u0637\u064a\u0639 \u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u0627\u0644\u062d\u0644\u0632\u0648\u0646\u064a\u0629 \u0644\u0635\u0646\u0639 "\u0646\u0648\u062f\u0644\u0632" \u0645\u0646 \u0627\u0644\u0643\u0648\u0633\u0627 \u0623\u0648 \u0627\u0644\u062c\u0632\u0631 \u0637\u0631\u064a\u0642\u0629 \u0628\u0633\u064a\u0637\u0629 \u0644\u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0645\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a.',"NHS"],t.w)
B.af_=new A.c(B.c,["Freezing fresh produce at peak ripeness retains most of its nutritional value for months.","\u062a\u062c\u0645\u064a\u062f \u0627\u0644\u0645\u0646\u062a\u062c\u0627\u062a \u0627\u0644\u0637\u0627\u0632\u062c\u0629 \u0641\u064a \u0630\u0631\u0648\u0629 \u0646\u0636\u062c\u0647\u0627 \u064a\u062d\u062a\u0641\u0638 \u0628\u0645\u0639\u0638\u0645 \u0642\u064a\u0645\u062a\u0647\u0627 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0644\u0639\u062f\u0629 \u0623\u0634\u0647\u0631.","Harvard Health"],t.w)
B.abI=new A.c(B.c,["Rinsing canned beans and vegetables removes up to 40% of the added sodium.","\u0634\u0637\u0641 \u0627\u0644\u0641\u0627\u0635\u0648\u0644\u064a\u0627 \u0648\u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u0627\u0644\u0645\u0639\u0644\u0651\u0628\u0629 \u064a\u0632\u064a\u0644 \u0645\u0627 \u064a\u0635\u0644 \u0625\u0644\u0649 40% \u0645\u0646 \u0627\u0644\u0635\u0648\u062f\u064a\u0648\u0645 \u0627\u0644\u0645\u0636\u0627\u0641.","Mayo Clinic"],t.w)
B.ado=new A.c(B.c,["Batch-cooking grains (rice, quinoa) on the weekend saves time and encourages healthier meals during the week.","\u0637\u0647\u064a \u0627\u0644\u062d\u0628\u0648\u0628 (\u0627\u0644\u0623\u0631\u0632\u060c \u0627\u0644\u0643\u064a\u0646\u0648\u0627) \u0628\u0643\u0645\u064a\u0627\u062a \u0643\u0628\u064a\u0631\u0629 \u0641\u064a \u0639\u0637\u0644\u0629 \u0646\u0647\u0627\u064a\u0629 \u0627\u0644\u0623\u0633\u0628\u0648\u0639 \u064a\u0648\u0641\u0651\u0631 \u0627\u0644\u0648\u0642\u062a \u0648\u064a\u0634\u062c\u0639 \u0639\u0644\u0649 \u0648\u062c\u0628\u0627\u062a \u0635\u062d\u064a\u0629 \u062e\u0644\u0627\u0644 \u0627\u0644\u0623\u0633\u0628\u0648\u0639.","NHS"],t.w)
B.aiC=new A.c(B.c,["Using citrus zest (lemon, orange) adds bright flavor to dishes without extra calories or sodium.","\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0642\u0634\u0631 \u0627\u0644\u062d\u0645\u0636\u064a\u0627\u062a (\u0627\u0644\u0644\u064a\u0645\u0648\u0646\u060c \u0627\u0644\u0628\u0631\u062a\u0642\u0627\u0644) \u064a\u0636\u064a\u0641 \u0646\u0643\u0647\u0629 \u0645\u0646\u0639\u0634\u0629 \u0644\u0644\u0623\u0637\u0628\u0627\u0642 \u062f\u0648\u0646 \u0633\u0639\u0631\u0627\u062a \u062d\u0631\u0627\u0631\u064a\u0629 \u0623\u0648 \u0635\u0648\u062f\u064a\u0648\u0645 \u0625\u0636\u0627\u0641\u064a.","Harvard Health"],t.w)
B.af3=new A.c(B.c,["Homemade salad dressings with olive oil and vinegar are generally healthier than most store-bought versions.","\u062a\u062a\u0628\u064a\u0644\u0627\u062a \u0627\u0644\u0633\u0644\u0637\u0629 \u0627\u0644\u0645\u0646\u0632\u0644\u064a\u0629 \u0627\u0644\u0645\u0635\u0646\u0648\u0639\u0629 \u0645\u0646 \u0632\u064a\u062a \u0627\u0644\u0632\u064a\u062a\u0648\u0646 \u0648\u0627\u0644\u062e\u0644 \u0623\u0643\u062b\u0631 \u0635\u062d\u0629 \u0639\u0645\u0648\u0645\u0627\u064b \u0645\u0646 \u0645\u0639\u0638\u0645 \u0627\u0644\u0623\u0646\u0648\u0627\u0639 \u0627\u0644\u062c\u0627\u0647\u0632\u0629.","Mayo Clinic"],t.w)
B.adT=new A.c(B.c,["Pressure cooking is one of the fastest methods and retains nutrients well due to shorter cooking times.","\u0627\u0644\u0637\u0647\u064a \u0628\u0627\u0644\u0636\u063a\u0637 \u0645\u0646 \u0623\u0633\u0631\u0639 \u0627\u0644\u0637\u0631\u0642 \u0648\u064a\u062d\u0627\u0641\u0638 \u0639\u0644\u0649 \u0627\u0644\u0639\u0646\u0627\u0635\u0631 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0628\u0634\u0643\u0644 \u062c\u064a\u062f \u0628\u0641\u0636\u0644 \u0623\u0648\u0642\u0627\u062a \u0627\u0644\u0637\u0647\u064a \u0627\u0644\u0642\u0635\u064a\u0631\u0629.","Harvard Health"],t.w)
B.ad2=new A.c(B.c,["Replacing cream-based sauces with tomato or vegetable-based sauces significantly reduces saturated fat and calories.","\u0627\u0633\u062a\u0628\u062f\u0627\u0644 \u0627\u0644\u0635\u0644\u0635\u0627\u062a \u0627\u0644\u0642\u0627\u0626\u0645\u0629 \u0639\u0644\u0649 \u0627\u0644\u0643\u0631\u064a\u0645\u0629 \u0628\u0635\u0644\u0635\u0627\u062a \u0627\u0644\u0637\u0645\u0627\u0637\u0645 \u0623\u0648 \u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u064a\u0642\u0644\u0644 \u0628\u0634\u0643\u0644 \u0643\u0628\u064a\u0631 \u0645\u0646 \u0627\u0644\u062f\u0647\u0648\u0646 \u0627\u0644\u0645\u0634\u0628\u0639\u0629 \u0648\u0627\u0644\u0633\u0639\u0631\u0627\u062a \u0627\u0644\u062d\u0631\u0627\u0631\u064a\u0629.","NHS"],t.w)
B.adS=new A.c(B.c,["Ingredients are listed in descending order by weight; the first few items make up the bulk of the product.","\u062a\u064f\u062f\u0631\u062c \u0627\u0644\u0645\u0643\u0648\u0646\u0627\u062a \u0628\u062a\u0631\u062a\u064a\u0628 \u062a\u0646\u0627\u0632\u0644\u064a \u062d\u0633\u0628 \u0627\u0644\u0648\u0632\u0646\u061b \u0648\u0627\u0644\u0639\u0646\u0627\u0635\u0631 \u0627\u0644\u0623\u0648\u0644\u0649 \u0641\u064a \u0627\u0644\u0642\u0627\u0626\u0645\u0629 \u062a\u0634\u0643\u0651\u0644 \u0627\u0644\u062c\u0632\u0621 \u0627\u0644\u0623\u0643\u0628\u0631 \u0645\u0646 \u0627\u0644\u0645\u0646\u062a\u062c.","NHS"],t.w)
B.agt=new A.c(B.c,['The "per 100 g" column on nutrition labels allows you to compare different products fairly.','\u0639\u0645\u0648\u062f "\u0644\u0643\u0644 100 \u063a\u0631\u0627\u0645" \u0639\u0644\u0649 \u0645\u0644\u0635\u0642\u0627\u062a \u0627\u0644\u062a\u063a\u0630\u064a\u0629 \u064a\u062a\u064a\u062d \u0644\u0643 \u0645\u0642\u0627\u0631\u0646\u0629 \u0627\u0644\u0645\u0646\u062a\u062c\u0627\u062a \u0627\u0644\u0645\u062e\u062a\u0644\u0641\u0629 \u0628\u0634\u0643\u0644 \u0639\u0627\u062f\u0644.',"NHS"],t.w)
B.ads=new A.c(B.c,['"Light" or "lite" on packaging can refer to flavor, color, or texture \u2014 not necessarily fewer calories.','\u0643\u0644\u0645\u0629 "\u062e\u0641\u064a\u0641" \u0623\u0648 "\u0644\u0627\u064a\u062a" \u0639\u0644\u0649 \u0627\u0644\u0639\u0628\u0648\u0629 \u0642\u062f \u062a\u0634\u064a\u0631 \u0625\u0644\u0649 \u0627\u0644\u0646\u0643\u0647\u0629 \u0623\u0648 \u0627\u0644\u0644\u0648\u0646 \u0623\u0648 \u0627\u0644\u0642\u0648\u0627\u0645 \u2014 \u0648\u0644\u064a\u0633 \u0628\u0627\u0644\u0636\u0631\u0648\u0631\u0629 \u0625\u0644\u0649 \u0633\u0639\u0631\u0627\u062a \u062d\u0631\u0627\u0631\u064a\u0629 \u0623\u0642\u0644.',"Harvard Health"],t.w)
B.aeK=new A.c(B.c,['Foods labeled "fat-free" may compensate with added sugar to maintain taste and texture.','\u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0645\u0635\u0646\u0651\u0641\u0629 "\u062e\u0627\u0644\u064a\u0629 \u0645\u0646 \u0627\u0644\u062f\u0647\u0648\u0646" \u0642\u062f \u062a\u0639\u0648\u0651\u0636 \u0630\u0644\u0643 \u0628\u0625\u0636\u0627\u0641\u0629 \u0627\u0644\u0633\u0643\u0631 \u0644\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u0627\u0644\u0637\u0639\u0645 \u0648\u0627\u0644\u0642\u0648\u0627\u0645.',"Mayo Clinic"],t.w)
B.abA=new A.c(B.c,["Daily Reference Values (%DV) on labels help you understand whether a serving is high or low in a nutrient.","\u0627\u0644\u0642\u064a\u0645 \u0627\u0644\u064a\u0648\u0645\u064a\u0629 \u0627\u0644\u0645\u0631\u062c\u0639\u064a\u0629 (%DV) \u0639\u0644\u0649 \u0627\u0644\u0645\u0644\u0635\u0642\u0627\u062a \u062a\u0633\u0627\u0639\u062f\u0643 \u0641\u064a \u0641\u0647\u0645 \u0645\u0627 \u0625\u0630\u0627 \u0643\u0627\u0646\u062a \u0627\u0644\u062d\u0635\u0629 \u063a\u0646\u064a\u0629 \u0623\u0648 \u0645\u0646\u062e\u0641\u0636\u0629 \u0628\u0639\u0646\u0635\u0631 \u063a\u0630\u0627\u0626\u064a \u0645\u0639\u064a\u0651\u0646.","Harvard Health"],t.w)
B.ags=new A.c(B.c,['"Natural" on a food label has no strict legal definition in many countries and does not guarantee healthfulness.','\u0643\u0644\u0645\u0629 "\u0637\u0628\u064a\u0639\u064a" \u0639\u0644\u0649 \u0645\u0644\u0635\u0642 \u0627\u0644\u0637\u0639\u0627\u0645 \u0644\u064a\u0633 \u0644\u0647\u0627 \u062a\u0639\u0631\u064a\u0641 \u0642\u0627\u0646\u0648\u0646\u064a \u0635\u0627\u0631\u0645 \u0641\u064a \u0643\u062b\u064a\u0631 \u0645\u0646 \u0627\u0644\u0628\u0644\u062f\u0627\u0646 \u0648\u0644\u0627 \u062a\u0636\u0645\u0646 \u0623\u0646 \u0627\u0644\u0645\u0646\u062a\u062c \u0635\u062d\u064a.',"Mayo Clinic"],t.w)
B.adZ=new A.c(B.c,['"Whole grain" should be the first ingredient for bread and cereals to truly be whole grain products.','\u064a\u062c\u0628 \u0623\u0646 \u062a\u0643\u0648\u0646 "\u0627\u0644\u062d\u0628\u0648\u0628 \u0627\u0644\u0643\u0627\u0645\u0644\u0629" \u0627\u0644\u0645\u0643\u0648\u0651\u0646 \u0627\u0644\u0623\u0648\u0644 \u0641\u064a \u0627\u0644\u062e\u0628\u0632 \u0648\u062d\u0628\u0648\u0628 \u0627\u0644\u0625\u0641\u0637\u0627\u0631 \u0644\u064a\u0643\u0648\u0646 \u0627\u0644\u0645\u0646\u062a\u062c \u0645\u0646 \u0627\u0644\u062d\u0628\u0648\u0628 \u0627\u0644\u0643\u0627\u0645\u0644\u0629 \u0641\u0639\u0644\u0627\u064b.',"Harvard Health"],t.w)
B.agN=new A.c(B.c,["Serving sizes on labels may be smaller than what you actually eat; always check and adjust.","\u0623\u062d\u062c\u0627\u0645 \u0627\u0644\u062d\u0635\u0635 \u0639\u0644\u0649 \u0627\u0644\u0645\u0644\u0635\u0642\u0627\u062a \u0642\u062f \u062a\u0643\u0648\u0646 \u0623\u0635\u063a\u0631 \u0645\u0645\u0627 \u062a\u062a\u0646\u0627\u0648\u0644\u0647 \u0641\u0639\u0644\u064a\u0627\u064b\u061b \u062a\u062d\u0642\u0642 \u062f\u0627\u0626\u0645\u0627\u064b \u0648\u0627\u0636\u0628\u0637 \u0627\u0644\u0643\u0645\u064a\u0627\u062a \u0648\u0641\u0642\u0627\u064b \u0644\u0630\u0644\u0643.","NHS"],t.w)
B.aey=new A.c(B.c,['"Organic" refers to how food is produced, not its nutritional content; organic cookies are still cookies.','\u0643\u0644\u0645\u0629 "\u0639\u0636\u0648\u064a" \u062a\u0634\u064a\u0631 \u0625\u0644\u0649 \u0637\u0631\u064a\u0642\u0629 \u0625\u0646\u062a\u0627\u062c \u0627\u0644\u063a\u0630\u0627\u0621 \u0648\u0644\u064a\u0633 \u0625\u0644\u0649 \u0645\u062d\u062a\u0648\u0627\u0647 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u061b \u0641\u0627\u0644\u0628\u0633\u0643\u0648\u064a\u062a \u0627\u0644\u0639\u0636\u0648\u064a \u0644\u0627 \u064a\u0632\u0627\u0644 \u0628\u0633\u0643\u0648\u064a\u062a\u0627\u064b.',"Harvard Health"],t.w)
B.ahI=new A.c(B.c,["Traffic-light labels (UK system) make it easy to see at a glance if a food is high in fat, salt, or sugar.","\u0645\u0644\u0635\u0642\u0627\u062a \u0625\u0634\u0627\u0631\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 (\u0627\u0644\u0646\u0638\u0627\u0645 \u0627\u0644\u0628\u0631\u064a\u0637\u0627\u0646\u064a) \u062a\u0633\u0647\u0651\u0644 \u0645\u0639\u0631\u0641\u0629 \u0645\u0627 \u0625\u0630\u0627 \u0643\u0627\u0646 \u0627\u0644\u0637\u0639\u0627\u0645 \u063a\u0646\u064a\u0627\u064b \u0628\u0627\u0644\u062f\u0647\u0648\u0646 \u0623\u0648 \u0627\u0644\u0645\u0644\u062d \u0623\u0648 \u0627\u0644\u0633\u0643\u0631 \u0628\u0646\u0638\u0631\u0629 \u0633\u0631\u064a\u0639\u0629.","NHS"],t.w)
B.ahR=new A.c(B.c,['"Multigrain" means multiple grains were used, but they may all be refined; look for "whole grain" instead.','\u0643\u0644\u0645\u0629 "\u0645\u062a\u0639\u062f\u062f \u0627\u0644\u062d\u0628\u0648\u0628" \u062a\u0639\u0646\u064a \u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0639\u062f\u0629 \u0623\u0646\u0648\u0627\u0639 \u0645\u0646 \u0627\u0644\u062d\u0628\u0648\u0628\u060c \u0644\u0643\u0646\u0647\u0627 \u0642\u062f \u062a\u0643\u0648\u0646 \u062c\u0645\u064a\u0639\u0647\u0627 \u0645\u0643\u0631\u0631\u0629\u061b \u0627\u0628\u062d\u062b \u0639\u0646 "\u062d\u0628\u0648\u0628 \u0643\u0627\u0645\u0644\u0629" \u0628\u062f\u0644\u0627\u064b \u0645\u0646 \u0630\u0644\u0643.',"Harvard Health"],t.w)
B.acT=new A.c(B.c,["Added sugars on labels include syrups, honey, and concentrated fruit juices used as sweeteners.","\u0627\u0644\u0633\u0643\u0631\u064a\u0627\u062a \u0627\u0644\u0645\u0636\u0627\u0641\u0629 \u0639\u0644\u0649 \u0627\u0644\u0645\u0644\u0635\u0642\u0627\u062a \u062a\u0634\u0645\u0644 \u0627\u0644\u0634\u0631\u0627\u0628 \u0648\u0627\u0644\u0639\u0633\u0644 \u0648\u0639\u0635\u0627\u0626\u0631 \u0627\u0644\u0641\u0627\u0643\u0647\u0629 \u0627\u0644\u0645\u0631\u0643\u0651\u0632\u0629 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645\u0629 \u0643\u0645\u062d\u0644\u0651\u064a\u0627\u062a.","Mayo Clinic"],t.w)
B.aex=new A.c(B.c,['Nutrition claims like "good source of" typically mean the food provides 10\u201319% of the Daily Value per serving.','\u0639\u0628\u0627\u0631\u0627\u062a \u0645\u062b\u0644 "\u0645\u0635\u062f\u0631 \u062c\u064a\u062f \u0644\u0640" \u062a\u0639\u0646\u064a \u0639\u0627\u062f\u0629\u064b \u0623\u0646 \u0627\u0644\u0637\u0639\u0627\u0645 \u064a\u0648\u0641\u0631 10-19% \u0645\u0646 \u0627\u0644\u0642\u064a\u0645\u0629 \u0627\u0644\u064a\u0648\u0645\u064a\u0629 \u0644\u0643\u0644 \u062d\u0635\u0629.',"Harvard Health"],t.w)
B.adv=new A.c(B.c,["Allergen information is usually highlighted in bold or listed separately; always check if you have food sensitivities.","\u0645\u0639\u0644\u0648\u0645\u0627\u062a \u0645\u0633\u0628\u0628\u0627\u062a \u0627\u0644\u062d\u0633\u0627\u0633\u064a\u0629 \u0639\u0627\u062f\u0629\u064b \u0645\u0627 \u062a\u0643\u0648\u0646 \u0645\u0645\u064a\u0651\u0632\u0629 \u0628\u062e\u0637 \u0639\u0631\u064a\u0636 \u0623\u0648 \u0645\u062f\u0631\u062c\u0629 \u0628\u0634\u0643\u0644 \u0645\u0646\u0641\u0635\u0644\u061b \u062a\u062d\u0642\u0642 \u0645\u0646\u0647\u0627 \u062f\u0627\u0626\u0645\u0627\u064b \u0625\u0630\u0627 \u0643\u0627\u0646\u062a \u0644\u062f\u064a\u0643 \u062d\u0633\u0627\u0633\u064a\u0629 \u063a\u0630\u0627\u0626\u064a\u0629.","NHS"],t.w)
B.acX=new A.c(B.c,["Comparing price per 100 g across brands helps you find the best value for nutritionally similar products.","\u0645\u0642\u0627\u0631\u0646\u0629 \u0627\u0644\u0633\u0639\u0631 \u0644\u0643\u0644 100 \u063a\u0631\u0627\u0645 \u0628\u064a\u0646 \u0627\u0644\u0639\u0644\u0627\u0645\u0627\u062a \u0627\u0644\u062a\u062c\u0627\u0631\u064a\u0629 \u064a\u0633\u0627\u0639\u062f\u0643 \u0641\u064a \u0627\u0644\u0639\u062b\u0648\u0631 \u0639\u0644\u0649 \u0623\u0641\u0636\u0644 \u0642\u064a\u0645\u0629 \u0644\u0644\u0645\u0646\u062a\u062c\u0627\u062a \u0627\u0644\u0645\u062a\u0634\u0627\u0628\u0647\u0629 \u063a\u0630\u0627\u0626\u064a\u0627\u064b.","NHS"],t.w)
B.aeA=new A.c(B.c,["Eating at least five portions (400 g) of fruit and vegetables per day is associated with lower mortality from all causes.","\u062a\u0646\u0627\u0648\u0644 \u062e\u0645\u0633 \u062d\u0635\u0635 \u0639\u0644\u0649 \u0627\u0644\u0623\u0642\u0644 (400 \u063a\u0631\u0627\u0645) \u0645\u0646 \u0627\u0644\u0641\u0648\u0627\u0643\u0647 \u0648\u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u064a\u0648\u0645\u064a\u0627\u064b \u064a\u0631\u062a\u0628\u0637 \u0628\u0627\u0646\u062e\u0641\u0627\u0636 \u0645\u0639\u062f\u0644 \u0627\u0644\u0648\u0641\u064a\u0627\u062a \u0645\u0646 \u062c\u0645\u064a\u0639 \u0627\u0644\u0623\u0633\u0628\u0627\u0628.","WHO"],t.w)
B.aeE=new A.c(B.c,["Fresh, frozen, canned (in juice, not syrup), and dried fruits all count toward your five-a-day.","\u0627\u0644\u0641\u0648\u0627\u0643\u0647 \u0627\u0644\u0637\u0627\u0632\u062c\u0629 \u0648\u0627\u0644\u0645\u062c\u0645\u062f\u0629 \u0648\u0627\u0644\u0645\u0639\u0644\u0651\u0628\u0629 (\u0641\u064a \u0639\u0635\u064a\u0631\u0647\u0627 \u0648\u0644\u064a\u0633 \u0641\u064a \u0634\u0631\u0627\u0628) \u0648\u0627\u0644\u0645\u062c\u0641\u0641\u0629 \u062c\u0645\u064a\u0639\u0647\u0627 \u062a\u064f\u062d\u062a\u0633\u0628 \u0636\u0645\u0646 \u062d\u0635\u0635\u0643 \u0627\u0644\u064a\u0648\u0645\u064a\u0629 \u0627\u0644\u062e\u0645\u0633.","NHS"],t.w)
B.ag8=new A.c(B.c,["Eating a rainbow of different colored produce ensures a wide variety of phytonutrients and antioxidants.","\u062a\u0646\u0627\u0648\u0644 \u062a\u0634\u0643\u064a\u0644\u0629 \u0645\u062a\u0646\u0648\u0639\u0629 \u0627\u0644\u0623\u0644\u0648\u0627\u0646 \u0645\u0646 \u0627\u0644\u0641\u0648\u0627\u0643\u0647 \u0648\u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u064a\u0636\u0645\u0646 \u0627\u0644\u062d\u0635\u0648\u0644 \u0639\u0644\u0649 \u0645\u062c\u0645\u0648\u0639\u0629 \u0648\u0627\u0633\u0639\u0629 \u0645\u0646 \u0627\u0644\u0645\u063a\u0630\u064a\u0627\u062a \u0627\u0644\u0646\u0628\u0627\u062a\u064a\u0629 \u0648\u0645\u0636\u0627\u062f\u0627\u062a \u0627\u0644\u0623\u0643\u0633\u062f\u0629.","Harvard Health"],t.w)
B.af5=new A.c(B.c,["Cruciferous vegetables (broccoli, cauliflower, cabbage, Brussels sprouts) contain compounds linked to cancer risk reduction.","\u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u0627\u0644\u0635\u0644\u064a\u0628\u064a\u0629 (\u0627\u0644\u0628\u0631\u0648\u0643\u0644\u064a\u060c \u0627\u0644\u0642\u0631\u0646\u0628\u064a\u0637\u060c \u0627\u0644\u0645\u0644\u0641\u0648\u0641\u060c \u0643\u0631\u0646\u0628 \u0628\u0631\u0648\u0643\u0633\u0644) \u062a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u0645\u0631\u0643\u0628\u0627\u062a \u0645\u0631\u062a\u0628\u0637\u0629 \u0628\u062a\u0642\u0644\u064a\u0644 \u062e\u0637\u0631 \u0627\u0644\u0625\u0635\u0627\u0628\u0629 \u0628\u0627\u0644\u0633\u0631\u0637\u0627\u0646.","Harvard Health"],t.w)
B.abV=new A.c(B.c,["Leafy greens like spinach and kale are among the most nutrient-dense foods available per calorie.","\u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u0627\u0644\u0648\u0631\u0642\u064a\u0629 \u0645\u062b\u0644 \u0627\u0644\u0633\u0628\u0627\u0646\u062e \u0648\u0627\u0644\u0643\u0631\u0646\u0628 \u0627\u0644\u0623\u062c\u0639\u062f \u0645\u0646 \u0623\u0643\u062b\u0631 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0643\u062b\u0627\u0641\u0629 \u0628\u0627\u0644\u0639\u0646\u0627\u0635\u0631 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0645\u0642\u0627\u0631\u0646\u0629 \u0628\u0633\u0639\u0631\u0627\u062a\u0647\u0627 \u0627\u0644\u062d\u0631\u0627\u0631\u064a\u0629.","Harvard Health"],t.w)
B.agA=new A.c(B.c,["Potatoes do not count toward your five-a-day because they are classified as starchy foods, not vegetables.","\u0627\u0644\u0628\u0637\u0627\u0637\u0633 \u0644\u0627 \u062a\u064f\u062d\u062a\u0633\u0628 \u0636\u0645\u0646 \u0627\u0644\u062d\u0635\u0635 \u0627\u0644\u064a\u0648\u0645\u064a\u0629 \u0627\u0644\u062e\u0645\u0633 \u0644\u0623\u0646\u0647\u0627 \u062a\u064f\u0635\u0646\u0651\u0641 \u0636\u0645\u0646 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0646\u0634\u0648\u064a\u0629 \u0648\u0644\u064a\u0633 \u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a.","NHS"],t.w)
B.afD=new A.c(B.c,["One portion of fresh fruit is roughly 80 g, about the size of a tennis ball or a medium apple.","\u062d\u0635\u0629 \u0648\u0627\u062d\u062f\u0629 \u0645\u0646 \u0627\u0644\u0641\u0627\u0643\u0647\u0629 \u0627\u0644\u0637\u0627\u0632\u062c\u0629 \u062a\u0628\u0644\u063a \u062a\u0642\u0631\u064a\u0628\u0627\u064b 80 \u063a\u0631\u0627\u0645\u0627\u064b\u060c \u0623\u064a \u0628\u062d\u062c\u0645 \u0643\u0631\u0629 \u0627\u0644\u062a\u0646\u0633 \u0623\u0648 \u062a\u0641\u0627\u062d\u0629 \u0645\u062a\u0648\u0633\u0637\u0629.","NHS"],t.w)
B.aeS=new A.c(B.c,["Berries are particularly high in antioxidants and have been linked to improved brain function in aging.","\u0627\u0644\u062a\u0648\u062a \u063a\u0646\u064a \u0628\u0634\u0643\u0644 \u062e\u0627\u0635 \u0628\u0645\u0636\u0627\u062f\u0627\u062a \u0627\u0644\u0623\u0643\u0633\u062f\u0629 \u0648\u0642\u062f \u0627\u0631\u062a\u0628\u0637 \u0628\u062a\u062d\u0633\u064a\u0646 \u0648\u0638\u0627\u0626\u0641 \u0627\u0644\u062f\u0645\u0627\u063a \u0645\u0639 \u0627\u0644\u062a\u0642\u062f\u0645 \u0641\u064a \u0627\u0644\u0639\u0645\u0631.","Harvard Health"],t.w)
B.aba=new A.c(B.c,["Frozen vegetables are often flash-frozen at peak ripeness and can be just as nutritious as fresh.","\u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u0627\u0644\u0645\u062c\u0645\u062f\u0629 \u063a\u0627\u0644\u0628\u0627\u064b \u0645\u0627 \u062a\u064f\u062c\u0645\u0651\u062f \u0628\u0633\u0631\u0639\u0629 \u0641\u064a \u0630\u0631\u0648\u0629 \u0646\u0636\u062c\u0647\u0627 \u0648\u064a\u0645\u0643\u0646 \u0623\u0646 \u062a\u0643\u0648\u0646 \u0645\u063a\u0630\u064a\u0629 \u0628\u0642\u062f\u0631 \u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u0627\u0644\u0637\u0627\u0632\u062c\u0629.","Harvard Health"],t.w)
B.agu=new A.c(B.c,["Eating fruit whole provides more fiber and leads to a slower sugar release than drinking fruit juice.","\u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0641\u0627\u0643\u0647\u0629 \u0643\u0627\u0645\u0644\u0629 \u064a\u0648\u0641\u0631 \u0623\u0644\u064a\u0627\u0641 \u0623\u0643\u062b\u0631 \u0648\u064a\u0624\u062f\u064a \u0625\u0644\u0649 \u0625\u0637\u0644\u0627\u0642 \u0623\u0628\u0637\u0623 \u0644\u0644\u0633\u0643\u0631 \u0645\u0642\u0627\u0631\u0646\u0629 \u0628\u0634\u0631\u0628 \u0639\u0635\u064a\u0631 \u0627\u0644\u0641\u0627\u0643\u0647\u0629.","NHS"],t.w)
B.aeL=new A.c(B.c,["Not all fats are equal; unsaturated fats (found in olive oil, nuts, avocados) are beneficial for health.","\u0644\u064a\u0633\u062a \u0643\u0644 \u0627\u0644\u062f\u0647\u0648\u0646 \u0645\u062a\u0633\u0627\u0648\u064a\u0629\u061b \u0641\u0627\u0644\u062f\u0647\u0648\u0646 \u063a\u064a\u0631 \u0627\u0644\u0645\u0634\u0628\u0639\u0629 (\u0627\u0644\u0645\u0648\u062c\u0648\u062f\u0629 \u0641\u064a \u0632\u064a\u062a \u0627\u0644\u0632\u064a\u062a\u0648\u0646 \u0648\u0627\u0644\u0645\u0643\u0633\u0631\u0627\u062a \u0648\u0627\u0644\u0623\u0641\u0648\u0643\u0627\u062f\u0648) \u0645\u0641\u064a\u062f\u0629 \u0644\u0644\u0635\u062d\u0629.","Harvard Health"],t.w)
B.abp=new A.c(B.c,["Saturated fat intake should be less than 10% of total daily energy; replace with unsaturated fats where possible.","\u064a\u062c\u0628 \u0623\u0646 \u064a\u0643\u0648\u0646 \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u062f\u0647\u0648\u0646 \u0627\u0644\u0645\u0634\u0628\u0639\u0629 \u0623\u0642\u0644 \u0645\u0646 10% \u0645\u0646 \u0625\u062c\u0645\u0627\u0644\u064a \u0627\u0644\u0637\u0627\u0642\u0629 \u0627\u0644\u064a\u0648\u0645\u064a\u0629\u061b \u0648\u0627\u0633\u062a\u0628\u062f\u0644\u0647\u0627 \u0628\u0627\u0644\u062f\u0647\u0648\u0646 \u063a\u064a\u0631 \u0627\u0644\u0645\u0634\u0628\u0639\u0629 \u0643\u0644\u0645\u0627 \u0623\u0645\u0643\u0646.","WHO"],t.w)
B.adD=new A.c(B.c,["Avocados provide heart-healthy monounsaturated fat along with potassium and fiber.","\u0627\u0644\u0623\u0641\u0648\u0643\u0627\u062f\u0648 \u064a\u0648\u0641\u0631 \u062f\u0647\u0648\u0646\u0627\u064b \u0623\u062d\u0627\u062f\u064a\u0629 \u063a\u064a\u0631 \u0645\u0634\u0628\u0639\u0629 \u0645\u0641\u064a\u062f\u0629 \u0644\u0644\u0642\u0644\u0628 \u0625\u0644\u0649 \u062c\u0627\u0646\u0628 \u0627\u0644\u0628\u0648\u062a\u0627\u0633\u064a\u0648\u0645 \u0648\u0627\u0644\u0623\u0644\u064a\u0627\u0641.","Harvard Health"],t.w)
B.abF=new A.c(B.c,["Extra virgin olive oil is rich in polyphenols and is a cornerstone of the heart-healthy Mediterranean diet.","\u0632\u064a\u062a \u0627\u0644\u0632\u064a\u062a\u0648\u0646 \u0627\u0644\u0628\u0643\u0631 \u0627\u0644\u0645\u0645\u062a\u0627\u0632 \u063a\u0646\u064a \u0628\u0645\u0631\u0643\u0628\u0627\u062a \u0627\u0644\u0628\u0648\u0644\u064a\u0641\u064a\u0646\u0648\u0644 \u0648\u0647\u0648 \u0631\u0643\u064a\u0632\u0629 \u0623\u0633\u0627\u0633\u064a\u0629 \u0641\u064a \u062d\u0645\u064a\u0629 \u0627\u0644\u0628\u062d\u0631 \u0627\u0644\u0623\u0628\u064a\u0636 \u0627\u0644\u0645\u062a\u0648\u0633\u0637 \u0627\u0644\u0635\u062d\u064a\u0629 \u0644\u0644\u0642\u0644\u0628.","Harvard Health"],t.w)
B.abn=new A.c(B.c,["Oily fish (salmon, mackerel, herring) are the best dietary source of omega-3 EPA and DHA fatty acids.","\u0627\u0644\u0623\u0633\u0645\u0627\u0643 \u0627\u0644\u062f\u0647\u0646\u064a\u0629 (\u0627\u0644\u0633\u0644\u0645\u0648\u0646\u060c \u0627\u0644\u0645\u0627\u0643\u0631\u064a\u0644\u060c \u0627\u0644\u0631\u0646\u062c\u0629) \u0647\u064a \u0623\u0641\u0636\u0644 \u0645\u0635\u062f\u0631 \u063a\u0630\u0627\u0626\u064a \u0644\u0623\u062d\u0645\u0627\u0636 \u0623\u0648\u0645\u064a\u063a\u0627-3 \u0627\u0644\u062f\u0647\u0646\u064a\u0629 EPA \u0648DHA.","NHS"],t.w)
B.ag7=new A.c(B.c,["Walnuts are unique among nuts because they provide a significant amount of plant-based omega-3 (ALA).","\u0627\u0644\u062c\u0648\u0632 \u0641\u0631\u064a\u062f \u0628\u064a\u0646 \u0627\u0644\u0645\u0643\u0633\u0631\u0627\u062a \u0644\u0623\u0646\u0647 \u064a\u0648\u0641\u0631 \u0643\u0645\u064a\u0629 \u0643\u0628\u064a\u0631\u0629 \u0645\u0646 \u0623\u0648\u0645\u064a\u063a\u0627-3 \u0627\u0644\u0646\u0628\u0627\u062a\u064a (\u062d\u0645\u0636 \u0623\u0644\u0641\u0627-\u0644\u064a\u0646\u0648\u0644\u064a\u0646\u064a\u0643).","Harvard Health"],t.w)
B.afR=new A.c(B.c,["Trans fats, found in some processed foods, raise LDL cholesterol and lower HDL cholesterol \u2014 the worst combination.","\u0627\u0644\u062f\u0647\u0648\u0646 \u0627\u0644\u0645\u062a\u062d\u0648\u0644\u0629 \u0627\u0644\u0645\u0648\u062c\u0648\u062f\u0629 \u0641\u064a \u0628\u0639\u0636 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0645\u0635\u0646\u0651\u0639\u0629 \u062a\u0631\u0641\u0639 \u0627\u0644\u0643\u0648\u0644\u064a\u0633\u062a\u0631\u0648\u0644 \u0627\u0644\u0636\u0627\u0631 \u0648\u062a\u062e\u0641\u0636 \u0627\u0644\u0643\u0648\u0644\u064a\u0633\u062a\u0631\u0648\u0644 \u0627\u0644\u0646\u0627\u0641\u0639 \u2014 \u0648\u0647\u0648 \u0623\u0633\u0648\u0623 \u0645\u0632\u064a\u062c.","WHO"],t.w)
B.abi=new A.c(B.c,["Flaxseeds and chia seeds are rich plant sources of alpha-linolenic acid (ALA), an omega-3 fatty acid.","\u0628\u0630\u0648\u0631 \u0627\u0644\u0643\u062a\u0627\u0646 \u0648\u0628\u0630\u0648\u0631 \u0627\u0644\u0634\u064a\u0627 \u0645\u0635\u0627\u062f\u0631 \u0646\u0628\u0627\u062a\u064a\u0629 \u063a\u0646\u064a\u0629 \u0628\u062d\u0645\u0636 \u0623\u0644\u0641\u0627-\u0644\u064a\u0646\u0648\u0644\u064a\u0646\u064a\u0643 (ALA)\u060c \u0648\u0647\u0648 \u062d\u0645\u0636 \u062f\u0647\u0646\u064a \u0645\u0646 \u0623\u0648\u0645\u064a\u063a\u0627-3.","Harvard Health"],t.w)
B.abd=new A.c(B.c,["Full-fat dairy in moderation may be part of a healthy diet; the overall dietary pattern matters more than single foods.","\u0645\u0646\u062a\u062c\u0627\u062a \u0627\u0644\u0623\u0644\u0628\u0627\u0646 \u0643\u0627\u0645\u0644\u0629 \u0627\u0644\u062f\u0633\u0645 \u0628\u0627\u0639\u062a\u062f\u0627\u0644 \u0642\u062f \u062a\u0643\u0648\u0646 \u062c\u0632\u0621\u0627\u064b \u0645\u0646 \u0646\u0638\u0627\u0645 \u063a\u0630\u0627\u0626\u064a \u0635\u062d\u064a\u061b \u0641\u0627\u0644\u0646\u0645\u0637 \u0627\u0644\u063a\u0630\u0627\u0626\u064a \u0627\u0644\u0639\u0627\u0645 \u0623\u0647\u0645 \u0645\u0646 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0645\u0646\u0641\u0631\u062f\u0629.","Harvard Health"],t.w)
B.aaV=new A.c(B.c,["Coconut oil is high in saturated fat; while not harmful in small amounts, it should not replace olive oil as your primary cooking fat.","\u0632\u064a\u062a \u062c\u0648\u0632 \u0627\u0644\u0647\u0646\u062f \u063a\u0646\u064a \u0628\u0627\u0644\u062f\u0647\u0648\u0646 \u0627\u0644\u0645\u0634\u0628\u0639\u0629\u061b \u0648\u0631\u063a\u0645 \u0623\u0646\u0647 \u0644\u064a\u0633 \u0636\u0627\u0631\u0627\u064b \u0628\u0643\u0645\u064a\u0627\u062a \u0635\u063a\u064a\u0631\u0629\u060c \u0625\u0644\u0627 \u0623\u0646\u0647 \u0644\u0627 \u064a\u0646\u0628\u063a\u064a \u0623\u0646 \u064a\u062d\u0644\u0651 \u0645\u062d\u0644 \u0632\u064a\u062a \u0627\u0644\u0632\u064a\u062a\u0648\u0646 \u0643\u0632\u064a\u062a \u0627\u0644\u0637\u0647\u064a \u0627\u0644\u0623\u0633\u0627\u0633\u064a.","Harvard Health"],t.w)
B.acP=new A.c(B.c,["Poor sleep increases levels of ghrelin (the hunger hormone) and decreases leptin (the fullness hormone), promoting overeating.","\u0642\u0644\u0629 \u0627\u0644\u0646\u0648\u0645 \u062a\u0631\u0641\u0639 \u0645\u0633\u062a\u0648\u064a\u0627\u062a \u0647\u0631\u0645\u0648\u0646 \u0627\u0644\u062c\u0631\u064a\u0644\u064a\u0646 (\u0647\u0631\u0645\u0648\u0646 \u0627\u0644\u062c\u0648\u0639) \u0648\u062a\u062e\u0641\u0636 \u0645\u0633\u062a\u0648\u064a\u0627\u062a \u0647\u0631\u0645\u0648\u0646 \u0627\u0644\u0644\u0628\u062a\u064a\u0646 (\u0647\u0631\u0645\u0648\u0646 \u0627\u0644\u0634\u0628\u0639)\u060c \u0645\u0645\u0627 \u064a\u0639\u0632\u0632 \u0627\u0644\u0625\u0641\u0631\u0627\u0637 \u0641\u064a \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0637\u0639\u0627\u0645.","Harvard Health"],t.w)
B.ai2=new A.c(B.c,["Eating a large meal close to bedtime can disrupt sleep quality and increase acid reflux risk.","\u062a\u0646\u0627\u0648\u0644 \u0648\u062c\u0628\u0629 \u0643\u0628\u064a\u0631\u0629 \u0642\u0628\u0644 \u0627\u0644\u0646\u0648\u0645 \u0645\u0628\u0627\u0634\u0631\u0629 \u0642\u062f \u064a\u064f\u062e\u0644\u0651 \u0628\u062c\u0648\u062f\u0629 \u0627\u0644\u0646\u0648\u0645 \u0648\u064a\u0632\u064a\u062f \u0645\u0646 \u062e\u0637\u0631 \u0627\u0644\u0627\u0631\u062a\u062c\u0627\u0639 \u0627\u0644\u062d\u0645\u0636\u064a.","Mayo Clinic"],t.w)
B.abO=new A.c(B.c,["Tart cherry juice is one of the few natural food sources of melatonin and may help improve sleep.","\u0639\u0635\u064a\u0631 \u0627\u0644\u0643\u0631\u0632 \u0627\u0644\u062d\u0627\u0645\u0636 \u0647\u0648 \u0623\u062d\u062f \u0627\u0644\u0645\u0635\u0627\u062f\u0631 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0627\u0644\u0637\u0628\u064a\u0639\u064a\u0629 \u0627\u0644\u0642\u0644\u064a\u0644\u0629 \u0644\u0644\u0645\u064a\u0644\u0627\u062a\u0648\u0646\u064a\u0646 \u0648\u0642\u062f \u064a\u0633\u0627\u0639\u062f \u0641\u064a \u062a\u062d\u0633\u064a\u0646 \u0627\u0644\u0646\u0648\u0645.","Harvard Health"],t.w)
B.ab4=new A.c(B.c,["Magnesium-rich foods (almonds, spinach, pumpkin seeds) may help promote relaxation and better sleep.","\u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u063a\u0646\u064a\u0629 \u0628\u0627\u0644\u0645\u063a\u0646\u064a\u0633\u064a\u0648\u0645 (\u0627\u0644\u0644\u0648\u0632 \u0648\u0627\u0644\u0633\u0628\u0627\u0646\u062e \u0648\u0628\u0630\u0648\u0631 \u0627\u0644\u064a\u0642\u0637\u064a\u0646) \u0642\u062f \u062a\u0633\u0627\u0639\u062f \u0641\u064a \u062a\u0639\u0632\u064a\u0632 \u0627\u0644\u0627\u0633\u062a\u0631\u062e\u0627\u0621 \u0648\u062a\u062d\u0633\u064a\u0646 \u062c\u0648\u062f\u0629 \u0627\u0644\u0646\u0648\u0645.","Mayo Clinic"],t.w)
B.aet=new A.c(B.c,["Caffeine has a half-life of 5\u20136 hours; avoid it after early afternoon to protect sleep quality.","\u064a\u0628\u0644\u063a \u0639\u0645\u0631 \u0627\u0644\u0646\u0635\u0641 \u0644\u0644\u0643\u0627\u0641\u064a\u064a\u0646 \u0645\u0646 5 \u0625\u0644\u0649 6 \u0633\u0627\u0639\u0627\u062a\u061b \u062a\u062c\u0646\u0651\u0628 \u062a\u0646\u0627\u0648\u0644\u0647 \u0628\u0639\u062f \u0623\u0648\u0627\u0626\u0644 \u0641\u062a\u0631\u0629 \u0645\u0627 \u0628\u0639\u062f \u0627\u0644\u0638\u0647\u0631 \u0644\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u062c\u0648\u062f\u0629 \u0627\u0644\u0646\u0648\u0645.","Harvard Health"],t.w)
B.abq=new A.c(B.c,["A light snack combining complex carbs and protein (e.g. whole grain crackers with cheese) may help you fall asleep.","\u0648\u062c\u0628\u0629 \u062e\u0641\u064a\u0641\u0629 \u062a\u062c\u0645\u0639 \u0628\u064a\u0646 \u0627\u0644\u0643\u0631\u0628\u0648\u0647\u064a\u062f\u0631\u0627\u062a \u0627\u0644\u0645\u0639\u0642\u062f\u0629 \u0648\u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 (\u0645\u062b\u0644 \u0627\u0644\u0628\u0633\u0643\u0648\u064a\u062a \u0627\u0644\u0645\u0635\u0646\u0648\u0639 \u0645\u0646 \u0627\u0644\u062d\u0628\u0648\u0628 \u0627\u0644\u0643\u0627\u0645\u0644\u0629 \u0645\u0639 \u0627\u0644\u062c\u0628\u0646) \u0642\u062f \u062a\u0633\u0627\u0639\u062f\u0643 \u0639\u0644\u0649 \u0627\u0644\u0646\u0648\u0645.","Mayo Clinic"],t.w)
B.aeF=new A.c(B.c,["Chronic sleep deprivation is associated with increased cravings for high-sugar, high-fat foods.","\u064a\u0631\u062a\u0628\u0637 \u0627\u0644\u062d\u0631\u0645\u0627\u0646 \u0627\u0644\u0645\u0632\u0645\u0646 \u0645\u0646 \u0627\u0644\u0646\u0648\u0645 \u0628\u0632\u064a\u0627\u062f\u0629 \u0627\u0644\u0631\u063a\u0628\u0629 \u0627\u0644\u0634\u062f\u064a\u062f\u0629 \u0641\u064a \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u063a\u0646\u064a\u0629 \u0628\u0627\u0644\u0633\u0643\u0631 \u0648\u0627\u0644\u062f\u0647\u0648\u0646.","Harvard Health"],t.w)
B.aiK=new A.c(B.c,["Alcohol may help you fall asleep faster but disrupts deep sleep and REM cycles later in the night.","\u0642\u062f \u064a\u0633\u0627\u0639\u062f\u0643 \u0627\u0644\u0643\u062d\u0648\u0644 \u0639\u0644\u0649 \u0627\u0644\u0646\u0648\u0645 \u0628\u0634\u0643\u0644 \u0623\u0633\u0631\u0639 \u0644\u0643\u0646\u0647 \u064a\u064f\u062e\u0644\u0651 \u0628\u0627\u0644\u0646\u0648\u0645 \u0627\u0644\u0639\u0645\u064a\u0642 \u0648\u062f\u0648\u0631\u0627\u062a \u062d\u0631\u0643\u0629 \u0627\u0644\u0639\u064a\u0646 \u0627\u0644\u0633\u0631\u064a\u0639\u0629 \u0644\u0627\u062d\u0642\u0627\u064b \u0641\u064a \u0627\u0644\u0644\u064a\u0644.","NHS"],t.w)
B.ah2=new A.c(B.c,["Kiwi fruit eaten before bed has been linked to improved sleep onset and duration in small studies.","\u0623\u0638\u0647\u0631\u062a \u062f\u0631\u0627\u0633\u0627\u062a \u0635\u063a\u064a\u0631\u0629 \u0623\u0646 \u062a\u0646\u0627\u0648\u0644 \u0641\u0627\u0643\u0647\u0629 \u0627\u0644\u0643\u064a\u0648\u064a \u0642\u0628\u0644 \u0627\u0644\u0646\u0648\u0645 \u064a\u0631\u062a\u0628\u0637 \u0628\u062a\u062d\u0633\u064a\u0646 \u0628\u062f\u0627\u064a\u0629 \u0627\u0644\u0646\u0648\u0645 \u0648\u0645\u062f\u062a\u0647.","Harvard Health"],t.w)
B.aih=new A.c(B.c,["Spicy foods before bed can raise body temperature and cause indigestion, both of which impair sleep.","\u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u062d\u0627\u0631\u0629 \u0642\u0628\u0644 \u0627\u0644\u0646\u0648\u0645 \u0642\u062f \u062a\u0631\u0641\u0639 \u062d\u0631\u0627\u0631\u0629 \u0627\u0644\u062c\u0633\u0645 \u0648\u062a\u0633\u0628\u0628 \u0639\u0633\u0631 \u0627\u0644\u0647\u0636\u0645\u060c \u0648\u0643\u0644\u0627\u0647\u0645\u0627 \u064a\u064f\u0636\u0639\u0641 \u062c\u0648\u062f\u0629 \u0627\u0644\u0646\u0648\u0645.","Mayo Clinic"],t.w)
B.adX=new A.c(B.c,["Tryptophan-rich foods (turkey, milk, bananas) are precursors to serotonin and melatonin, supporting sleep.","\u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u063a\u0646\u064a\u0629 \u0628\u0627\u0644\u062a\u0631\u064a\u0628\u062a\u0648\u0641\u0627\u0646 (\u0627\u0644\u062f\u064a\u0643 \u0627\u0644\u0631\u0648\u0645\u064a \u0648\u0627\u0644\u062d\u0644\u064a\u0628 \u0648\u0627\u0644\u0645\u0648\u0632) \u0647\u064a \u0645\u0648\u0627\u062f \u0623\u0648\u0644\u064a\u0629 \u0644\u0644\u0633\u064a\u0631\u0648\u062a\u0648\u0646\u064a\u0646 \u0648\u0627\u0644\u0645\u064a\u0644\u0627\u062a\u0648\u0646\u064a\u0646\u060c \u0645\u0645\u0627 \u064a\u062f\u0639\u0645 \u0627\u0644\u0646\u0648\u0645.","Harvard Health"],t.w)
B.aes=new A.c(B.c,["People who sleep fewer than 7 hours per night tend to consume more calories the following day.","\u064a\u0645\u064a\u0644 \u0627\u0644\u0623\u0634\u062e\u0627\u0635 \u0627\u0644\u0630\u064a\u0646 \u064a\u0646\u0627\u0645\u0648\u0646 \u0623\u0642\u0644 \u0645\u0646 7 \u0633\u0627\u0639\u0627\u062a \u0641\u064a \u0627\u0644\u0644\u064a\u0644\u0629 \u0625\u0644\u0649 \u0627\u0633\u062a\u0647\u0644\u0627\u0643 \u0633\u0639\u0631\u0627\u062a \u062d\u0631\u0627\u0631\u064a\u0629 \u0623\u0643\u062b\u0631 \u0641\u064a \u0627\u0644\u064a\u0648\u0645 \u0627\u0644\u062a\u0627\u0644\u064a.","Harvard Health"],t.w)
B.abK=new A.c(B.c,["Chamomile tea contains apigenin, an antioxidant that may promote sleepiness and reduce insomnia.","\u064a\u062d\u062a\u0648\u064a \u0634\u0627\u064a \u0627\u0644\u0628\u0627\u0628\u0648\u0646\u062c \u0639\u0644\u0649 \u0627\u0644\u0623\u0628\u064a\u062c\u064a\u0646\u064a\u0646\u060c \u0648\u0647\u0648 \u0645\u0636\u0627\u062f \u0623\u0643\u0633\u062f\u0629 \u0642\u062f \u064a\u0639\u0632\u0632 \u0627\u0644\u0646\u0639\u0627\u0633 \u0648\u064a\u0642\u0644\u0644 \u0627\u0644\u0623\u0631\u0642.","Mayo Clinic"],t.w)
B.aeM=new A.c(B.c,["Irregular meal times can disrupt your circadian rhythm, which in turn affects sleep quality.","\u0623\u0648\u0642\u0627\u062a \u0627\u0644\u0648\u062c\u0628\u0627\u062a \u063a\u064a\u0631 \u0627\u0644\u0645\u0646\u062a\u0638\u0645\u0629 \u0642\u062f \u062a\u064f\u062e\u0644\u0651 \u0628\u0627\u0644\u0625\u064a\u0642\u0627\u0639 \u0627\u0644\u064a\u0648\u0645\u064a \u0644\u0644\u062c\u0633\u0645\u060c \u0645\u0645\u0627 \u064a\u0624\u062b\u0631 \u0628\u062f\u0648\u0631\u0647 \u0639\u0644\u0649 \u062c\u0648\u062f\u0629 \u0627\u0644\u0646\u0648\u0645.","Harvard Health"],t.w)
B.aiD=new A.c(B.c,["A Mediterranean diet pattern has been associated with better sleep quality in multiple studies.","\u064a\u0631\u062a\u0628\u0637 \u0646\u0645\u0637 \u062d\u0645\u064a\u0629 \u0627\u0644\u0628\u062d\u0631 \u0627\u0644\u0623\u0628\u064a\u0636 \u0627\u0644\u0645\u062a\u0648\u0633\u0637 \u0628\u062c\u0648\u062f\u0629 \u0646\u0648\u0645 \u0623\u0641\u0636\u0644 \u0641\u064a \u062f\u0631\u0627\u0633\u0627\u062a \u0645\u062a\u0639\u062f\u062f\u0629.","Harvard Health"],t.w)
B.aeB=new A.c(B.c,["Vitamin D deficiency is linked to sleep disorders; ensure adequate intake through sunlight, food, or supplements.","\u064a\u0631\u062a\u0628\u0637 \u0646\u0642\u0635 \u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u062f \u0628\u0627\u0636\u0637\u0631\u0627\u0628\u0627\u062a \u0627\u0644\u0646\u0648\u0645\u061b \u0627\u062d\u0631\u0635 \u0639\u0644\u0649 \u0627\u0644\u062d\u0635\u0648\u0644 \u0639\u0644\u0649 \u0643\u0645\u064a\u0629 \u0643\u0627\u0641\u064a\u0629 \u0645\u0646 \u062e\u0644\u0627\u0644 \u0623\u0634\u0639\u0629 \u0627\u0644\u0634\u0645\u0633 \u0623\u0648 \u0627\u0644\u063a\u0630\u0627\u0621 \u0623\u0648 \u0627\u0644\u0645\u0643\u0645\u0644\u0627\u062a.","NHS"],t.w)
B.aiO=new A.c(B.c,["High-fiber diets are associated with deeper, more restorative slow-wave sleep.","\u062a\u0631\u062a\u0628\u0637 \u0627\u0644\u0623\u0646\u0638\u0645\u0629 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0627\u0644\u063a\u0646\u064a\u0629 \u0628\u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0628\u0646\u0648\u0645 \u0623\u0639\u0645\u0642 \u0648\u0623\u0643\u062b\u0631 \u062a\u0631\u0645\u064a\u0645\u0627\u064b \u0645\u0646 \u0646\u0648\u0639 \u0627\u0644\u0645\u0648\u062c\u0627\u062a \u0627\u0644\u0628\u0637\u064a\u0626\u0629.","Harvard Health"],t.w)
B.afS=new A.c(B.c,["Warm milk before bed may help with sleep partly due to tryptophan and partly due to the comforting ritual.","\u0642\u062f \u064a\u0633\u0627\u0639\u062f \u0627\u0644\u062d\u0644\u064a\u0628 \u0627\u0644\u062f\u0627\u0641\u0626 \u0642\u0628\u0644 \u0627\u0644\u0646\u0648\u0645 \u0639\u0644\u0649 \u0627\u0644\u0646\u0648\u0645 \u062c\u0632\u0626\u064a\u0627\u064b \u0628\u0641\u0636\u0644 \u0627\u0644\u062a\u0631\u064a\u0628\u062a\u0648\u0641\u0627\u0646 \u0648\u062c\u0632\u0626\u064a\u0627\u064b \u0628\u0641\u0636\u0644 \u0627\u0644\u0637\u0642\u0633 \u0627\u0644\u0645\u0631\u064a\u062d \u0627\u0644\u0645\u0635\u0627\u062d\u0628 \u0644\u0647.","Mayo Clinic"],t.w)
B.ahl=new A.c(B.c,["Eating too little during the day can cause hunger-related wakefulness at night.","\u062a\u0646\u0627\u0648\u0644 \u0643\u0645\u064a\u0627\u062a \u0642\u0644\u064a\u0644\u0629 \u062c\u062f\u0627\u064b \u0645\u0646 \u0627\u0644\u0637\u0639\u0627\u0645 \u062e\u0644\u0627\u0644 \u0627\u0644\u0646\u0647\u0627\u0631 \u0642\u062f \u064a\u0633\u0628\u0628 \u0627\u0644\u0627\u0633\u062a\u064a\u0642\u0627\u0638 \u0644\u064a\u0644\u0627\u064b \u0628\u0633\u0628\u0628 \u0627\u0644\u062c\u0648\u0639.","Harvard Health"],t.w)
B.agb=new A.c(B.c,["Consistent meal and sleep schedules work together to keep your body clock properly synchronized.","\u062a\u0639\u0645\u0644 \u0645\u0648\u0627\u0639\u064a\u062f \u0627\u0644\u0648\u062c\u0628\u0627\u062a \u0648\u0627\u0644\u0646\u0648\u0645 \u0627\u0644\u0645\u0646\u062a\u0638\u0645\u0629 \u0645\u0639\u0627\u064b \u0644\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u062a\u0632\u0627\u0645\u0646 \u0627\u0644\u0633\u0627\u0639\u0629 \u0627\u0644\u0628\u064a\u0648\u0644\u0648\u062c\u064a\u0629 \u0644\u0644\u062c\u0633\u0645 \u0628\u0634\u0643\u0644 \u0633\u0644\u064a\u0645.","Mayo Clinic"],t.w)
B.afo=new A.c(B.c,["Vitamin C does not prevent colds but may shorten their duration; citrus fruits, peppers, and strawberries are rich sources.","\u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u062c \u0644\u0627 \u064a\u0645\u0646\u0639 \u0646\u0632\u0644\u0627\u062a \u0627\u0644\u0628\u0631\u062f \u0644\u0643\u0646\u0647 \u0642\u062f \u064a\u0642\u0635\u0651\u0631 \u0645\u062f\u062a\u0647\u0627\u061b \u0627\u0644\u062d\u0645\u0636\u064a\u0627\u062a \u0648\u0627\u0644\u0641\u0644\u0641\u0644 \u0648\u0627\u0644\u0641\u0631\u0627\u0648\u0644\u0629 \u0645\u0635\u0627\u062f\u0631 \u063a\u0646\u064a\u0629 \u0628\u0647.","Harvard Health"],t.w)
B.adC=new A.c(B.c,["Zinc is essential for immune cell development; shellfish, meat, legumes, and pumpkin seeds provide it.","\u0627\u0644\u0632\u0646\u0643 \u0636\u0631\u0648\u0631\u064a \u0644\u062a\u0637\u0648\u064a\u0631 \u0627\u0644\u062e\u0644\u0627\u064a\u0627 \u0627\u0644\u0645\u0646\u0627\u0639\u064a\u0629\u061b \u0627\u0644\u0645\u062d\u0627\u0631 \u0648\u0627\u0644\u0644\u062d\u0648\u0645 \u0648\u0627\u0644\u0628\u0642\u0648\u0644\u064a\u0627\u062a \u0648\u0628\u0630\u0648\u0631 \u0627\u0644\u064a\u0642\u0637\u064a\u0646 \u062a\u0648\u0641\u0631\u0647.","Mayo Clinic"],t.w)
B.af2=new A.c(B.c,["Vitamin D plays a critical role in immune function; deficiency is linked to increased susceptibility to infection.","\u064a\u0644\u0639\u0628 \u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u062f \u062f\u0648\u0631\u0627\u064b \u062d\u0627\u0633\u0645\u0627\u064b \u0641\u064a \u0648\u0638\u064a\u0641\u0629 \u0627\u0644\u0645\u0646\u0627\u0639\u0629\u061b \u0648\u064a\u0631\u062a\u0628\u0637 \u0646\u0642\u0635\u0647 \u0628\u0632\u064a\u0627\u062f\u0629 \u0627\u0644\u0642\u0627\u0628\u0644\u064a\u0629 \u0644\u0644\u0625\u0635\u0627\u0628\u0629 \u0628\u0627\u0644\u0639\u062f\u0648\u0649.","Harvard Health"],t.w)
B.afz=new A.c(B.c,["Garlic contains allicin, which has antimicrobial properties and may support immune function.","\u064a\u062d\u062a\u0648\u064a \u0627\u0644\u062b\u0648\u0645 \u0639\u0644\u0649 \u0645\u0627\u062f\u0629 \u0627\u0644\u0623\u0644\u064a\u0633\u064a\u0646 \u0627\u0644\u062a\u064a \u062a\u0645\u062a\u0644\u0643 \u062e\u0635\u0627\u0626\u0635 \u0645\u0636\u0627\u062f\u0629 \u0644\u0644\u0645\u064a\u0643\u0631\u0648\u0628\u0627\u062a \u0648\u0642\u062f \u062a\u062f\u0639\u0645 \u0648\u0638\u064a\u0641\u0629 \u0627\u0644\u0645\u0646\u0627\u0639\u0629.","Harvard Health"],t.w)
B.afF=new A.c(B.c,["Probiotic-rich foods support gut health, where approximately 70% of immune cells reside.","\u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u063a\u0646\u064a\u0629 \u0628\u0627\u0644\u0628\u0631\u0648\u0628\u064a\u0648\u062a\u064a\u0643 \u062a\u062f\u0639\u0645 \u0635\u062d\u0629 \u0627\u0644\u0623\u0645\u0639\u0627\u0621\u060c \u062d\u064a\u062b \u064a\u062a\u0648\u0627\u062c\u062f \u0646\u062d\u0648 70% \u0645\u0646 \u0627\u0644\u062e\u0644\u0627\u064a\u0627 \u0627\u0644\u0645\u0646\u0627\u0639\u064a\u0629.","Harvard Health"],t.w)
B.abH=new A.c(B.c,["Elderberry supplements have shown some promise in reducing the severity and duration of colds and flu.","\u0623\u0638\u0647\u0631\u062a \u0645\u0643\u0645\u0644\u0627\u062a \u0627\u0644\u0628\u0644\u0633\u0627\u0646 \u0628\u0639\u0636 \u0627\u0644\u0641\u0639\u0627\u0644\u064a\u0629 \u0641\u064a \u062a\u0642\u0644\u064a\u0644 \u0634\u062f\u0629 \u0648\u0645\u062f\u0629 \u0646\u0632\u0644\u0627\u062a \u0627\u0644\u0628\u0631\u062f \u0648\u0627\u0644\u0625\u0646\u0641\u0644\u0648\u0646\u0632\u0627.","Mayo Clinic"],t.w)
B.afv=new A.c(B.c,["Excessive alcohol consumption suppresses both the innate and adaptive immune systems.","\u0627\u0644\u0625\u0641\u0631\u0627\u0637 \u0641\u064a \u0627\u0633\u062a\u0647\u0644\u0627\u0643 \u0627\u0644\u0643\u062d\u0648\u0644 \u064a\u064f\u062b\u0628\u0651\u0637 \u0643\u0644\u0627\u064b \u0645\u0646 \u0627\u0644\u062c\u0647\u0627\u0632 \u0627\u0644\u0645\u0646\u0627\u0639\u064a \u0627\u0644\u0641\u0637\u0631\u064a \u0648\u0627\u0644\u0645\u0643\u062a\u0633\u0628.","Harvard Health"],t.w)
B.adg=new A.c(B.c,["Beta-carotene in orange and yellow vegetables is converted to vitamin A, which helps maintain immune barriers.","\u064a\u062a\u062d\u0648\u0644 \u0627\u0644\u0628\u064a\u062a\u0627 \u0643\u0627\u0631\u0648\u062a\u064a\u0646 \u0627\u0644\u0645\u0648\u062c\u0648\u062f \u0641\u064a \u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u0627\u0644\u0628\u0631\u062a\u0642\u0627\u0644\u064a\u0629 \u0648\u0627\u0644\u0635\u0641\u0631\u0627\u0621 \u0625\u0644\u0649 \u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u0623 \u0627\u0644\u0630\u064a \u064a\u0633\u0627\u0639\u062f \u0641\u064a \u0627\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u0627\u0644\u062d\u0648\u0627\u062c\u0632 \u0627\u0644\u0645\u0646\u0627\u0639\u064a\u0629.","NHS"],t.w)
B.aeu=new A.c(B.c,["Green tea contains catechins, antioxidants that may enhance immune function.","\u064a\u062d\u062a\u0648\u064a \u0627\u0644\u0634\u0627\u064a \u0627\u0644\u0623\u062e\u0636\u0631 \u0639\u0644\u0649 \u0627\u0644\u0643\u0627\u062a\u064a\u0643\u064a\u0646\u0627\u062a\u060c \u0648\u0647\u064a \u0645\u0636\u0627\u062f\u0627\u062a \u0623\u0643\u0633\u062f\u0629 \u0642\u062f \u062a\u0639\u0632\u0632 \u0648\u0638\u064a\u0641\u0629 \u0627\u0644\u0645\u0646\u0627\u0639\u0629.","Harvard Health"],t.w)
B.acG=new A.c(B.c,["Iron deficiency impairs immune responses; ensure adequate intake especially for menstruating women.","\u0646\u0642\u0635 \u0627\u0644\u062d\u062f\u064a\u062f \u064a\u064f\u0636\u0639\u0641 \u0627\u0644\u0627\u0633\u062a\u062c\u0627\u0628\u0627\u062a \u0627\u0644\u0645\u0646\u0627\u0639\u064a\u0629\u061b \u0627\u062d\u0631\u0635 \u0639\u0644\u0649 \u062a\u0646\u0627\u0648\u0644 \u0643\u0645\u064a\u0627\u062a \u0643\u0627\u0641\u064a\u0629 \u062e\u0627\u0635\u0629 \u0644\u0644\u0646\u0633\u0627\u0621 \u0641\u064a \u0633\u0646 \u0627\u0644\u062d\u064a\u0636.","WHO"],t.w)
B.ae4=new A.c(B.c,["Selenium supports the immune system; Brazil nuts, fish, and whole grains are good sources.","\u0627\u0644\u0633\u064a\u0644\u064a\u0646\u064a\u0648\u0645 \u064a\u062f\u0639\u0645 \u0627\u0644\u062c\u0647\u0627\u0632 \u0627\u0644\u0645\u0646\u0627\u0639\u064a\u061b \u0627\u0644\u062c\u0648\u0632 \u0627\u0644\u0628\u0631\u0627\u0632\u064a\u0644\u064a \u0648\u0627\u0644\u0623\u0633\u0645\u0627\u0643 \u0648\u0627\u0644\u062d\u0628\u0648\u0628 \u0627\u0644\u0643\u0627\u0645\u0644\u0629 \u0645\u0635\u0627\u062f\u0631 \u062c\u064a\u062f\u0629 \u0644\u0647.","Mayo Clinic"],t.w)
B.aeO=new A.c(B.c,["Turmeric contains curcumin, which has anti-inflammatory properties that may support immune health.","\u064a\u062d\u062a\u0648\u064a \u0627\u0644\u0643\u0631\u0643\u0645 \u0639\u0644\u0649 \u0645\u0627\u062f\u0629 \u0627\u0644\u0643\u0631\u0643\u0645\u064a\u0646 \u0630\u0627\u062a \u0627\u0644\u062e\u0635\u0627\u0626\u0635 \u0627\u0644\u0645\u0636\u0627\u062f\u0629 \u0644\u0644\u0627\u0644\u062a\u0647\u0627\u0628\u0627\u062a \u0627\u0644\u062a\u064a \u0642\u062f \u062a\u062f\u0639\u0645 \u0635\u062d\u0629 \u0627\u0644\u0645\u0646\u0627\u0639\u0629.","Harvard Health"],t.w)
B.ail=new A.c(B.c,["Vitamin E is a powerful antioxidant that helps the body fight infection; almonds and sunflower seeds are rich sources.","\u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u0647\u0640 \u0645\u0636\u0627\u062f \u0623\u0643\u0633\u062f\u0629 \u0642\u0648\u064a \u064a\u0633\u0627\u0639\u062f \u0627\u0644\u062c\u0633\u0645 \u0639\u0644\u0649 \u0645\u0643\u0627\u0641\u062d\u0629 \u0627\u0644\u0639\u062f\u0648\u0649\u061b \u0627\u0644\u0644\u0648\u0632 \u0648\u0628\u0630\u0648\u0631 \u062f\u0648\u0627\u0631 \u0627\u0644\u0634\u0645\u0633 \u0645\u0635\u0627\u062f\u0631 \u063a\u0646\u064a\u0629 \u0628\u0647.","Harvard Health"],t.w)
B.acB=new A.c(B.c,["Mushrooms (especially shiitake and maitake) contain beta-glucans that may stimulate immune activity.","\u064a\u062d\u062a\u0648\u064a \u0627\u0644\u0641\u0637\u0631 (\u062e\u0627\u0635\u0629 \u0627\u0644\u0634\u064a\u062a\u0627\u0643\u064a \u0648\u0627\u0644\u0645\u0627\u064a\u062a\u0627\u0643\u064a) \u0639\u0644\u0649 \u0628\u064a\u062a\u0627 \u063a\u0644\u0648\u0643\u0627\u0646 \u0627\u0644\u062a\u064a \u0642\u062f \u062a\u062d\u0641\u0651\u0632 \u0646\u0634\u0627\u0637 \u0627\u0644\u062c\u0647\u0627\u0632 \u0627\u0644\u0645\u0646\u0627\u0639\u064a.","Harvard Health"],t.w)
B.ab1=new A.c(B.c,["A diet high in processed foods and added sugars may impair immune function over time.","\u0627\u0644\u0646\u0638\u0627\u0645 \u0627\u0644\u063a\u0630\u0627\u0626\u064a \u0627\u0644\u063a\u0646\u064a \u0628\u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0645\u0635\u0646\u0651\u0639\u0629 \u0648\u0627\u0644\u0633\u0643\u0631\u064a\u0627\u062a \u0627\u0644\u0645\u0636\u0627\u0641\u0629 \u0642\u062f \u064a\u064f\u0636\u0639\u0641 \u0648\u0638\u064a\u0641\u0629 \u0627\u0644\u0645\u0646\u0627\u0639\u0629 \u0645\u0639 \u0645\u0631\u0648\u0631 \u0627\u0644\u0648\u0642\u062a.","Harvard Health"],t.w)
B.ah7=new A.c(B.c,["Adequate protein intake is essential for producing antibodies and immune cells.","\u062a\u0646\u0627\u0648\u0644 \u0643\u0645\u064a\u0629 \u0643\u0627\u0641\u064a\u0629 \u0645\u0646 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0636\u0631\u0648\u0631\u064a \u0644\u0625\u0646\u062a\u0627\u062c \u0627\u0644\u0623\u062c\u0633\u0627\u0645 \u0627\u0644\u0645\u0636\u0627\u062f\u0629 \u0648\u0627\u0644\u062e\u0644\u0627\u064a\u0627 \u0627\u0644\u0645\u0646\u0627\u0639\u064a\u0629.","Harvard Health"],t.w)
B.agV=new A.c(B.c,["Ginger has anti-inflammatory and antioxidant properties and may help support immune defenses.","\u064a\u062a\u0645\u062a\u0639 \u0627\u0644\u0632\u0646\u062c\u0628\u064a\u0644 \u0628\u062e\u0635\u0627\u0626\u0635 \u0645\u0636\u0627\u062f\u0629 \u0644\u0644\u0627\u0644\u062a\u0647\u0627\u0628\u0627\u062a \u0648\u0645\u0636\u0627\u062f\u0629 \u0644\u0644\u0623\u0643\u0633\u062f\u0629 \u0648\u0642\u062f \u064a\u0633\u0627\u0639\u062f \u0641\u064a \u062f\u0639\u0645 \u0627\u0644\u062f\u0641\u0627\u0639\u0627\u062a \u0627\u0644\u0645\u0646\u0627\u0639\u064a\u0629.","Mayo Clinic"],t.w)
B.agW=new A.c(B.c,["Honey has natural antibacterial properties and can soothe sore throats, but should not be given to infants under one year.","\u064a\u062a\u0645\u062a\u0639 \u0627\u0644\u0639\u0633\u0644 \u0628\u062e\u0635\u0627\u0626\u0635 \u0637\u0628\u064a\u0639\u064a\u0629 \u0645\u0636\u0627\u062f\u0629 \u0644\u0644\u0628\u0643\u062a\u064a\u0631\u064a\u0627 \u0648\u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u0647\u062f\u0626 \u0627\u0644\u062a\u0647\u0627\u0628 \u0627\u0644\u062d\u0644\u0642\u060c \u0644\u0643\u0646 \u064a\u062c\u0628 \u0639\u062f\u0645 \u0625\u0639\u0637\u0627\u0626\u0647 \u0644\u0644\u0631\u0636\u0639 \u062f\u0648\u0646 \u0639\u0645\u0631 \u0627\u0644\u0633\u0646\u0629.","NHS"],t.w)
B.ad5=new A.c(B.c,["Folate supports the production of new cells including immune cells; leafy greens and fortified grains are key sources.","\u062d\u0645\u0636 \u0627\u0644\u0641\u0648\u0644\u064a\u0643 \u064a\u062f\u0639\u0645 \u0625\u0646\u062a\u0627\u062c \u062e\u0644\u0627\u064a\u0627 \u062c\u062f\u064a\u062f\u0629 \u0628\u0645\u0627 \u0641\u064a\u0647\u0627 \u0627\u0644\u062e\u0644\u0627\u064a\u0627 \u0627\u0644\u0645\u0646\u0627\u0639\u064a\u0629\u061b \u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u0627\u0644\u0648\u0631\u0642\u064a\u0629 \u0648\u0627\u0644\u062d\u0628\u0648\u0628 \u0627\u0644\u0645\u062f\u0639\u0651\u0645\u0629 \u0645\u0635\u0627\u062f\u0631 \u0623\u0633\u0627\u0633\u064a\u0629 \u0644\u0647.","Harvard Health"],t.w)
B.aiJ=new A.c(B.c,['No single food or supplement can "boost" your immune system; a balanced overall diet is what matters most.','\u0644\u0627 \u064a\u0648\u062c\u062f \u0637\u0639\u0627\u0645 \u0623\u0648 \u0645\u0643\u0645\u0644 \u0648\u0627\u062d\u062f \u064a\u0645\u0643\u0646\u0647 "\u062a\u0639\u0632\u064a\u0632" \u062c\u0647\u0627\u0632\u0643 \u0627\u0644\u0645\u0646\u0627\u0639\u064a\u061b \u0627\u0644\u0646\u0638\u0627\u0645 \u0627\u0644\u063a\u0630\u0627\u0626\u064a \u0627\u0644\u0645\u062a\u0648\u0627\u0632\u0646 \u0627\u0644\u0634\u0627\u0645\u0644 \u0647\u0648 \u0627\u0644\u0623\u0647\u0645.',"NHS"],t.w)
B.adV=new A.c(B.c,["Whole grains cause a slower rise in blood sugar compared to refined grains, reducing diabetes risk.","\u062a\u0633\u0628\u0628 \u0627\u0644\u062d\u0628\u0648\u0628 \u0627\u0644\u0643\u0627\u0645\u0644\u0629 \u0627\u0631\u062a\u0641\u0627\u0639\u0627\u064b \u0623\u0628\u0637\u0623 \u0641\u064a \u0633\u0643\u0631 \u0627\u0644\u062f\u0645 \u0645\u0642\u0627\u0631\u0646\u0629 \u0628\u0627\u0644\u062d\u0628\u0648\u0628 \u0627\u0644\u0645\u0643\u0631\u0631\u0629\u060c \u0645\u0645\u0627 \u064a\u0642\u0644\u0644 \u062e\u0637\u0631 \u0627\u0644\u0625\u0635\u0627\u0628\u0629 \u0628\u0627\u0644\u0633\u0643\u0631\u064a.","Harvard Health"],t.w)
B.ain=new A.c(B.c,["Losing just 5\u20137% of body weight can reduce the risk of developing type 2 diabetes by up to 58%.","\u0641\u0642\u062f\u0627\u0646 5 \u0625\u0644\u0649 7% \u0641\u0642\u0637 \u0645\u0646 \u0648\u0632\u0646 \u0627\u0644\u062c\u0633\u0645 \u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u0642\u0644\u0644 \u062e\u0637\u0631 \u0627\u0644\u0625\u0635\u0627\u0628\u0629 \u0628\u0627\u0644\u0633\u0643\u0631\u064a \u0645\u0646 \u0627\u0644\u0646\u0648\u0639 \u0627\u0644\u062b\u0627\u0646\u064a \u0628\u0646\u0633\u0628\u0629 \u062a\u0635\u0644 \u0625\u0644\u0649 58%.","CDC"],t.w)
B.aho=new A.c(B.c,["Sugary drinks are one of the strongest dietary risk factors for type 2 diabetes.","\u0627\u0644\u0645\u0634\u0631\u0648\u0628\u0627\u062a \u0627\u0644\u0633\u0643\u0631\u064a\u0629 \u0647\u064a \u0623\u062d\u062f \u0623\u0642\u0648\u0649 \u0639\u0648\u0627\u0645\u0644 \u0627\u0644\u062e\u0637\u0631 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0644\u0644\u0625\u0635\u0627\u0628\u0629 \u0628\u0627\u0644\u0633\u0643\u0631\u064a \u0645\u0646 \u0627\u0644\u0646\u0648\u0639 \u0627\u0644\u062b\u0627\u0646\u064a.","Harvard Health"],t.w)
B.ad4=new A.c(B.c,["Regular physical activity improves insulin sensitivity, helping your body use blood sugar more effectively.","\u0627\u0644\u0646\u0634\u0627\u0637 \u0627\u0644\u0628\u062f\u0646\u064a \u0627\u0644\u0645\u0646\u062a\u0638\u0645 \u064a\u062d\u0633\u0651\u0646 \u062d\u0633\u0627\u0633\u064a\u0629 \u0627\u0644\u0623\u0646\u0633\u0648\u0644\u064a\u0646\u060c \u0645\u0645\u0627 \u064a\u0633\u0627\u0639\u062f \u062c\u0633\u0645\u0643 \u0639\u0644\u0649 \u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0633\u0643\u0631 \u0627\u0644\u062f\u0645 \u0628\u0634\u0643\u0644 \u0623\u0643\u062b\u0631 \u0641\u0639\u0627\u0644\u064a\u0629.","Mayo Clinic"],t.w)
B.ahS=new A.c(B.c,["Fiber slows glucose absorption; aim for at least 30 g per day to help regulate blood sugar.","\u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u062a\u0628\u0637\u0626 \u0627\u0645\u062a\u0635\u0627\u0635 \u0627\u0644\u062c\u0644\u0648\u0643\u0648\u0632\u061b \u0627\u0633\u062a\u0647\u062f\u0641 30 \u063a\u0631\u0627\u0645\u0627\u064b \u0639\u0644\u0649 \u0627\u0644\u0623\u0642\u0644 \u064a\u0648\u0645\u064a\u0627\u064b \u0644\u0644\u0645\u0633\u0627\u0639\u062f\u0629 \u0641\u064a \u062a\u0646\u0638\u064a\u0645 \u0633\u0643\u0631 \u0627\u0644\u062f\u0645.","NHS"],t.w)
B.aib=new A.c(B.c,["The glycemic index (GI) ranks foods by how quickly they raise blood sugar; choose low-GI foods more often.","\u0627\u0644\u0645\u0624\u0634\u0631 \u0627\u0644\u062c\u0644\u0627\u064a\u0633\u064a\u0645\u064a \u064a\u0635\u0646\u0651\u0641 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u062d\u0633\u0628 \u0633\u0631\u0639\u0629 \u0631\u0641\u0639\u0647\u0627 \u0644\u0633\u0643\u0631 \u0627\u0644\u062f\u0645\u061b \u0627\u062e\u062a\u0631 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0630\u0627\u062a \u0627\u0644\u0645\u0624\u0634\u0631 \u0627\u0644\u0645\u0646\u062e\u0641\u0636 \u0641\u064a \u0623\u063a\u0644\u0628 \u0627\u0644\u0623\u062d\u064a\u0627\u0646.","Harvard Health"],t.w)
B.aiN=new A.c(B.c,["Cinnamon may have a modest effect on lowering blood sugar levels, though more research is needed.","\u0642\u062f \u064a\u0643\u0648\u0646 \u0644\u0644\u0642\u0631\u0641\u0629 \u062a\u0623\u062b\u064a\u0631 \u0645\u062a\u0648\u0627\u0636\u0639 \u0641\u064a \u062e\u0641\u0636 \u0645\u0633\u062a\u0648\u064a\u0627\u062a \u0633\u0643\u0631 \u0627\u0644\u062f\u0645\u060c \u0631\u063a\u0645 \u0627\u0644\u062d\u0627\u062c\u0629 \u0625\u0644\u0649 \u0645\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u0623\u0628\u062d\u0627\u062b.","Mayo Clinic"],t.w)
B.ahN=new A.c(B.c,["Eating protein and healthy fat with carbohydrates slows the blood sugar response after a meal.","\u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0648\u0627\u0644\u062f\u0647\u0648\u0646 \u0627\u0644\u0635\u062d\u064a\u0629 \u0645\u0639 \u0627\u0644\u0643\u0631\u0628\u0648\u0647\u064a\u062f\u0631\u0627\u062a \u064a\u0628\u0637\u0626 \u0627\u0633\u062a\u062c\u0627\u0628\u0629 \u0633\u0643\u0631 \u0627\u0644\u062f\u0645 \u0628\u0639\u062f \u0627\u0644\u0648\u062c\u0628\u0629.","Harvard Health"],t.w)
B.ag2=new A.c(B.c,["Nuts consumed regularly are associated with a reduced risk of type 2 diabetes in large population studies.","\u064a\u0631\u062a\u0628\u0637 \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0645\u0643\u0633\u0631\u0627\u062a \u0628\u0627\u0646\u062a\u0638\u0627\u0645 \u0628\u0627\u0646\u062e\u0641\u0627\u0636 \u062e\u0637\u0631 \u0627\u0644\u0625\u0635\u0627\u0628\u0629 \u0628\u0627\u0644\u0633\u0643\u0631\u064a \u0645\u0646 \u0627\u0644\u0646\u0648\u0639 \u0627\u0644\u062b\u0627\u0646\u064a \u0641\u064a \u062f\u0631\u0627\u0633\u0627\u062a \u0633\u0643\u0627\u0646\u064a\u0629 \u0643\u0628\u064a\u0631\u0629.","Harvard Health"],t.w)
B.agG=new A.c(B.c,["Vinegar consumed before a meal may slow the digestion of starch and reduce post-meal blood sugar spikes.","\u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u062e\u0644 \u0642\u0628\u0644 \u0627\u0644\u0648\u062c\u0628\u0629 \u0642\u062f \u064a\u0628\u0637\u0626 \u0647\u0636\u0645 \u0627\u0644\u0646\u0634\u0627 \u0648\u064a\u0642\u0644\u0644 \u0627\u0631\u062a\u0641\u0627\u0639 \u0633\u0643\u0631 \u0627\u0644\u062f\u0645 \u0628\u0639\u062f \u0627\u0644\u0623\u0643\u0644.","Harvard Health"],t.w)
B.adJ=new A.c(B.c,["Coffee consumption (both regular and decaf) has been associated with a lower risk of type 2 diabetes.","\u064a\u0631\u062a\u0628\u0637 \u0627\u0633\u062a\u0647\u0644\u0627\u0643 \u0627\u0644\u0642\u0647\u0648\u0629 (\u0627\u0644\u0639\u0627\u062f\u064a\u0629 \u0648\u0645\u0646\u0632\u0648\u0639\u0629 \u0627\u0644\u0643\u0627\u0641\u064a\u064a\u0646) \u0628\u0627\u0646\u062e\u0641\u0627\u0636 \u062e\u0637\u0631 \u0627\u0644\u0625\u0635\u0627\u0628\u0629 \u0628\u0627\u0644\u0633\u0643\u0631\u064a \u0645\u0646 \u0627\u0644\u0646\u0648\u0639 \u0627\u0644\u062b\u0627\u0646\u064a.","Harvard Health"],t.w)
B.ah0=new A.c(B.c,["Replacing white rice with brown rice even part of the time can meaningfully reduce type 2 diabetes risk.","\u0627\u0633\u062a\u0628\u062f\u0627\u0644 \u0627\u0644\u0623\u0631\u0632 \u0627\u0644\u0623\u0628\u064a\u0636 \u0628\u0627\u0644\u0623\u0631\u0632 \u0627\u0644\u0628\u0646\u064a \u062d\u062a\u0649 \u062c\u0632\u0626\u064a\u0627\u064b \u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u0642\u0644\u0644 \u0628\u0634\u0643\u0644 \u0645\u0644\u0645\u0648\u0633 \u0645\u0646 \u062e\u0637\u0631 \u0627\u0644\u0625\u0635\u0627\u0628\u0629 \u0628\u0627\u0644\u0633\u0643\u0631\u064a \u0645\u0646 \u0627\u0644\u0646\u0648\u0639 \u0627\u0644\u062b\u0627\u0646\u064a.","Harvard Health"],t.w)
B.ah1=new A.c(B.c,["Excess belly fat is more closely linked to insulin resistance than fat stored elsewhere in the body.","\u062f\u0647\u0648\u0646 \u0627\u0644\u0628\u0637\u0646 \u0627\u0644\u0632\u0627\u0626\u062f\u0629 \u0645\u0631\u062a\u0628\u0637\u0629 \u0628\u0645\u0642\u0627\u0648\u0645\u0629 \u0627\u0644\u0623\u0646\u0633\u0648\u0644\u064a\u0646 \u0623\u0643\u062b\u0631 \u0645\u0646 \u0627\u0644\u062f\u0647\u0648\u0646 \u0627\u0644\u0645\u062e\u0632\u0651\u0646\u0629 \u0641\u064a \u0623\u062c\u0632\u0627\u0621 \u0623\u062e\u0631\u0649 \u0645\u0646 \u0627\u0644\u062c\u0633\u0645.","Mayo Clinic"],t.w)
B.agK=new A.c(B.c,["Legumes have a low glycemic index and high fiber content, making them excellent for blood sugar management.","\u062a\u062a\u0645\u062a\u0639 \u0627\u0644\u0628\u0642\u0648\u0644\u064a\u0627\u062a \u0628\u0645\u0624\u0634\u0631 \u062c\u0644\u0627\u064a\u0633\u064a\u0645\u064a \u0645\u0646\u062e\u0641\u0636 \u0648\u0645\u062d\u062a\u0648\u0649 \u0639\u0627\u0644\u064d \u0645\u0646 \u0627\u0644\u0623\u0644\u064a\u0627\u0641\u060c \u0645\u0645\u0627 \u064a\u062c\u0639\u0644\u0647\u0627 \u0645\u0645\u062a\u0627\u0632\u0629 \u0644\u0625\u062f\u0627\u0631\u0629 \u0633\u0643\u0631 \u0627\u0644\u062f\u0645.","Harvard Health"],t.w)
B.aeh=new A.c(B.c,["Chronic sleep deprivation impairs glucose metabolism and increases type 2 diabetes risk.","\u0627\u0644\u062d\u0631\u0645\u0627\u0646 \u0627\u0644\u0645\u0632\u0645\u0646 \u0645\u0646 \u0627\u0644\u0646\u0648\u0645 \u064a\u064f\u0636\u0639\u0641 \u0623\u064a\u0636 \u0627\u0644\u062c\u0644\u0648\u0643\u0648\u0632 \u0648\u064a\u0632\u064a\u062f \u062e\u0637\u0631 \u0627\u0644\u0625\u0635\u0627\u0628\u0629 \u0628\u0627\u0644\u0633\u0643\u0631\u064a \u0645\u0646 \u0627\u0644\u0646\u0648\u0639 \u0627\u0644\u062b\u0627\u0646\u064a.","Harvard Health"],t.w)
B.acZ=new A.c(B.c,["A brisk 30-minute walk daily can significantly reduce the risk of developing type 2 diabetes.","\u0627\u0644\u0645\u0634\u064a \u0627\u0644\u0633\u0631\u064a\u0639 \u0644\u0645\u062f\u0629 30 \u062f\u0642\u064a\u0642\u0629 \u064a\u0648\u0645\u064a\u0627\u064b \u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u0642\u0644\u0644 \u0628\u0634\u0643\u0644 \u0643\u0628\u064a\u0631 \u0645\u0646 \u062e\u0637\u0631 \u0627\u0644\u0625\u0635\u0627\u0628\u0629 \u0628\u0627\u0644\u0633\u0643\u0631\u064a \u0645\u0646 \u0627\u0644\u0646\u0648\u0639 \u0627\u0644\u062b\u0627\u0646\u064a.","WHO"],t.w)
B.adF=new A.c(B.c,["Portion control is key for blood sugar management; even healthy foods raise glucose if eaten in excess.","\u0627\u0644\u062a\u062d\u0643\u0645 \u0641\u064a \u062d\u062c\u0645 \u0627\u0644\u062d\u0635\u0635 \u0623\u0633\u0627\u0633\u064a \u0644\u0625\u062f\u0627\u0631\u0629 \u0633\u0643\u0631 \u0627\u0644\u062f\u0645\u061b \u062d\u062a\u0649 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0635\u062d\u064a\u0629 \u062a\u0631\u0641\u0639 \u0627\u0644\u062c\u0644\u0648\u0643\u0648\u0632 \u0625\u0630\u0627 \u0623\u064f\u0643\u0644\u062a \u0628\u0625\u0641\u0631\u0627\u0637.","Mayo Clinic"],t.w)
B.agP=new A.c(B.c,["Magnesium intake from food sources is inversely associated with type 2 diabetes risk.","\u064a\u0631\u062a\u0628\u0637 \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0645\u063a\u0646\u064a\u0633\u064a\u0648\u0645 \u0645\u0646 \u0645\u0635\u0627\u062f\u0631 \u063a\u0630\u0627\u0626\u064a\u0629 \u0639\u0643\u0633\u064a\u0627\u064b \u0628\u062e\u0637\u0631 \u0627\u0644\u0625\u0635\u0627\u0628\u0629 \u0628\u0627\u0644\u0633\u0643\u0631\u064a \u0645\u0646 \u0627\u0644\u0646\u0648\u0639 \u0627\u0644\u062b\u0627\u0646\u064a.","Harvard Health"],t.w)
B.acz=new A.c(B.c,["Eating vegetables before carbohydrates in a meal may reduce the post-meal blood sugar spike.","\u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u0642\u0628\u0644 \u0627\u0644\u0643\u0631\u0628\u0648\u0647\u064a\u062f\u0631\u0627\u062a \u0641\u064a \u0627\u0644\u0648\u062c\u0628\u0629 \u0642\u062f \u064a\u0642\u0644\u0644 \u0645\u0646 \u0627\u0631\u062a\u0641\u0627\u0639 \u0633\u0643\u0631 \u0627\u0644\u062f\u0645 \u0628\u0639\u062f \u0627\u0644\u0623\u0643\u0644.","Harvard Health"],t.w)
B.abJ=new A.c(B.c,["Prediabetes can often be reversed with diet and lifestyle changes before it progresses to type 2 diabetes.","\u064a\u0645\u0643\u0646 \u0639\u0643\u0633 \u062d\u0627\u0644\u0629 \u0645\u0627 \u0642\u0628\u0644 \u0627\u0644\u0633\u0643\u0631\u064a \u0641\u064a \u0643\u062b\u064a\u0631 \u0645\u0646 \u0627\u0644\u0623\u062d\u064a\u0627\u0646 \u0628\u062a\u063a\u064a\u064a\u0631\u0627\u062a \u0641\u064a \u0627\u0644\u0646\u0638\u0627\u0645 \u0627\u0644\u063a\u0630\u0627\u0626\u064a \u0648\u0646\u0645\u0637 \u0627\u0644\u062d\u064a\u0627\u0629 \u0642\u0628\u0644 \u062a\u0637\u0648\u0631\u0647\u0627 \u0625\u0644\u0649 \u0627\u0644\u0633\u0643\u0631\u064a \u0645\u0646 \u0627\u0644\u0646\u0648\u0639 \u0627\u0644\u062b\u0627\u0646\u064a.","CDC"],t.w)
B.ad0=new A.c(B.c,["Children need a variety of foods from all food groups for proper growth and development.","\u064a\u062d\u062a\u0627\u062c \u0627\u0644\u0623\u0637\u0641\u0627\u0644 \u0625\u0644\u0649 \u062a\u0646\u0648\u0639 \u0641\u064a \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0645\u0646 \u062c\u0645\u064a\u0639 \u0627\u0644\u0645\u062c\u0645\u0648\u0639\u0627\u062a \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0644\u0636\u0645\u0627\u0646 \u0627\u0644\u0646\u0645\u0648 \u0648\u0627\u0644\u062a\u0637\u0648\u0631 \u0627\u0644\u0633\u0644\u064a\u0645.","NHS"],t.w)
B.aiP=new A.c(B.c,["Breakfast is especially important for children; it improves concentration, memory, and academic performance.","\u0648\u062c\u0628\u0629 \u0627\u0644\u0625\u0641\u0637\u0627\u0631 \u0645\u0647\u0645\u0629 \u0628\u0634\u0643\u0644 \u062e\u0627\u0635 \u0644\u0644\u0623\u0637\u0641\u0627\u0644\u061b \u0641\u0647\u064a \u062a\u062d\u0633\u0651\u0646 \u0627\u0644\u062a\u0631\u0643\u064a\u0632 \u0648\u0627\u0644\u0630\u0627\u0643\u0631\u0629 \u0648\u0627\u0644\u0623\u062f\u0627\u0621 \u0627\u0644\u0623\u0643\u0627\u062f\u064a\u0645\u064a.","NHS"],t.w)
B.ag6=new A.c(B.c,["Children should have no more than 1 sugary drink per day; water and milk are the best choices.","\u064a\u062c\u0628 \u0623\u0644\u0627 \u064a\u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0623\u0637\u0641\u0627\u0644 \u0623\u0643\u062b\u0631 \u0645\u0646 \u0645\u0634\u0631\u0648\u0628 \u0633\u0643\u0631\u064a \u0648\u0627\u062d\u062f \u064a\u0648\u0645\u064a\u0627\u064b\u061b \u0627\u0644\u0645\u0627\u0621 \u0648\u0627\u0644\u062d\u0644\u064a\u0628 \u0647\u0645\u0627 \u0627\u0644\u062e\u064a\u0627\u0631 \u0627\u0644\u0623\u0641\u0636\u0644.","WHO"],t.w)
B.acg=new A.c(B.c,["Introducing a wide variety of vegetables early in life increases acceptance of healthy foods later.","\u062a\u0642\u062f\u064a\u0645 \u0645\u062c\u0645\u0648\u0639\u0629 \u0648\u0627\u0633\u0639\u0629 \u0645\u0646 \u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u0641\u064a \u0645\u0631\u062d\u0644\u0629 \u0645\u0628\u0643\u0631\u0629 \u0645\u0646 \u0627\u0644\u062d\u064a\u0627\u0629 \u064a\u0632\u064a\u062f \u0645\u0646 \u062a\u0642\u0628\u0651\u0644 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0635\u062d\u064a\u0629 \u0644\u0627\u062d\u0642\u0627\u064b.","NHS"],t.w)
B.aim=new A.c(B.c,["Children who eat family meals together tend to eat more fruits and vegetables and fewer processed foods.","\u064a\u0645\u064a\u0644 \u0627\u0644\u0623\u0637\u0641\u0627\u0644 \u0627\u0644\u0630\u064a\u0646 \u064a\u062a\u0646\u0627\u0648\u0644\u0648\u0646 \u0648\u062c\u0628\u0627\u062a \u0639\u0627\u0626\u0644\u064a\u0629 \u0645\u0634\u062a\u0631\u0643\u0629 \u0625\u0644\u0649 \u0623\u0643\u0644 \u0627\u0644\u0645\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u0641\u0648\u0627\u0643\u0647 \u0648\u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u0648\u0623\u0637\u0639\u0645\u0629 \u0645\u0635\u0646\u0651\u0639\u0629 \u0623\u0642\u0644.","Harvard Health"],t.w)
B.aij=new A.c(B.c,["Calcium and vitamin D are critical during childhood and adolescence for building strong bones.","\u0627\u0644\u0643\u0627\u0644\u0633\u064a\u0648\u0645 \u0648\u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u062f \u0636\u0631\u0648\u0631\u064a\u0627\u0646 \u062e\u0644\u0627\u0644 \u0645\u0631\u062d\u0644\u0629 \u0627\u0644\u0637\u0641\u0648\u0644\u0629 \u0648\u0627\u0644\u0645\u0631\u0627\u0647\u0642\u0629 \u0644\u0628\u0646\u0627\u0621 \u0639\u0638\u0627\u0645 \u0642\u0648\u064a\u0629.","Mayo Clinic"],t.w)
B.agz=new A.c(B.c,["Iron deficiency is the most common nutritional deficiency in children worldwide and affects cognitive development.","\u0646\u0642\u0635 \u0627\u0644\u062d\u062f\u064a\u062f \u0647\u0648 \u0623\u0643\u062b\u0631 \u062d\u0627\u0644\u0627\u062a \u0646\u0642\u0635 \u0627\u0644\u062a\u063a\u0630\u064a\u0629 \u0634\u064a\u0648\u0639\u0627\u064b \u0644\u062f\u0649 \u0627\u0644\u0623\u0637\u0641\u0627\u0644 \u0639\u0627\u0644\u0645\u064a\u0627\u064b \u0648\u064a\u0624\u062b\u0631 \u0639\u0644\u0649 \u0627\u0644\u062a\u0637\u0648\u0631 \u0627\u0644\u0645\u0639\u0631\u0641\u064a.","WHO"],t.w)
B.afA=new A.c(B.c,["Toddlers may need to be offered a new food 10\u201315 times before they accept it; persistence pays off.","\u0642\u062f \u064a\u062d\u062a\u0627\u062c \u0627\u0644\u0623\u0637\u0641\u0627\u0644 \u0627\u0644\u0635\u063a\u0627\u0631 \u0625\u0644\u0649 \u062a\u0642\u062f\u064a\u0645 \u0637\u0639\u0627\u0645 \u062c\u062f\u064a\u062f \u0644\u0647\u0645 \u0645\u0646 10 \u0625\u0644\u0649 15 \u0645\u0631\u0629 \u0642\u0628\u0644 \u0623\u0646 \u064a\u062a\u0642\u0628\u0651\u0644\u0648\u0647\u061b \u0627\u0644\u0645\u062b\u0627\u0628\u0631\u0629 \u062a\u0624\u062a\u064a \u062b\u0645\u0627\u0631\u0647\u0627.","NHS"],t.w)
B.aca=new A.c(B.c,["Limiting screen time during meals helps children focus on hunger and fullness cues.","\u062a\u0642\u0644\u064a\u0644 \u0648\u0642\u062a \u0627\u0644\u0634\u0627\u0634\u0627\u062a \u0623\u062b\u0646\u0627\u0621 \u0627\u0644\u0648\u062c\u0628\u0627\u062a \u064a\u0633\u0627\u0639\u062f \u0627\u0644\u0623\u0637\u0641\u0627\u0644 \u0639\u0644\u0649 \u0627\u0644\u062a\u0631\u0643\u064a\u0632 \u0639\u0644\u0649 \u0625\u0634\u0627\u0631\u0627\u062a \u0627\u0644\u062c\u0648\u0639 \u0648\u0627\u0644\u0634\u0628\u0639.","Harvard Health"],t.w)
B.afO=new A.c(B.c,["Involving children in food preparation encourages them to try new foods and develop healthy habits.","\u0625\u0634\u0631\u0627\u0643 \u0627\u0644\u0623\u0637\u0641\u0627\u0644 \u0641\u064a \u062a\u062d\u0636\u064a\u0631 \u0627\u0644\u0637\u0639\u0627\u0645 \u064a\u0634\u062c\u0639\u0647\u0645 \u0639\u0644\u0649 \u062a\u062c\u0631\u0628\u0629 \u0623\u0637\u0639\u0645\u0629 \u062c\u062f\u064a\u062f\u0629 \u0648\u062a\u0637\u0648\u064a\u0631 \u0639\u0627\u062f\u0627\u062a \u0635\u062d\u064a\u0629.","NHS"],t.w)
B.agI=new A.c(B.c,["Adolescents have higher calorie and nutrient needs than adults due to rapid growth and development.","\u064a\u062d\u062a\u0627\u062c \u0627\u0644\u0645\u0631\u0627\u0647\u0642\u0648\u0646 \u0625\u0644\u0649 \u0633\u0639\u0631\u0627\u062a \u062d\u0631\u0627\u0631\u064a\u0629 \u0648\u0645\u063a\u0630\u064a\u0627\u062a \u0623\u0643\u062b\u0631 \u0645\u0646 \u0627\u0644\u0628\u0627\u0644\u063a\u064a\u0646 \u0628\u0633\u0628\u0628 \u0627\u0644\u0646\u0645\u0648 \u0648\u0627\u0644\u062a\u0637\u0648\u0631 \u0627\u0644\u0633\u0631\u064a\u0639.","WHO"],t.w)
B.acs=new A.c(B.c,["Fruit juice should be limited to 150 ml per day for children; whole fruit is a better option.","\u064a\u062c\u0628 \u062a\u0642\u0644\u064a\u0644 \u0639\u0635\u064a\u0631 \u0627\u0644\u0641\u0627\u0643\u0647\u0629 \u0625\u0644\u0649 150 \u0645\u0644 \u064a\u0648\u0645\u064a\u0627\u064b \u0644\u0644\u0623\u0637\u0641\u0627\u0644\u061b \u0627\u0644\u0641\u0627\u0643\u0647\u0629 \u0627\u0644\u0643\u0627\u0645\u0644\u0629 \u062e\u064a\u0627\u0631 \u0623\u0641\u0636\u0644.","NHS"],t.w)
B.abe=new A.c(B.c,["Packing healthy school lunches with a protein, whole grain, fruit, and vegetable supports learning.","\u062a\u062d\u0636\u064a\u0631 \u0648\u062c\u0628\u0627\u062a \u0645\u062f\u0631\u0633\u064a\u0629 \u0635\u062d\u064a\u0629 \u062a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u0628\u0631\u0648\u062a\u064a\u0646 \u0648\u062d\u0628\u0648\u0628 \u0643\u0627\u0645\u0644\u0629 \u0648\u0641\u0627\u0643\u0647\u0629 \u0648\u062e\u0636\u0631\u0648\u0627\u062a \u064a\u062f\u0639\u0645 \u0627\u0644\u062a\u0639\u0644\u0651\u0645.","Harvard Health"],t.w)
B.ahx=new A.c(B.c,["Children should not follow adult weight-loss diets; they need adequate calories and nutrients to grow.","\u064a\u062c\u0628 \u0623\u0644\u0627 \u064a\u062a\u0628\u0639 \u0627\u0644\u0623\u0637\u0641\u0627\u0644 \u0623\u0646\u0638\u0645\u0629 \u0625\u0646\u0642\u0627\u0635 \u0627\u0644\u0648\u0632\u0646 \u0627\u0644\u0645\u062e\u0635\u0635\u0629 \u0644\u0644\u0628\u0627\u0644\u063a\u064a\u0646\u061b \u0641\u0647\u0645 \u064a\u062d\u062a\u0627\u062c\u0648\u0646 \u0625\u0644\u0649 \u0633\u0639\u0631\u0627\u062a \u062d\u0631\u0627\u0631\u064a\u0629 \u0648\u0645\u063a\u0630\u064a\u0627\u062a \u0643\u0627\u0641\u064a\u0629 \u0644\u0644\u0646\u0645\u0648.","NHS"],t.w)
B.ae8=new A.c(B.c,["Omega-3 fatty acids from fish support brain development in children; aim for 1\u20132 servings per week.","\u0623\u062d\u0645\u0627\u0636 \u0623\u0648\u0645\u064a\u063a\u0627 3 \u0627\u0644\u062f\u0647\u0646\u064a\u0629 \u0645\u0646 \u0627\u0644\u0623\u0633\u0645\u0627\u0643 \u062a\u062f\u0639\u0645 \u0646\u0645\u0648 \u0627\u0644\u062f\u0645\u0627\u063a \u0644\u062f\u0649 \u0627\u0644\u0623\u0637\u0641\u0627\u0644\u061b \u0627\u0633\u062a\u0647\u062f\u0641 \u062d\u0635\u0629 \u0625\u0644\u0649 \u062d\u0635\u062a\u064a\u0646 \u0623\u0633\u0628\u0648\u0639\u064a\u0627\u064b.","Harvard Health"],t.w)
B.abk=new A.c(B.c,["Honey should never be given to children under 12 months due to the risk of infant botulism.","\u064a\u062c\u0628 \u0639\u062f\u0645 \u0625\u0639\u0637\u0627\u0621 \u0627\u0644\u0639\u0633\u0644 \u0623\u0628\u062f\u0627\u064b \u0644\u0644\u0623\u0637\u0641\u0627\u0644 \u062f\u0648\u0646 12 \u0634\u0647\u0631\u0627\u064b \u0628\u0633\u0628\u0628 \u062e\u0637\u0631 \u0627\u0644\u062a\u0633\u0645\u0645 \u0627\u0644\u063a\u0630\u0627\u0626\u064a \u0627\u0644\u0648\u0634\u064a\u0642\u064a \u0639\u0646\u062f \u0627\u0644\u0631\u0636\u0639.","NHS"],t.w)
B.agy=new A.c(B.c,["Healthy snacks for children include fruit slices, vegetable sticks with hummus, yogurt, and whole grain crackers.","\u0627\u0644\u0648\u062c\u0628\u0627\u062a \u0627\u0644\u062e\u0641\u064a\u0641\u0629 \u0627\u0644\u0635\u062d\u064a\u0629 \u0644\u0644\u0623\u0637\u0641\u0627\u0644 \u062a\u0634\u0645\u0644 \u0634\u0631\u0627\u0626\u062d \u0627\u0644\u0641\u0627\u0643\u0647\u0629 \u0648\u0623\u0635\u0627\u0628\u0639 \u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u0645\u0639 \u0627\u0644\u062d\u0645\u0635 \u0648\u0627\u0644\u0632\u0628\u0627\u062f\u064a \u0648\u0628\u0633\u0643\u0648\u064a\u062a \u0627\u0644\u062d\u0628\u0648\u0628 \u0627\u0644\u0643\u0627\u0645\u0644\u0629.","NHS"],t.w)
B.ahA=new A.c(B.c,["Excessive salt in children's diets can establish a preference for salty foods and raise blood pressure.","\u0627\u0644\u0645\u0644\u062d \u0627\u0644\u0632\u0627\u0626\u062f \u0641\u064a \u063a\u0630\u0627\u0621 \u0627\u0644\u0623\u0637\u0641\u0627\u0644 \u0642\u062f \u064a\u0631\u0633\u0651\u062e \u062a\u0641\u0636\u064a\u0644\u0627\u064b \u0644\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0645\u0627\u0644\u062d\u0629 \u0648\u064a\u0631\u0641\u0639 \u0636\u063a\u0637 \u0627\u0644\u062f\u0645.","WHO"],t.w)
B.aga=new A.c(B.c,["Exclusive breastfeeding for the first 6 months provides ideal nutrition and protects against infections.","\u0627\u0644\u0631\u0636\u0627\u0639\u0629 \u0627\u0644\u0637\u0628\u064a\u0639\u064a\u0629 \u0627\u0644\u062d\u0635\u0631\u064a\u0629 \u062e\u0644\u0627\u0644 \u0627\u0644\u0623\u0634\u0647\u0631 \u0627\u0644\u0633\u062a\u0629 \u0627\u0644\u0623\u0648\u0644\u0649 \u062a\u0648\u0641\u0631 \u062a\u063a\u0630\u064a\u0629 \u0645\u062b\u0627\u0644\u064a\u0629 \u0648\u062a\u062d\u0645\u064a \u0645\u0646 \u0627\u0644\u0639\u062f\u0648\u0649.","WHO"],t.w)
B.ad7=new A.c(B.c,["Teaching children to read simple food labels empowers them to make healthier choices as they grow.","\u062a\u0639\u0644\u064a\u0645 \u0627\u0644\u0623\u0637\u0641\u0627\u0644 \u0642\u0631\u0627\u0621\u0629 \u0645\u0644\u0635\u0642\u0627\u062a \u0627\u0644\u0637\u0639\u0627\u0645 \u0627\u0644\u0628\u0633\u064a\u0637\u0629 \u064a\u0645\u0643\u0651\u0646\u0647\u0645 \u0645\u0646 \u0627\u062a\u062e\u0627\u0630 \u062e\u064a\u0627\u0631\u0627\u062a \u0635\u062d\u064a\u0629 \u0623\u0641\u0636\u0644 \u0645\u0639 \u0646\u0645\u0648\u0647\u0645.","Harvard Health"],t.w)
B.ac0=new A.c(B.c,["Vitamin C is essential for collagen production, which keeps skin firm and helps wounds heal.","\u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u062c \u0636\u0631\u0648\u0631\u064a \u0644\u0625\u0646\u062a\u0627\u062c \u0627\u0644\u0643\u0648\u0644\u0627\u062c\u064a\u0646 \u0627\u0644\u0630\u064a \u064a\u062d\u0627\u0641\u0638 \u0639\u0644\u0649 \u0645\u062a\u0627\u0646\u0629 \u0627\u0644\u0628\u0634\u0631\u0629 \u0648\u064a\u0633\u0627\u0639\u062f \u0641\u064a \u0627\u0644\u062a\u0626\u0627\u0645 \u0627\u0644\u062c\u0631\u0648\u062d.","Harvard Health"],t.w)
B.abX=new A.c(B.c,["Omega-3 fatty acids help maintain the skin's lipid barrier, keeping it moisturized and reducing inflammation.","\u062a\u0633\u0627\u0639\u062f \u0623\u062d\u0645\u0627\u0636 \u0623\u0648\u0645\u064a\u063a\u0627 3 \u0627\u0644\u062f\u0647\u0646\u064a\u0629 \u0641\u064a \u0627\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u062d\u0627\u062c\u0632 \u0627\u0644\u062f\u0647\u0648\u0646 \u0641\u064a \u0627\u0644\u0628\u0634\u0631\u0629\u060c \u0645\u0645\u0627 \u064a\u0628\u0642\u064a\u0647\u0627 \u0631\u0637\u0628\u0629 \u0648\u064a\u0642\u0644\u0644 \u0627\u0644\u0627\u0644\u062a\u0647\u0627\u0628.","Harvard Health"],t.w)
B.adR=new A.c(B.c,["Lycopene in cooked tomatoes may provide some protection against UV skin damage from the inside.","\u0642\u062f \u064a\u0648\u0641\u0631 \u0627\u0644\u0644\u064a\u0643\u0648\u0628\u064a\u0646 \u0627\u0644\u0645\u0648\u062c\u0648\u062f \u0641\u064a \u0627\u0644\u0637\u0645\u0627\u0637\u0645 \u0627\u0644\u0645\u0637\u0628\u0648\u062e\u0629 \u0628\u0639\u0636 \u0627\u0644\u062d\u0645\u0627\u064a\u0629 \u0645\u0646 \u0623\u0636\u0631\u0627\u0631 \u0627\u0644\u0623\u0634\u0639\u0629 \u0641\u0648\u0642 \u0627\u0644\u0628\u0646\u0641\u0633\u062c\u064a\u0629 \u0644\u0644\u0628\u0634\u0631\u0629 \u0645\u0646 \u0627\u0644\u062f\u0627\u062e\u0644.","Harvard Health"],t.w)
B.acf=new A.c(B.c,["Adequate hydration helps maintain skin elasticity and overall appearance.","\u0627\u0644\u062a\u0631\u0637\u064a\u0628 \u0627\u0644\u0643\u0627\u0641\u064a \u064a\u0633\u0627\u0639\u062f \u0641\u064a \u0627\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u0645\u0631\u0648\u0646\u0629 \u0627\u0644\u0628\u0634\u0631\u0629 \u0648\u0645\u0638\u0647\u0631\u0647\u0627 \u0627\u0644\u0639\u0627\u0645.","Mayo Clinic"],t.w)
B.agn=new A.c(B.c,["Vitamin E in nuts and seeds acts as an antioxidant that protects skin cells from oxidative damage.","\u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u0647\u0640 \u0627\u0644\u0645\u0648\u062c\u0648\u062f \u0641\u064a \u0627\u0644\u0645\u0643\u0633\u0631\u0627\u062a \u0648\u0627\u0644\u0628\u0630\u0648\u0631 \u064a\u0639\u0645\u0644 \u0643\u0645\u0636\u0627\u062f \u0623\u0643\u0633\u062f\u0629 \u064a\u062d\u0645\u064a \u062e\u0644\u0627\u064a\u0627 \u0627\u0644\u0628\u0634\u0631\u0629 \u0645\u0646 \u0627\u0644\u0636\u0631\u0631 \u0627\u0644\u062a\u0623\u0643\u0633\u062f\u064a.","Harvard Health"],t.w)
B.adn=new A.c(B.c,["Beta-carotene in carrots, sweet potatoes, and pumpkin gives skin a healthy glow and acts as a natural sunscreen.","\u0627\u0644\u0628\u064a\u062a\u0627 \u0643\u0627\u0631\u0648\u062a\u064a\u0646 \u0627\u0644\u0645\u0648\u062c\u0648\u062f \u0641\u064a \u0627\u0644\u062c\u0632\u0631 \u0648\u0627\u0644\u0628\u0637\u0627\u0637\u0627 \u0627\u0644\u062d\u0644\u0648\u0629 \u0648\u0627\u0644\u064a\u0642\u0637\u064a\u0646 \u064a\u0645\u0646\u062d \u0627\u0644\u0628\u0634\u0631\u0629 \u062a\u0648\u0647\u062c\u0627\u064b \u0635\u062d\u064a\u0627\u064b \u0648\u064a\u0639\u0645\u0644 \u0643\u0648\u0627\u0642\u064d \u0637\u0628\u064a\u0639\u064a \u0645\u0646 \u0627\u0644\u0634\u0645\u0633.","Harvard Health"],t.w)
B.afL=new A.c(B.c,["High-sugar diets accelerate glycation, a process that damages collagen and elastin, leading to premature aging.","\u0627\u0644\u0623\u0646\u0638\u0645\u0629 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0627\u0644\u063a\u0646\u064a\u0629 \u0628\u0627\u0644\u0633\u0643\u0631 \u062a\u064f\u0633\u0631\u0651\u0639 \u0639\u0645\u0644\u064a\u0629 \u0627\u0644\u063a\u0644\u0648\u0632\u0629 \u0627\u0644\u062a\u064a \u062a\u064f\u062a\u0644\u0641 \u0627\u0644\u0643\u0648\u0644\u0627\u062c\u064a\u0646 \u0648\u0627\u0644\u0625\u064a\u0644\u0627\u0633\u062a\u064a\u0646\u060c \u0645\u0645\u0627 \u064a\u0624\u062f\u064a \u0625\u0644\u0649 \u0627\u0644\u0634\u064a\u062e\u0648\u062e\u0629 \u0627\u0644\u0645\u0628\u0643\u0631\u0629.","Harvard Health"],t.w)
B.aiq=new A.c(B.c,["Zinc supports skin repair and renewal; deficiency can cause slow wound healing and skin rashes.","\u0627\u0644\u0632\u0646\u0643 \u064a\u062f\u0639\u0645 \u0625\u0635\u0644\u0627\u062d \u0627\u0644\u0628\u0634\u0631\u0629 \u0648\u062a\u062c\u062f\u062f\u0647\u0627\u061b \u0648\u0646\u0642\u0635\u0647 \u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u0633\u0628\u0628 \u0628\u0637\u0621 \u0627\u0644\u062a\u0626\u0627\u0645 \u0627\u0644\u062c\u0631\u0648\u062d \u0648\u0637\u0641\u062d\u0627\u064b \u062c\u0644\u062f\u064a\u0627\u064b.","Mayo Clinic"],t.w)
B.adL=new A.c(B.c,["Green tea polyphenols may protect skin from UV radiation and improve skin elasticity.","\u0642\u062f \u062a\u062d\u0645\u064a \u0645\u0627\u062f\u0629 \u0627\u0644\u0628\u0648\u0644\u064a\u0641\u064a\u0646\u0648\u0644 \u0641\u064a \u0627\u0644\u0634\u0627\u064a \u0627\u0644\u0623\u062e\u0636\u0631 \u0627\u0644\u0628\u0634\u0631\u0629 \u0645\u0646 \u0627\u0644\u0623\u0634\u0639\u0629 \u0641\u0648\u0642 \u0627\u0644\u0628\u0646\u0641\u0633\u062c\u064a\u0629 \u0648\u062a\u062d\u0633\u0651\u0646 \u0645\u0631\u0648\u0646\u062a\u0647\u0627.","Harvard Health"],t.w)
B.afU=new A.c(B.c,["Avocados provide healthy fats and vitamins C and E, all of which support skin health.","\u064a\u0648\u0641\u0631 \u0627\u0644\u0623\u0641\u0648\u0643\u0627\u062f\u0648 \u062f\u0647\u0648\u0646\u0627\u064b \u0635\u062d\u064a\u0629 \u0648\u0641\u064a\u062a\u0627\u0645\u064a\u0646\u0627\u062a \u062c \u0648\u0647\u0640\u060c \u0648\u062c\u0645\u064a\u0639\u0647\u0627 \u062a\u062f\u0639\u0645 \u0635\u062d\u0629 \u0627\u0644\u0628\u0634\u0631\u0629.","Harvard Health"],t.w)
B.ah5=new A.c(B.c,["Excessive alcohol consumption dehydrates the skin and can worsen conditions like rosacea and eczema.","\u0627\u0644\u0625\u0641\u0631\u0627\u0637 \u0641\u064a \u0627\u0633\u062a\u0647\u0644\u0627\u0643 \u0627\u0644\u0643\u062d\u0648\u0644 \u064a\u064f\u062c\u0641\u0641 \u0627\u0644\u0628\u0634\u0631\u0629 \u0648\u0642\u062f \u064a\u064f\u0641\u0627\u0642\u0645 \u062d\u0627\u0644\u0627\u062a \u0645\u062b\u0644 \u0627\u0644\u0648\u0631\u062f\u064a\u0629 \u0648\u0627\u0644\u0623\u0643\u0632\u064a\u0645\u0627.","NHS"],t.w)
B.afX=new A.c(B.c,["Biotin (vitamin B7) supports healthy skin, hair, and nails; eggs, nuts, and whole grains are good sources.","\u0627\u0644\u0628\u064a\u0648\u062a\u064a\u0646 (\u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u06287) \u064a\u062f\u0639\u0645 \u0635\u062d\u0629 \u0627\u0644\u0628\u0634\u0631\u0629 \u0648\u0627\u0644\u0634\u0639\u0631 \u0648\u0627\u0644\u0623\u0638\u0627\u0641\u0631\u061b \u0627\u0644\u0628\u064a\u0636 \u0648\u0627\u0644\u0645\u0643\u0633\u0631\u0627\u062a \u0648\u0627\u0644\u062d\u0628\u0648\u0628 \u0627\u0644\u0643\u0627\u0645\u0644\u0629 \u0645\u0635\u0627\u062f\u0631 \u062c\u064a\u062f\u0629 \u0644\u0647.","Mayo Clinic"],t.w)
B.adW=new A.c(B.c,["Dark chocolate (70%+ cocoa) contains flavonoids that may improve skin hydration and blood flow to the skin.","\u0627\u0644\u0634\u0648\u0643\u0648\u0644\u0627\u062a\u0629 \u0627\u0644\u062f\u0627\u0643\u0646\u0629 (\u0628\u0646\u0633\u0628\u0629 \u0643\u0627\u0643\u0627\u0648 70% \u0623\u0648 \u0623\u0643\u062b\u0631) \u062a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u0627\u0644\u0641\u0644\u0627\u0641\u0648\u0646\u0648\u064a\u062f\u0627\u062a \u0627\u0644\u062a\u064a \u0642\u062f \u062a\u062d\u0633\u0651\u0646 \u062a\u0631\u0637\u064a\u0628 \u0627\u0644\u0628\u0634\u0631\u0629 \u0648\u062a\u062f\u0641\u0642 \u0627\u0644\u062f\u0645 \u0625\u0644\u064a\u0647\u0627.","Harvard Health"],t.w)
B.agT=new A.c(B.c,["Selenium helps protect skin from oxidative stress; Brazil nuts, fish, and eggs are excellent sources.","\u0627\u0644\u0633\u064a\u0644\u064a\u0646\u064a\u0648\u0645 \u064a\u0633\u0627\u0639\u062f \u0641\u064a \u062d\u0645\u0627\u064a\u0629 \u0627\u0644\u0628\u0634\u0631\u0629 \u0645\u0646 \u0627\u0644\u0625\u062c\u0647\u0627\u062f \u0627\u0644\u062a\u0623\u0643\u0633\u062f\u064a\u061b \u0627\u0644\u062c\u0648\u0632 \u0627\u0644\u0628\u0631\u0627\u0632\u064a\u0644\u064a \u0648\u0627\u0644\u0623\u0633\u0645\u0627\u0643 \u0648\u0627\u0644\u0628\u064a\u0636 \u0645\u0635\u0627\u062f\u0631 \u0645\u0645\u062a\u0627\u0632\u0629 \u0644\u0647.","Harvard Health"],t.w)
B.aiF=new A.c(B.c,["A diet rich in fruits and vegetables provides antioxidants that combat free radical damage to skin cells.","\u0627\u0644\u0646\u0638\u0627\u0645 \u0627\u0644\u063a\u0630\u0627\u0626\u064a \u0627\u0644\u063a\u0646\u064a \u0628\u0627\u0644\u0641\u0648\u0627\u0643\u0647 \u0648\u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u064a\u0648\u0641\u0631 \u0645\u0636\u0627\u062f\u0627\u062a \u0623\u0643\u0633\u062f\u0629 \u062a\u0643\u0627\u0641\u062d \u0623\u0636\u0631\u0627\u0631 \u0627\u0644\u062c\u0630\u0648\u0631 \u0627\u0644\u062d\u0631\u0629 \u0644\u062e\u0644\u0627\u064a\u0627 \u0627\u0644\u0628\u0634\u0631\u0629.","NHS"],t.w)
B.aiz=new A.c(B.c,["Older adults need more protein per kilogram of body weight to maintain muscle mass and prevent sarcopenia.","\u064a\u062d\u062a\u0627\u062c \u0643\u0628\u0627\u0631 \u0627\u0644\u0633\u0646 \u0625\u0644\u0649 \u0627\u0644\u0645\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0644\u0643\u0644 \u0643\u064a\u0644\u0648\u063a\u0631\u0627\u0645 \u0645\u0646 \u0648\u0632\u0646 \u0627\u0644\u062c\u0633\u0645 \u0644\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u0627\u0644\u0643\u062a\u0644\u0629 \u0627\u0644\u0639\u0636\u0644\u064a\u0629 \u0648\u0627\u0644\u0648\u0642\u0627\u064a\u0629 \u0645\u0646 \u0636\u0645\u0648\u0631 \u0627\u0644\u0639\u0636\u0644\u0627\u062a.","Harvard Health"],t.w)
B.ai6=new A.c(B.c,["Vitamin B12 absorption decreases with age; adults over 50 should consider fortified foods or supplements.","\u064a\u062a\u0646\u0627\u0642\u0635 \u0627\u0645\u062a\u0635\u0627\u0635 \u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u062812 \u0645\u0639 \u0627\u0644\u062a\u0642\u062f\u0645 \u0641\u064a \u0627\u0644\u0639\u0645\u0631\u061b \u064a\u064f\u0646\u0635\u062d \u0627\u0644\u0628\u0627\u0644\u063a\u0648\u0646 \u0641\u0648\u0642 \u0627\u0644\u062e\u0645\u0633\u064a\u0646 \u0628\u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0645\u062f\u0639\u0651\u0645\u0629 \u0623\u0648 \u0627\u0644\u0645\u0643\u0645\u0644\u0627\u062a.","NHS"],t.w)
B.afp=new A.c(B.c,["Calcium needs increase after age 50; aim for 1200 mg per day from food and supplements if needed.","\u062a\u0632\u062f\u0627\u062f \u0627\u0644\u062d\u0627\u062c\u0629 \u0625\u0644\u0649 \u0627\u0644\u0643\u0627\u0644\u0633\u064a\u0648\u0645 \u0628\u0639\u062f \u0633\u0646 \u0627\u0644\u062e\u0645\u0633\u064a\u0646\u061b \u0627\u0633\u062a\u0647\u062f\u0641 1200 \u0645\u0644\u063a \u064a\u0648\u0645\u064a\u0627\u064b \u0645\u0646 \u0627\u0644\u063a\u0630\u0627\u0621 \u0648\u0627\u0644\u0645\u0643\u0645\u0644\u0627\u062a \u0639\u0646\u062f \u0627\u0644\u062d\u0627\u062c\u0629.","Mayo Clinic"],t.w)
B.adj=new A.c(B.c,["The Mediterranean diet is associated with slower cognitive decline and reduced risk of Alzheimer's disease.","\u064a\u0631\u062a\u0628\u0637 \u0646\u0638\u0627\u0645 \u062d\u0645\u064a\u0629 \u0627\u0644\u0628\u062d\u0631 \u0627\u0644\u0623\u0628\u064a\u0636 \u0627\u0644\u0645\u062a\u0648\u0633\u0637 \u0628\u062a\u0628\u0627\u0637\u0624 \u0627\u0644\u062a\u062f\u0647\u0648\u0631 \u0627\u0644\u0645\u0639\u0631\u0641\u064a \u0648\u0627\u0646\u062e\u0641\u0627\u0636 \u062e\u0637\u0631 \u0627\u0644\u0625\u0635\u0627\u0628\u0629 \u0628\u0645\u0631\u0636 \u0627\u0644\u0632\u0647\u0627\u064a\u0645\u0631.","Harvard Health"],t.w)
B.aid=new A.c(B.c,["Dehydration risk increases with age as the sense of thirst diminishes; drink water regularly throughout the day.","\u064a\u0632\u062f\u0627\u062f \u062e\u0637\u0631 \u0627\u0644\u062c\u0641\u0627\u0641 \u0645\u0639 \u0627\u0644\u062a\u0642\u062f\u0645 \u0641\u064a \u0627\u0644\u0639\u0645\u0631 \u0644\u0623\u0646 \u0627\u0644\u0625\u062d\u0633\u0627\u0633 \u0628\u0627\u0644\u0639\u0637\u0634 \u064a\u062a\u0631\u0627\u062c\u0639\u061b \u0627\u0634\u0631\u0628 \u0627\u0644\u0645\u0627\u0621 \u0628\u0627\u0646\u062a\u0638\u0627\u0645 \u0637\u0648\u0627\u0644 \u0627\u0644\u064a\u0648\u0645.","NHS"],t.w)
B.abo=new A.c(B.c,["Blueberries and other berry fruits may help protect the brain from age-related decline due to their flavonoid content.","\u0642\u062f \u064a\u0633\u0627\u0639\u062f \u0627\u0644\u062a\u0648\u062a \u0627\u0644\u0623\u0632\u0631\u0642 \u0648\u0623\u0646\u0648\u0627\u0639 \u0627\u0644\u062a\u0648\u062a \u0627\u0644\u0623\u062e\u0631\u0649 \u0641\u064a \u062d\u0645\u0627\u064a\u0629 \u0627\u0644\u062f\u0645\u0627\u063a \u0645\u0646 \u0627\u0644\u062a\u062f\u0647\u0648\u0631 \u0627\u0644\u0645\u0631\u062a\u0628\u0637 \u0628\u0627\u0644\u062a\u0642\u062f\u0645 \u0641\u064a \u0627\u0644\u0639\u0645\u0631 \u0628\u0641\u0636\u0644 \u0645\u062d\u062a\u0648\u0627\u0647\u0627 \u0645\u0646 \u0645\u0631\u0643\u0628\u0627\u062a \u0627\u0644\u0641\u0644\u0627\u0641\u0648\u0646\u0648\u064a\u062f.","Harvard Health"],t.w)
B.acy=new A.c(B.c,["Vitamin D supplementation becomes more important with age as the skin's ability to synthesize it from sunlight decreases.","\u062a\u0632\u062f\u0627\u062f \u0623\u0647\u0645\u064a\u0629 \u0645\u0643\u0645\u0644\u0627\u062a \u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u062f \u0645\u0639 \u0627\u0644\u062a\u0642\u062f\u0645 \u0641\u064a \u0627\u0644\u0639\u0645\u0631\u060c \u0625\u0630 \u062a\u062a\u0631\u0627\u062c\u0639 \u0642\u062f\u0631\u0629 \u0627\u0644\u062c\u0644\u062f \u0639\u0644\u0649 \u062a\u0635\u0646\u064a\u0639\u0647 \u0645\u0646 \u0623\u0634\u0639\u0629 \u0627\u0644\u0634\u0645\u0633.","NHS"],t.w)
B.agM=new A.c(B.c,["Sarcopenia (age-related muscle loss) can be slowed with adequate protein intake and resistance exercise.","\u064a\u0645\u0643\u0646 \u0625\u0628\u0637\u0627\u0621 \u0636\u0645\u0648\u0631 \u0627\u0644\u0639\u0636\u0644\u0627\u062a \u0627\u0644\u0645\u0631\u062a\u0628\u0637 \u0628\u0627\u0644\u0639\u0645\u0631 (\u0627\u0644\u0633\u0627\u0631\u0643\u0648\u0628\u064a\u0646\u064a\u0627) \u0645\u0646 \u062e\u0644\u0627\u0644 \u062a\u0646\u0627\u0648\u0644 \u0643\u0645\u064a\u0627\u062a \u0643\u0627\u0641\u064a\u0629 \u0645\u0646 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0648\u0645\u0645\u0627\u0631\u0633\u0629 \u062a\u0645\u0627\u0631\u064a\u0646 \u0627\u0644\u0645\u0642\u0627\u0648\u0645\u0629.","Mayo Clinic"],t.w)
B.ahn=new A.c(B.c,["Omega-3 fatty acids may help reduce inflammation associated with age-related diseases like arthritis.","\u0642\u062f \u062a\u0633\u0627\u0639\u062f \u0623\u062d\u0645\u0627\u0636 \u0623\u0648\u0645\u064a\u063a\u0627-3 \u0627\u0644\u062f\u0647\u0646\u064a\u0629 \u0641\u064a \u062a\u0642\u0644\u064a\u0644 \u0627\u0644\u0627\u0644\u062a\u0647\u0627\u0628\u0627\u062a \u0627\u0644\u0645\u0631\u062a\u0628\u0637\u0629 \u0628\u0623\u0645\u0631\u0627\u0636 \u0627\u0644\u0634\u064a\u062e\u0648\u062e\u0629 \u0643\u0627\u0644\u062a\u0647\u0627\u0628 \u0627\u0644\u0645\u0641\u0627\u0635\u0644.","Harvard Health"],t.w)
B.ag9=new A.c(B.c,["Fiber intake remains important for older adults to maintain digestive health and prevent constipation.","\u064a\u0638\u0644 \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0645\u0647\u0645\u064b\u0627 \u0644\u0643\u0628\u0627\u0631 \u0627\u0644\u0633\u0646 \u0644\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u0635\u062d\u0629 \u0627\u0644\u062c\u0647\u0627\u0632 \u0627\u0644\u0647\u0636\u0645\u064a \u0648\u0627\u0644\u0648\u0642\u0627\u064a\u0629 \u0645\u0646 \u0627\u0644\u0625\u0645\u0633\u0627\u0643.","NHS"],t.w)
B.ac1=new A.c(B.c,["Smaller, more frequent meals can help older adults who find large meals difficult or have reduced appetite.","\u064a\u0645\u0643\u0646 \u0644\u0644\u0648\u062c\u0628\u0627\u062a \u0627\u0644\u0635\u063a\u064a\u0631\u0629 \u0648\u0627\u0644\u0645\u062a\u0643\u0631\u0631\u0629 \u0623\u0646 \u062a\u0633\u0627\u0639\u062f \u0643\u0628\u0627\u0631 \u0627\u0644\u0633\u0646 \u0627\u0644\u0630\u064a\u0646 \u064a\u062c\u062f\u0648\u0646 \u0635\u0639\u0648\u0628\u0629 \u0641\u064a \u062a\u0646\u0627\u0648\u0644 \u0648\u062c\u0628\u0627\u062a \u0643\u0628\u064a\u0631\u0629 \u0623\u0648 \u064a\u0639\u0627\u0646\u0648\u0646 \u0645\u0646 \u0636\u0639\u0641 \u0627\u0644\u0634\u0647\u064a\u0629.","NHS"],t.w)
B.abb=new A.c(B.c,["Leafy green vegetables (spinach, kale) are associated with slower age-related cognitive decline.","\u062a\u0631\u062a\u0628\u0637 \u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u0627\u0644\u0648\u0631\u0642\u064a\u0629 \u0627\u0644\u062e\u0636\u0631\u0627\u0621 (\u0643\u0627\u0644\u0633\u0628\u0627\u0646\u062e \u0648\u0627\u0644\u0643\u0631\u0646\u0628 \u0627\u0644\u0623\u062c\u0639\u062f) \u0628\u0625\u0628\u0637\u0627\u0621 \u0627\u0644\u062a\u062f\u0647\u0648\u0631 \u0627\u0644\u0645\u0639\u0631\u0641\u064a \u0627\u0644\u0645\u0631\u062a\u0628\u0637 \u0628\u0627\u0644\u0639\u0645\u0631.","Harvard Health"],t.w)
B.aiL=new A.c(B.c,["Potassium becomes more important with age to help control blood pressure; bananas, potatoes, and beans are good sources.","\u064a\u0632\u062f\u0627\u062f \u0627\u0644\u0628\u0648\u062a\u0627\u0633\u064a\u0648\u0645 \u0623\u0647\u0645\u064a\u0629 \u0645\u0639 \u0627\u0644\u062a\u0642\u062f\u0645 \u0641\u064a \u0627\u0644\u0639\u0645\u0631 \u0644\u0644\u0645\u0633\u0627\u0639\u062f\u0629 \u0641\u064a \u0627\u0644\u062a\u062d\u0643\u0645 \u0628\u0636\u063a\u0637 \u0627\u0644\u062f\u0645\u061b \u0648\u0627\u0644\u0645\u0648\u0632 \u0648\u0627\u0644\u0628\u0637\u0627\u0637\u0627 \u0648\u0627\u0644\u0628\u0642\u0648\u0644\u064a\u0627\u062a \u0645\u0635\u0627\u062f\u0631 \u062c\u064a\u062f\u0629 \u0644\u0647.","Harvard Health"],t.w)
B.abl=new A.c(B.c,["Social isolation can reduce appetite in older adults; eating with others encourages better nutrition.","\u0642\u062f \u062a\u0642\u0644\u0644 \u0627\u0644\u0639\u0632\u0644\u0629 \u0627\u0644\u0627\u062c\u062a\u0645\u0627\u0639\u064a\u0629 \u0645\u0646 \u0634\u0647\u064a\u0629 \u0643\u0628\u0627\u0631 \u0627\u0644\u0633\u0646\u061b \u0648\u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0637\u0639\u0627\u0645 \u0645\u0639 \u0627\u0644\u0622\u062e\u0631\u064a\u0646 \u064a\u0634\u062c\u0639 \u0639\u0644\u0649 \u062a\u063a\u0630\u064a\u0629 \u0623\u0641\u0636\u0644.","NHS"],t.w)
B.ahT=new A.c(B.c,["Foods fortified with vitamin D and calcium (like fortified cereals and plant milks) are especially valuable for older adults.","\u062a\u064f\u0639\u062f\u0651 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0645\u062f\u0639\u0645\u0629 \u0628\u0641\u064a\u062a\u0627\u0645\u064a\u0646 \u062f \u0648\u0627\u0644\u0643\u0627\u0644\u0633\u064a\u0648\u0645 (\u0643\u062d\u0628\u0648\u0628 \u0627\u0644\u0625\u0641\u0637\u0627\u0631 \u0627\u0644\u0645\u062f\u0639\u0645\u0629 \u0648\u062d\u0644\u064a\u0628 \u0627\u0644\u0646\u0628\u0627\u062a) \u0630\u0627\u062a \u0642\u064a\u0645\u0629 \u062e\u0627\u0635\u0629 \u0644\u0643\u0628\u0627\u0631 \u0627\u0644\u0633\u0646.","Mayo Clinic"],t.w)
B.aeT=new A.c(B.c,["Antioxidant-rich foods (berries, dark chocolate, pecans) help combat oxidative stress associated with aging.","\u062a\u0633\u0627\u0639\u062f \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u063a\u0646\u064a\u0629 \u0628\u0645\u0636\u0627\u062f\u0627\u062a \u0627\u0644\u0623\u0643\u0633\u062f\u0629 (\u0643\u0627\u0644\u062a\u0648\u062a \u0648\u0627\u0644\u0634\u0648\u0643\u0648\u0644\u0627\u062a\u0629 \u0627\u0644\u062f\u0627\u0643\u0646\u0629 \u0648\u0627\u0644\u062c\u0648\u0632 \u0627\u0644\u0628\u0642\u0627\u0646) \u0641\u064a \u0645\u0643\u0627\u0641\u062d\u0629 \u0627\u0644\u0625\u062c\u0647\u0627\u062f \u0627\u0644\u062a\u0623\u0643\u0633\u062f\u064a \u0627\u0644\u0645\u0631\u062a\u0628\u0637 \u0628\u0627\u0644\u0634\u064a\u062e\u0648\u062e\u0629.","Harvard Health"],t.w)
B.aix=new A.c(B.c,["Adequate folate intake helps maintain red blood cell production, which can decline with age.","\u064a\u0633\u0627\u0639\u062f \u062a\u0646\u0627\u0648\u0644 \u0643\u0645\u064a\u0629 \u0643\u0627\u0641\u064a\u0629 \u0645\u0646 \u062d\u0645\u0636 \u0627\u0644\u0641\u0648\u0644\u064a\u0643 \u0641\u064a \u0627\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u0625\u0646\u062a\u0627\u062c \u062e\u0644\u0627\u064a\u0627 \u0627\u0644\u062f\u0645 \u0627\u0644\u062d\u0645\u0631\u0627\u0621 \u0627\u0644\u0630\u064a \u0642\u062f \u064a\u062a\u0631\u0627\u062c\u0639 \u0645\u0639 \u0627\u0644\u062a\u0642\u062f\u0645 \u0641\u064a \u0627\u0644\u0639\u0645\u0631.","Harvard Health"],t.w)
B.afn=new A.c(B.c,["Staying well-nourished supports immune function, which naturally weakens with age.","\u064a\u062f\u0639\u0645 \u0627\u0644\u062d\u0635\u0648\u0644 \u0639\u0644\u0649 \u062a\u063a\u0630\u064a\u0629 \u062c\u064a\u062f\u0629 \u0648\u0638\u064a\u0641\u0629 \u0627\u0644\u062c\u0647\u0627\u0632 \u0627\u0644\u0645\u0646\u0627\u0639\u064a \u0627\u0644\u062a\u064a \u062a\u0636\u0639\u0641 \u0628\u0634\u0643\u0644 \u0637\u0628\u064a\u0639\u064a \u0645\u0639 \u0627\u0644\u062a\u0642\u062f\u0645 \u0641\u064a \u0627\u0644\u0639\u0645\u0631.","NHS"],t.w)
B.ahF=new A.c(B.c,["Dental health affects nutrition in older adults; soft-textured protein sources like eggs, fish, and yogurt can help.","\u062a\u0624\u062b\u0631 \u0635\u062d\u0629 \u0627\u0644\u0623\u0633\u0646\u0627\u0646 \u0639\u0644\u0649 \u062a\u063a\u0630\u064a\u0629 \u0643\u0628\u0627\u0631 \u0627\u0644\u0633\u0646\u061b \u0648\u064a\u0645\u0643\u0646 \u0623\u0646 \u062a\u0633\u0627\u0639\u062f \u0645\u0635\u0627\u062f\u0631 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0637\u0631\u064a\u0629 \u0627\u0644\u0642\u0648\u0627\u0645 \u0643\u0627\u0644\u0628\u064a\u0636 \u0648\u0627\u0644\u0633\u0645\u0643 \u0648\u0627\u0644\u0632\u0628\u0627\u062f\u064a.","NHS"],t.w)
B.abv=new A.c(B.c,["The MIND diet (combining Mediterranean and DASH diets) was specifically designed to support brain health in aging.","\u0635\u064f\u0645\u0645 \u0646\u0638\u0627\u0645 \u0645\u0627\u064a\u0646\u062f \u0627\u0644\u063a\u0630\u0627\u0626\u064a (\u0627\u0644\u0630\u064a \u064a\u062c\u0645\u0639 \u0628\u064a\u0646 \u062d\u0645\u064a\u0629 \u0627\u0644\u0628\u062d\u0631 \u0627\u0644\u0623\u0628\u064a\u0636 \u0627\u0644\u0645\u062a\u0648\u0633\u0637 \u0648\u062d\u0645\u064a\u0629 \u062f\u0627\u0634) \u062e\u0635\u064a\u0635\u064b\u0627 \u0644\u062f\u0639\u0645 \u0635\u062d\u0629 \u0627\u0644\u062f\u0645\u0627\u063a \u0623\u062b\u0646\u0627\u0621 \u0627\u0644\u0634\u064a\u062e\u0648\u062e\u0629.","Harvard Health"],t.w)
B.ade=new A.c(B.c,["Carbohydrates are the primary fuel source during moderate-to-high intensity exercise.","\u0627\u0644\u0643\u0631\u0628\u0648\u0647\u064a\u062f\u0631\u0627\u062a \u0647\u064a \u0645\u0635\u062f\u0631 \u0627\u0644\u0648\u0642\u0648\u062f \u0627\u0644\u0623\u0633\u0627\u0633\u064a \u0623\u062b\u0646\u0627\u0621 \u0627\u0644\u062a\u0645\u0627\u0631\u064a\u0646 \u0645\u062a\u0648\u0633\u0637\u0629 \u0625\u0644\u0649 \u0639\u0627\u0644\u064a\u0629 \u0627\u0644\u0634\u062f\u0629.","Mayo Clinic"],t.w)
B.afs=new A.c(B.c,["Eating a meal 2\u20133 hours before exercise provides energy without causing digestive discomfort.","\u064a\u0648\u0641\u0631 \u062a\u0646\u0627\u0648\u0644 \u0648\u062c\u0628\u0629 \u0642\u0628\u0644 \u0627\u0644\u062a\u0645\u0631\u064a\u0646 \u0628\u0633\u0627\u0639\u062a\u064a\u0646 \u0625\u0644\u0649 \u062b\u0644\u0627\u062b \u0633\u0627\u0639\u0627\u062a \u0627\u0644\u0637\u0627\u0642\u0629 \u062f\u0648\u0646 \u0627\u0644\u062a\u0633\u0628\u0628 \u0641\u064a \u0627\u0636\u0637\u0631\u0627\u0628\u0627\u062a \u0647\u0636\u0645\u064a\u0629.","Mayo Clinic"],t.w)
B.acO=new A.c(B.c,["Post-exercise nutrition should include both carbohydrates (to replenish glycogen) and protein (for muscle repair).","\u064a\u062c\u0628 \u0623\u0646 \u062a\u062a\u0636\u0645\u0646 \u0627\u0644\u062a\u063a\u0630\u064a\u0629 \u0628\u0639\u062f \u0627\u0644\u062a\u0645\u0631\u064a\u0646 \u0643\u0631\u0628\u0648\u0647\u064a\u062f\u0631\u0627\u062a (\u0644\u062a\u0639\u0648\u064a\u0636 \u0627\u0644\u063a\u0644\u064a\u0643\u0648\u062c\u064a\u0646) \u0648\u0628\u0631\u0648\u062a\u064a\u0646\u064b\u0627 (\u0644\u0625\u0635\u0644\u0627\u062d \u0627\u0644\u0639\u0636\u0644\u0627\u062a).","Harvard Health"],t.w)
B.abE=new A.c(B.c,["For exercise lasting less than 60 minutes, water is sufficient; sports drinks are unnecessary.","\u0628\u0627\u0644\u0646\u0633\u0628\u0629 \u0644\u0644\u062a\u0645\u0627\u0631\u064a\u0646 \u0627\u0644\u062a\u064a \u062a\u0642\u0644 \u0645\u062f\u062a\u0647\u0627 \u0639\u0646 60 \u062f\u0642\u064a\u0642\u0629\u060c \u064a\u0643\u0641\u064a \u0634\u0631\u0628 \u0627\u0644\u0645\u0627\u0621\u061b \u0648\u0644\u0627 \u062d\u0627\u062c\u0629 \u0644\u0645\u0634\u0631\u0648\u0628\u0627\u062a \u0627\u0644\u0637\u0627\u0642\u0629 \u0627\u0644\u0631\u064a\u0627\u0636\u064a\u0629.","Mayo Clinic"],t.w)
B.afb=new A.c(B.c,["Bananas are an excellent pre-workout snack, providing easily digestible carbohydrates and potassium.","\u064a\u064f\u0639\u062f\u0651 \u0627\u0644\u0645\u0648\u0632 \u0648\u062c\u0628\u0629 \u062e\u0641\u064a\u0641\u0629 \u0645\u0645\u062a\u0627\u0632\u0629 \u0642\u0628\u0644 \u0627\u0644\u062a\u0645\u0631\u064a\u0646\u060c \u0625\u0630 \u064a\u0648\u0641\u0631 \u0643\u0631\u0628\u0648\u0647\u064a\u062f\u0631\u0627\u062a \u0633\u0647\u0644\u0629 \u0627\u0644\u0647\u0636\u0645 \u0648\u0628\u0648\u062a\u0627\u0633\u064a\u0648\u0645.","Harvard Health"],t.w)
B.abT=new A.c(B.c,["Chocolate milk is an effective post-workout recovery drink due to its optimal ratio of carbs to protein.","\u064a\u064f\u0639\u062a\u0628\u0631 \u062d\u0644\u064a\u0628 \u0627\u0644\u0634\u0648\u0643\u0648\u0644\u0627\u062a\u0629 \u0645\u0634\u0631\u0648\u0628\u064b\u0627 \u0641\u0639\u0627\u0644\u064b\u0627 \u0644\u0644\u062a\u0639\u0627\u0641\u064a \u0628\u0639\u062f \u0627\u0644\u062a\u0645\u0631\u064a\u0646 \u0628\u0641\u0636\u0644 \u0646\u0633\u0628\u062a\u0647 \u0627\u0644\u0645\u062b\u0627\u0644\u064a\u0629 \u0645\u0646 \u0627\u0644\u0643\u0631\u0628\u0648\u0647\u064a\u062f\u0631\u0627\u062a \u0625\u0644\u0649 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646.","Harvard Health"],t.w)
B.adx=new A.c(B.c,["Creatine is one of the most well-studied sports supplements and can improve performance in short, intense activities.","\u064a\u064f\u0639\u062f\u0651 \u0627\u0644\u0643\u0631\u064a\u0627\u062a\u064a\u0646 \u0645\u0646 \u0623\u0643\u062b\u0631 \u0627\u0644\u0645\u0643\u0645\u0644\u0627\u062a \u0627\u0644\u0631\u064a\u0627\u0636\u064a\u0629 \u0627\u0644\u062a\u064a \u062e\u0636\u0639\u062a \u0644\u0644\u062f\u0631\u0627\u0633\u0629\u060c \u0648\u064a\u0645\u0643\u0646\u0647 \u062a\u062d\u0633\u064a\u0646 \u0627\u0644\u0623\u062f\u0627\u0621 \u0641\u064a \u0627\u0644\u0623\u0646\u0634\u0637\u0629 \u0627\u0644\u0642\u0635\u064a\u0631\u0629 \u0648\u0627\u0644\u0645\u0643\u062b\u0641\u0629.","Mayo Clinic"],t.w)
B.ai0=new A.c(B.c,["Electrolytes (sodium, potassium, magnesium) lost through sweat need to be replaced during prolonged exercise.","\u064a\u062c\u0628 \u062a\u0639\u0648\u064a\u0636 \u0627\u0644\u0625\u0644\u0643\u062a\u0631\u0648\u0644\u064a\u062a\u0627\u062a (\u0627\u0644\u0635\u0648\u062f\u064a\u0648\u0645 \u0648\u0627\u0644\u0628\u0648\u062a\u0627\u0633\u064a\u0648\u0645 \u0648\u0627\u0644\u0645\u063a\u0646\u064a\u0633\u064a\u0648\u0645) \u0627\u0644\u0645\u0641\u0642\u0648\u062f\u0629 \u0639\u0628\u0631 \u0627\u0644\u062a\u0639\u0631\u0642 \u0623\u062b\u0646\u0627\u0621 \u0627\u0644\u062a\u0645\u0627\u0631\u064a\u0646 \u0627\u0644\u0645\u0637\u0648\u0644\u0629.","Mayo Clinic"],t.w)
B.ah8=new A.c(B.c,["Caffeine consumed 30\u201360 minutes before exercise can improve endurance performance and reduce perceived effort.","\u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u062d\u0633\u0651\u0646 \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0643\u0627\u0641\u064a\u064a\u0646 \u0642\u0628\u0644 \u0627\u0644\u062a\u0645\u0631\u064a\u0646 \u0628\u0640 30 \u0625\u0644\u0649 60 \u062f\u0642\u064a\u0642\u0629 \u0645\u0646 \u0623\u062f\u0627\u0621 \u0627\u0644\u062a\u062d\u0645\u0644 \u0648\u064a\u0642\u0644\u0644 \u0627\u0644\u0634\u0639\u0648\u0631 \u0628\u0627\u0644\u062c\u0647\u062f.","Harvard Health"],t.w)
B.ae0=new A.c(B.c,["Female athletes should pay special attention to iron intake, as deficiency can impair performance.","\u064a\u062c\u0628 \u0639\u0644\u0649 \u0627\u0644\u0631\u064a\u0627\u0636\u064a\u0627\u062a \u0627\u0644\u0625\u0646\u0627\u062b \u0627\u0644\u0627\u0647\u062a\u0645\u0627\u0645 \u0628\u0634\u0643\u0644 \u062e\u0627\u0635 \u0628\u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u062d\u062f\u064a\u062f\u060c \u0625\u0630 \u0642\u062f \u064a\u0624\u062b\u0631 \u0646\u0642\u0635\u0647 \u0633\u0644\u0628\u064b\u0627 \u0639\u0644\u0649 \u0627\u0644\u0623\u062f\u0627\u0621.","Mayo Clinic"],t.w)
B.aiI=new A.c(B.c,["Overhydrating during exercise (hyponatremia) can be dangerous; drink to thirst rather than forcing fluids.","\u0642\u062f \u064a\u0643\u0648\u0646 \u0627\u0644\u0625\u0641\u0631\u0627\u0637 \u0641\u064a \u0634\u0631\u0628 \u0627\u0644\u0645\u0627\u0621 \u0623\u062b\u0646\u0627\u0621 \u0627\u0644\u062a\u0645\u0631\u064a\u0646 (\u0646\u0642\u0635 \u0635\u0648\u062f\u064a\u0648\u0645 \u0627\u0644\u062f\u0645) \u062e\u0637\u064a\u0631\u064b\u0627\u061b \u0627\u0634\u0631\u0628 \u0648\u0641\u0642\u064b\u0627 \u0644\u0634\u0639\u0648\u0631\u0643 \u0628\u0627\u0644\u0639\u0637\u0634 \u0628\u062f\u0644\u064b\u0627 \u0645\u0646 \u0625\u062c\u0628\u0627\u0631 \u0646\u0641\u0633\u0643 \u0639\u0644\u0649 \u0634\u0631\u0628 \u0627\u0644\u0633\u0648\u0627\u0626\u0644.","Harvard Health"],t.w)
B.abs=new A.c(B.c,["Complex carbs (oatmeal, whole grain toast) are better pre-exercise choices than simple sugars for sustained energy.","\u062a\u064f\u0639\u062f\u0651 \u0627\u0644\u0643\u0631\u0628\u0648\u0647\u064a\u062f\u0631\u0627\u062a \u0627\u0644\u0645\u0639\u0642\u062f\u0629 (\u0643\u0627\u0644\u0634\u0648\u0641\u0627\u0646 \u0648\u062e\u0628\u0632 \u0627\u0644\u062d\u0628\u0648\u0628 \u0627\u0644\u0643\u0627\u0645\u0644\u0629) \u062e\u064a\u0627\u0631\u0627\u062a \u0623\u0641\u0636\u0644 \u0642\u0628\u0644 \u0627\u0644\u062a\u0645\u0631\u064a\u0646 \u0645\u0646 \u0627\u0644\u0633\u0643\u0631\u064a\u0627\u062a \u0627\u0644\u0628\u0633\u064a\u0637\u0629 \u0644\u0637\u0627\u0642\u0629 \u0645\u0633\u062a\u062f\u0627\u0645\u0629.","Mayo Clinic"],t.w)
B.abY=new A.c(B.c,["Beetroot juice contains nitrates that may improve exercise efficiency and endurance performance.","\u064a\u062d\u062a\u0648\u064a \u0639\u0635\u064a\u0631 \u0627\u0644\u0634\u0645\u0646\u062f\u0631 \u0639\u0644\u0649 \u0646\u062a\u0631\u0627\u062a \u0642\u062f \u062a\u062d\u0633\u0651\u0646 \u0643\u0641\u0627\u0621\u0629 \u0627\u0644\u062a\u0645\u0631\u064a\u0646 \u0648\u0623\u062f\u0627\u0621 \u0627\u0644\u062a\u062d\u0645\u0644.","Harvard Health"],t.w)
B.ae_=new A.c(B.c,["Protein needs for regular exercisers are 1.2\u20132.0 g per kg of body weight per day, depending on intensity.","\u062a\u062a\u0631\u0627\u0648\u062d \u0627\u062d\u062a\u064a\u0627\u062c\u0627\u062a \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0644\u0645\u0646 \u064a\u0645\u0627\u0631\u0633\u0648\u0646 \u0627\u0644\u0631\u064a\u0627\u0636\u0629 \u0628\u0627\u0646\u062a\u0638\u0627\u0645 \u0628\u064a\u0646 1.2 \u06482.0 \u063a\u0631\u0627\u0645 \u0644\u0643\u0644 \u0643\u064a\u0644\u0648\u063a\u0631\u0627\u0645 \u0645\u0646 \u0648\u0632\u0646 \u0627\u0644\u062c\u0633\u0645 \u064a\u0648\u0645\u064a\u064b\u0627\u060c \u062d\u0633\u0628 \u0634\u062f\u0629 \u0627\u0644\u062a\u0645\u0631\u064a\u0646.","Mayo Clinic"],t.w)
B.ae5=new A.c(B.c,["Avoid high-fat and high-fiber meals immediately before exercise, as they are slower to digest.","\u062a\u062c\u0646\u0628 \u0627\u0644\u0648\u062c\u0628\u0627\u062a \u0627\u0644\u063a\u0646\u064a\u0629 \u0628\u0627\u0644\u062f\u0647\u0648\u0646 \u0648\u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0645\u0628\u0627\u0634\u0631\u0629 \u0642\u0628\u0644 \u0627\u0644\u062a\u0645\u0631\u064a\u0646\u060c \u0644\u0623\u0646\u0647\u0627 \u0623\u0628\u0637\u0623 \u0641\u064a \u0627\u0644\u0647\u0636\u0645.","Mayo Clinic"],t.w)
B.ag0=new A.c(B.c,["Tart cherry juice may reduce muscle soreness and inflammation after intense exercise.","\u0642\u062f \u064a\u0642\u0644\u0644 \u0639\u0635\u064a\u0631 \u0627\u0644\u0643\u0631\u0632 \u0627\u0644\u062d\u0627\u0645\u0636 \u0645\u0646 \u0622\u0644\u0627\u0645 \u0627\u0644\u0639\u0636\u0644\u0627\u062a \u0648\u0627\u0644\u0627\u0644\u062a\u0647\u0627\u0628\u0627\u062a \u0628\u0639\u062f \u0627\u0644\u062a\u0645\u0627\u0631\u064a\u0646 \u0627\u0644\u0645\u0643\u062b\u0641\u0629.","Harvard Health"],t.w)
B.aie=new A.c(B.c,["Adequate glycogen stores before exercise prevent early fatigue; eat sufficient carbohydrates in the hours beforehand.","\u064a\u0645\u0646\u0639 \u0648\u062c\u0648\u062f \u0645\u062e\u0632\u0648\u0646 \u0643\u0627\u0641\u064d \u0645\u0646 \u0627\u0644\u063a\u0644\u064a\u0643\u0648\u062c\u064a\u0646 \u0642\u0628\u0644 \u0627\u0644\u062a\u0645\u0631\u064a\u0646 \u0627\u0644\u0625\u0631\u0647\u0627\u0642 \u0627\u0644\u0645\u0628\u0643\u0631\u061b \u062a\u0646\u0627\u0648\u0644 \u0643\u0645\u064a\u0629 \u0643\u0627\u0641\u064a\u0629 \u0645\u0646 \u0627\u0644\u0643\u0631\u0628\u0648\u0647\u064a\u062f\u0631\u0627\u062a \u0641\u064a \u0627\u0644\u0633\u0627\u0639\u0627\u062a \u0627\u0644\u0633\u0627\u0628\u0642\u0629 \u0644\u0644\u062a\u0645\u0631\u064a\u0646.","Mayo Clinic"],t.w)
B.ab8=new A.c(B.c,["The anabolic window after exercise is wider than once thought; eating protein within 2 hours is sufficient.","\u0646\u0627\u0641\u0630\u0629 \u0627\u0644\u0628\u0646\u0627\u0621 \u0627\u0644\u0639\u0636\u0644\u064a \u0628\u0639\u062f \u0627\u0644\u062a\u0645\u0631\u064a\u0646 \u0623\u0648\u0633\u0639 \u0645\u0645\u0627 \u0643\u0627\u0646 \u064a\u064f\u0639\u062a\u0642\u062f \u0633\u0627\u0628\u0642\u064b\u0627\u061b \u064a\u0643\u0641\u064a \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u062e\u0644\u0627\u0644 \u0633\u0627\u0639\u062a\u064a\u0646 \u0645\u0646 \u0627\u0644\u062a\u0645\u0631\u064a\u0646.","Harvard Health"],t.w)
B.adt=new A.c(B.c,["For endurance events over 90 minutes, consuming 30\u201360 g of carbohydrates per hour during exercise helps maintain performance.","\u0641\u064a \u0641\u0639\u0627\u0644\u064a\u0627\u062a \u0627\u0644\u062a\u062d\u0645\u0644 \u0627\u0644\u062a\u064a \u062a\u062a\u062c\u0627\u0648\u0632 90 \u062f\u0642\u064a\u0642\u0629\u060c \u064a\u0633\u0627\u0639\u062f \u062a\u0646\u0627\u0648\u0644 30 \u0625\u0644\u0649 60 \u063a\u0631\u0627\u0645\u064b\u0627 \u0645\u0646 \u0627\u0644\u0643\u0631\u0628\u0648\u0647\u064a\u062f\u0631\u0627\u062a \u0641\u064a \u0627\u0644\u0633\u0627\u0639\u0629 \u0623\u062b\u0646\u0627\u0621 \u0627\u0644\u062a\u0645\u0631\u064a\u0646 \u0639\u0644\u0649 \u0627\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u0627\u0644\u0623\u062f\u0627\u0621.","Mayo Clinic"],t.w)
B.agC=new A.c(B.c,["Adequate sleep is as important as nutrition for exercise recovery and performance improvement.","\u064a\u064f\u0639\u062f\u0651 \u0627\u0644\u0646\u0648\u0645 \u0627\u0644\u0643\u0627\u0641\u064a \u0628\u0646\u0641\u0633 \u0623\u0647\u0645\u064a\u0629 \u0627\u0644\u062a\u063a\u0630\u064a\u0629 \u0644\u062a\u0639\u0627\u0641\u064a \u0627\u0644\u062c\u0633\u0645 \u0628\u0639\u062f \u0627\u0644\u062a\u0645\u0631\u064a\u0646 \u0648\u062a\u062d\u0633\u064a\u0646 \u0627\u0644\u0623\u062f\u0627\u0621.","Harvard Health"],t.w)
B.aeZ=new A.c(B.c,["Plant-based diets generally have a lower environmental footprint than diets high in animal products.","\u062a\u0645\u062a\u0644\u0643 \u0627\u0644\u0623\u0646\u0638\u0645\u0629 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0627\u0644\u0646\u0628\u0627\u062a\u064a\u0629 \u0639\u0645\u0648\u0645\u064b\u0627 \u0628\u0635\u0645\u0629 \u0628\u064a\u0626\u064a\u0629 \u0623\u0642\u0644 \u0645\u0642\u0627\u0631\u0646\u0629 \u0628\u0627\u0644\u0623\u0646\u0638\u0645\u0629 \u0627\u0644\u063a\u0646\u064a\u0629 \u0628\u0627\u0644\u0645\u0646\u062a\u062c\u0627\u062a \u0627\u0644\u062d\u064a\u0648\u0627\u0646\u064a\u0629.","WHO"],t.w)
B.ahm=new A.c(B.c,["Reducing food waste at home saves money and reduces the environmental impact of food production.","\u064a\u0648\u0641\u0631 \u062a\u0642\u0644\u064a\u0644 \u0647\u062f\u0631 \u0627\u0644\u0637\u0639\u0627\u0645 \u0641\u064a \u0627\u0644\u0645\u0646\u0632\u0644 \u0627\u0644\u0645\u0627\u0644 \u0648\u064a\u0642\u0644\u0644 \u0627\u0644\u0623\u062b\u0631 \u0627\u0644\u0628\u064a\u0626\u064a \u0644\u0625\u0646\u062a\u0627\u062c \u0627\u0644\u063a\u0630\u0627\u0621.","NHS"],t.w)
B.ai7=new A.c(B.c,["Buying seasonal, locally grown produce reduces transport emissions and often means fresher, tastier food.","\u064a\u0642\u0644\u0644 \u0634\u0631\u0627\u0621 \u0627\u0644\u0645\u0646\u062a\u062c\u0627\u062a \u0627\u0644\u0645\u0648\u0633\u0645\u064a\u0629 \u0648\u0627\u0644\u0645\u062d\u0644\u064a\u0629 \u0645\u0646 \u0627\u0646\u0628\u0639\u0627\u062b\u0627\u062a \u0627\u0644\u0646\u0642\u0644\u060c \u0648\u063a\u0627\u0644\u0628\u064b\u0627 \u0645\u0627 \u064a\u0639\u0646\u064a \u0637\u0639\u0627\u0645\u064b\u0627 \u0623\u0643\u062b\u0631 \u0637\u0632\u0627\u062c\u0629 \u0648\u0644\u0630\u0629.","Harvard Health"],t.w)
B.aaY=new A.c(B.c,["Legumes (beans, lentils) are one of the most sustainable protein sources, enriching soil with nitrogen as they grow.","\u062a\u064f\u0639\u062f\u0651 \u0627\u0644\u0628\u0642\u0648\u0644\u064a\u0627\u062a (\u0643\u0627\u0644\u0641\u0627\u0635\u0648\u0644\u064a\u0627 \u0648\u0627\u0644\u0639\u062f\u0633) \u0645\u0646 \u0623\u0643\u062b\u0631 \u0645\u0635\u0627\u062f\u0631 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0627\u0633\u062a\u062f\u0627\u0645\u0629\u060c \u0625\u0630 \u062a\u064f\u062b\u0631\u064a \u0627\u0644\u062a\u0631\u0628\u0629 \u0628\u0627\u0644\u0646\u064a\u062a\u0631\u0648\u062c\u064a\u0646 \u0623\u062b\u0646\u0627\u0621 \u0646\u0645\u0648\u0647\u0627.","WHO"],t.w)
B.acY=new A.c(B.c,["Planning meals and making a shopping list reduces food waste and unnecessary packaging.","\u064a\u0642\u0644\u0644 \u0627\u0644\u062a\u062e\u0637\u064a\u0637 \u0644\u0644\u0648\u062c\u0628\u0627\u062a \u0648\u0625\u0639\u062f\u0627\u062f \u0642\u0627\u0626\u0645\u0629 \u062a\u0633\u0648\u0642 \u0645\u0646 \u0647\u062f\u0631 \u0627\u0644\u0637\u0639\u0627\u0645 \u0648\u0627\u0644\u062a\u063a\u0644\u064a\u0641 \u063a\u064a\u0631 \u0627\u0644\u0636\u0631\u0648\u0631\u064a.","NHS"],t.w)
B.agj=new A.c(B.c,["Eating less red meat and more plant-based proteins is one of the most impactful dietary changes for the planet.","\u064a\u064f\u0639\u062f\u0651 \u062a\u0646\u0627\u0648\u0644 \u0643\u0645\u064a\u0627\u062a \u0623\u0642\u0644 \u0645\u0646 \u0627\u0644\u0644\u062d\u0648\u0645 \u0627\u0644\u062d\u0645\u0631\u0627\u0621 \u0648\u0627\u0644\u0645\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646\u0627\u062a \u0627\u0644\u0646\u0628\u0627\u062a\u064a\u0629 \u0645\u0646 \u0623\u0643\u062b\u0631 \u0627\u0644\u062a\u063a\u064a\u064a\u0631\u0627\u062a \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u062a\u0623\u062b\u064a\u0631\u064b\u0627 \u0625\u064a\u062c\u0627\u0628\u064a\u064b\u0627 \u0639\u0644\u0649 \u0643\u0648\u0643\u0628 \u0627\u0644\u0623\u0631\u0636.","Harvard Health"],t.w)
B.acS=new A.c(B.c,["Frozen fruits and vegetables have a longer shelf life, reducing waste while retaining nutritional value.","\u062a\u062a\u0645\u062a\u0639 \u0627\u0644\u0641\u0648\u0627\u0643\u0647 \u0648\u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u0627\u0644\u0645\u062c\u0645\u062f\u0629 \u0628\u0639\u0645\u0631 \u062a\u062e\u0632\u064a\u0646 \u0623\u0637\u0648\u0644\u060c \u0645\u0645\u0627 \u064a\u0642\u0644\u0644 \u0627\u0644\u0647\u062f\u0631 \u0645\u0639 \u0627\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u0627\u0644\u0642\u064a\u0645\u0629 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629.","Harvard Health"],t.w)
B.abg=new A.c(B.c,["Using leftover vegetables in soups, stir-fries, or smoothies prevents waste and adds nutrition.","\u064a\u0645\u0646\u0639 \u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0628\u0642\u0627\u064a\u0627 \u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u0641\u064a \u0627\u0644\u062d\u0633\u0627\u0621 \u0623\u0648 \u0627\u0644\u0642\u0644\u064a \u0627\u0644\u0633\u0631\u064a\u0639 \u0623\u0648 \u0627\u0644\u0639\u0635\u0627\u0626\u0631 \u0627\u0644\u0647\u062f\u0631\u064e \u0648\u064a\u0636\u064a\u0641 \u0642\u064a\u0645\u0629 \u063a\u0630\u0627\u0626\u064a\u0629.","NHS"],t.w)
B.aiy=new A.c(B.c,["Choosing sustainably sourced fish helps protect ocean ecosystems; look for MSC certification.","\u064a\u0633\u0627\u0639\u062f \u0627\u062e\u062a\u064a\u0627\u0631 \u0627\u0644\u0623\u0633\u0645\u0627\u0643 \u0627\u0644\u0645\u0633\u062a\u062f\u0627\u0645\u0629 \u0627\u0644\u0645\u0635\u062f\u0631 \u0641\u064a \u062d\u0645\u0627\u064a\u0629 \u0627\u0644\u0646\u0638\u0645 \u0627\u0644\u0628\u064a\u0626\u064a\u0629 \u0627\u0644\u0628\u062d\u0631\u064a\u0629\u061b \u0627\u0628\u062d\u062b \u0639\u0646 \u0634\u0647\u0627\u062f\u0629 MSC.","NHS"],t.w)
B.adh=new A.c(B.c,["Composting food scraps diverts waste from landfills and creates nutrient-rich soil.","\u064a\u062d\u0648\u0651\u0644 \u062a\u062d\u0648\u064a\u0644 \u0628\u0642\u0627\u064a\u0627 \u0627\u0644\u0637\u0639\u0627\u0645 \u0625\u0644\u0649 \u0633\u0645\u0627\u062f \u0639\u0636\u0648\u064a \u0627\u0644\u0646\u0641\u0627\u064a\u0627\u062a \u0628\u0639\u064a\u062f\u064b\u0627 \u0639\u0646 \u0645\u0643\u0628\u0627\u062a \u0627\u0644\u0642\u0645\u0627\u0645\u0629 \u0648\u064a\u064f\u0646\u062a\u062c \u062a\u0631\u0628\u0629 \u063a\u0646\u064a\u0629 \u0628\u0627\u0644\u0645\u063a\u0630\u064a\u0627\u062a.","Harvard Health"],t.w)
B.ais=new A.c(B.c,["Tap water has a far lower environmental impact than bottled water and is safe in most developed countries.","\u064a\u0645\u062a\u0644\u0643 \u0645\u0627\u0621 \u0627\u0644\u0635\u0646\u0628\u0648\u0631 \u0623\u062b\u0631\u064b\u0627 \u0628\u064a\u0626\u064a\u064b\u0627 \u0623\u0642\u0644 \u0628\u0643\u062b\u064a\u0631 \u0645\u0646 \u0627\u0644\u0645\u064a\u0627\u0647 \u0627\u0644\u0645\u0639\u0628\u0623\u0629\u060c \u0648\u0647\u0648 \u0622\u0645\u0646 \u0641\u064a \u0645\u0639\u0638\u0645 \u0627\u0644\u062f\u0648\u0644 \u0627\u0644\u0645\u062a\u0642\u062f\u0645\u0629.","NHS"],t.w)
B.ahQ=new A.c(B.c,['Understanding "best before" vs "use by" dates prevents discarding perfectly safe food unnecessarily.','\u064a\u0645\u0646\u0639 \u0641\u0647\u0645 \u0627\u0644\u0641\u0631\u0642 \u0628\u064a\u0646 \u0639\u0628\u0627\u0631\u062a\u064a "\u064a\u064f\u0641\u0636\u0644 \u0627\u0644\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0642\u0628\u0644" \u0648"\u064a\u064f\u0633\u062a\u062e\u062f\u0645 \u0642\u0628\u0644" \u0627\u0644\u062a\u062e\u0644\u0635 \u0645\u0646 \u0637\u0639\u0627\u0645 \u0622\u0645\u0646 \u062a\u0645\u0627\u0645\u064b\u0627 \u062f\u0648\u0646 \u062f\u0627\u0639\u064d.',"NHS"],t.w)
B.aii=new A.c(B.c,["Growing herbs at home (basil, parsley, mint) reduces packaging waste and adds fresh flavor to cooking.","\u062a\u0642\u0644\u0644 \u0632\u0631\u0627\u0639\u0629 \u0627\u0644\u0623\u0639\u0634\u0627\u0628 \u0641\u064a \u0627\u0644\u0645\u0646\u0632\u0644 (\u0643\u0627\u0644\u0631\u064a\u062d\u0627\u0646 \u0648\u0627\u0644\u0628\u0642\u062f\u0648\u0646\u0633 \u0648\u0627\u0644\u0646\u0639\u0646\u0627\u0639) \u0645\u0646 \u0646\u0641\u0627\u064a\u0627\u062a \u0627\u0644\u062a\u063a\u0644\u064a\u0641 \u0648\u062a\u0636\u064a\u0641 \u0646\u0643\u0647\u0629 \u0637\u0627\u0632\u062c\u0629 \u0644\u0644\u0637\u0628\u062e.","Harvard Health"],t.w)
B.aig=new A.c(B.c,["Choosing whole, unprocessed foods reduces packaging waste compared to heavily packaged processed products.","\u064a\u0642\u0644\u0644 \u0627\u062e\u062a\u064a\u0627\u0631 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0643\u0627\u0645\u0644\u0629 \u063a\u064a\u0631 \u0627\u0644\u0645\u0635\u0646\u0639\u0629 \u0645\u0646 \u0646\u0641\u0627\u064a\u0627\u062a \u0627\u0644\u062a\u063a\u0644\u064a\u0641 \u0645\u0642\u0627\u0631\u0646\u0629 \u0628\u0627\u0644\u0645\u0646\u062a\u062c\u0627\u062a \u0627\u0644\u0645\u0635\u0646\u0639\u0629 \u0630\u0627\u062a \u0627\u0644\u062a\u063a\u0644\u064a\u0641 \u0627\u0644\u0643\u062b\u064a\u0641.","NHS"],t.w)
B.ad9=new A.c(B.c,["A flexitarian approach (mostly plant-based with occasional meat) balances health and sustainability goals.","\u064a\u062d\u0642\u0642 \u0627\u0644\u0646\u0647\u062c \u0627\u0644\u0645\u0631\u0646 \u0641\u064a \u0627\u0644\u062a\u063a\u0630\u064a\u0629 (\u0646\u0628\u0627\u062a\u064a \u0641\u064a \u0627\u0644\u063a\u0627\u0644\u0628 \u0645\u0639 \u0644\u062d\u0648\u0645 \u0641\u064a \u0628\u0639\u0636 \u0627\u0644\u0623\u062d\u064a\u0627\u0646) \u0627\u0644\u062a\u0648\u0627\u0632\u0646 \u0628\u064a\u0646 \u0623\u0647\u062f\u0627\u0641 \u0627\u0644\u0635\u062d\u0629 \u0648\u0627\u0644\u0627\u0633\u062a\u062f\u0627\u0645\u0629.","Harvard Health"],t.w)
B.ab2=new A.c(B.c,["Pairing protein with fiber in snacks (e.g. apple with peanut butter) provides lasting energy and satiety.","\u064a\u0648\u0641\u0631 \u0627\u0644\u062c\u0645\u0639 \u0628\u064a\u0646 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0648\u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0641\u064a \u0627\u0644\u0648\u062c\u0628\u0627\u062a \u0627\u0644\u062e\u0641\u064a\u0641\u0629 (\u0643\u0627\u0644\u062a\u0641\u0627\u062d \u0645\u0639 \u0632\u0628\u062f\u0629 \u0627\u0644\u0641\u0648\u0644 \u0627\u0644\u0633\u0648\u062f\u0627\u0646\u064a) \u0637\u0627\u0642\u0629 \u0645\u0633\u062a\u062f\u0627\u0645\u0629 \u0648\u0634\u0639\u0648\u0631\u064b\u0627 \u0628\u0627\u0644\u0634\u0628\u0639.","Harvard Health"],t.w)
B.afu=new A.c(B.c,["Eating directly from large packages makes it easy to overconsume; portion snacks into small bowls instead.","\u064a\u0633\u0647\u0651\u0644 \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0637\u0639\u0627\u0645 \u0645\u0628\u0627\u0634\u0631\u0629 \u0645\u0646 \u0627\u0644\u0639\u0628\u0648\u0627\u062a \u0627\u0644\u0643\u0628\u064a\u0631\u0629 \u0627\u0644\u0625\u0641\u0631\u0627\u0637 \u0641\u064a \u0627\u0644\u0623\u0643\u0644\u061b \u0642\u0633\u0651\u0645 \u0627\u0644\u0648\u062c\u0628\u0627\u062a \u0627\u0644\u062e\u0641\u064a\u0641\u0629 \u0641\u064a \u0623\u0637\u0628\u0627\u0642 \u0635\u063a\u064a\u0631\u0629 \u0628\u062f\u0644\u064b\u0627 \u0645\u0646 \u0630\u0644\u0643.","Mayo Clinic"],t.w)
B.afB=new A.c(B.c,["Nuts are calorie-dense but highly satiating; a small handful (30 g) makes a nutritious snack.","\u0627\u0644\u0645\u0643\u0633\u0631\u0627\u062a \u063a\u0646\u064a\u0629 \u0628\u0627\u0644\u0633\u0639\u0631\u0627\u062a \u0627\u0644\u062d\u0631\u0627\u0631\u064a\u0629 \u0644\u0643\u0646\u0647\u0627 \u062a\u0645\u0646\u062d \u0634\u0639\u0648\u0631\u064b\u0627 \u0639\u0627\u0644\u064a\u064b\u0627 \u0628\u0627\u0644\u0634\u0628\u0639\u061b \u0648\u062d\u0641\u0646\u0629 \u0635\u063a\u064a\u0631\u0629 (30 \u063a\u0631\u0627\u0645\u064b\u0627) \u062a\u064f\u0634\u0643\u0644 \u0648\u062c\u0628\u0629 \u062e\u0641\u064a\u0641\u0629 \u0645\u063a\u0630\u064a\u0629.","Harvard Health"],t.w)
B.ahG=new A.c(B.c,["Eating while distracted (TV, phone, computer) leads to consuming more calories without realizing it.","\u064a\u0624\u062f\u064a \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0637\u0639\u0627\u0645 \u0623\u062b\u0646\u0627\u0621 \u0627\u0644\u0627\u0646\u0634\u063a\u0627\u0644 (\u0643\u0645\u0634\u0627\u0647\u062f\u0629 \u0627\u0644\u062a\u0644\u0641\u0632\u064a\u0648\u0646 \u0623\u0648 \u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0647\u0627\u062a\u0641 \u0623\u0648 \u0627\u0644\u062d\u0627\u0633\u0648\u0628) \u0625\u0644\u0649 \u0627\u0633\u062a\u0647\u0644\u0627\u0643 \u0633\u0639\u0631\u0627\u062a \u062d\u0631\u0627\u0631\u064a\u0629 \u0623\u0643\u062b\u0631 \u062f\u0648\u0646 \u0625\u062f\u0631\u0627\u0643.","Harvard Health"],t.w)
B.af6=new A.c(B.c,["Hard-boiled eggs are a portable, protein-rich snack that keeps you full between meals.","\u064a\u064f\u0639\u062f\u0651 \u0627\u0644\u0628\u064a\u0636 \u0627\u0644\u0645\u0633\u0644\u0648\u0642 \u0648\u062c\u0628\u0629 \u062e\u0641\u064a\u0641\u0629 \u063a\u0646\u064a\u0629 \u0628\u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0648\u0633\u0647\u0644\u0629 \u0627\u0644\u062d\u0645\u0644 \u062a\u064f\u0628\u0642\u064a\u0643 \u0645\u0645\u062a\u0644\u0626\u064b\u0627 \u0628\u064a\u0646 \u0627\u0644\u0648\u062c\u0628\u0627\u062a.","Mayo Clinic"],t.w)
B.adf=new A.c(B.c,["Before reaching for a snack, pause and ask if you are truly hungry or eating out of boredom or habit.","\u0642\u0628\u0644 \u062a\u0646\u0627\u0648\u0644 \u0648\u062c\u0628\u0629 \u062e\u0641\u064a\u0641\u0629\u060c \u062a\u0648\u0642\u0641 \u0648\u0627\u0633\u0623\u0644 \u0646\u0641\u0633\u0643 \u0645\u0627 \u0625\u0630\u0627 \u0643\u0646\u062a \u062c\u0627\u0626\u0639\u064b\u0627 \u062d\u0642\u064b\u0627 \u0623\u0645 \u062a\u0623\u0643\u0644 \u0628\u062f\u0627\u0641\u0639 \u0627\u0644\u0645\u0644\u0644 \u0623\u0648 \u0627\u0644\u0639\u0627\u062f\u0629.","Harvard Health"],t.w)
B.ahq=new A.c(B.c,["Edamame is a fiber-and protein-rich snack with only about 120 calories per half cup.","\u0641\u0648\u0644 \u0627\u0644\u0635\u0648\u064a\u0627 \u0627\u0644\u0623\u062e\u0636\u0631 (\u0625\u062f\u0627\u0645\u0627\u0645\u064a) \u0648\u062c\u0628\u0629 \u062e\u0641\u064a\u0641\u0629 \u063a\u0646\u064a\u0629 \u0628\u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0648\u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u062a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u0646\u062d\u0648 120 \u0633\u0639\u0631\u0629 \u062d\u0631\u0627\u0631\u064a\u0629 \u0641\u0642\u0637 \u0644\u0643\u0644 \u0646\u0635\u0641 \u0643\u0648\u0628.","Mayo Clinic"],t.w)
B.afV=new A.c(B.c,["Keeping unhealthy snacks out of sight (or out of the house) significantly reduces mindless eating.","\u064a\u0642\u0644\u0644 \u0625\u0628\u0639\u0627\u062f \u0627\u0644\u0648\u062c\u0628\u0627\u062a \u0627\u0644\u062e\u0641\u064a\u0641\u0629 \u063a\u064a\u0631 \u0627\u0644\u0635\u062d\u064a\u0629 \u0639\u0646 \u0627\u0644\u0623\u0646\u0638\u0627\u0631 (\u0623\u0648 \u0639\u062f\u0645 \u0625\u062d\u0636\u0627\u0631\u0647\u0627 \u0644\u0644\u0645\u0646\u0632\u0644) \u0628\u0634\u0643\u0644 \u0643\u0628\u064a\u0631 \u0645\u0646 \u0627\u0644\u0623\u0643\u0644 \u063a\u064a\u0631 \u0627\u0644\u0648\u0627\u0639\u064a.","Harvard Health"],t.w)
B.aeU=new A.c(B.c,["Greek yogurt with berries provides protein, probiotics, fiber, and antioxidants in one snack.","\u064a\u0648\u0641\u0631 \u0627\u0644\u0632\u0628\u0627\u062f\u064a \u0627\u0644\u064a\u0648\u0646\u0627\u0646\u064a \u0645\u0639 \u0627\u0644\u062a\u0648\u062a \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0648\u0627\u0644\u0628\u0631\u0648\u0628\u064a\u0648\u062a\u064a\u0643 \u0648\u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0648\u0645\u0636\u0627\u062f\u0627\u062a \u0627\u0644\u0623\u0643\u0633\u062f\u0629 \u0641\u064a \u0648\u062c\u0628\u0629 \u062e\u0641\u064a\u0641\u0629 \u0648\u0627\u062d\u062f\u0629.","Harvard Health"],t.w)
B.aiu=new A.c(B.c,["Savoring food by eating slowly and noticing flavors increases satisfaction and reduces the desire to overeat.","\u064a\u0632\u064a\u062f \u062a\u0630\u0648\u0642 \u0627\u0644\u0637\u0639\u0627\u0645 \u0628\u0628\u0637\u0621 \u0648\u0627\u0644\u0627\u0646\u062a\u0628\u0627\u0647 \u0644\u0644\u0646\u0643\u0647\u0627\u062a \u0645\u0646 \u0627\u0644\u0634\u0639\u0648\u0631 \u0628\u0627\u0644\u0631\u0636\u0627 \u0648\u064a\u0642\u0644\u0644 \u0627\u0644\u0631\u063a\u0628\u0629 \u0641\u064a \u0627\u0644\u0625\u0641\u0631\u0627\u0637 \u0641\u064a \u0627\u0644\u0623\u0643\u0644.","Mayo Clinic"],t.w)
B.acI=new A.c(B.c,["Air-popped popcorn is a whole grain, high-fiber snack with only about 30 calories per cup.","\u064a\u064f\u0639\u062f\u0651 \u0627\u0644\u0641\u0634\u0627\u0631 \u0627\u0644\u0645\u062d\u0636\u0631 \u0628\u0627\u0644\u0647\u0648\u0627\u0621 \u0627\u0644\u0633\u0627\u062e\u0646 \u0648\u062c\u0628\u0629 \u062e\u0641\u064a\u0641\u0629 \u0645\u0646 \u0627\u0644\u062d\u0628\u0648\u0628 \u0627\u0644\u0643\u0627\u0645\u0644\u0629 \u0627\u0644\u063a\u0646\u064a\u0629 \u0628\u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u062a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u0646\u062d\u0648 30 \u0633\u0639\u0631\u0629 \u062d\u0631\u0627\u0631\u064a\u0629 \u0641\u0642\u0637 \u0644\u0643\u0644 \u0643\u0648\u0628.","Harvard Health"],t.w)
B.afy=new A.c(B.c,["Planning snacks as part of your daily meals prevents random grazing on whatever is available.","\u064a\u0645\u0646\u0639 \u0627\u0644\u062a\u062e\u0637\u064a\u0637 \u0644\u0644\u0648\u062c\u0628\u0627\u062a \u0627\u0644\u062e\u0641\u064a\u0641\u0629 \u0643\u062c\u0632\u0621 \u0645\u0646 \u0648\u062c\u0628\u0627\u062a\u0643 \u0627\u0644\u064a\u0648\u0645\u064a\u0629 \u0627\u0644\u0623\u0643\u0644 \u0627\u0644\u0639\u0634\u0648\u0627\u0626\u064a \u0645\u0646 \u0623\u064a \u0634\u064a\u0621 \u0645\u062a\u0627\u062d.","Mayo Clinic"],t.w)
B.abB=new A.c(B.c,["Hummus with vegetable sticks (carrots, celery, peppers) provides fiber, protein, and healthy fats.","\u064a\u0648\u0641\u0631 \u0627\u0644\u062d\u0645\u0635 \u0645\u0639 \u0623\u0635\u0627\u0628\u0639 \u0627\u0644\u062e\u0636\u0627\u0631 (\u0643\u0627\u0644\u062c\u0632\u0631 \u0648\u0627\u0644\u0643\u0631\u0641\u0633 \u0648\u0627\u0644\u0641\u0644\u0641\u0644) \u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0648\u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0648\u0627\u0644\u062f\u0647\u0648\u0646 \u0627\u0644\u0635\u062d\u064a\u0629.","Harvard Health"],t.w)
B.afx=new A.c(B.c,["Eating in a calm, seated position rather than standing or rushing improves digestion and satisfaction.","\u064a\u062d\u0633\u0651\u0646 \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0637\u0639\u0627\u0645 \u0628\u0647\u062f\u0648\u0621 \u0648\u0623\u0646\u062a \u062c\u0627\u0644\u0633 \u0628\u062f\u0644\u064b\u0627 \u0645\u0646 \u0627\u0644\u0648\u0642\u0648\u0641 \u0623\u0648 \u0627\u0644\u0627\u0633\u062a\u0639\u062c\u0627\u0644 \u0639\u0645\u0644\u064a\u0629 \u0627\u0644\u0647\u0636\u0645 \u0648\u0627\u0644\u0634\u0639\u0648\u0631 \u0628\u0627\u0644\u0631\u0636\u0627.","Harvard Health"],t.w)
B.afM=new A.c(B.c,["Trail mix can be healthy but watch for added sugar, chocolate, and excessive dried fruit; make your own for better control.","\u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u0643\u0648\u0646 \u0645\u0632\u064a\u062c \u0627\u0644\u0645\u0643\u0633\u0631\u0627\u062a \u0648\u0627\u0644\u0641\u0648\u0627\u0643\u0647 \u0627\u0644\u0645\u062c\u0641\u0641\u0629 \u0635\u062d\u064a\u064b\u0627\u060c \u0644\u0643\u0646 \u0627\u062d\u0630\u0631 \u0645\u0646 \u0627\u0644\u0633\u0643\u0631 \u0627\u0644\u0645\u0636\u0627\u0641 \u0648\u0627\u0644\u0634\u0648\u0643\u0648\u0644\u0627\u062a\u0629 \u0648\u0627\u0644\u0625\u0641\u0631\u0627\u0637 \u0641\u064a \u0627\u0644\u0641\u0648\u0627\u0643\u0647 \u0627\u0644\u0645\u062c\u0641\u0641\u0629\u061b \u062d\u0636\u0651\u0631\u0647 \u0628\u0646\u0641\u0633\u0643 \u0644\u0644\u062a\u062d\u0643\u0645 \u0628\u0634\u0643\u0644 \u0623\u0641\u0636\u0644.","Mayo Clinic"],t.w)
B.afa=new A.c(B.c,["Putting your fork down between bites is a simple technique to slow down and eat more mindfully.","\u064a\u064f\u0639\u062f\u0651 \u0648\u0636\u0639 \u0627\u0644\u0634\u0648\u0643\u0629 \u0639\u0644\u0649 \u0627\u0644\u0637\u0627\u0648\u0644\u0629 \u0628\u064a\u0646 \u0643\u0644 \u0644\u0642\u0645\u0629 \u0648\u0623\u062e\u0631\u0649 \u0623\u0633\u0644\u0648\u0628\u064b\u0627 \u0628\u0633\u064a\u0637\u064b\u0627 \u0644\u0625\u0628\u0637\u0627\u0621 \u0627\u0644\u0623\u0643\u0644 \u0648\u062a\u0646\u0627\u0648\u0644\u0647 \u0628\u0648\u0639\u064a \u0623\u0643\u0628\u0631.","Harvard Health"],t.w)
B.agk=new A.c(B.c,["Cottage cheese with pineapple or berries is a high-protein, satisfying snack under 200 calories.","\u064a\u064f\u0639\u062f\u0651 \u0627\u0644\u062c\u0628\u0646 \u0627\u0644\u0642\u0631\u064a\u0634 \u0645\u0639 \u0627\u0644\u0623\u0646\u0627\u0646\u0627\u0633 \u0623\u0648 \u0627\u0644\u062a\u0648\u062a \u0648\u062c\u0628\u0629 \u062e\u0641\u064a\u0641\u0629 \u063a\u0646\u064a\u0629 \u0628\u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0648\u0645\u064f\u0634\u0628\u0639\u0629 \u062a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u0623\u0642\u0644 \u0645\u0646 200 \u0633\u0639\u0631\u0629 \u062d\u0631\u0627\u0631\u064a\u0629.","Mayo Clinic"],t.w)
B.aeN=new A.c(B.c,["Hunger peaks about 4\u20135 hours after a meal; planning a snack at this time prevents overeating at the next meal.","\u064a\u0628\u0644\u063a \u0627\u0644\u062c\u0648\u0639 \u0630\u0631\u0648\u062a\u0647 \u0628\u0639\u062f \u0646\u062d\u0648 4 \u0625\u0644\u0649 5 \u0633\u0627\u0639\u0627\u062a \u0645\u0646 \u0627\u0644\u0648\u062c\u0628\u0629\u061b \u0648\u0627\u0644\u062a\u062e\u0637\u064a\u0637 \u0644\u0648\u062c\u0628\u0629 \u062e\u0641\u064a\u0641\u0629 \u0641\u064a \u0647\u0630\u0627 \u0627\u0644\u0648\u0642\u062a \u064a\u0645\u0646\u0639 \u0627\u0644\u0625\u0641\u0631\u0627\u0637 \u0641\u064a \u0627\u0644\u0623\u0643\u0644 \u0641\u064a \u0627\u0644\u0648\u062c\u0628\u0629 \u0627\u0644\u062a\u0627\u0644\u064a\u0629.","Harvard Health"],t.w)
B.acK=new A.c(B.c,["Rice cakes topped with avocado or nut butter make a crunchy, satisfying snack with balanced macros.","\u062a\u064f\u0634\u0643\u0644 \u0643\u0639\u0643\u0627\u062a \u0627\u0644\u0623\u0631\u0632 \u0645\u0639 \u0627\u0644\u0623\u0641\u0648\u0643\u0627\u062f\u0648 \u0623\u0648 \u0632\u0628\u062f\u0629 \u0627\u0644\u0645\u0643\u0633\u0631\u0627\u062a \u0648\u062c\u0628\u0629 \u062e\u0641\u064a\u0641\u0629 \u0645\u0642\u0631\u0645\u0634\u0629 \u0648\u0645\u064f\u0634\u0628\u0639\u0629 \u0628\u0639\u0646\u0627\u0635\u0631 \u063a\u0630\u0627\u0626\u064a\u0629 \u0645\u062a\u0648\u0627\u0632\u0646\u0629.","Harvard Health"],t.w)
B.age=new A.c(B.c,['Checking in with your body after eating \u2014 "Am I satisfied?" \u2014 builds awareness and prevents overconsumption.','\u064a\u0628\u0646\u064a \u0627\u0644\u062a\u062d\u0642\u0642 \u0645\u0646 \u0625\u062d\u0633\u0627\u0633\u0643 \u0627\u0644\u062c\u0633\u062f\u064a \u0628\u0639\u062f \u0627\u0644\u0623\u0643\u0644 \u2014 "\u0647\u0644 \u0623\u0646\u0627 \u0631\u0627\u0636\u064d\u061f" \u2014 \u0648\u0639\u064a\u064b\u0627 \u064a\u0645\u0646\u0639 \u0627\u0644\u0625\u0641\u0631\u0627\u0637 \u0641\u064a \u0627\u0644\u0627\u0633\u062a\u0647\u0644\u0627\u0643.',"Mayo Clinic"],t.w)
B.aef=new A.c(B.c,["People who eat breakfast regularly tend to have better nutrient intake and healthier body weight.","\u064a\u0645\u064a\u0644 \u0627\u0644\u0623\u0634\u062e\u0627\u0635 \u0627\u0644\u0630\u064a\u0646 \u064a\u062a\u0646\u0627\u0648\u0644\u0648\u0646 \u0648\u062c\u0628\u0629 \u0627\u0644\u0625\u0641\u0637\u0627\u0631 \u0628\u0627\u0646\u062a\u0638\u0627\u0645 \u0625\u0644\u0649 \u0627\u0644\u062d\u0635\u0648\u0644 \u0639\u0644\u0649 \u062a\u063a\u0630\u064a\u0629 \u0623\u0641\u0636\u0644 \u0648\u0648\u0632\u0646 \u062c\u0633\u0645 \u0623\u0643\u062b\u0631 \u0635\u062d\u0629.","NHS"],t.w)
B.adM=new A.c(B.c,["A breakfast containing protein (eggs, yogurt) keeps blood sugar stable and reduces mid-morning cravings.","\u064a\u062d\u0627\u0641\u0638 \u0625\u0641\u0637\u0627\u0631 \u064a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 (\u0643\u0627\u0644\u0628\u064a\u0636 \u0648\u0627\u0644\u0632\u0628\u0627\u062f\u064a) \u0639\u0644\u0649 \u0627\u0633\u062a\u0642\u0631\u0627\u0631 \u0633\u0643\u0631 \u0627\u0644\u062f\u0645 \u0648\u064a\u0642\u0644\u0644 \u0627\u0644\u0631\u063a\u0628\u0629 \u0641\u064a \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0637\u0639\u0627\u0645 \u0645\u0646\u062a\u0635\u0641 \u0627\u0644\u0635\u0628\u0627\u062d.","Harvard Health"],t.w)
B.agH=new A.c(B.c,["Overnight oats are a convenient no-cook breakfast that provides fiber, protein, and slow-release energy.","\u064a\u064f\u0639\u062f\u0651 \u0627\u0644\u0634\u0648\u0641\u0627\u0646 \u0627\u0644\u0645\u0646\u0642\u0648\u0639 \u0637\u0648\u0627\u0644 \u0627\u0644\u0644\u064a\u0644 \u0625\u0641\u0637\u0627\u0631\u064b\u0627 \u0645\u0631\u064a\u062d\u064b\u0627 \u0644\u0627 \u064a\u062d\u062a\u0627\u062c \u0644\u0644\u0637\u0647\u064a \u0648\u064a\u0648\u0641\u0631 \u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0648\u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0648\u0627\u0644\u0637\u0627\u0642\u0629 \u0628\u0637\u064a\u0626\u0629 \u0627\u0644\u0625\u0637\u0644\u0627\u0642.","Harvard Health"],t.w)
B.ahV=new A.c(B.c,["Many commercial breakfast cereals are high in sugar; choose those with less than 5 g of sugar per serving.","\u062a\u062d\u062a\u0648\u064a \u0643\u062b\u064a\u0631 \u0645\u0646 \u062d\u0628\u0648\u0628 \u0627\u0644\u0625\u0641\u0637\u0627\u0631 \u0627\u0644\u062a\u062c\u0627\u0631\u064a\u0629 \u0639\u0644\u0649 \u0646\u0633\u0628\u0629 \u0639\u0627\u0644\u064a\u0629 \u0645\u0646 \u0627\u0644\u0633\u0643\u0631\u061b \u0627\u062e\u062a\u0631 \u062a\u0644\u0643 \u0627\u0644\u062a\u064a \u062a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u0623\u0642\u0644 \u0645\u0646 5 \u063a\u0631\u0627\u0645\u0627\u062a \u0645\u0646 \u0627\u0644\u0633\u0643\u0631 \u0644\u0643\u0644 \u062d\u0635\u0629.","NHS"],t.w)
B.acp=new A.c(B.c,["Adding a handful of berries to your breakfast significantly boosts your antioxidant intake for the day.","\u062a\u0639\u0632\u0632 \u0625\u0636\u0627\u0641\u0629 \u062d\u0641\u0646\u0629 \u0645\u0646 \u0627\u0644\u062a\u0648\u062a \u0625\u0644\u0649 \u0625\u0641\u0637\u0627\u0631\u0643 \u0628\u0634\u0643\u0644 \u0643\u0628\u064a\u0631 \u0645\u0646 \u062a\u0646\u0627\u0648\u0644\u0643 \u0644\u0645\u0636\u0627\u062f\u0627\u062a \u0627\u0644\u0623\u0643\u0633\u062f\u0629 \u062e\u0644\u0627\u0644 \u0627\u0644\u064a\u0648\u0645.","Harvard Health"],t.w)
B.agF=new A.c(B.c,["Whole grain toast with avocado provides healthy fats, fiber, and sustained energy to start the day.","\u064a\u0648\u0641\u0631 \u062e\u0628\u0632 \u0627\u0644\u062d\u0628\u0648\u0628 \u0627\u0644\u0643\u0627\u0645\u0644\u0629 \u0627\u0644\u0645\u062d\u0645\u0635 \u0645\u0639 \u0627\u0644\u0623\u0641\u0648\u0643\u0627\u062f\u0648 \u062f\u0647\u0648\u0646\u064b\u0627 \u0635\u062d\u064a\u0629 \u0648\u0623\u0644\u064a\u0627\u0641\u064b\u0627 \u0648\u0637\u0627\u0642\u0629 \u0645\u0633\u062a\u062f\u0627\u0645\u0629 \u0644\u0628\u062f\u0621 \u0627\u0644\u064a\u0648\u0645.","Harvard Health"],t.w)
B.aeX=new A.c(B.c,["Smoothies can be nutritious breakfasts if they include protein (yogurt, nut butter) and are not just fruit and juice.","\u064a\u0645\u0643\u0646 \u0623\u0646 \u062a\u0643\u0648\u0646 \u0627\u0644\u0639\u0635\u0627\u0626\u0631 \u0627\u0644\u0645\u062e\u0641\u0648\u0642\u0629 \u0648\u062c\u0628\u0627\u062a \u0625\u0641\u0637\u0627\u0631 \u0645\u063a\u0630\u064a\u0629 \u0625\u0630\u0627 \u062a\u0636\u0645\u0646\u062a \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 (\u0643\u0627\u0644\u0632\u0628\u0627\u062f\u064a \u0623\u0648 \u0632\u0628\u062f\u0629 \u0627\u0644\u0645\u0643\u0633\u0631\u0627\u062a) \u0648\u0644\u0645 \u062a\u0642\u062a\u0635\u0631 \u0639\u0644\u0649 \u0627\u0644\u0641\u0627\u0643\u0647\u0629 \u0648\u0627\u0644\u0639\u0635\u064a\u0631 \u0641\u0642\u0637.","Mayo Clinic"],t.w)
B.ab5=new A.c(B.c,["Skipping breakfast is associated with higher cortisol levels and increased stress responses throughout the morning.","\u064a\u0631\u062a\u0628\u0637 \u062a\u062e\u0637\u064a \u0648\u062c\u0628\u0629 \u0627\u0644\u0625\u0641\u0637\u0627\u0631 \u0628\u0627\u0631\u062a\u0641\u0627\u0639 \u0645\u0633\u062a\u0648\u064a\u0627\u062a \u0627\u0644\u0643\u0648\u0631\u062a\u064a\u0632\u0648\u0644 \u0648\u0632\u064a\u0627\u062f\u0629 \u0627\u0633\u062a\u062c\u0627\u0628\u0627\u062a \u0627\u0644\u062a\u0648\u062a\u0631 \u0637\u0648\u0627\u0644 \u0641\u062a\u0631\u0629 \u0627\u0644\u0635\u0628\u0627\u062d.","Harvard Health"],t.w)
B.aeR=new A.c(B.c,["Eggs at breakfast provide high-quality protein and have been shown to increase fullness compared to cereal-based breakfasts.","\u064a\u0648\u0641\u0631 \u0627\u0644\u0628\u064a\u0636 \u0641\u064a \u0627\u0644\u0625\u0641\u0637\u0627\u0631 \u0628\u0631\u0648\u062a\u064a\u0646\u064b\u0627 \u0639\u0627\u0644\u064a \u0627\u0644\u062c\u0648\u062f\u0629 \u0648\u0642\u062f \u062b\u0628\u062a \u0623\u0646\u0647 \u064a\u0632\u064a\u062f \u0627\u0644\u0634\u0639\u0648\u0631 \u0628\u0627\u0644\u0627\u0645\u062a\u0644\u0627\u0621 \u0645\u0642\u0627\u0631\u0646\u0629 \u0628\u0648\u062c\u0628\u0627\u062a \u0627\u0644\u0625\u0641\u0637\u0627\u0631 \u0627\u0644\u0642\u0627\u0626\u0645\u0629 \u0639\u0644\u0649 \u0627\u0644\u062d\u0628\u0648\u0628.","Harvard Health"],t.w)
B.ah_=new A.c(B.c,["Preparing breakfast ingredients the night before removes barriers and makes healthy morning eating easier.","\u064a\u0632\u064a\u0644 \u062a\u062d\u0636\u064a\u0631 \u0645\u0643\u0648\u0646\u0627\u062a \u0627\u0644\u0625\u0641\u0637\u0627\u0631 \u0641\u064a \u0627\u0644\u0644\u064a\u0644\u0629 \u0627\u0644\u0633\u0627\u0628\u0642\u0629 \u0627\u0644\u0639\u0648\u0627\u0626\u0642 \u0648\u064a\u062c\u0639\u0644 \u062a\u0646\u0627\u0648\u0644 \u0625\u0641\u0637\u0627\u0631 \u0635\u062d\u064a \u0641\u064a \u0627\u0644\u0635\u0628\u0627\u062d \u0623\u0633\u0647\u0644.","NHS"],t.w)
B.ago=new A.c(B.c,["Porridge made with milk and topped with fruit and nuts is one of the most balanced and filling breakfast options.","\u062a\u064f\u0639\u062f\u0651 \u0627\u0644\u0639\u0635\u064a\u062f\u0629 \u0627\u0644\u0645\u062d\u0636\u0631\u0629 \u0628\u0627\u0644\u062d\u0644\u064a\u0628 \u0648\u0627\u0644\u0645\u063a\u0637\u0627\u0629 \u0628\u0627\u0644\u0641\u0627\u0643\u0647\u0629 \u0648\u0627\u0644\u0645\u0643\u0633\u0631\u0627\u062a \u0645\u0646 \u0623\u0643\u062b\u0631 \u062e\u064a\u0627\u0631\u0627\u062a \u0627\u0644\u0625\u0641\u0637\u0627\u0631 \u062a\u0648\u0627\u0632\u0646\u064b\u0627 \u0648\u0625\u0634\u0628\u0627\u0639\u064b\u0627.","NHS"],t.w)
B.aeb=new A.c(B.c,["Breakfast pastries (croissants, muffins, danish) are often high in sugar and saturated fat despite seeming light.","\u063a\u0627\u0644\u0628\u064b\u0627 \u0645\u0627 \u062a\u062d\u062a\u0648\u064a \u0645\u0639\u062c\u0646\u0627\u062a \u0627\u0644\u0625\u0641\u0637\u0627\u0631 (\u0643\u0627\u0644\u0643\u0631\u0648\u0627\u0633\u0648\u0646 \u0648\u0627\u0644\u0645\u0627\u0641\u0646 \u0648\u0627\u0644\u062f\u0627\u0646\u064a\u0634) \u0639\u0644\u0649 \u0646\u0633\u0628\u0629 \u0639\u0627\u0644\u064a\u0629 \u0645\u0646 \u0627\u0644\u0633\u0643\u0631 \u0648\u0627\u0644\u062f\u0647\u0648\u0646 \u0627\u0644\u0645\u0634\u0628\u0639\u0629 \u0631\u063a\u0645 \u0645\u0638\u0647\u0631\u0647\u0627 \u0627\u0644\u062e\u0641\u064a\u0641.","Harvard Health"],t.w)
B.agm=new A.c(B.c,["Greek yogurt parfaits layered with granola and fruit provide protein, probiotics, and complex carbs.","\u064a\u0648\u0641\u0631 \u0628\u0627\u0631\u0641\u064a\u0647 \u0627\u0644\u0632\u0628\u0627\u062f\u064a \u0627\u0644\u064a\u0648\u0646\u0627\u0646\u064a \u0645\u0639 \u0637\u0628\u0642\u0627\u062a \u0627\u0644\u063a\u0631\u0627\u0646\u0648\u0644\u0627 \u0648\u0627\u0644\u0641\u0627\u0643\u0647\u0629 \u0627\u0644\u0628\u0631\u0648\u062a\u064a\u0646 \u0648\u0627\u0644\u0628\u0631\u0648\u0628\u064a\u0648\u062a\u064a\u0643 \u0648\u0627\u0644\u0643\u0631\u0628\u0648\u0647\u064a\u062f\u0631\u0627\u062a \u0627\u0644\u0645\u0639\u0642\u062f\u0629.","Mayo Clinic"],t.w)
B.afJ=new A.c(B.c,["If you are not hungry first thing in the morning, a small breakfast 1\u20132 hours after waking still provides benefits.","\u0625\u0630\u0627 \u0644\u0645 \u062a\u0634\u0639\u0631 \u0628\u0627\u0644\u062c\u0648\u0639 \u0641\u0648\u0631 \u0627\u0644\u0627\u0633\u062a\u064a\u0642\u0627\u0638\u060c \u0641\u0625\u0646 \u062a\u0646\u0627\u0648\u0644 \u0625\u0641\u0637\u0627\u0631 \u0635\u063a\u064a\u0631 \u0628\u0639\u062f \u0633\u0627\u0639\u0629 \u0625\u0644\u0649 \u0633\u0627\u0639\u062a\u064a\u0646 \u0645\u0646 \u0627\u0644\u0627\u0633\u062a\u064a\u0642\u0627\u0638 \u0644\u0627 \u064a\u0632\u0627\u0644 \u064a\u0642\u062f\u0645 \u0641\u0648\u0627\u0626\u062f.","Harvard Health"],t.w)
B.abw=new A.c(B.c,["Adding ground flaxseed or chia seeds to breakfast boosts fiber and omega-3 intake with minimal effort.","\u062a\u0639\u0632\u0632 \u0625\u0636\u0627\u0641\u0629 \u0628\u0630\u0648\u0631 \u0627\u0644\u0643\u062a\u0627\u0646 \u0627\u0644\u0645\u0637\u062d\u0648\u0646\u0629 \u0623\u0648 \u0628\u0630\u0648\u0631 \u0627\u0644\u0634\u064a\u0627 \u0625\u0644\u0649 \u0627\u0644\u0625\u0641\u0637\u0627\u0631 \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0623\u0644\u064a\u0627\u0641 \u0648\u0623\u0648\u0645\u064a\u063a\u0627-3 \u0628\u0623\u0642\u0644 \u062c\u0647\u062f.","Harvard Health"],t.w)
B.act=new A.c(B.c,["Eating fat does not necessarily make you fat; excess calories from any source cause weight gain.","\u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u062f\u0647\u0648\u0646 \u0644\u0627 \u064a\u0639\u0646\u064a \u0628\u0627\u0644\u0636\u0631\u0648\u0631\u0629 \u0632\u064a\u0627\u062f\u0629 \u0627\u0644\u0648\u0632\u0646\u061b \u0641\u0627\u0644\u0633\u0639\u0631\u0627\u062a \u0627\u0644\u062d\u0631\u0627\u0631\u064a\u0629 \u0627\u0644\u0632\u0627\u0626\u062f\u0629 \u0645\u0646 \u0623\u064a \u0645\u0635\u062f\u0631 \u0647\u064a \u0627\u0644\u062a\u064a \u062a\u0633\u0628\u0628 \u0632\u064a\u0627\u062f\u0629 \u0627\u0644\u0648\u0632\u0646.","Harvard Health"],t.w)
B.afW=new A.c(B.c,["Detox diets and juice cleanses have no scientific evidence supporting their claims; your liver and kidneys already detoxify.","\u0644\u0627 \u064a\u0648\u062c\u062f \u062f\u0644\u064a\u0644 \u0639\u0644\u0645\u064a \u064a\u062f\u0639\u0645 \u062d\u0645\u064a\u0627\u062a \u0627\u0644\u062a\u062e\u0644\u0635 \u0645\u0646 \u0627\u0644\u0633\u0645\u0648\u0645 \u0648\u062a\u0637\u0647\u064a\u0631 \u0627\u0644\u062c\u0633\u0645 \u0628\u0627\u0644\u0639\u0635\u0627\u0626\u0631\u061b \u0641\u0627\u0644\u0643\u0628\u062f \u0648\u0627\u0644\u0643\u0644\u064a\u062a\u0627\u0646 \u064a\u0642\u0648\u0645\u0627\u0646 \u0628\u0627\u0644\u0641\u0639\u0644 \u0628\u062a\u0646\u0642\u064a\u0629 \u0627\u0644\u062c\u0633\u0645.","NHS"],t.w)
B.ahi=new A.c(B.c,["Eating after 8 PM does not inherently cause weight gain; total daily calorie intake matters more than timing.","\u0644\u0627 \u064a\u062a\u0633\u0628\u0628 \u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0637\u0639\u0627\u0645 \u0628\u0639\u062f \u0627\u0644\u0633\u0627\u0639\u0629 \u0627\u0644\u062b\u0627\u0645\u0646\u0629 \u0645\u0633\u0627\u0621\u064b \u0628\u0627\u0644\u0636\u0631\u0648\u0631\u0629 \u0641\u064a \u0632\u064a\u0627\u062f\u0629 \u0627\u0644\u0648\u0632\u0646\u061b \u0625\u062c\u0645\u0627\u0644\u064a \u0627\u0644\u0633\u0639\u0631\u0627\u062a \u0627\u0644\u062d\u0631\u0627\u0631\u064a\u0629 \u0627\u0644\u064a\u0648\u0645\u064a\u0629 \u0623\u0647\u0645 \u0645\u0646 \u062a\u0648\u0642\u064a\u062a \u0627\u0644\u0623\u0643\u0644.","Harvard Health"],t.w)
B.ahH=new A.c(B.c,["Carbohydrates are not the enemy; whole grains, fruits, and vegetables are carbohydrate-rich and essential for health.","\u0627\u0644\u0643\u0631\u0628\u0648\u0647\u064a\u062f\u0631\u0627\u062a \u0644\u064a\u0633\u062a \u0627\u0644\u0639\u062f\u0648\u061b \u0641\u0627\u0644\u062d\u0628\u0648\u0628 \u0627\u0644\u0643\u0627\u0645\u0644\u0629 \u0648\u0627\u0644\u0641\u0648\u0627\u0643\u0647 \u0648\u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u063a\u0646\u064a\u0629 \u0628\u0627\u0644\u0643\u0631\u0628\u0648\u0647\u064a\u062f\u0631\u0627\u062a \u0648\u0636\u0631\u0648\u0631\u064a\u0629 \u0644\u0644\u0635\u062d\u0629.","Harvard Health"],t.w)
B.ahK=new A.c(B.c,["Fresh vegetables are not always more nutritious than frozen; frozen produce is often picked and frozen at peak ripeness.","\u0627\u0644\u062e\u0636\u0631\u0648\u0627\u062a \u0627\u0644\u0637\u0627\u0632\u062c\u0629 \u0644\u064a\u0633\u062a \u062f\u0627\u0626\u0645\u064b\u0627 \u0623\u0643\u062b\u0631 \u0642\u064a\u0645\u0629 \u063a\u0630\u0627\u0626\u064a\u0629 \u0645\u0646 \u0627\u0644\u0645\u062c\u0645\u062f\u0629\u061b \u0641\u0627\u0644\u0645\u0646\u062a\u062c\u0627\u062a \u0627\u0644\u0645\u062c\u0645\u062f\u0629 \u063a\u0627\u0644\u0628\u064b\u0627 \u0645\u0627 \u062a\u064f\u0642\u0637\u0641 \u0648\u062a\u064f\u062c\u0645\u0651\u062f \u0641\u064a \u0630\u0631\u0648\u0629 \u0646\u0636\u062c\u0647\u0627.","Harvard Health"],t.w)
B.afG=new A.c(B.c,['"Superfoods" is a marketing term; no single food provides all the nutrients you need.','"\u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u062e\u0627\u0631\u0642\u0629" \u0645\u0635\u0637\u0644\u062d \u062a\u0633\u0648\u064a\u0642\u064a\u061b \u0644\u0627 \u064a\u0648\u062c\u062f \u0637\u0639\u0627\u0645 \u0648\u0627\u062d\u062f \u064a\u0648\u0641\u0631 \u062c\u0645\u064a\u0639 \u0627\u0644\u0639\u0646\u0627\u0635\u0631 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0627\u0644\u062a\u064a \u062a\u062d\u062a\u0627\u062c\u0647\u0627.',"NHS"],t.w)
B.abu=new A.c(B.c,["Eggs do not significantly raise blood cholesterol for most people; dietary cholesterol has less impact than once thought.","\u0644\u0627 \u064a\u0631\u0641\u0639 \u0627\u0644\u0628\u064a\u0636 \u0645\u0633\u062a\u0648\u0649 \u0627\u0644\u0643\u0648\u0644\u064a\u0633\u062a\u0631\u0648\u0644 \u0641\u064a \u0627\u0644\u062f\u0645 \u0628\u0634\u0643\u0644 \u0643\u0628\u064a\u0631 \u0644\u062f\u0649 \u0645\u0639\u0638\u0645 \u0627\u0644\u0646\u0627\u0633\u061b \u0641\u062a\u0623\u062b\u064a\u0631 \u0627\u0644\u0643\u0648\u0644\u064a\u0633\u062a\u0631\u0648\u0644 \u0627\u0644\u063a\u0630\u0627\u0626\u064a \u0623\u0642\u0644 \u0645\u0645\u0627 \u0643\u0627\u0646 \u064a\u064f\u0639\u062a\u0642\u062f \u0633\u0627\u0628\u0642\u064b\u0627.","Harvard Health"],t.w)
B.air=new A.c(B.c,["You do not need to drink exactly 8 glasses of water per day; needs vary by individual, climate, and activity level.","\u0644\u0627 \u062a\u062d\u062a\u0627\u062c \u0644\u0634\u0631\u0628 8 \u0623\u0643\u0648\u0627\u0628 \u0645\u0646 \u0627\u0644\u0645\u0627\u0621 \u064a\u0648\u0645\u064a\u064b\u0627 \u0628\u0627\u0644\u0636\u0628\u0637\u061b \u0641\u0627\u0644\u0627\u062d\u062a\u064a\u0627\u062c\u0627\u062a \u062a\u062e\u062a\u0644\u0641 \u062d\u0633\u0628 \u0627\u0644\u0641\u0631\u062f \u0648\u0627\u0644\u0645\u0646\u0627\u062e \u0648\u0645\u0633\u062a\u0648\u0649 \u0627\u0644\u0646\u0634\u0627\u0637.","Mayo Clinic"],t.w)
B.ac9=new A.c(B.c,["Gluten is only harmful to people with coeliac disease or non-coeliac gluten sensitivity; it is safe for everyone else.","\u0627\u0644\u063a\u0644\u0648\u062a\u064a\u0646 \u0636\u0627\u0631 \u0641\u0642\u0637 \u0644\u0644\u0623\u0634\u062e\u0627\u0635 \u0627\u0644\u0645\u0635\u0627\u0628\u064a\u0646 \u0628\u0645\u0631\u0636 \u0627\u0644\u0633\u064a\u0644\u064a\u0627\u0643 \u0623\u0648 \u062d\u0633\u0627\u0633\u064a\u0629 \u0627\u0644\u063a\u0644\u0648\u062a\u064a\u0646 \u063a\u064a\u0631 \u0627\u0644\u0633\u064a\u0644\u064a\u0627\u0643\u064a\u0629\u061b \u0648\u0647\u0648 \u0622\u0645\u0646 \u0644\u062c\u0645\u064a\u0639 \u0627\u0644\u0622\u062e\u0631\u064a\u0646.","Mayo Clinic"],t.w)
B.acJ=new A.c(B.c,["Microwaving food does not destroy nutrients more than other cooking methods; it may actually preserve them better.","\u0644\u0627 \u064a\u062f\u0645\u0631 \u0627\u0644\u0645\u064a\u0643\u0631\u0648\u0648\u064a\u0641 \u0627\u0644\u0639\u0646\u0627\u0635\u0631 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0623\u0643\u062b\u0631 \u0645\u0646 \u0637\u0631\u0642 \u0627\u0644\u0637\u0647\u064a \u0627\u0644\u0623\u062e\u0631\u0649\u061b \u0628\u0644 \u0642\u062f \u064a\u062d\u0627\u0641\u0638 \u0639\u0644\u064a\u0647\u0627 \u0628\u0634\u0643\u0644 \u0623\u0641\u0636\u0644.","Harvard Health"],t.w)
B.ahd=new A.c(B.c,["Sea salt and Himalayan pink salt contain similar amounts of sodium as table salt; they are not healthier alternatives.","\u064a\u062d\u062a\u0648\u064a \u0645\u0644\u062d \u0627\u0644\u0628\u062d\u0631 \u0648\u0645\u0644\u062d \u0627\u0644\u0647\u064a\u0645\u0627\u0644\u0627\u064a\u0627 \u0627\u0644\u0648\u0631\u062f\u064a \u0639\u0644\u0649 \u0643\u0645\u064a\u0627\u062a \u0645\u0645\u0627\u062b\u0644\u0629 \u0645\u0646 \u0627\u0644\u0635\u0648\u062f\u064a\u0648\u0645 \u0645\u0642\u0627\u0631\u0646\u0629 \u0628\u0645\u0644\u062d \u0627\u0644\u0637\u0639\u0627\u0645\u061b \u0648\u0644\u064a\u0633\u0627 \u0628\u062f\u0627\u0626\u0644 \u0623\u0643\u062b\u0631 \u0635\u062d\u0629.","Harvard Health"],t.w)
B.abN=new A.c(B.c,["Snacking is not inherently bad; what matters is the quality and quantity of what you snack on.","\u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0648\u062c\u0628\u0627\u062a \u0627\u0644\u062e\u0641\u064a\u0641\u0629 \u0644\u064a\u0633 \u0633\u064a\u0626\u064b\u0627 \u0628\u0637\u0628\u064a\u0639\u062a\u0647\u061b \u0627\u0644\u0645\u0647\u0645 \u0647\u0648 \u062c\u0648\u062f\u0629 \u0648\u0643\u0645\u064a\u0629 \u0645\u0627 \u062a\u062a\u0646\u0627\u0648\u0644\u0647 \u0645\u0646 \u0648\u062c\u0628\u0627\u062a \u062e\u0641\u064a\u0641\u0629.","Harvard Health"],t.w)
B.aeG=new A.c(B.c,["Supplements cannot replace a healthy diet; nutrients from whole foods are better absorbed and more beneficial.","\u0644\u0627 \u064a\u0645\u0643\u0646 \u0644\u0644\u0645\u0643\u0645\u0644\u0627\u062a \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0623\u0646 \u062a\u062d\u0644 \u0645\u062d\u0644 \u0627\u0644\u0646\u0638\u0627\u0645 \u0627\u0644\u063a\u0630\u0627\u0626\u064a \u0627\u0644\u0635\u062d\u064a\u061b \u0641\u0627\u0644\u0639\u0646\u0627\u0635\u0631 \u0627\u0644\u063a\u0630\u0627\u0626\u064a\u0629 \u0645\u0646 \u0627\u0644\u0623\u0637\u0639\u0645\u0629 \u0627\u0644\u0643\u0627\u0645\u0644\u0629 \u062a\u064f\u0645\u062a\u0635 \u0628\u0634\u0643\u0644 \u0623\u0641\u0636\u0644 \u0648\u0623\u0643\u062b\u0631 \u0641\u0627\u0626\u062f\u0629.","NHS"],t.w)
