B.a8D=new A.c(B.ax,["Chicken & chorizo paella","The Spanish can be quite protective about what is and what isn't a paella, but the spirit of their cooking has always been flexible to whatever meat, fish, or game can be found.",494,27,76,12,50,"Medium","Dinner",4,0,0,"Jamie Oliver","https://upload.wikimedia.org/wikipedia/commons/thumb/a/af/Chicken%2C_Chorizo_and_green_beans_paella%2C_Brisbane%2C_2021.jpg/960px-Chicken%2C_Chorizo_and_green_beans_paella%2C_Brisbane%2C_2021.jpg","https://www.jamieoliver.com/recipes/rice/chicken-chorizo-paella/",B.a38,"\u0628\u0627\u064a\u0644\u0627 \u0627\u0644\u062f\u062c\u0627\u062c \u0648\u0627\u0644\u062a\u0634\u0648\u0631\u064a\u0632\u0648","\u0631\u0648\u062d \u0627\u0644\u0637\u0628\u062e \u0627\u0644\u0625\u0633\u0628\u0627\u0646\u064a \u0643\u0627\u0646\u062a \u062f\u0627\u0626\u0645\u0627\u064b \u0645\u0631\u0646\u0629 \u0645\u0639 \u0623\u064a \u0644\u062d\u0645 \u0623\u0648 \u0633\u0645\u0643 \u0645\u062a\u0648\u0641\u0631.",B.a4B],t.R)
B.a4i=s(["Preheat oven to 200\xb0C. Peel and halve onions, tear up peppers. Place in a roasting tray with chicken, Cajun seasoning and whole unpeeled garlic cloves.","Drizzle with olive oil and red wine vinegar, season with pepper and toss well, turning chicken skin side up. Roast for 40 minutes.","Remove tray and mash soft garlic into the juices. Pour in 1 mug of rice and 2 mugs of boiling water around the chicken.","Cover tightly with foil and return to the oven for 20 minutes, until rice is fluffy and chicken pulls easily from the bone.","Season to perfection and serve with yoghurt and a drizzle of extra virgin olive oil."],t.s)
B.a5I=s(["\u0633\u062e\u0651\u0646 \u0627\u0644\u0641\u0631\u0646 \u0639\u0644\u0649 200 \u062f\u0631\u062c\u0629. \u0642\u0634\u0651\u0631 \u0648\u0642\u0637\u0651\u0639 \u0627\u0644\u0628\u0635\u0644 \u0648\u0645\u0632\u0651\u0642 \u0627\u0644\u0641\u0644\u0641\u0644. \u0636\u0639\u0647\u0627 \u0641\u064a \u0635\u064a\u0646\u064a\u0629 \u0645\u0639 \u0627\u0644\u062f\u062c\u0627\u062c \u0648\u062a\u0648\u0627\u0628\u0644 \u0627\u0644\u0643\u0627\u062c\u0648\u0646 \u0648\u0627\u0644\u062b\u0648\u0645.","\u0631\u0634\u0651 \u0632\u064a\u062a \u0627\u0644\u0632\u064a\u062a\u0648\u0646 \u0648\u0627\u0644\u062e\u0644 \u0648\u062a\u0628\u0651\u0644 \u0648\u0642\u0644\u0651\u0628 \u0645\u0639 \u0648\u0636\u0639 \u0627\u0644\u062f\u062c\u0627\u062c \u0628\u0627\u0644\u062c\u0644\u062f \u0644\u0644\u0623\u0639\u0644\u0649. \u0627\u062e\u0628\u0632 \u0644\u0645\u062f\u0629 40 \u062f\u0642\u064a\u0642\u0629.","\u0623\u062e\u0631\u062c \u0627\u0644\u0635\u064a\u0646\u064a\u0629 \u0648\u0627\u0647\u0631\u0633 \u0627\u0644\u062b\u0648\u0645 \u0627\u0644\u0637\u0631\u064a \u0641\u064a \u0627\u0644\u0639\u0635\u0627\u0631\u0629. \u0627\u0633\u0643\u0628 \u0643\u0648\u0628 \u0623\u0631\u0632 \u0648\u0643\u0648\u0628\u064a\u0646 \u0645\u0627\u0621 \u0645\u063a\u0644\u064a \u062d\u0648\u0644 \u0627\u0644\u062f\u062c\u0627\u062c.","\u063a\u0637\u0651 \u0628\u0625\u062d\u0643\u0627\u0645 \u0628\u0648\u0631\u0642 \u0627\u0644\u0642\u0635\u062f\u064a\u0631 \u0648\u0623\u0639\u062f\u0647 \u0644\u0644\u0641\u0631\u0646 \u0644\u0645\u062f\u0629 20 \u062f\u0642\u064a\u0642\u0629 \u062d\u062a\u0649 \u064a\u0635\u0628\u062d \u0627\u0644\u0623\u0631\u0632 \u0647\u0634\u0627\u064b.","\u062a\u0628\u0651\u0644 \u0648\u0642\u062f\u0651\u0645 \u0645\u0639 \u0627\u0644\u0632\u0628\u0627\u062f\u064a \u0648\u0631\u0630\u0627\u0630 \u0632\u064a\u062a \u0632\u064a\u062a\u0648\u0646."],t.s)
B.a8y=new A.c(B.ax,["Cajun chicken traybake","Full of colour, optimism and heaps of flavour, this one-pan wonder is a great principle recipe to have up your sleeve.",633,35,78,23,67,"Medium","Dinner",4,0,0,"Jamie Oliver","https://upload.wikimedia.org/wikipedia/commons/thumb/3/3b/Pollastre_al_forn.jpg/960px-Pollastre_al_forn.jpg","https://www.jamieoliver.com/recipes/chicken/cajun-chicken-traybake/",B.a4i,"\u0635\u064a\u0646\u064a\u0629 \u062f\u062c\u0627\u062c \u0643\u0627\u062c\u0648\u0646","\u0645\u0644\u064a\u0621 \u0628\u0627\u0644\u0623\u0644\u0648\u0627\u0646 \u0648\u0627\u0644\u0646\u0643\u0647\u0629\u060c \u0647\u0630\u0627 \u0627\u0644\u0637\u0628\u0642 \u0628\u0635\u064a\u0646\u064a\u0629 \u0648\u0627\u062d\u062f\u0629 \u0631\u0627\u0626\u0639 \u0644\u0623\u064a\u0627\u0645 \u0627\u0644\u0623\u0633\u0628\u0648\u0639.",B.a5I],t.R)
B.a1F=s(["Preheat oven to 200\xb0C. Scrub butternut squash, cut into chunks, toss with balti curry paste and roast for 30 minutes.","Dice lamb into 2cm pieces. Grate over lime zest, squeeze over juice, stir through most of the yoghurt and marinate for 30 minutes.","Heat oil in a large pan. Peel and slice garlic and ginger, finely slice chilli. Fry for a few minutes.","Peel and finely slice onion, add to pan and cook for 10 minutes until softened.","Tip in the roasted squash and tinned plum tomatoes. Fill one tin with water and add that too.","Add the lamb with seasoning, bring to the boil. Cover and simmer for 1 hour until tender, stirring occasionally.","Garnish with chopped coriander. Serve with fluffy rice or naan bread and remaining yoghurt."],t.s)
B.a5o=s(["\u0633\u062e\u0651\u0646 \u0627\u0644\u0641\u0631\u0646 \u0639\u0644\u0649 200 \u062f\u0631\u062c\u0629. \u0646\u0638\u0651\u0641 \u0627\u0644\u0642\u0631\u0639 \u0648\u0642\u0637\u0651\u0639\u0647 \u0648\u0642\u0644\u0651\u0628\u0647 \u0645\u0639 \u0645\u0639\u062c\u0648\u0646 \u0627\u0644\u0628\u0627\u0644\u062a\u064a \u0648\u0627\u062e\u0628\u0632 \u0644\u0645\u062f\u0629 30 \u062f\u0642\u064a\u0642\u0629.","\u0642\u0637\u0651\u0639 \u0627\u0644\u0644\u062d\u0645 \u0645\u0643\u0639\u0628\u0627\u062a 2 \u0633\u0645. \u0627\u0628\u0631\u0634 \u0642\u0634\u0631 \u0627\u0644\u0644\u064a\u0645\u0648\u0646 \u0648\u0627\u0639\u0635\u0631\u0647 \u0648\u0623\u0636\u0641 \u0645\u0639\u0638\u0645 \u0627\u0644\u0632\u0628\u0627\u062f\u064a \u0648\u0627\u062a\u0631\u0643\u0647 \u064a\u062a\u0628\u0651\u0644 \u0644\u0645\u062f\u0629 30 \u062f\u0642\u064a\u0642\u0629.","\u0633\u062e\u0651\u0646 \u0627\u0644\u0632\u064a\u062a \u0641\u064a \u0642\u062f\u0631 \u0643\u0628\u064a\u0631. \u0642\u0634\u0651\u0631 \u0648\u0627\u0641\u0631\u0645 \u0627\u0644\u062b\u0648\u0645 \u0648\u0627\u0644\u0632\u0646\u062c\u0628\u064a\u0644 \u0648\u0627\u0644\u0641\u0644\u0641\u0644 \u0627\u0644\u062d\u0627\u0631 \u0648\u062d\u0645\u0651\u0631\u0647\u0645.","\u0642\u0634\u0651\u0631 \u0648\u0627\u0641\u0631\u0645 \u0627\u0644\u0628\u0635\u0644 \u0648\u0623\u0636\u0641\u0647 \u0648\u0627\u0637\u0647\u0650 \u0644\u0645\u062f\u0629 10 \u062f\u0642\u0627\u0626\u0642 \u062d\u062a\u0649 \u064a\u0644\u064a\u0646.","\u0623\u0636\u0641 \u0627\u0644\u0642\u0631\u0639 \u0627\u0644\u0645\u0634\u0648\u064a \u0648\u0627\u0644\u0637\u0645\u0627\u0637\u0645 \u0627\u0644\u0645\u0639\u0644\u0628\u0629. \u0627\u0645\u0644\u0623 \u0639\u0644\u0628\u0629 \u0628\u0627\u0644\u0645\u0627\u0621 \u0648\u0623\u0636\u0641\u0647.","\u0623\u0636\u0641 \u0627\u0644\u0644\u062d\u0645 \u0645\u0639 \u0627\u0644\u062a\u0648\u0627\u0628\u0644 \u0648\u0627\u063a\u0644\u0650. \u063a\u0637\u0651 \u0648\u0627\u062a\u0631\u0643\u0647 \u064a\u064f\u0637\u0647\u0649 \u0639\u0644\u0649 \u0646\u0627\u0631 \u0647\u0627\u062f\u0626\u0629 \u0644\u0645\u062f\u0629 \u0633\u0627\u0639\u0629 \u0645\u0639 \u0627\u0644\u062a\u062d\u0631\u064a\u0643 \u0623\u062d\u064a\u0627\u0646\u0627\u064b.","\u0632\u064a\u0651\u0646 \u0628\u0627\u0644\u0643\u0632\u0628\u0631\u0629 \u0627\u0644\u0645\u0641\u0631\u0648\u0645\u0629. \u0642\u062f\u0651\u0645 \u0645\u0639 \u0627\u0644\u0623\u0631\u0632 \u0623\u0648 \u062e\u0628\u0632 \u0627\u0644\u0646\u0627\u0646 \u0648\u0628\u0627\u0642\u064a \u0627\u0644\u0632\u0628\u0627\u062f\u064a."],t.s)
B.a8z=new A.c(B.ax,["Lovely lamb balti","A hot and sizzling South Indian lamb curry recipe, packed with fantastic flavour and texture.",235,13,10,16,90,"Medium","Dinner",4,0,0,"Jamie Oliver","https://upload.wikimedia.org/wikipedia/commons/thumb/2/2b/Balti_gosht.jpg/960px-Balti_gosht.jpg","https://www.jamieoliver.com/recipes/lamb/lovely-lamb-balti/",B.a1F,"\u0628\u0627\u0644\u062a\u064a \u0644\u062d\u0645 \u0627\u0644\u0636\u0623\u0646","\u0643\u0627\u0631\u064a \u0644\u062d\u0645 \u0636\u0623\u0646 \u0647\u0646\u062f\u064a \u062d\u0627\u0631 \u0648\u0645\u0644\u064a\u0621 \u0628\u0627\u0644\u0646\u0643\u0647\u0629 \u0648\u0627\u0644\u0642\u0648\u0627\u0645 \u0627\u0644\u0631\u0627\u0626\u0639.",B.a5o],t.R)
B.a1k=s(["Preheat oven to 180\xb0C. Cook whole pepper, tomatoes, spring onions and chilli in a dry frying pan for 10 minutes until charred.","Place peppers and chilli in a bowl, cover and set aside for 5 minutes. Chop tomatoes and spring onions on a board.","Peel, deseed and chop pepper and chilli. Mix with tomatoes, charred sweetcorn, coriander and lime juice.","Stack tortillas, cut into eighths. Arrange on trays and bake for 15 minutes, turning halfway, until golden.","Drain and rinse black beans, char in the frying pan for 5 minutes until they pop open.","Peel, destone and slice avocado, drizzle with lime juice.","Arrange tortilla chips on a platter, top with popped beans, salsa, avocado and crumbled feta."],t.s)
