B.a8q=new A.c(B.ax,["Basque cheesecake","Take yourself to sunny San Sebastian with this incredibly easy burnt Basque cheesecake. With only 5 ingredients, it's so simple and absolutely delicious!",449,7,32,33,55,"Medium","Dessert",14,0,0,"Jamie Oliver","https://upload.wikimedia.org/wikipedia/commons/thumb/3/34/Basque-cheesecake.jpg/960px-Basque-cheesecake.jpg","https://www.jamieoliver.com/recipes/desserts/basque-cheesecake/",B.a2P,"\u062a\u0634\u064a\u0632 \u0643\u064a\u0643 \u0628\u0627\u0633\u0643\u064a","\u0627\u0646\u0642\u0644 \u0646\u0641\u0633\u0643 \u0625\u0644\u0649 \u0633\u0627\u0646 \u0633\u064a\u0628\u0627\u0633\u062a\u064a\u0627\u0646 \u0645\u0639 \u0647\u0630\u0627 \u0627\u0644\u062a\u0634\u064a\u0632 \u0643\u064a\u0643 \u0627\u0644\u0628\u0627\u0633\u0643\u064a \u0627\u0644\u0645\u062d\u062a\u0631\u0642 \u0627\u0644\u0633\u0647\u0644 \u062c\u062f\u0627\u064b. \u0628\u062e\u0645\u0633\u0629 \u0645\u0643\u0648\u0646\u0627\u062a \u0641\u0642\u0637!",B.a2_],t.R)
B.a2R=s(["Heat a large saucepan and add the minced beef a handful at a time, cooking until browned. Add the onion and cook for another few minutes.","Add all remaining ingredients apart from the spaghetti. Bring to the boil, then lower the heat and simmer gently for 15-20 minutes.","When the sauce has been cooking for 10 minutes, start the spaghetti. Bring a large pan of water to the boil, add the pasta and cook for 8-10 minutes until tender.","Season the sauce with pepper. Drain the spaghetti and serve with the sauce."],t.s)
